INSERT INTO `team_details_datas` VALUES (1,75,'哈哈','2022-04-13 12:10:16','2022-04-13 12:10:16',1),(2,76,'不知道','2022-04-13 12:10:16','2022-04-13 12:10:16',1),(3,77,'3','2022-04-13 12:10:16','2022-04-13 12:10:16',1),(4,78,'4','2022-04-13 12:10:16','2022-04-13 12:10:16',1),(15,82,' 一種應用程式，用來提升年長者的生活品質，增加日常生活的色彩。','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(16,82,'現今人口高齡化，加上子女陪伴的時間不多，導致許多年長者的生活枯燥乏味，因此設計此應用程式可以提供他們熱忱的陪伴者，帶他們去想要去的地方。','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(17,82,'我們將老遊趣製作成一個應用程式，這個應用程式與Uber Eats、Foodpanda和探探類似的技術，年長者透過這個應用程式，與陪伴者聯繫，讓年長者自由選擇他們的陪伴者，陪伴者能帶著他們到處遊玩，不讓他們感到無聊，年長者也能有充實的一天。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(18,82,'https://drive.google.com/open?id=18ULmryjjEAPwCyzDQ-WsiEEPWMg0G1Uc','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(19,82,'https://drive.google.com/open?id=1mtgxWluuDnftin7E5qyj-X_Ry9HPE1fv','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(20,82,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(21,83,'幫助玩家了解當地景點特色。','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(22,83,'身為應日系的學生，常常可以看到同學參加學校的赴日團，遊玩回來卻還是對當地景點一知半解，全程都在走馬看花，旅行結束後也沒有特別覺得有意義的地方。','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(23,83,'搭配地圖製作一款大富翁結合卡牌的桌遊，幫助大家了解當地景點的文化特色，以及一些隱藏小景點等。所有地點皆可製作成這款桌遊，本組以日本東京23區為主題示範。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(24,83,'https://drive.google.com/open?id=1SwCpee2PpCV6a-ojPmLrpAOFJX0q_m-7','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(25,83,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(26,83,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(27,84,'在空間議題裡，發現到台灣的防火巷經常因車輛違停，導致警車、救護車、消防車等的救災不便，進而討論解決方法，並設計商品。','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(28,84,'台灣建物密集，老舊建物充斥，部分防火巷弄堆置雜物、違規停車，甚至還有違章建築，除有礙市容觀瞻，也影響居住品質，一旦發生火災，就可能危害周邊居民安全。','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(29,84,'利用下列四種方式:聲音感應器,車牌辨識,重量感應,鏡頭偵測結合倒刺與ㄇ型鐵,在防火巷出入口以及兩側做設計阻隔一般車輛進出,上述四種方式都是現有的技術可以在急需的防火巷做實驗,預期達成目標是減少人為因素帶來的負面影響,恢復防火巷原有的規劃意義.','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(30,84,'https://drive.google.com/open?id=1fHygZ8peQQqHOEAB4AEA-u-TmB7X5jTQ','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(31,84,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(32,84,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(33,85,'飢荒是世界面臨到的重大議題','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(34,85,'我們將饑荒會遇到的問題跟煩惱加以分析','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(35,85,'我們希望可以藉覺饑荒讓世界更美好','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(36,85,'https://drive.google.com/open?id=1-KG9cIh52c3pReO4NZv--gCA7stSKeaa','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(37,85,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(38,85,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(39,86,'大樹地區地方創生，建立大樹市集品牌','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(40,86,'身為台灣人，你聽過大樹嗎？我們四個作為高雄人，對大樹區卻所知甚少，對大樹的印像只有鳳梨。但其實大樹是個物產豐饒的地方，不僅農產和農副產品豐富，在自然和人文也不輸其他地方。我們拜訪致力於大樹地方創生的黃惠珠女士，了解地方創生的困境。我們發現，大樹區有豐富有趣的地方能量，但卻缺乏曝光度。','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(41,86,'市集，能帶來人潮、促進商業行為。成立市集品牌，集結大樹產業，主動出擊，讓市集成為對外行銷出口。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(42,86,'https://drive.google.com/open?id=1VhK7ITAS6b45G9BT1yqGpVwxmAXH4Fx3','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(43,86,'https://drive.google.com/open?id=1-AdoTHmLHJf28MYTojKd3mPT-8Xzf1oa','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(44,86,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(45,87,'利用蜂窩狀涼感背墊來減輕背包客的壓力，防止出汗。','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(46,87,'在夏天背後背包的時候，常常會因為流汗導致書包接觸身體的部分會感覺又濕又悶，過了一段時間還有可能會有汗臭味','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(47,87,'可以將後肩帶的部分設計改成S型加厚，便能分散壓力，減輕負重感。背墊則將材質設計為蜂窩狀涼感背墊，能更加透氣涼爽。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(48,87,'https://drive.google.com/open?id=1OwGlKIgv9GIRzTw0CqkQZ6vMF713SnKP','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(49,87,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(50,87,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(51,88,'愛心冰箱寶特瓶回收機結合成即期販賣機','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(52,88,'現今，有越來越多人在用自己的力量在關懷街友。 但要如何將愛心的價值發揮到最大呢?','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(53,88,'結合現有產品變成「即期販賣機」\n兼顧改善環境問題及發揮愛心關懷街友\n為回收業者、超商及量販店帶來商機\n本販賣機設計對象是由街友及其他需要幫助的人為出發點，請將食物留給需要的人。\n就距離而言，街友大多沒有交通工具的情況下，要走到回收場用回收物換取現金和到超商或量販店前的即期販賣機相比，到超商的距離較近且便利。\n','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(54,88,'https://drive.google.com/open?id=1AYF6CzCGXkZQBFxQYySYmsmiB7KMBOkS','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(55,88,'https://drive.google.com/open?id=12yXt61214mhuBdE2P6XqBSUOZb1CptoO','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(56,88,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(57,89,'我們設計一款APP有效解決紫南宮塞車的情形，APP內包含了預約系統、停車系統，也結合周邊商家推出優惠活動。','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(58,89,'紫南宮是個觀光勝地，每逢假日，就會有不少信徒或觀光客前往，總會造成塞車，尤其是辦一些宮裡活動的時候，浪費了許多寶貴的時間。','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(59,89,'我們想到跟紫南宮合作推出一款可以預約時段的系統，透過系統不但可以管控人流，更可以改善塞車和排隊的問題。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(60,89,'https://drive.google.com/open?id=1bJVdiEkcXAKZF-v1qxQuggs6UCZ8ZqNl','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(61,89,'https://drive.google.com/open?id=1uSKfuaqYwg4tt638x9_KvNy5yrM1a4p7','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(62,89,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(63,90,'解決樹木濫砍','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(64,90,'森林保育人員嚴重不足','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(65,90,'在沒開放開採的山林樹木上，裝設感測器，如果有被移動，就可以知道有人在開採山區的樹木。\n','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(66,90,'https://drive.google.com/open?id=1hrQkzFi95KY5sJ5VyMO7yZVckz9tw5Ds','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(67,90,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(68,90,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(69,91,'改善現有食物銀行以往的作風，有效解決食物浪費與飢餓','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(70,91,'許多人沒有飯吃，而我們還是不斷的浪費食物','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(71,91,'捐贈者只要在家中，透過拍照、錄影加上說明食物的內容後，上傳至我們食物銀行的APP，而需求者在向我們提出需求前，必須先經過資料的審核通過才能領取，我們所審核的資料基本上有里長或村長的許可就能通過，盡可能地減少有人詐欺，我們會通知物流中心，將食物從捐贈者的家中送往需求者的所在地。\n\n競爭力分析，透過跟食物補給站和食物券做比較，我們最大的優勢就是在運輸配送的方面，我們和物流中心的合作，盡可能減去需求者的恐慌。\n \n技術可行性，為了讓需求者更快速的取得物資，我們架設APP，在技術的方面會有一定的價值在。經濟的方面，如果物流中心有意願善盡社會責任，則不收取運輸費用，再者，也可利用募款的方式籌措運輸費用，再與物流中心協調。而人事成本的方面，我們採自願性且不領薪的方式招募志工。這樣不僅能滿足需求者，也能營造口碑。社會的部分，就是珍惜食物，幫助需要的人。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(72,91,'https://drive.google.com/open?id=1nCUmndijcbd-Ej4fPSzVVM8ChDO1DjzK','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(73,91,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(74,91,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(75,92,'考慮台灣常發生淹水的情形，而發想出家庭式的自動抽水系統','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(76,92,'因為居住於低窪地區，加上家裡人常出國長時間不在家，有時下大雨家裡淹水無法即時處理','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(77,92,'從技術層面：\n1.可以偵測目前積水量，來調節抽水馬達的轉速\n2.可以用手機遠端偵測跟遠端啟動抽水\n3.使用水閘門，再抽水同時防止更多水流入\n驗證可行性：\n目前已有雛型\n未來市場發展潛力：\n1.各家戶皆可購入\n2.價格並不昂貴\n3.方便操作','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(78,92,'https://drive.google.com/open?id=1S7U0NzvUExF6kDG27o-LpSWgMDTEVPhM','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(79,92,'','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(80,92,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(81,93,'宣揚客家文化','2022-04-13 18:41:12','2022-04-13 18:41:12',15),(82,93,'台灣是個多族群的社會，因文化多樣，造就其多元而豐富的面貌；其中的客家文化即是「文化台灣」重要元素之一。然而，近年來儘管客家人自我認同逐年提升，但客家語言流失情況仍然嚴重。為了能夠推廣各個地區的客家文化，於是有了「客家五腔文化園區」的想法，希望能以此復興客家文化。','2022-04-13 18:41:12','2022-04-13 18:41:12',16),(83,93,'團隊構想是在台中東勢的東勢林業文化園區內的荒廢建物設立園區，用「以住代護」的方式，將此建物改造成一個富有客家文化的園區。園區內設有五個不同腔調的文化館，每個館內會介紹用此腔調的地區及其特色，在不同的時段也可以開設手做，讓民眾能製作富有客家特色的物品，藉此讓民眾了解客家人的文化及其語言。','2022-04-13 18:41:12','2022-04-13 18:41:12',17),(84,93,'https://drive.google.com/open?id=1CkCTK2jFgKBFbbMuJgY7qL5ZsoZImxa-','2022-04-13 18:41:12','2022-04-13 18:41:12',18),(85,93,'https://drive.google.com/open?id=1QNtjfj097iq6hTjcsq5SriZILhNPzd4w','2022-04-13 18:41:12','2022-04-13 18:41:12',19),(86,93,'','2022-04-13 18:41:12','2022-04-13 18:41:12',20),(87,94,' 一種應用程式，用來提升年長者的生活品質，增加日常生活的色彩。','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(88,94,'現今人口高齡化，加上子女陪伴的時間不多，導致許多年長者的生活枯燥乏味，因此設計此應用程式可以提供他們熱忱的陪伴者，帶他們去想要去的地方。','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(89,94,'我們將老遊趣製作成一個應用程式，這個應用程式與Uber Eats、Foodpanda和探探類似的技術，年長者透過這個應用程式，與陪伴者聯繫，讓年長者自由選擇他們的陪伴者，陪伴者能帶著他們到處遊玩，不讓他們感到無聊，年長者也能有充實的一天。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(90,94,'https://drive.google.com/open?id=18ULmryjjEAPwCyzDQ-WsiEEPWMg0G1Uc','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(91,94,'https://drive.google.com/open?id=1mtgxWluuDnftin7E5qyj-X_Ry9HPE1fv','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(92,94,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(93,95,'幫助玩家了解當地景點特色。','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(94,95,'身為應日系的學生，常常可以看到同學參加學校的赴日團，遊玩回來卻還是對當地景點一知半解，全程都在走馬看花，旅行結束後也沒有特別覺得有意義的地方。','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(95,95,'搭配地圖製作一款大富翁結合卡牌的桌遊，幫助大家了解當地景點的文化特色，以及一些隱藏小景點等。所有地點皆可製作成這款桌遊，本組以日本東京23區為主題示範。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(96,95,'https://drive.google.com/open?id=1SwCpee2PpCV6a-ojPmLrpAOFJX0q_m-7','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(97,95,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(98,95,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(99,96,'在空間議題裡，發現到台灣的防火巷經常因車輛違停，導致警車、救護車、消防車等的救災不便，進而討論解決方法，並設計商品。','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(100,96,'台灣建物密集，老舊建物充斥，部分防火巷弄堆置雜物、違規停車，甚至還有違章建築，除有礙市容觀瞻，也影響居住品質，一旦發生火災，就可能危害周邊居民安全。','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(101,96,'利用下列四種方式:聲音感應器,車牌辨識,重量感應,鏡頭偵測結合倒刺與ㄇ型鐵,在防火巷出入口以及兩側做設計阻隔一般車輛進出,上述四種方式都是現有的技術可以在急需的防火巷做實驗,預期達成目標是減少人為因素帶來的負面影響,恢復防火巷原有的規劃意義.','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(102,96,'https://drive.google.com/open?id=1fHygZ8peQQqHOEAB4AEA-u-TmB7X5jTQ','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(103,96,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(104,96,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(105,97,'飢荒是世界面臨到的重大議題','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(106,97,'我們將饑荒會遇到的問題跟煩惱加以分析','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(107,97,'我們希望可以藉覺饑荒讓世界更美好','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(108,97,'https://drive.google.com/open?id=1-KG9cIh52c3pReO4NZv--gCA7stSKeaa','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(109,97,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(110,97,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(111,98,'大樹地區地方創生，建立大樹市集品牌','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(112,98,'身為台灣人，你聽過大樹嗎？我們四個作為高雄人，對大樹區卻所知甚少，對大樹的印像只有鳳梨。但其實大樹是個物產豐饒的地方，不僅農產和農副產品豐富，在自然和人文也不輸其他地方。我們拜訪致力於大樹地方創生的黃惠珠女士，了解地方創生的困境。我們發現，大樹區有豐富有趣的地方能量，但卻缺乏曝光度。','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(113,98,'市集，能帶來人潮、促進商業行為。成立市集品牌，集結大樹產業，主動出擊，讓市集成為對外行銷出口。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(114,98,'https://drive.google.com/open?id=1VhK7ITAS6b45G9BT1yqGpVwxmAXH4Fx3','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(115,98,'https://drive.google.com/open?id=1-AdoTHmLHJf28MYTojKd3mPT-8Xzf1oa','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(116,98,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(117,99,'利用蜂窩狀涼感背墊來減輕背包客的壓力，防止出汗。','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(118,99,'在夏天背後背包的時候，常常會因為流汗導致書包接觸身體的部分會感覺又濕又悶，過了一段時間還有可能會有汗臭味','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(119,99,'可以將後肩帶的部分設計改成S型加厚，便能分散壓力，減輕負重感。背墊則將材質設計為蜂窩狀涼感背墊，能更加透氣涼爽。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(120,99,'https://drive.google.com/open?id=1OwGlKIgv9GIRzTw0CqkQZ6vMF713SnKP','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(121,99,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(122,99,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(123,100,'愛心冰箱寶特瓶回收機結合成即期販賣機','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(124,100,'現今，有越來越多人在用自己的力量在關懷街友。 但要如何將愛心的價值發揮到最大呢?','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(125,100,'結合現有產品變成「即期販賣機」\n兼顧改善環境問題及發揮愛心關懷街友\n為回收業者、超商及量販店帶來商機\n本販賣機設計對象是由街友及其他需要幫助的人為出發點，請將食物留給需要的人。\n就距離而言，街友大多沒有交通工具的情況下，要走到回收場用回收物換取現金和到超商或量販店前的即期販賣機相比，到超商的距離較近且便利。\n','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(126,100,'https://drive.google.com/open?id=1AYF6CzCGXkZQBFxQYySYmsmiB7KMBOkS','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(127,100,'https://drive.google.com/open?id=12yXt61214mhuBdE2P6XqBSUOZb1CptoO','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(128,100,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(129,101,'我們設計一款APP有效解決紫南宮塞車的情形，APP內包含了預約系統、停車系統，也結合周邊商家推出優惠活動。','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(130,101,'紫南宮是個觀光勝地，每逢假日，就會有不少信徒或觀光客前往，總會造成塞車，尤其是辦一些宮裡活動的時候，浪費了許多寶貴的時間。','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(131,101,'我們想到跟紫南宮合作推出一款可以預約時段的系統，透過系統不但可以管控人流，更可以改善塞車和排隊的問題。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(132,101,'https://drive.google.com/open?id=1bJVdiEkcXAKZF-v1qxQuggs6UCZ8ZqNl','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(133,101,'https://drive.google.com/open?id=1uSKfuaqYwg4tt638x9_KvNy5yrM1a4p7','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(134,101,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(135,102,'解決樹木濫砍','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(136,102,'森林保育人員嚴重不足','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(137,102,'在沒開放開採的山林樹木上，裝設感測器，如果有被移動，就可以知道有人在開採山區的樹木。\n','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(138,102,'https://drive.google.com/open?id=1hrQkzFi95KY5sJ5VyMO7yZVckz9tw5Ds','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(139,102,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(140,102,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(141,103,'改善現有食物銀行以往的作風，有效解決食物浪費與飢餓','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(142,103,'許多人沒有飯吃，而我們還是不斷的浪費食物','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(143,103,'捐贈者只要在家中，透過拍照、錄影加上說明食物的內容後，上傳至我們食物銀行的APP，而需求者在向我們提出需求前，必須先經過資料的審核通過才能領取，我們所審核的資料基本上有里長或村長的許可就能通過，盡可能地減少有人詐欺，我們會通知物流中心，將食物從捐贈者的家中送往需求者的所在地。\n\n競爭力分析，透過跟食物補給站和食物券做比較，我們最大的優勢就是在運輸配送的方面，我們和物流中心的合作，盡可能減去需求者的恐慌。\n \n技術可行性，為了讓需求者更快速的取得物資，我們架設APP，在技術的方面會有一定的價值在。經濟的方面，如果物流中心有意願善盡社會責任，則不收取運輸費用，再者，也可利用募款的方式籌措運輸費用，再與物流中心協調。而人事成本的方面，我們採自願性且不領薪的方式招募志工。這樣不僅能滿足需求者，也能營造口碑。社會的部分，就是珍惜食物，幫助需要的人。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(144,103,'https://drive.google.com/open?id=1nCUmndijcbd-Ej4fPSzVVM8ChDO1DjzK','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(145,103,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(146,103,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(147,104,'考慮台灣常發生淹水的情形，而發想出家庭式的自動抽水系統','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(148,104,'因為居住於低窪地區，加上家裡人常出國長時間不在家，有時下大雨家裡淹水無法即時處理','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(149,104,'從技術層面：\n1.可以偵測目前積水量，來調節抽水馬達的轉速\n2.可以用手機遠端偵測跟遠端啟動抽水\n3.使用水閘門，再抽水同時防止更多水流入\n驗證可行性：\n目前已有雛型\n未來市場發展潛力：\n1.各家戶皆可購入\n2.價格並不昂貴\n3.方便操作','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(150,104,'https://drive.google.com/open?id=1S7U0NzvUExF6kDG27o-LpSWgMDTEVPhM','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(151,104,'','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(152,104,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(153,105,'宣揚客家文化','2022-04-13 18:43:00','2022-04-13 18:43:00',21),(154,105,'台灣是個多族群的社會，因文化多樣，造就其多元而豐富的面貌；其中的客家文化即是「文化台灣」重要元素之一。然而，近年來儘管客家人自我認同逐年提升，但客家語言流失情況仍然嚴重。為了能夠推廣各個地區的客家文化，於是有了「客家五腔文化園區」的想法，希望能以此復興客家文化。','2022-04-13 18:43:00','2022-04-13 18:43:00',22),(155,105,'團隊構想是在台中東勢的東勢林業文化園區內的荒廢建物設立園區，用「以住代護」的方式，將此建物改造成一個富有客家文化的園區。園區內設有五個不同腔調的文化館，每個館內會介紹用此腔調的地區及其特色，在不同的時段也可以開設手做，讓民眾能製作富有客家特色的物品，藉此讓民眾了解客家人的文化及其語言。','2022-04-13 18:43:00','2022-04-13 18:43:00',23),(156,105,'https://drive.google.com/open?id=1CkCTK2jFgKBFbbMuJgY7qL5ZsoZImxa-','2022-04-13 18:43:00','2022-04-13 18:43:00',24),(157,105,'https://drive.google.com/open?id=1QNtjfj097iq6hTjcsq5SriZILhNPzd4w','2022-04-13 18:43:00','2022-04-13 18:43:00',25),(158,105,'','2022-04-13 18:43:00','2022-04-13 18:43:00',26),(159,106,' 一種應用程式，用來提升年長者的生活品質，增加日常生活的色彩。','2022-04-18 04:26:15','2022-04-18 04:26:15',27),(160,106,'現今人口高齡化，加上子女陪伴的時間不多，導致許多年長者的生活枯燥乏味，因此設計此應用程式可以提供他們熱忱的陪伴者，帶他們去想要去的地方。','2022-04-18 04:26:15','2022-04-18 04:26:15',28),(161,106,'我們將老遊趣製作成一個應用程式，這個應用程式與Uber Eats、Foodpanda和探探類似的技術，年長者透過這個應用程式，與陪伴者聯繫，讓年長者自由選擇他們的陪伴者，陪伴者能帶著他們到處