lKIgv9GIRzTw0CqkQZ6vMF713SnKP','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(282,123,'','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(283,123,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(284,123,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(285,124,'愛心冰箱寶特瓶回收機結合成即期販賣機','2022-04-18 04:30:41','2022-04-18 04:30:41',34),(286,124,'現今，有越來越多人在用自己的力量在關懷街友。 但要如何將愛心的價值發揮到最大呢?','2022-04-18 04:30:41','2022-04-18 04:30:41',35),(287,124,'結合現有產品變成「即期販賣機」\n兼顧改善環境問題及發揮愛心關懷街友\n為回收業者、超商及量販店帶來商機\n本販賣機設計對象是由街友及其他需要幫助的人為出發點，請將食物留給需要的人。\n就距離而言，街友大多沒有交通工具的情況下，要走到回收場用回收物換取現金和到超商或量販店前的即期販賣機相比，到超商的距離較近且便利。\n','2022-04-18 04:30:41','2022-04-18 04:30:41',36),(288,124,'https://drive.google.com/open?id=1AYF6CzCGXkZQBFxQYySYmsmiB7KMBOkS','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(289,124,'https://drive.google.com/open?id=12yXt61214mhuBdE2P6XqBSUOZb1CptoO','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(290,124,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(291,124,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(292,125,'我們設計一款APP有效解決紫南宮塞車的情形，APP內包含了預約系統、停車系統，也結合周邊商家推出優惠活動。','2022-04-18 04:30:41','2022-04-18 04:30:41',34),(293,125,'紫南宮是個觀光勝地，每逢假日，就會有不少信徒或觀光客前往，總會造成塞車，尤其是辦一些宮裡活動的時候，浪費了許多寶貴的時間。','2022-04-18 04:30:41','2022-04-18 04:30:41',35),(294,125,'我們想到跟紫南宮合作推出一款可以預約時段的系統，透過系統不但可以管控人流，更可以改善塞車和排隊的問題。','2022-04-18 04:30:41','2022-04-18 04:30:41',36),(295,125,'https://drive.google.com/open?id=1bJVdiEkcXAKZF-v1qxQuggs6UCZ8ZqNl','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(296,125,'https://drive.google.com/open?id=1uSKfuaqYwg4tt638x9_KvNy5yrM1a4p7','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(297,125,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(298,125,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(299,126,'解決樹木濫砍','2022-04-18 04:30:41','2022-04-18 04:30:41',34),(300,126,'森林保育人員嚴重不足','2022-04-18 04:30:41','2022-04-18 04:30:41',35),(301,126,'在沒開放開採的山林樹木上，裝設感測器，如果有被移動，就可以知道有人在開採山區的樹木。\n','2022-04-18 04:30:41','2022-04-18 04:30:41',36),(302,126,'https://drive.google.com/open?id=1hrQkzFi95KY5sJ5VyMO7yZVckz9tw5Ds','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(303,126,'','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(304,126,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(305,126,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(306,127,'改善現有食物銀行以往的作風，有效解決食物浪費與飢餓','2022-04-18 04:30:41','2022-04-18 04:30:41',34),(307,127,'許多人沒有飯吃，而我們還是不斷的浪費食物','2022-04-18 04:30:41','2022-04-18 04:30:41',35),(308,127,'捐贈者只要在家中，透過拍照、錄影加上說明食物的內容後，上傳至我們食物銀行的APP，而需求者在向我們提出需求前，必須先經過資料的審核通過才能領取，我們所審核的資料基本上有里長或村長的許可就能通過，盡可能地減少有人詐欺，我們會通知物流中心，將食物從捐贈者的家中送往需求者的所在地。\n\n競爭力分析，透過跟食物補給站和食物券做比較，我們最大的優勢就是在運輸配送的方面，我們和物流中心的合作，盡可能減去需求者的恐慌。\n \n技術可行性，為了讓需求者更快速的取得物資，我們架設APP，在技術的方面會有一定的價值在。經濟的方面，如果物流中心有意願善盡社會責任，則不收取運輸費用，再者，也可利用募款的方式籌措運輸費用，再與物流中心協調。而人事成本的方面，我們採自願性且不領薪的方式招募志工。這樣不僅能滿足需求者，也能營造口碑。社會的部分，就是珍惜食物，幫助需要的人。','2022-04-18 04:30:41','2022-04-18 04:30:41',36),(309,127,'https://drive.google.com/open?id=1nCUmndijcbd-Ej4fPSzVVM8ChDO1DjzK','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(310,127,'','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(311,127,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(312,127,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(313,128,'考慮台灣常發生淹水的情形，而發想出家庭式的自動抽水系統','2022-04-18 04:30:41','2022-04-18 04:30:41',34),(314,128,'因為居住於低窪地區，加上家裡人常出國長時間不在家，有時下大雨家裡淹水無法即時處理','2022-04-18 04:30:41','2022-04-18 04:30:41',35),(315,128,'從技術層面：\n1.可以偵測目前積水量，來調節抽水馬達的轉速\n2.可以用手機遠端偵測跟遠端啟動抽水\n3.使用水閘門，再抽水同時防止更多水流入\n驗證可行性：\n目前已有雛型\n未來市場發展潛力：\n1.各家戶皆可購入\n2.價格並不昂貴\n3.方便操作','2022-04-18 04:30:41','2022-04-18 04:30:41',36),(316,128,'https://drive.google.com/open?id=1S7U0NzvUExF6kDG27o-LpSWgMDTEVPhM','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(317,128,'','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(318,128,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(319,128,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(320,129,'宣揚客家文化','2022-04-18 04:30:41','2022-04-18 04:30:41',34),(321,129,'台灣是個多族群的社會，因文化多樣，造就其多元而豐富的面貌；其中的客家文化即是「文化台灣」重要元素之一。然而，近年來儘管客家人自我認同逐年提升，但客家語言流失情況仍然嚴重。為了能夠推廣各個地區的客家文化，於是有了「客家五腔文化園區」的想法，希望能以此復興客家文化。','2022-04-18 04:30:41','2022-04-18 04:30:41',35),(322,129,'團隊構想是在台中東勢的東勢林業文化園區內的荒廢建物設立園區，用「以住代護」的方式，將此建物改造成一個富有客家文化的園區。園區內設有五個不同腔調的文化館，每個館內會介紹用此腔調的地區及其特色，在不同的時段也可以開設手做，讓民眾能製作富有客家特色的物品，藉此讓民眾了解客家人的文化及其語言。','2022-04-18 04:30:41','2022-04-18 04:30:41',36),(323,129,'https://drive.google.com/open?id=1CkCTK2jFgKBFbbMuJgY7qL5ZsoZImxa-','2022-04-18 04:30:41','2022-04-18 04:30:41',37),(324,129,'https://drive.google.com/open?id=1QNtjfj097iq6hTjcsq5SriZILhNPzd4w','2022-04-18 04:30:41','2022-04-18 04:30:41',38),(325,129,'','2022-04-18 04:30:41','2022-04-18 04:30:41',39),(326,129,'','2022-04-18 04:30:41','2022-04-18 04:30:41',40),(327,130,' 一種應用程式，用來提升年長者的生活品質，增加日常生活的色彩。','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(328,130,'現今人口高齡化，加上子女陪伴的時間不多，導致許多年長者的生活枯燥乏味，因此設計此應用程式可以提供他們熱忱的陪伴者，帶他們去想要去的地方。','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(329,130,'我們將老遊趣製作成一個應用程式，這個應用程式與Uber Eats、Foodpanda和探探類似的技術，年長者透過這個應用程式，與陪伴者聯繫，讓年長者自由選擇他們的陪伴者，陪伴者能帶著他們到處遊玩，不讓他們感到無聊，年長者也能有充實的一天。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(330,130,'https://drive.google.com/open?id=18ULmryjjEAPwCyzDQ-WsiEEPWMg0G1Uc','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(331,130,'https://drive.google.com/open?id=1mtgxWluuDnftin7E5qyj-X_Ry9HPE1fv','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(332,131,'幫助玩家了解當地景點特色。','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(333,131,'身為應日系的學生，常常可以看到同學參加學校的赴日團，遊玩回來卻還是對當地景點一知半解，全程都在走馬看花，旅行結束後也沒有特別覺得有意義的地方。','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(334,131,'搭配地圖製作一款大富翁結合卡牌的桌遊，幫助大家了解當地景點的文化特色，以及一些隱藏小景點等。所有地點皆可製作成這款桌遊，本組以日本東京23區為主題示範。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(335,131,'https://drive.google.com/open?id=1SwCpee2PpCV6a-ojPmLrpAOFJX0q_m-7','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(336,131,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(337,132,'在空間議題裡，發現到台灣的防火巷經常因車輛違停，導致警車、救護車、消防車等的救災不便，進而討論解決方法，並設計商品。','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(338,132,'台灣建物密集，老舊建物充斥，部分防火巷弄堆置雜物、違規停車，甚至還有違章建築，除有礙市容觀瞻，也影響居住品質，一旦發生火災，就可能危害周邊居民安全。','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(339,132,'利用下列四種方式:聲音感應器,車牌辨識,重量感應,鏡頭偵測結合倒刺與ㄇ型鐵,在防火巷出入口以及兩側做設計阻隔一般車輛進出,上述四種方式都是現有的技術可以在急需的防火巷做實驗,預期達成目標是減少人為因素帶來的負面影響,恢復防火巷原有的規劃意義.','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(340,132,'https://drive.google.com/open?id=1fHygZ8peQQqHOEAB4AEA-u-TmB7X5jTQ','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(341,132,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(342,133,'飢荒是世界面臨到的重大議題','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(343,133,'我們將饑荒會遇到的問題跟煩惱加以分析','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(344,133,'我們希望可以藉覺饑荒讓世界更美好','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(345,133,'https://drive.google.com/open?id=1-KG9cIh52c3pReO4NZv--gCA7stSKeaa','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(346,133,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(347,134,'大樹地區地方創生，建立大樹市集品牌','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(348,134,'身為台灣人，你聽過大樹嗎？我們四個作為高雄人，對大樹區卻所知甚少，對大樹的印像只有鳳梨。但其實大樹是個物產豐饒的地方，不僅農產和農副產品豐富，在自然和人文也不輸其他地方。我們拜訪致力於大樹地方創生的黃惠珠女士，了解地方創生的困境。我們發現，大樹區有豐富有趣的地方能量，但卻缺乏曝光度。','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(349,134,'市集，能帶來人潮、促進商業行為。成立市集品牌，集結大樹產業，主動出擊，讓市集成為對外行銷出口。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(350,134,'https://drive.google.com/open?id=1VhK7ITAS6b45G9BT1yqGpVwxmAXH4Fx3','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(351,134,'https://drive.google.com/open?id=1-AdoTHmLHJf28MYTojKd3mPT-8Xzf1oa','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(352,135,'利用蜂窩狀涼感背墊來減輕背包客的壓力，防止出汗。','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(353,135,'在夏天背後背包的時候，常常會因為流汗導致書包接觸身體的部分會感覺又濕又悶，過了一段時間還有可能會有汗臭味','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(354,135,'可以將後肩帶的部分設計改成S型加厚，便能分散壓力，減輕負重感。背墊則將材質設計為蜂窩狀涼感背墊，能更加透氣涼爽。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(355,135,'https://drive.google.com/open?id=1OwGlKIgv9GIRzTw0CqkQZ6vMF713SnKP','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(356,135,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(357,136,'愛心冰箱寶特瓶回收機結合成即期販賣機','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(358,136,'現今，有越來越多人在用自己的力量在關懷街友。 但要如何將愛心的價值發揮到最大呢?','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(359,136,'結合現有產品變成「即期販賣機」\n兼顧改善環境問題及發揮愛心關懷街友\n為回收業者、超商及量販店帶來商機\n本販賣機設計對象是由街友及其他需要幫助的人為出發點，請將食物留給需要的人。\n就距離而言，街友大多沒有交通工具的情況下，要走到回收場用回收物換取現金和到超商或量販店前的即期販賣機相比，到超商的距離較近且便利。\n','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(360,136,'https://drive.google.com/open?id=1AYF6CzCGXkZQBFxQYySYmsmiB7KMBOkS','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(361,136,'https://drive.google.com/open?id=12yXt61214mhuBdE2P6XqBSUOZb1CptoO','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(362,137,'我們設計一款APP有效解決紫南宮塞車的情形，APP內包含了預約系統、停車系統，也結合周邊商家推出優惠活動。','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(363,137,'紫南宮是個觀光勝地，每逢假日，就會有不少信徒或觀光客前往，總會造成塞車，尤其是辦一些宮裡活動的時候，浪費了許多寶貴的時間。','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(364,137,'我們想到跟紫南宮合作推出一款可以預約時段的系統，透過系統不但可以管控人流，更可以改善塞車和排隊的問題。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(365,137,'https://drive.google.com/open?id=1bJVdiEkcXAKZF-v1qxQuggs6UCZ8ZqNl','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(366,137,'https://drive.google.com/open?id=1uSKfuaqYwg4tt638x9_KvNy5yrM1a4p7','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(367,138,'解決樹木濫砍','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(368,138,'森林保育人員嚴重不足','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(369,138,'在沒開放開採的山林樹木上，裝設感測器，如果有被移動，就可以知道有人在開採山區的樹木。\n','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(370,138,'https://drive.google.com/open?id=1hrQkzFi95KY5sJ5VyMO7yZVckz9tw5Ds','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(371,138,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(372,139,'改善現有食物銀行以往的作風，有效解決食物浪費與飢餓','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(373,139,'許多人沒有飯吃，而我們還是不斷的浪費食物','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(374,139,'捐贈者只要在家中，透過拍照、錄影加上說明食物的內容後，上傳至我們食物銀行的APP，而需求者在向我們提出需求前，必須先經過資料的審核通過才能領取，我們所審核的資料基本上有里長或村長的許可就能通過，盡可能地減少有人詐欺，我們會通知物流中心，將食物從捐贈者的家中送往需求者的所在地。\n\n競爭力分析，透過跟食物補給站和食物券做比較，我們最大的優勢就是在運輸配送的方面，我們和物流中心的合作，盡可能減去需求者的恐慌。\n \n技術可行性，為了讓需求者更快速的取得物資，我們架設APP，在技術的方面會有一定的價值在。經濟的方面，如果物流中心有意願善盡社會責任，則不收取運輸費用，再者，也可利用募款的方式籌措運輸費用，再與物流中心協調。而人事成本的方面，我們採自願性且不領薪的方式招募志工。這樣不僅能滿足需求者，也能營造口碑。社會的部分，就是珍惜食物，幫助需要的人。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(375,139,'https://drive.google.com/open?id=1nCUmndijcbd-Ej4fPSzVVM8ChDO1DjzK','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(376,139,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(377,140,'考慮台灣常發生淹水的情形，而發想出家庭式的自動抽水系統','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(378,140,'因為居住於低窪地區，加上家裡人常出國長時間不在家，有時下大雨家裡淹水無法即時處理','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(379,140,'從技術層面：\n1.可以偵測目前積水量，來調節抽水馬達的轉速\n2.可以用手機遠端偵測跟遠端啟動抽水\n3.使用水閘門，再抽水同時防止更多水流入\n驗證可行性：\n目前已有雛型\n未來市場發展潛力：\n1.各家戶皆可購入\n2.價格並不昂貴\n3.方便操作','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(380,140,'https://drive.google.com/open?id=1S7U0NzvUExF6kDG27o-LpSWgMDTEVPhM','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(381,140,'','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(382,141,'宣揚客家文化','2022-04-18 11:02:59','2022-04-18 11:02:59',41),(383,141,'台灣是個多族群的社會，因文化多樣，造就其多元而豐富的面貌；其中的客家文化即是「文化台灣」重要元素之一。然而，近年來儘管客家人自我認同逐年提升，但客家語言流失情況仍然嚴重。為了能夠推廣各個地區的客家文化，於是有了「客家五腔文化園區」的想法，希望能以此復興客家文化。','2022-04-18 11:02:59','2022-04-18 11:02:59',42),(384,141,'團隊構想是在台中東勢的東勢林業文化園區內的荒廢建物設立園區，用「以住代護」的方式，將此建物改造成一個富有客家文化的園區。園區內設有五個不同腔調的文化館，每個館內會介紹用此腔調的地區及其特色，在不同的時段也可以開設手做，讓民眾能製作富有客家特色的物品，藉此讓民眾了解客家人的文化及其語言。','2022-04-18 11:02:59','2022-04-18 11:02:59',43),(385,141,'https://drive.google.com/open?id=1CkCTK2jFgKBFbbMuJgY7qL5ZsoZImxa-','2022-04-18 11:02:59','2022-04-18 11:02:59',44),(386,141,'https://drive.google.com/open?id=1QNtjfj097iq6hTjcsq5SriZILhNPzd4w','2022-04-18 11:02:59','2022-04-18 11:02:59',45),(387,184,' 一種應用程式，用來提升年長者的生活品質，增加日常生活的色彩。','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(388,184,'現今人口高齡化，加上子女陪伴的時間不多，導致許多年長者的生活枯燥乏味，因此設計此應用程式可以提供他們熱忱的陪伴者，帶他們去想要去的地方。','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(389,184,'我們將老遊趣製作成一個應用程式，這個應用程式與Uber Eats、Foodpanda和探探類似的技術，年長者透過這個應用程式，與陪伴者聯繫，讓年長者自由選擇他們的陪伴者，陪伴者能帶著他們到處遊玩，不讓他們感到無聊，年長者也能有充實的一天。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(390,184,'https://drive.google.com/open?id=18ULmryjjEAPwCyzDQ-WsiEEPWMg0G1Uc','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(391,184,'https://drive.google.com/open?id=1mtgxWluuDnftin7E5qyj-X_Ry9HPE1fv','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(392,185,'幫助玩家了解當地景點特色。','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(393,185,'身為應日系的學生，常常可以看到同學參加學校的赴日團，遊玩回來卻還是對當地景點一知半解，全程都在走馬看花，旅行結束後也沒有特別覺得有意義的地方。','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(394,185,'搭配地圖製作一款大富翁結合卡牌的桌遊，幫助大家了解當地景點的文化特色，以及一些隱藏小景點等。所有地點皆可製作成這款桌遊，本組以日本東京23區為主題示範。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(395,185,'https://drive.google.com/open?id=1SwCpee2PpCV6a-ojPmLrpAOFJX0q_m-7','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(396,185,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(397,186,'在空間議題裡，發現到台灣的防火巷經常因車輛違停，導致警車、救護車、消防車等的救災不便，進而討論解決方法，並設計商品。','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(398,186,'台灣建物密集，老舊建物充斥，部分防火巷弄堆置雜物、違規停車，甚至還有違章建築，除有礙市容觀瞻，也影響居住品質，一旦發生火災，就可能危害周邊居民安全。','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(399,186,'利用下列四種方式:聲音感應器,車牌辨識,重量感應,鏡頭偵測結合倒刺與ㄇ型鐵,在防火巷出入口以及兩側做設計阻隔一般車輛進出,上述四種方式都是現有的技術可以在急需的防火巷做實驗,預期達成目標是減少人為因素帶來的負面影響,恢復防火巷原有的規劃意義.','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(400,186,'https://drive.google.com/open?id=1fHygZ8peQQqHOEAB4AEA-u-TmB7X5jTQ','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(401,186,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(402,187,'飢荒是世界面臨到的重大議題','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(403,187,'我們將饑荒會遇到的問題跟煩惱加以分析','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(404,187,'我們希望可以藉覺饑荒讓世界更美好','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(405,187,'https://drive.google.com/open?id=1-KG9cIh52c3pReO4NZv--gCA7stSKeaa','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(406,187,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(407,188,'大樹地區地方創生，建立大樹市集品牌','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(408,188,'身為台灣人，你聽過大樹嗎？我們四個作為高雄人，對大樹區卻所知甚少，對大樹的印像只有鳳梨。但其實大樹是個物產豐饒的地方，不僅農產和農副產品豐富，在自然和人文也不輸其他地方。我們拜訪致力於大樹地方創生的黃惠珠女士，了解地方創生的困境。我們發現，大樹區有豐富有趣的地方能量，但卻缺乏曝光度。','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(409,188,'市集，能帶來人潮、促進商業行為。成立市集品牌，集結大樹產業，主動出擊，讓市集成為對外行銷出口。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(410,188,'https://drive.google.com/open?id=1VhK7ITAS6b45G9BT1yqGpVwxmAXH4Fx3','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(411,188,'https://drive.google.com/open?id=1-AdoTHmLHJf28MYTojKd3mPT-8Xzf1oa','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(412,189,'利用蜂窩狀涼感背墊來減輕背包客的壓力，防止出汗。','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(413,189,'在夏天背後背包的時候，常常會因為流汗導致書包接觸身體的部分會感覺又濕又悶，過了一段時間還有可能會有汗臭味','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(414,189,'可以將後肩帶的部分設計改成S型加厚，便能分散壓力，減輕負重感。背墊則將材質設計為蜂窩狀涼感背墊，能更加透氣涼爽。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(415,189,'https://drive.google.com/open?id=1OwGlKIgv9GIRzTw0CqkQZ6vMF713SnKP','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(416,189,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(417,190,'愛心冰箱寶特瓶回收機結合成即期販賣機','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(418,190,'現今，有越來越多人在用自己的力量在關懷街友。 但要如何將愛心的價值發揮到最大呢?','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(419,190,'結合現有產品變成「即期販賣機」\n兼顧改善環境問題及發揮愛心關懷街友\n為回收業者、超商及量販店帶來商機\n本販賣機設計對象是由街友及其他需要幫助的人為出發點，請將食物留給需要的人。\n就距離而言，街友大多沒有交通工具的情況下，要走到回收場用回收物換取現金和到超商或量販店前的即期販賣機相比，到超商的距離較近且便利。\n','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(420,190,'https://drive.google.com/open?id=1AYF6CzCGXkZQBFxQYySYmsmiB7KMBOkS','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(421,190,'https://drive.google.com/open?id=12yXt61214mhuBdE2P6XqBSUOZb1CptoO','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(422,191,'我們設計一款APP有效解決紫南宮塞車的情形，APP內包含了預約系統、停車系統，也結合周邊商家推出優惠活動。','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(423,191,'紫南宮是個觀光勝地，每逢假日，就會有不少信徒或觀光客前往，總會造成塞車，尤其是辦一些宮裡活動的時候，浪費了許多寶貴的時間。','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(424,191,'我們想到跟紫南宮合作推出一款可以預約時段的系統，透過系統不但可以管控人流，更可以改善塞車和排隊的問題。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(425,191,'https://drive.google.com/open?id=1bJVdiEkcXAKZF-v1qxQuggs6UCZ8ZqNl','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(426,191,'https://drive.google.com/open?id=1uSKfuaqYwg4tt638x9_KvNy5yrM1a4p7','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(427,192,'解決樹木濫砍','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(428,192,'森林保育人員嚴重不足','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(429,192,'在沒開放開採的山林樹木上，裝設感測器，如果有被移動，就可以知道有人在開採山區的樹木。\n','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(430,192,'https://drive.google.com/open?id=1hrQkzFi95KY5sJ5VyMO7yZVckz9tw5Ds','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(431,192,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(432,193,'改善現有食物銀行以往的作風，有效解決食物浪費與飢餓','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(433,193,'許多人沒有飯吃，而我們還是不斷的浪費食物','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(434,193,'捐贈者只要在家中，透過拍照、錄影加上說明食物的內容後，上傳至我們食物銀行的APP，而需求者在向我們提出需求前，必須先經過資料的審核通過才能領取，我們所審核的資料基本上有里長或村長的許可就能通過，盡可能地減少有人詐欺，我們會通知物流中心，將食物從捐贈者的家中送往需求者的所在地。\n\n競爭力分析，透過跟食物補給站和食物券做比較，我們最大的優勢就是在運輸配送的方面，我們和物流中心的合作，盡可能減去需求者的恐慌。\n \n技術可行性，為了讓需求者更快速的取得物資，我們架設APP，在技術的方面會有一定的價值在。經濟的方面，如果物流中心有意願善盡社會責任，則不收取運輸費用，再者，也可利用募款的方式籌措運輸費用，再與物流中心協調。而人事成本的方面，我們採自願性且不領薪的方式招募志工。這樣不僅能滿足需求者，也能營造口碑。社會的部分，就是珍惜食物，幫助需要的人。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(435,193,'https://drive.google.com/open?id=1nCUmndijcbd-Ej4fPSzVVM8ChDO1DjzK','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(436,193,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(437,194,'考慮台灣常發生淹水的情形，而發想出家庭式的自動抽水系統','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(438,194,'因為居住於低窪地區，加上家裡人常出國長時間不在家，有時下大雨家裡淹水無法即時處理','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(439,194,'從技術層面：\n1.可以偵測目前積水量，來調節抽水馬達的轉速\n2.可以用手機遠端偵測跟遠端啟動抽水\n3.使用水閘門，再抽水同時防止更多水流入\n驗證可行性：\n目前已有雛型\n未來市場發展潛力：\n1.各家戶皆可購入\n2.價格並不昂貴\n3.方便操作','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(440,194,'https://drive.google.com/open?id=1S7U0NzvUExF6kDG27o-LpSWgMDTEVPhM','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(441,194,'','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(442,195,'宣揚客家文化','2022-04-20 13:37:50','2022-04-20 13:37:50',46),(443,195,'台灣是個多族群的社會，因文化多樣，造就其多元而豐富的面貌；其中的客家文化即是「文化台灣」重要元素之一。然而，近年來儘管客家人自我認同逐年提升，但客家語言流失情況仍然嚴重。為了能夠推廣各個地區的客家文化，於是有了「客家五腔文化園區」的想法，希望能以此復興客家文化。','2022-04-20 13:37:50','2022-04-20 13:37:50',47),(444,195,'團隊構想是在台中東勢的東勢林業文化園區內的荒廢建物設立園區，用「以住代護」的方式，將此建物改造成一個富有客家文化的園區。園區內設有五個不同腔調的文化館，每個館內會介紹用此腔調的地區及其特色，在不同的時段也可以開設手做，讓民眾能製作富有客家特色的物品，藉此讓民眾了解客家人的文化及其語言。','2022-04-20 13:37:50','2022-04-20 13:37:50',48),(445,195,'https://drive.google.com/open?id=1CkCTK2jFgKBFbbMuJgY7qL5ZsoZImxa-','2022-04-20 13:37:50','2022-04-20 13:37:50',49),(446,195,'https://drive.google.com/open?id=1QNtjfj097iq6hTjcsq5SriZILhNPzd4w','2022-04-20 13:37:50','2022-04-20 13:37:50',50),(447,308,'(三)海洋特色類','2022-05-04 15:19:49','2022-05-04 15:19:49',51),(448,308,'在海灘遊玩使用我們的可折疊垃圾桶，環保且易固定於沙中。','2022-05-04 15:19:49','2022-05-04 15:19:49',52),(449,308,'前陣子海龜鼻子塞進一根吸管的新聞引起多人關注，因此我們想減少垃圾掉入海裡的可能，但我們發現人們去海邊遊玩很少人會攜帶垃圾桶，因為市面上的垃圾桶體積都偏大，人們會覺得麻煩，而攜帶垃圾袋的話會容易飛走，這樣垃圾反而飛的到處都是。','2022-05-04 15:19:49','2022-05-04 15:19:49',53),(450,308,'我們的設計是製作可折疊垃圾桶來解決體積偏大的問題，可以折起來收納達到方便攜帶的效果，在桶子底下設計支撐的小腳，那可以插進沙里固定位置，以防桶子飛走或被風吹倒，垃圾桶使用完可以做清洗的動作，重覆再利用不浪費，而我們也選擇使用可分解材質來製作此商品，達到環保的效果，降低對大自然的傷害，且市面上相關設計的產品較少，常見的有折疊杯、折疊水桶，而折疊垃圾桶較少。','2022-05-04 15:19:49','2022-05-04 15:19:49',54),(451,308,'https://drive.google.com/open?id=1eM8JrbsxQqCQ5O_UpQEmaQ8QpcRUSqoP','2022-05-04 15:19:49','2022-05-04 15:19:49',55),(452,308,'','2022-05-04 15:19:49','2022-05-04 15:19:49',56),(453,308,'','2022-05-04 15:19:49','2022-05-04 15:19:49',57),(454,308,'沈佳蓁','2022-05-04 15:19:49','2022-05-04 15:19:49',58),(455,308,'楊雅萱','2022-05-04 15:19:49','2022-05-04 15:19:49',59),(456,308,'洪翎恩','2022-05-04 15:19:49','2022-05-04 15:19:49',60),(457,308,'吳易誠','2022-05-04 15:19:49','2022-05-04 15:19:49',61),(458,308,'曾浩賓','2022-05-04 15:19:49','2022-05-04 15:19:49',62),(45