以只能經由發起活動後參加後才可加好友，而進行活動之區域需經由系統判定為公共區域，否則活動不會通過。\n\nAPP設計功能 : \n虛擬人物 : 此概念與遊戲相同，為了讓使用者是因為興趣來使用而非性別，此功能的設計也是為了避免性別歧視與不平等的問題。\n\nSTART : 雷達功能，將時間與興趣設定好後，可以發起活動尋找附近的人。\n\n社團 : 將喜好加以區分，提供一個討論的地方，讓有共同喜好的人可以交流。\n\n興趣 : 簡易表格給予勾選，符合使用者的需求，也可以設定喜好的時間，以方便接收到活動通知。\n\n\n\n技術方面 : GPS定位、資料庫整合、WIFI、 程式設計\n團隊 : 企劃部、電腦中心、資訊部、客戶服務部、行銷部\n\n\n\n\n2022年台灣年齡層20歲-64歲的人口總計15,458,998人，根據目前2021市場調查總計有16款類似產品在市面上活躍，預估市場占有率1%，即15,4589人，訂閱制12個月3,000(元)，3,000(元)＊15,4589(人)＝463,767,000(元)\n','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(839,337,'https://drive.google.com/open?id=1Y9h6H5-Tnd579WZ3TwubGjwTbBGBQ4gX','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(840,337,'https://drive.google.com/open?id=1E22s8By5MzCx6mTyOBegEnSOHHUgD1EP','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(841,337,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(842,337,'賴聖博','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(843,337,'陳冠崴','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(844,337,'胡清琳','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(845,337,'曾柏勛','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(846,337,'林騰彥','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(847,337,'巴慧玲老師','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(848,337,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(849,338,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(850,338,'改善博愛座的數量和並不是專門只給老人使用。','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(851,338,'\n假如孕婦帶小孩卻無法使用兩個位置  \n借用別人的身分乘坐怎麼辦\n公車/捷運上有空位子卻不能使用','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(852,338,'所用技術包含:\n1.設計理念：減少博愛座的紛爭與與論\n2.功能：可以適當的判別需求/不需求者\n3.造型：電影沙發椅\n4.材質：真皮，高密度泡棉\n5.使用方式：上車掃卡確認身分，再到位置上掃碼解鎖椅子\n6.產品組合：掃卡機、電影椅、QRcode技術\n預估達成目標:\n高雄市區公車全路線168條，平均一條路線8輛公車，一台公車安裝8個安心就座，預估銷售數量10752張安就座椅，安心就座椅成本8000元，搭配系統安裝整套售價13000元。\n(168x8)(預估高雄市公車總數) x 8(每台公車上座椅安裝數量) x (13000-8000)(售價-成本)=預估銷售金額約53,760,000元','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(853,338,'https://drive.google.com/open?id=18DxeIDcpW4jnNTQ8iF1S8xSffg-qwS8n','2022-05-05 08:55:04','2022-05-0