8),(1127,357,'巴慧玲','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1128,357,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1129,358,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1130,358,'利用智慧回報系統，app改善校園無人管制的校內愛心鐵馬','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1131,358,'發現校內腳踏車無人管制，校園各個角落都有被隨便丟棄的蹤影，希望透過智慧科技管理校內腳踏車並回報是否故障。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1132,358,'Q 1.如何讓前使用這主動並快速的回報腳踏車故障?\nA 1.我們決定在腳踏車上安裝按鈕，一旦發現車體故障，即可按下按鈕向工友室回報。\nQ 2.要怎麼讓工友即時知道故障車體的位置?\nA 2.經過討論後我們認為在車上安裝GPS，以便於在回報後能即時知道車體位置已派人檢修。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1133,358,'https://drive.google.com/open?id=1npBNly6UcwuoM135-7hcS_lDzZhBx6-N','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1134,358,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1135,358,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1136,358,'蔡侑蓁','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1137,358,'張詔崴','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1138,358,'黃佳慧','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1139,358,'詹庭瑜 ','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1140,358,'洪愷廷','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1141,358,'張婷媛','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1142,358,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1143,359,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1144,359,'可以用AI偵測環境音，必要的聲音可用手機調整打開，若不必要時可以將它關掉','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1145,359,'因現在的耳機降噪功能只有開降噪、關降噪與通透模式','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1146,359,'我們在高頻降噪的部分提出了一個方案，透過ANC晶片與AI運算的輔助，針對高頻的改善。在降噪功能的部分，因市面上只能降已設定好特定的音頻，所以我們想出透過AI輔助的技術來做微調想降噪的部分，我們稱它為「降噪調節器」，如：身在路上且附近有施工的雜音，我們可以透過降噪調節器去做改善。\n\n\nANC降噪原理\n麥克風接收外界的噪音，再透过DSP處理噪音雜訊，轉換出與噪音相反聲波來抵銷噪音，但無法消除不規律或突發性聲音。\n\n\nANC好處\nANC可以減少不少的噪音來舒緩你的耳多。\n\n因ANC無法消除不規律或突發性聲音，所以我們利用搭載AI降噪技術的麥克風，其AI已載入多種類型的環境噪音，同時保存有規律的聲音波型已提供清晰的音質。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1147,359,'https://drive.google.com/open?id=1-GEYs6QaAoXDAyxv3vFgtM5yNnP78Pmi','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1148,359,'https://drive.google.com/open?id=1du6EX2WYqPZ-9MdcxyP-OqZp2tFc3pk3','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1149,359,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1150,359,'王葦程','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1151,359,'林俊廷','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1152,359,'石博宇','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1153,359,'','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1154,359,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1155,359,'張婷媛','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1156,359,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1157,360,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1158,360,'利用抵抗杯壁水珠神器避免飲料杯上的水珠弄濕桌子','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1159,360,'每當炎炎夏日總想買一杯冰飲料來喝，但冰涼的飲料遇上炎熱的室溫總會使冰塊融化，杯壁上也會有水珠凝結附著，而杯身的水滴流到桌面上會弄濕桌面以及桌面上的物品，但有許多物品是無防水功能的，這總是造成生活中很大的困擾。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1160,360,'從「矽膠杯套」+「花盆底座」+「吊飾繩」作為創意發想的起點，選用矽膠來當作我們產品的主要材質，方便清洗且製作難度及難度都較其他材質低，並以不同大小的花盆底座相疊做為發想；結合兩個尺寸為一體，讓杯底尺寸不同的杯子也能使用同一個杯墊，並在杯墊側邊加上吊飾繩，讓此產品能被當成吊飾，便於攜帶。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1161,360,'https://drive.google.com/open?id=1Uf3QvtjzS3SbqO5E02LkToR9b1NpTdr6','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1162,360,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1163,360,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1164,360,'蔡沄芷','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1165,360,'張芫睿','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1166,360,'柯采萱','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1167,360,'馮璿臻','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1168,360,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1169,360,'宋旗桂','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1170,360,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1171,361,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1172,361,'結合導航與行車記錄器和影像辨識系統','2022-05-05