5 08:55:04',82),(1289,369,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1290,369,'沈智名','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1291,369,'蔡兆倫','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1292,369,'簡正容','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1293,369,'曾咨惟','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1294,369,'邱羽慈','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1295,369,'張婷媛','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1296,369,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1297,370,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1298,370,'用餐巔峰時刻，沒有幫忙帶位和點餐的服務人員……','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1299,370,'1.去餐廳發現店內經常人手不足，導致即便店內有空桌但無法帶位的窘境。\n\n2. 因店內人手不足，經常導致內用與外帶餐點等待過久。\n\n3. 發現店裡會有先來後到的上菜順序糾紛。\n\n4. 店內忙碌時人手忙不過來，而空閒時又造成冗員，效率不高。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1300,370,'1.採用手機APP可以查詢自己等候的組數、以及即將入座的桌號，知道桌號後即可自行前往。\n\n2.可以在預訂座位時也預定餐點，到達座位後掃描QRcode完成報到，即可通知廚房送餐。\n\n3.以報到時間為.主，可以更有效的收集顧客入座時間，並且排序。\n\n4透過預定組數可以進行縮減員工人數或安排另外事務。\n\n技術分析\n	透過APP可以節省排隊等候時間\n顧客可以自行安排出門時間。\n	線上預訂餐點，抵達後餐點即可上桌\n大家都知道義式料理的備餐時間都比較久，像是義大利麵、焗烤，然後廚房端要等櫃檯人員點餐後，將訂單送至廚房後，廚師才開始烹調，如果加上客人又很多，就會讓顧客很久，雖然美食是值得等待的，不過也可以想辦法讓出餐變得更迅速。\n	線上預付訂金，不怕顧客爽約\n社會新聞有時都會看到，打電話預定大量或是高價的餐點，最終卻沒有去取餐，讓店家損失慘重等，那假如有這個機制，雖然無法杜絕，但可以避免類似的狀況再度發生。\n	人員使用效率最大化，降低人事成本\n觀察過義森義式的人員配置，可以知道櫃檯人員除了櫃檯點餐之外，還需要支援廚房出餐或是送餐給客人，然後要點餐的排隊隊伍佔據走道，因為店面不是很寬敞，可能會阻礙到服務人員送餐的動線，也很容易造成危險的發生，若有此款APP，客人就能自行查位後入座，替代服務人員帶位集點餐的工作，以提供更高品質的服務。\n	多元支付，收款更容易\n除了現場結帳之外，也提供電子支付，讓結帳方式更多元。\n\n1.	預計達成目標\n應用於餐飲業，讓人員效益發揮最大效益，不用為了帶位和點餐分散其餘人力。\n2.	市場發展潛力\n每個服務人員都能各司其職，不會有服務人員忙不過來的問題產生。相信大家應該都有經歷過只是想吃個飯，卻要現場等候半小時以上的困擾，但在這個講求效率的時代，人們對於時間的掌控要求提高，因此耐心相當有限，有時候會認為與其花時間排隊，不如改吃其他能夠快速取得的食物，不過有了此款APP，人們可以精準掌握時間，不用再眼睛瞪大的望著裡面正在用餐的顧客。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1301,370,'https://drive.google.com/open?id=10_Vyl1SQKmsOmo_CsRV50iHZ-TBgsXX7','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1302,370,'https://drive.google.com/open?id=1SjEPBo7dmgSSb6MoP6KC8A_cLvNcp7Tv','2022-05