盟的資料顯示使用該系統保守估計可以降低19-28%的肇事死亡率，所以從汽車ISA系統延伸發想出機車版本，以提升機車行車安全。而就技術面而言，ISA系統大概可以分成三個主要構成：GPS、標誌識別鏡頭、電腦調速，而就今日台灣機車產業來說，這三者早已成熟發展，產業鏈具有可行性；鑑於此產品並未在機車市場上有相似產品，進入市場有先行者優勢，並且可以遊說政府推廣此產品，市場發展潛力大。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1399,377,'https://drive.google.com/open?id=1rFC-SUXSTx4-bxezWOZOmsWsmzNftdvS','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1400,377,'https://drive.google.com/open?id=1KnebdZk7R0vC0FggL-d5SnHn05YLhOvK','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1401,377,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1402,377,'林秭礽','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1403,377,'陳欣妤','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1404,377,'蔡棋安','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1405,377,'周羿慈','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1406,377,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1407,377,'劉處英','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1408,377,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1409,378,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1410,378,'設計出一個打不開的箱子來解決讀書時因為手機導致不專心的問題','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1411,378,'準備考試時需要十分的專注，卻往往被手機吸引，而時間大部分都浪費在滑手機上面了。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1412,378,'於是我們設計出一個會使我們專心的箱子，一個沒有密碼的箱子，在讀書的時候先把會讓我們不專心的東西放進去ex.手機或者小玩具等，計時開始，關上。此刻我們不管多想打開箱子都打不開，因為它鎖死了！唯一開的方法只能等計時完畢才能打開。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1413,378,'https://drive.google.com/open?id=17WeUZ1nfGWDDLvjIP8StQ1v2Xfjlgv5I','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1414,378,'https://drive.google.com/open?id=1-HXUkH71UgAaGNocS-3Af_OApxnrD96e','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1415,378,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1416,378,'陳哲修','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1417,378,'紀元順','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1418,378,'李怡如','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1419,378,'許佩臻','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1420,378,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1421,378,'張珝丹','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1422,378,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1423,379,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1424,379,'本計畫旨在開發一個議題導向電子佈告欄，幫助使用者能夠從眾多消息中聚焦及有效管理資訊','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1425,379,'由於網路興起，人們日常生活所接觸之資料與訊息量巨幅成長，而這幾年因疫情影響，不論企業乃至校園皆由實體轉而成線上，如此一來更使得組織與成員之間資訊溝通變得更加重要，然而，目前組織訊息傳遞方式主要透過電子郵件(例如:gmail)、網路公告(例如:fb)、或即時通訊軟體(例如: line)。但上述之社群軟體不限年齡、職業供所有人使用，每個人都可以在平台上自由發言，不侷限於某種群體，雖然能夠讓不同身分地位的人們進行交流，但也導致資訊的不集中及過多的無用資訊。以即時通訊軟體來說，常常一個重要公告發佈後，會被後繼而來的訊息給覆蓋掉;電子郵件更是如此，如校內校園活動預告，也受限於文字，使得吸引力大幅下降。如此一來使用者便無法有效且快速獲取正確資訊，也無法有效管理所獲得之訊息。\n除上述之問題，社區也有類似問題，公告常為實體且張貼在電梯內，但並不是所有住戶皆會搭乘電梯，如低樓層住戶，抑或是公告較為臨時或較為攏長，搭電梯的時間往往不夠閱讀完畢。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1426,379,'本計畫旨在開發一個議題導向電子佈告欄，幫助使用者能夠聚焦及有效管理資訊，此系統可為校園版、企業版、社區版等.....，達到直接限定族群及管理特定族群之相關資訊，其主要概念為源自傳統電子佈告欄(Bulletin Board System: BBS)與Youtube，所有使用者對需要大家參與討論或公告通知之相關議題(issue)，以校園版舉例:課程作業討論、聚餐時間、教科書交易或行政公告等，可動態進行發表(publish)、修正(modify)與刪除(delete)等動作，同時可審視、參與或訂閱其他使用者所發表議題，當議題內容資訊有異動或更新時，系統會自動通知所有參與此議題之使用者。透過此系統可使群體間能夠快速交流與獲得重要資訊。\n\n而系統在實作上則透過Android平台上的開發程式Android studio，運作前端，畫面設計則不同於以往論壇網站以文字呈現的版型，以現今大家常用的YouTube做為創新的設計理念，使用者可自行選擇感興趣的文章訂閱，而系統會經由演算法，推薦每位使用者喜歡的文章類型，也會推薦些熱門文章，演算法的部分也可隨著時間去做更新，而後端部分則是結合PHP與 MySQL運行，以記錄所有議題與使用者資料。\n\n團隊成員皆為資訊相關人員，有ui設計為專長的成員、程式設計為專長的成員，也有對行銷有興趣之成員，在技術及執行方面可說相對完整。\n\n此app尚未上架於play商店，待未來功能完整有望進行販售。\n\n此app未來發展性可說十分有看頭，他結合了youtube演算法運作，fb的圖文並茂，跳脫了ppt及dcard的分類式介面，本團隊也認為，不是越複雜功能越多的應用程式就是好，要能夠讓使用者認為實用且介面清楚最為重要。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1427,379,'https://drive.google.com/open?id=1cxKV1FyUluEcBVe7o4fJ2zwg7BgZILh9','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1428,379,'https://drive.google.com/open?id=1h_QAPyg3JeqOnYFRXbwMcom5ZWUSJn2n','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1429,379,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1430,379,'鄭虹君','2022-05-05 08:55:04','2022-05-05 08:55:04