現有的手環置入手語辨識的功能，一邊用成手環樣式，另一邊用成手錶樣式，利用首飾來辨認出表達的意思，用藍芽連接到對方手機顯示成文字，也可以利用外放的方式把手勢翻譯成文字的內容朗讀出來。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1482,383,'產品設計理念:「手譯者」這套產品主要是設計給聾啞人士使用，我們為了減少產品的外觀過於吸引旁人的注目而引來非議的眼光，我們將Apple watch的外觀做為參考，將我們的產品設計成智慧型手錶、科技手環的形式。\n\n功能：將手語翻譯成文字傳送到對方手機裡或以語音的方式播出；手機App功能:將文字輸入手機後轉換成手語圖示投影到手錶上。\n\n造型：手錶-方形觸控式螢幕，四角皆為圓弧角。手環-圓環狀，內圈為曲線色塊。\n\n設計提案創新之處：\n解決聾啞人士日常溝通不便的難題\n硬體結合智慧型手錶，產品多功能化\n使用常用規格，及配件可單獨更換\n軟體結合app，操作更為直覺方便\n健康監測，隨時得知身體狀態\n\n年齡：不拘\n性別：不拘\n適用者：\n1. 聾啞人士\n2. 身旁有聾啞人士的朋友\n3. 年長者\n4. 任何人\n使用情況或場所：\n1. (與)聾啞人士溝通時\n2. 家中、公共設施、醫院、養老院......等\n3. 簡易查看健康狀態時\n\n現階段有看到類似這項產品的想法建構，但還沒看到此類相關產品上市，希望以簡約方便的使用介面 來縮短聾啞人士及社會大眾的距離。\n目前市售智慧手環(手錶)價格起伏非常大，功能性較多的價格相對高昂，反觀小米手環價格就較為親民，我們的手環功能著重在手語翻譯功能，較沒有太繁瑣的功能，故定價定在新台幣4999。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1483,383,'https://drive.google.com/open?id=1JOy0RW9dJg4aSSpCE6S17xHQ6bOBO25h','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1484,383,'https://drive.google.com/open?id=1U18mvZgZK5Z5xir71qH9wUZTx0jmGI7y','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1485,383,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1486,383,'江宜宸','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1487,383,'葉宇樺','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1488,383,'曾嬿伶','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1489,383,'吳頌主','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1490,383,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1491,383,'巴慧玲','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1492,383,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1493,384,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1494,384,'我們想要讓世界上的排隊糾紛以及排隊花費的時間減少','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1495,384,'每到中午，學餐總是人擠人，導致學餐的員工在叫號的時候必須喊得很大聲，而且有時候會沒人搭理，動線也都被堵住，變得不易行走。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1496,384,'為了解決種種問題，我們打算做一個可以線上點餐的APP，讓原本繁瑣且複雜的點餐流程可以僅透過手機就完成。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1497,384,'https://drive.google.com/open?id=1nBoj_56qENY2mDPc7xgQCJfZBnwFe2Qn','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1498,384,'https://drive.google.com/open?id=1Cd-M_twEiznvuuM8lOgDz6d5-mgSXNr2','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1499,384,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1500,384,'周秉葳','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1501,384,'吳紀偉','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1502,384,'吳曄聰','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1503,384,'','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1504,384,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1505,384,'張婷媛','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1506,384,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1507,385,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1508,385,'希望能讓被報廢的紙箱，通過創意，再次獲得新生','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1509,385,'因現今物流日漸發達，紙類包裝的使用量大幅提升，但有大量不要的廢紙或紙箱會因為一些外觀瑕疵導致被報廢，可是其實都還是可持續使用的，因此我們的小隊希望能提出一些創意想法，來讓被報廢的紙重獲新生，但紙必定會存在一些缺點，像是紙怕水的特性，還有單層的紙支撐力不夠，以及被報廢的紙大多外觀都已受到磨損、不美觀等等的問題。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1510,385,'材料的部分，會向各個物流廠商收購報廢的紙包裝，而之前提到的紙類的缺點，第一點是紙怕水的問題，我們有上網查找一些資料，發現現在市面上有店家在販賣紙類專用的保護漆，可讓紙類不會因碰到一點點水就毀壞，但若是碰到大量的水還是會發生此問題，因此這將會列入之後可持續探討的問題，第二點是單層的紙支撐力會不足，我們也有上網查找資料，發現現在大多數的紙類商品，都會運用特殊的結構來為紙的產品增加支撐力和維持平衡，第三點則是報廢的紙大多外館已受到磨損，因此我們小隊討論出，可在外觀塗上不同顏色的顏料，或是不同花色的布料來做為外層的裝飾，最後我們小隊希望能將我們主要的理念--讓紙重獲新生，能推廣出去，讓更多人知道，並一起為環境盡一份責任。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1511,385,'https://drive.google.com/open?id=1Ykg8dDIDnrlhdQHwnnVT7AKxa5RiCJkM','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1512,385,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1513,385,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1514,385,'陳虹妤','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1515,385,'黃姿樺','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1516,385,'詹欣瑩','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1517,385,'蔡宜蓁','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1518,385,'彭宇濤','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(15