05-05 08:55:04','2022-05-05 08:55:04',90),(1941,416,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1942,416,'3D 虛擬試衣網路商店','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1943,416,'疫情的上升導致許多重要活動被迫延後或者取消，或許服飾店也會封館清消，但衣櫃裡總要有一兩件適合重要場合穿的套裝、西服，可於疫情趨緩時，也能穿的合宜參加活動。\n所以我們打算結合VR虛擬實境的選品店，讓大家不出門也可以安心逛街，且怎麼試衣服都不累，並找到適合的套裝。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1944,416,'3D虛擬試衣間的推出，藉由在家試穿體驗，不僅能在購物前先評估服裝是否適合自己，也可以不斷瀏覽，選擇不同的服裝試穿，購買時，系統會將用戶的使用記錄保留，當用戶再次試衣時，系統除了可自行選擇試衣款式外，也會推薦她可能喜歡的類型，並通過流行色彩或不同款式的搭配進行大數據分析，使用戶能夠精準快速地挑選合適的衣服。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1945,416,'https://drive.google.com/open?id=1c3wCe01dcSFQC85pLZMjCEZEYojQhnPK','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1946,416,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1947,416,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1948,416,'胡柏淵','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1949,416,'杜文諺','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1950,416,'王俊智','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1951,416,'陳俞嘉','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1952,416,'林芷君 ','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1953,416,'張婷媛','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1954,416,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1955,417,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1956,417,'一套可利用歷史手術資訊精準預測手術時間的系統。','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1957,417,'因全民健保實施，加上醫療保健意識提升，人們不再諱疾忌醫，主動前往就醫。醫院經營者面對眾多的就醫人口，必須審視自身政策的優劣。汰換不堪使用的硬體(如：病房設備等)，更新不合時宜的軟體(如：看診流程等)，以提升醫院的競爭力，提供更優良的醫療水準。其中，因手術室具有高收益及高成本支出的特性，如何規劃及管理手術室，使其利益最大化，往往最為需要謹慎考量。\n現今醫院中預測手術時間的方式大多需要耗費額外人力，預測結果也不準確，若能開發一套手術時間預測系統，不僅可降低成本，也可減少預測誤差，有效利用手術室與麻醉室資源。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1958,417,'利用歷史手術資訊事先產生預測模型，改善目前排程人員因手術時間和麻醉時間預估不準確，導致排程內容與實際狀況不符的問題。\n我們設計一款可被實際應用在醫療現場的手術時間預測系統。此系統核心目標在於利用多樣性的客製化資料處理功能，再利用特徵選取方法讓使用者選取出最為適切的資料特徵，最後利用倒傳遞神經網路或其他演算法，訓練預測模型以透過術前資料預測未來手術花費時間。可針對各科別手術進行評估且提供使用者手術時間或麻醉時間當參考。\n手術室排程人員多無相關知識，為順利將手術歷史資訊轉換為可用於預測的資料，系統內須包含資料清洗和轉換功能，並以淺顯易懂的方式將產生模型所需的工作拆分為多個步驟，輔以使用說明，使無相關專業的排程人員能輕易操作此系統。\n自新冠肺炎爆發以來，台灣乃至各國都相當重視醫療。如何有效率的運用醫療資源已是一個重要的課題。未來若與多家醫院合作，建立互惠模式，我們取得去識別化的手術歷史資料後，我們便可以更增進本系統的模型效能。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1959,417,'https://drive.google.com/open?id=1bV1cfCFyCee1VrsfckRUZ--WAu2X53u9','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1960,417,'https://drive.google.com/open?id=1vpHcJdMKHoK-dHjQls9T1ArD9YlyaNol','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1961,417,'https://drive.google.com/open?id=1H2p1_iJE0VEMSEUEEYrRYmFWz4pHLoqm','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1962,417,'蔡浤楷','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1963,417,'林垣志','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1964,417,'楊昀真','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1965,417,'許至佑','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(1966,417,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(1967,417,'江傳文','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(1968,417,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(1969,418,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(1970,418,'水渦流發電式自動洗手乳供應機','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(1971,418,'因應疫情嚴峻，洗手變得更為重要，有了高科技\"水渦流發電式自動洗手乳供應機\"，就不用怕使用洗手乳會接觸到上一個使用者的病菌了，而且也可避免像一般休息站的自動洗手乳供應機還要架設電線跟降電壓裝置帶來的麻煩。','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(1972,418,'利用開水時水流出過程的動力來發電並對電池充電，進而提供自動洗手乳供應機的電力所需，且水龍頭裡亦有過濾芯片可以過濾水，避免洗到髒水也可以保護發電設備，增加使用持久度。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(1973,418,'https://drive.google.com/open?id=1vjqR0PfC1KlrZM3YpOgJFXGlz-0l7hKc','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(1974,418,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(1975,418,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(1976,418,'邱凱榆','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(1977,418,'陳柏旭','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(1978,418,'彭銨生','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(1979,418,'張弘竣','2022-05-05 08:55:04','2022-05-05 08