'彭煒棠','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(2005,420,'陳昱豪','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(2006,420,'張茂駿','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(2007,420,'孫華佑','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(2008,420,'白宇廷','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(2009,420,'張婷媛','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(2010,420,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(2011,421,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(2012,421,'我們的發明主要是解決製圖桌的不方便性','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(2013,421,'發現學校並沒有製圖桌，讓我們在畫圖時畫出來的線條難以達到精確的平行，許多同學因此感到不方便。於是我們發想出了能在沒有製圖桌的情況下，也能畫出相較正確及美觀的建築圖。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(2014,421,'解決方法：\n起初為了畫建築圖中的牆、柱、梁，需要精確的平行線，我們設計了平行工程筆，內有兩根筆芯，由於筆芯是固定住的，所以能畫出平行線，不需分兩次畫出兩條平行線，從而降低一支筆所畫出平行線的誤差。\n之後我們又遇到，平行線間距離的問題，因牆、柱、梁的寬有各自的尺寸，所以我們解決問題的方法結合了橫桿圓規的設計，它能使筆芯間的距離做出變化，達到畫出不同間距的平行線。\n而在美觀的部分，我們在畫建築圖時會轉筆，讓線條達到均勻。但因為平行工程筆的兩支筆芯是固定住的以至於沒辦法轉筆，所以我們的解決方法是在筆當中加入一蝸桿與蝸輪結構，讓我們直接畫平行線時能自動幫助我們進行轉筆。\n\n目標：由於部分學校沒有製圖桌，但是建築、機械及設計相關科系的學生們仍有製圖的需求，所以我們希望平行工程筆能夠解決學生在製圖時會遇到的問題，提升學生繪製的工程圖的品質。\n\n未來發展的潛力：市面上還未有具備如此多功能的產品，而且價格並不昂貴，勢必可以吸引有需要此商品的消費者。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(2015,421,'https://drive.google.com/open?id=1Wgvnfsu7YBNJUC5lXIbY7f1Y_b-4g3m_','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(2016,421,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(2017,421,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(2018,421,'陳昊','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(2019,421,'潘冠倫','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(2020,421,'吳瑜娟','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(2021,421,'許仲裕','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(2022,421,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(2023,421,'宋旗桂','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(2024,421,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(2025,422,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(2026,422,'一種採用組裝的架子，比起一般的塑膠夾更加環保耐用','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(2027,422,'平時使用的曬衣夾，收納和耐用度都令人非常困擾，常常弄丟或者按個幾下就斷掉，但又因其價格低下，讓人覺得無所謂，但在購買和尋找的過程中，已經浪費了許多的時間和金錢，我們尋思是否能改進缺點的同時，又不失其方便的功能。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(2028,422,'我們將夾子改為拼裝式的，夾子分為三個部分，左右兩邊是鐵片而中間的部分則是矽膠，鐵片與矽膠的接合處我們採用卡榫的構造，在矽膠的兩端則加裝磁鐵，利用磁鐵的吸引力來當作夾子夾起來的力量','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(2029,422,'https://drive.google.com/open?id=1zsH3w5bLxPtf8GnCMTZ1c6w09EP9XDdD','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(2030,422,'https://drive.google.com/open?id=1Teb5lpNcQ4y-ahKiWslfB4FqB_6m_coo','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(2031,422,'https://drive.google.com/open?id=1zN9hq75cNf72qgBaiUR7LEfjx1eFDY_h','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(2032,422,'林楓竣','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(2033,422,'陳美儒','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(2034,422,'范晴','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(2035,422,'馬浚哲','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(2036,422,'','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(2037,422,'宋旗桂','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(2038,422,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(2039,423,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(2040,423,'提供廣告商與創作者間適合彼此的合作對象','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(2041,423,'常看到很多廣告商與眾多創作者間的合作宣傳，如較為小眾的創作者們較不易被廣告商們找尋，廣告商之廣告預算可能也有所受限，因而發想此媒合平台供廣告商與創作者彼此間挑選適合的合作對象','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(2042,423,'廣告商提供給我們產品資訊存放入系統資料庫內，創作者們也提供其訂閱人數、流量、預期價位等給廣告商做選擇，廣告商再經由媒合服務平台之創作者清單，挑選合適的價位與訂閱數，並傳送訊息通知創作者有意與其合作之廠商及其產品資訊，不管是聲量較大的創作者可自行等待廣告商的接洽，抑或是小眾創作者也能有穩定收入，此服務系統也可透過雙方收益抽成，提供更完善的服務。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(2043,423,'https://drive.google.com/open?id=1EqBF3jyMkO3jJHTeCT-qgedcsWBB7j1m','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(2044,423,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(2045,423,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(2046,423,'林貞智','20