再生橡膠，橡膠不易於回收，用再生橡膠可以增加橡膠的生命週期，符合永續精神，且現在有大量消費者願意為環保買單，這樣能夠增加目標客群。而香菇造型的拖鞋可以讓水順著香菇的造型向下流，就不會造成積水，發出啾啾聲，不易滑倒，且洗完澡後腳就不會那麼濕了。再加上採用模組化設計，將按摩功能加進排水浴室拖鞋中，並讓使用者能根據不同的需求來選擇是否要更換依照腳底穴道設計的按摩鞋墊，使自由度提高。','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(2099,427,'https://drive.google.com/open?id=1qmSzUWWmczmqti1ydVoeuXcrTNc6Hk-o','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(2100,427,'https://drive.google.com/open?id=1OZgfTStQRvBgywHucyUofX5HM03V4kpv','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(2101,427,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(2102,427,'劉昕芽','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(2103,427,'王品淳','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(2104,427,'賴震東','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(2105,427,'陳宇鈞','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(2106,427,'陳家豪','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(2107,427,'陳建志','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(2108,427,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(2109,428,'(二)智慧生活類','2022-05-05 08:55:04','2022-05-05 08:55:04',77),(2110,428,'家庭總有許多問題，團隊致力於家庭孩童和長輩照護，為每個家庭開發APP。','2022-05-05 08:55:04','2022-05-05 08:55:04',78),(2111,428,'家庭總有許多問題：\n長輩一個人在家摔倒沒人知道、\n出去玩忘了帶東西、\n孩童手機都玩很久……等','2022-05-05 08:55:04','2022-05-05 08:55:04',79),(2112,428,'開發一個APP：\n長輩摔倒了通知家裡其他人、\n長輩忘記回家的路可以導航、\n小孩的手機一段時間會被鎖住不能玩遊戲、\n有設定備忘錄，出家門50公尺會提醒拿東西、\n有設定日程安排，提醒長輩生活作息。\n','2022-05-05 08:55:04','2022-05-05 08:55:04',80),(2113,428,'https://drive.google.com/open?id=1kBxlRC7LFj5RNR167BvdNOpBneGj7IUD','2022-05-05 08:55:04','2022-05-05 08:55:04',81),(2114,428,'','2022-05-05 08:55:04','2022-05-05 08:55:04',82),(2115,428,'','2022-05-05 08:55:04','2022-05-05 08:55:04',83),(2116,428,'許力勻','2022-05-05 08:55:04','2022-05-05 08:55:04',84),(2117,428,'林禹鑫','2022-05-05 08:55:04','2022-05-05 08:55:04',85),(2118,428,'林祐丞','2022-05-05 08:55:04','2022-05-05 08:55:04',86),(2119,428,'李沅璋','2022-05-05 08:55:04','2022-05-05 08:55:04',87),(2120,428,'黃建凱','2022-05-05 08:55:04','2022-05-05 08:55:04',88),(2121,428,'陳建志','2022-05-05 08:55:04','2022-05-05 08:55:04',89),(2122,428,'','2022-05-05 08:55:04','2022-05-05 08:55:04',90),(2123,429,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2124,429,'現代人在繁忙的生活中，又很重視健身，因此我們發想了折疊式飛輪車，不論在哪、任何時間都能做使用','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2125,429,'現代人最大的通病就是因為生活的忙碌\n而沒有多餘的時間運動，也因此造成肥\n胖、高血壓等等的身體症狀，充斥在我\n們的生活周遭。\n雖然有健身房、戶外運動場等等可供民\n眾運動休閒的地方，但就是空不出時間\n或是懶得出門運動。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2126,429,'我們結合了健身房常見的飛輪車與折疊式腳踏\n車，發想出了「摺疊式健身飛輪車」。\n如此一來便解決了飛輪車只能在定點擺設的問\n題，也方便攜帶，無論在哪都可以使用。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2127,429,'https://drive.google.com/open?id=1hKXUFXW4bzZ_1a6cDIuzqyxo_b_pSY1l','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2128,429,'https://drive.google.com/open?id=1RopmDNY5ZCBynLnEpnGzANpzBXWHJXYF','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2129,429,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2130,429,'張䕒恩','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2131,429,'陳柏禎','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2132,429,'薛少凱','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2133,429,'','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2134,429,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2135,429,'陳怡君','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2136,429,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2137,430,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2138,430,'真空式雨衣，改善雨天穿雨衣還是會淋濕、灌風等問題','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2139,430,'雨天穿雨衣很不方便，通常下大雨時還是會淋濕\n且安全性低（勾到、破掉、灌風），所以我們想解決市面上雨衣的問題，且小組成員提出復仇者聯盟中鋼鐵人的變形雨衣，因此利用彈性收縮這觀點設計出本組產品。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2140,430,' 我們採用真空設計將雨衣與身體之間的空氣抽除使其貼身，以按鈕作為開關，真空後會符合身形，並且提高安全性及方便性。每個雨衣開口處都會有加強的節點，使其不易進水且防風灌入，並且使用彈性收縮增加舒適度。在雨衣背後可以縮放增加空間，解決身材不同及後背包問題。鞋套底部新增止滑設計，讓使用者在雨天能不受地面路滑影響，能順暢走路。\n    由於雨衣市場已經趨於飽和，加上品牌多樣化，相對我們的產品知名度較不足，但近年外送產業興盛，我們可以利用此機會改變我們的劣勢，由勞動部統110年台灣外送員大約87,618位，我們若讓其中70%的外送員穿戴我們產品，對於他們來說雨衣使用率比一般大眾高，會比較願意購買稍貴的雨衣，也會更願意提供我們相關意見使我們改善產品，他們長期會在外奔波且常與人接觸，能作為我們的行動廣告模特，當然我們會推相關優惠於此客群，增加他們得購買意願，假設一台機車都有一位主人，而一位主人不會有兩台機車，第一年預估銷售量為61,333，占環保署統計台灣機動車輛0.4%，第二年占其1%，第二年2%，預估一件售價為1,299，銷售成長率第二年129.95%，第三年為100.00%，預估銷售額三年為79,671,567、183,208,362及366,415,425。\n','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2141,430,'https://drive.google.com/open?id=11vjJiF9C21b-sCbEy4fuVMVTPzbyy1j3','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2142,430,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2143,430,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2144,430,'黃莉嵐','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2145,430,'陳佩筠','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2146,430,'陳品叡','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2147,430,'','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2148,430,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2149,430,'巴慧玲','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2150,430,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2151,431,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2152,431,'結合安全帽的雨衣，能快速提供遮雨功能。','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2153,431,'在突如其來的雨中，我們發現等穿好雨衣之後，身體也差不多全濕了，所以我們就想設計一個體積不大，容易收納，又能夠快速穿好的雨衣。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2154,431,'設計一個穿脫快速、收納方便、材質強韌的雨衣，讓大家在面臨突然的降雨時，不需要再從車廂拿出雨衣，直接套上即可。\n\n所用技術包含:\n1.拉鍊(柔軟可凹折)\n\n2.鈕扣(耐用)\n\n3.魔鬼氈(耐用、固定性佳、不會勾頭髮)\n\n4.雨衣材質(輕薄、強韌、防水度高)\n\n5.收納時雨衣體積小\n\n預估達成目標:\n台灣人口數約2300萬人，機車數量約1500萬輛\n扣掉未滿18歲、沒有駕照的人，可說幾乎一人一台機車，\n單以外送員來評估，人數約有10萬人，\n假設其中的1/4的人來買此產品，我們定價500元，成本200元\n預估營業額 : 1250萬元\n淨利 : 750萬元\n(售價500-成本200)*銷售數量10萬*預估購買人數1/4)\n未來市場發展潛力:大\n','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2155,431,'https://drive.google.com/open?id=1aqwlpJ5pTL5vz9Tg7MVEK-qlbFR3j1zf','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2156,431,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2157,431,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2158,431,'曾慶峰','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2159,431,'陳俞安','2022-05-05 0