配合書本厚度變動','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2183,433,'https://drive.google.com/open?id=1ULoXE4sPRnvElAa5OmOGGbuSofValGBl','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2184,433,'https://drive.google.com/open?id=13NVTT84dMupRugh0r2D58tpNu-0TyNEN','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2185,433,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2186,433,'黃苡淇','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2187,433,'張俊嘉','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2188,433,'莊承諺','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2189,433,'宋俊毅','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2190,433,'李佳淇','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2191,433,'張婷媛','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2192,433,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2193,434,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2194,434,'可手動多段式調整高度的鞋子','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2195,434,'日常方面，比較矮的人，會想要讓自己拍照的時候看起來比較高，而在購物時，有些商品放得較高，就會痛恨自己太矮；娛樂方面，當去演唱會或看煙火時，想看前方的事物卻被長得過高的人擋住。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2196,434,'創意特色：利用鞋子結合伸縮拐杖上的卡榫整合出可調式增高鞋\n\n產品結構：鞋子底部，中間的地方用一個軸心固定多個環，然後環與環之間，拉開後可以用卡榫固定，讓鞋子達到增高的效果，多段環的設計，可以讓使用者自由調整想要的高度。環的材質為鋼頭鞋常用的塑化鋼，他可以支撐人的重量，重量也比一般的鐵環還要輕，最後底部會加一層橡膠墊，降低走路時的聲音\n\n市場競爭：我們的產品(可調式增高鞋)與厚底鞋和增高墊做比較，在鞋子的墊高方面，可調式增高鞋可在需要時多段調高，不需要時恢復成一般鞋子的高度，增高墊墊高程度適中等，厚底鞋的墊高程度雖然是高，但卻不可調整；在高度調整的機動性方面，可調式增高鞋可隨時調整高度；增高墊和厚底鞋是固定高度的；在安全性上，可調式增高鞋因為可調整高度，所以不會ˋ有扭傷的問題，但是其他兩種是固定高度，所以會有扭傷的風險。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2197,434,'https://drive.google.com/open?id=14NhE5f8tzsDjXSXE9M1RM7nv-S0g7pfg','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2198,434,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2199,434,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2200,434,'黃心雨','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2201,434,'林聖智','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2202,434,'陳妤萱','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2203,434,'黃瑋豪','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2204,434,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2205,434,'宋旗桂','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2206,434,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2207,435,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2208,435,'自製的配電盤，能透過手機監控各個電力迴路狀況。','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2209,435,'Q1：過載發生時，裝置會如何運作？\nQ2：你們家配電盤易安裝和維護嗎？\nQ3：為何要用電安e管家？','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2210,435,'A1：當快到達過載臨界點時，裝置會透過手機APP警告使用者。假如真的發生過載狀況時，將自動斷開連通電器的電力迴路，且等待狀況排除。\nA2：因本產品設計為模組化易安裝和維護，若有問題撥打專線將會有專人提供完整售後服務，不建議客人自行維修以免有安全疑慮。\nA3：只需要打開手機，便能查看家中各個電器的用電狀況(電壓、功率、電流大小、用電度數、比較上個月的用電度數……等)，且還能控制各個電器線路的開關。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2211,435,'https://drive.google.com/open?id=1csyg4p86U_cZLGediUCJ0YV8Uz_Q9Z0q','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2212,435,'https://drive.google.com/open?id=1HC1glEMWbIf3tdTpePpGEkwa3vt2B4pp','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2213,435,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2214,435,'張峻銘','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2215,435,'李詠詮','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2216,435,'李權修','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2217,435,'','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2218,435,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2219,435,'張婷媛','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2220,435,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2221,436,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2222,436,'將原子筆與立可白合而為一的文具，以提升書寫的便利性','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2223,436,'考作文的學生，需要在短短幾十分鐘內寫出一篇優秀的文章，而學生要是因考試緊張而常常寫錯字的話，反覆因錯誤拿起立可白修改又拿起筆的過程就非常不方便，而修改花掉的時間又會讓考生更加焦急，本來能穩定發揮的實力又會到影響。\n','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2224,436,'我們發想出一種結合立可白與原子筆兩種文具的產品來提升書寫與修改的便利性。一支筆的體積裡，一端為原子筆，另一端則為立可白，中間使用螺紋互鎖，皆為半透明外殼，方便看到筆與立可白的殘量，以做替換。原子筆端為替換筆芯，有多種顏色粗細可供選擇，而立可白端須整支替換。隨寫隨塗兩用筆可以在書寫錯誤時，將筆轉向另一端使用立可白進行修改，不需要放下筆，在拿起立可白修改後又拿起筆的過程。選擇立可白而不是立可帶，是因為立可白不需要立可帶一樣複雜的結構，這樣才能將體積縮小，方便攜帶。\n','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2225,436,'https://drive.google.com/open?id=1KmYyNu9b6DyhVyTIyqnkDteakFIbgyFw','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2226,436,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2227,436,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2228,436,'陳冠倫','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2229,436,'黃冠哲','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2230,436,'周冠宇','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2231,436,'李嘉華','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2232,436,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2233,436,'宋旗桂','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2234,436,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2235,437,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2236,437,'注重於改善全球暖化，讓社會大眾一起來做環保','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2237,437,'生活問題:炎熱的天氣','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2238,437,'解決問題:持續做環保，減少對地球的負擔。\n技術、團隊驗證等可行性:環保集點一開始推出下載人數僅3、4千，直到去年底已成長至26萬，截至目前已快達27萬，同類產品預計可達20萬\n\n每一萬個播放量能賺到300元，20*300*30 = 180,000\n40%做公益 180000*0.6=108000\n預計可營利10萬','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2239,437,'https://drive.google.com/open?id=1CSkxgLPKijdZFie15pLzUILj_9vYJm3h','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2240,437,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2241,437,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2242,437,'張穆殊','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2243,437,'邱致中','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2244,437,'無','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2245,437,'','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2246,437,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2247,437,'巴慧玲','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2248,437,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2249,438,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2250,438,'蓮蓬頭結合沐浴乳','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2251,438,'若是出事故常常在洗澡時因為一隻手受傷導致使用沐浴乳時困難重重','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2252,438,'我們以蓮蓬頭背後加裝可以容納沐浴乳的容器，並在容器與蓮蓬頭手柄處裝上按壓開關，可以讓我們在沖澡時按壓按鈕使沐浴乳隨著水流沖出，在停止施壓時，沐浴乳則不會流出，對於手受傷的人們來說，是更加便利的一個發明','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2253,438,'https://drive.google.com/open?id=1CpxwTcDmioSL7wjwsF1wCch3fD0XC3GB','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2254,438,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2255,438,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2256,438,'何紹銓','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2257,438,'尉建泓','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2258,438,'黃彥璿','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2259,438,'林睿邦','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2260,438,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2261,438,'宋旗桂','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2262,438,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2263,439,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2264,439,'神器在手，一提就走。 主人與狗狗散步必備好夥伴','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2265,439,'現代人養寵物的比率越來越高，每次帶寵物出去散步時都需要帶著寵物水壺、拾便袋及伸縮牽繩等，不過如果要把全部的東西都帶齊，那麼就需要帶著大包小包的出門，非常不方便，因此我們就有了要是能一次把東西都帶齊全，且又能讓帶寵物出門散步的人減輕負擔的想法。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2266,439,'針對這個問題我們想出了把拾便袋、寵物水壺及寵物伸縮牽繩合而為一的寵物神器。我們寵物神器的握把參考手提式手電筒的把手，因為此種握把較堅固，因此能承受較大的重量，不怕提到一半把手斷掉的問題，且能一提就走。再來我們結合市面上常見的寵物水壺，只要按下出水鈕，水就會從出水口流到水壺前端，讓狗狗在外面可以隨時隨地補充水分。並且我們還結合手動伸縮牽繩，只要推一下握把上的推鈕，就可以輕鬆將牽繩拉長或是縮短，減少繩子過長沒地方收的困擾。在寵物神器的尾部我們設計了可以放置拾便袋的容器，容器採用的是掀蓋式，如果拾便袋用光時，就可以把容器的蓋子掀開再遞補新的拾便袋進去，且在容器外面我們設計了一個缺口，讓寵物主人可以更方便的將拾便袋取出。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2267,439,'https://drive.google.com/open?id=1xzqt4Pw18cT1vLd_y4zVevHwHKfI9AnK','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2268,439,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2269,439,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2270,439,'陳昱琳','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2271,439,'吳威廷','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2272,439,'鄭瑜菡','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2273,439,'賴盛瑋','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2274,439,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2275,439,'宋旗桂','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2276,439,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2277,440,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2278,440,'使用單抽濕紙巾盒可以在單手操作的時候，一次抽出單張濕紙巾，從根源解決濕紙巾連抽問題。','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2279,440,'每次使用濕紙巾時，常常會有連抽問題，導致一次抽出過多濕紙巾。而被過多抽出的濕紙巾受到污染又不好直接塞回包裝，導致浪費也不衛生。當我們只能單手操作時，這個裝置可使我們更好拿取濕紙巾。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2280,440,'因為濕紙巾的包裝是一張疊著一張，濕的紙巾有黏著性，我們在開口加上束口設計，增加濕紙巾與開口的摩擦力，使濕紙巾不會連續抽出。解決辦法的構想是聯想到褲子的鬆緊帶，於是設計出與鬆緊帶類似的束口裝置，安裝至盒子開口上，我們實體做出此裝置並實際測試，結果是可行的。將束口設計跟紙盒組裝，原理像面紙盒，可將各牌濕紙巾放入此裝置，市面上未有相關設計，具有獨特性，可申請專利。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2281,440,'https://drive.google.com/open?id=1-efjvoBMzLzFmYEv2TXvrPh88CcmHR-G','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2282,440,'https://drive.google.com/open?id=1G8P2oRuw3M5vV0DIb84cff296obAVzVu','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2283,440,'https://drive.google.com/open?id=1thMRW4XSRbth7VnPi4i6YkH3xFZhi-lx','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2284,440,'張禎芫','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2285,440,'湯旭媛','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2286,440,'李梓綺','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2287,440,'林羽柔','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2288,440,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2289,440,'宋旗桂','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2290,440,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2291,441,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2292,441,'針對腳踏車族群，打造，依身體傾斜，有方向指示功能的雨衣','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2293,441,'無論是，下雨天或者是晚上甚至是白天，在路上騎機車時因為無法辨別前方腳踏車的行車方向，即使有保持安全距離，在他突然轉彎時還是有安全性的問題','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2294,441,'\n在現今人人都可輕易拿到駕照的台灣，我們常常忽視關於交通安全的問題，而我們的道路上有著以大欺小的文化，因此常常會發生憾事；我們這次關注的是最為弱勢的腳踏車騎士，這種沒動力的車輛通常是沒有儲備電量可以讓各式燈具發光，因此我們希望製造一件防水外套，並將燈具安裝在外套上，而發電系統就仰賴輪子帶動發電機提供LED所需的電流，如此一來希望能大幅減少沒方向燈警示而發生的憾事。在腳踏車的龍頭加裝類機車按鍵式打燈鈕，在電路的部分，沿著腳踏車的煞車線連結至腳踏車的發電機，(以Ubike為模型)發電機有開設USB的連接孔用於插入防水外套的USB連接插頭，當腳踏車的按鍵觸發時防水外套便會接受指令觸發外套上的LED燈泡打造一件主動式發光雨衣。這產品具有新穎性，受年輕人喜愛，年輕人也是UBIKE的受眾，對於這項產品提供了巨大的優勢，同時台灣對主動式發光還是一片藍海市場，順利完善產品，相信能為台灣這個社會提供些許的價值，使人們在騎腳踏車時能夠減少些許也好，在安全方面的疑慮。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2295,441,'https://drive.google.com/open?id=1mGZMcsoPCjREebrJjGuDJHkRKSDJoeS3','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2296,441,'https://drive.google.com/open?id=1p0kokbXAnkrwK_dP1bILyB45l-s6cNku','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2297,441,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2298,441,'陳薪富','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2299,441,'徐銘御','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2300,441,'王顥霖','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2301,441,'葉忠諺','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2302,441,'杜奕呈 ','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2303,441,'張婷媛','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2304,441,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2305,442,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2306,442,'以廢棄的蔬菜做成的紙來做成的動物園地圖，有給動物吃、折價卷、地圖','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2307,442,'發現現在環境污染嚴重近幾年環境保護議題逐漸受到大家重視我們也需要對環境做一份貢獻開發一個可以保護環境堅固實用的產品','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2308,442,'我們使用廢棄的蔬菜做成紙張，再利用蔬菜紙做成地圖，蔬菜紙導覽圖有地圖還有折價卷還有餵食動物的功用，我們預計達到月銷量5,000,000張','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2309,442,'https://drive.google.com/open?id=1D8ZSV3vHHr0WT2J2HJLfh771zpPkxbAv','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2310,442,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2311,442,'',