-05-05 08:55:24',92),(2335,444,'1.發現多數保溫瓶不易清洗，毛刷無法隨身攜帶，清洗較為不便。\n2.杯子盛裝飲品上限固定，無法客製化對應每位飲用者的需求量。\n3.大多數的保溫瓶因材質關係都不建議承裝飲品，尤其是碳酸類的飲料，飲用上有所限制。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2336,444,'解決問題:\n1.分節瓶身的設計方便快速用手清洗\n2.出門可依需求調整攜帶容量\n3.可自由選擇不同內部材質的保溫環(Ex:316醫療級不鏽鋼，陶瓷等)，使其能承裝酸性溶液\n\n產品技術分析:\n保溫環：採抽真空技術，搭配可串聯結構即可將部件組裝再一起，杯內部連接處搭配止水環，可防止液體從杯外溢出，兩個保溫環設計旋轉到一定緊度後自動卡榫，確保止水環有效。\n\n杯底/杯墊：在沒有使用某一保溫環時，可以與另外設計的杯墊組合，方便在家中多幾個保溫小杯承裝飲料分享等用途，杯墊內壁也是不鏽鋼材質，外部則是隔熱板材質。\n\n洩壓器：內部使用訂製彈簧，當瓶身壓力達一定之標準，彈簧下金屬片被向上擠壓就可以釋放氣體，當顛倒過來時，金屬球會因為重力把出氣孔稍微堵住，不會一次洩漏出太多液體與氣體，整個結構採取可拆式，只需要把上蓋移除，即可取出，方便清洗。\n\nSWOT分析:\nStrength：方便使用 、易於清洗 、自由組裝、隨心變換 、材質多元 、安全無慮\nWeakness：技術成本較市售高\nOpportunity：樣式新穎，能應付大多需求\nThreat：市售保溫瓶眾多，競爭激烈','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2337,444,'https://drive.google.com/open?id=1iF5UP3BAtqEpEHgHNPAzSsv5Ktmiq160','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2338,444,'https://drive.google.com/open?id=1XZO696Fk9IclxUkwjIW3ATjxa1crSWqp','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2339,444,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2340,444,'劉瑾謙','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2341,444,'鄭丞雅','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2342,444,'許方綺','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2343,444,'陳仕旗','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2344,444,'王唯任','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2345,444,'張婷媛','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2346,444,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2347,445,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2348,445,'藉由小設計去減少街道的菸蒂','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2349,445,'路邊容易看到被亂丟的菸蒂，影響城市美觀，而想更進一步去設想一個產品。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2350,445,'開發一款三合一的產品，菸盒、打火機、熄菸多重功能的菸盒，在外加一個存放菸蒂的小空間，達到吸引顧客購買、同時使用已達到菸蒂不落地。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2351,445,'https://drive.google.com/open?id=1aJM3xYCjtWOU-7mBD_ru1sTAna7-fb28','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2