4','2022-05-05 08:55:24',99),(2566,460,'林庭卉','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2567,460,'陳玟君','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2568,460,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2569,460,'宋旗桂','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2570,460,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2571,461,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2572,461,'改善包裹用紙箱，使紙箱可多次重複利用','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2573,461,'在現代社會中，線上購物已是我們生活的一部分。送到手中的包裹常常因為各種外在因素而遭損壞，且不能再次使用。我們為了改善紙箱的不防水、易受潮、不防尖銳物、易燒毀以及易變形的五大缺點，將紙箱新增了針對五大缺點的改善方式。以上，我們的紙箱在運送過程中，能有效減少損毀，並能重複利用，更加環保。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2574,461,'解決的問題\n1.不防水= 在紙箱外層貼上環保塑膠材質，以達到防水且環保效果。\n2.易受潮= 在内層紙箱放乾燥劑減少受潮率。\n3.不妨尖銳物= 利用外層塑膠材質，增加紙盒韌性。讓尖銳物第一時間先接觸塑膠，而不是\n之上。\n4.易燒毀= 外層使用防水，防火的玻璃膜，可以防止易燒毀。\n5.易變形= 外層使用環保塑膠或防撞材質使紙箱能回彈或更堅固。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2575,461,'https://drive.google.com/open?id=1nWG74WIbAJNo2ayvA13GPPDnCcwLIya8','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2576,461,'https://drive.google.com/open?id=1nfTHAdd-dN9OqghyPcHmZJ-s_XcRXp_P','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2577,461,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2578,461,'洪飛鵬','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2579,461,'林健身','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2580,461,'林沛錚','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2581,461,'郭嘉欣','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2582,461,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2583,461,'陳建志','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2584,461,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2585,462,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2586,462,'開發一個手機APP，通過AI虛擬助理，協助規劃健康飲食。','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2587,462,'平時缺乏健康觀念的人若想通過飲食減肥，第一件事情是先Google搜尋方法，但面對真僞難辨的網路資訊，常常會感到迷茫而怯步。經濟能力不足以聘請專業健康顧問，又需要可靠、個人化的健康飲食建議。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2588,462,'與營養師團隊合作彙整健康飲食相關資料，確保資訊正確無誤後，開始建立一個手機APP，提供個人化的健康飲食規劃服務。\n\n基本功能包含：分析食材相剋風險及推薦替換食材、針對想改善的疾病推薦飲食配方、掃描餐盤分析營養成分。虛擬助理(TIVA)類似LINE BOT機器人，使用者可透過關鍵字啟用不同功能。虛擬助理會記錄使用者每次輸入的資料和分析結果，定期總結飲食改善狀況、給予正面回饋。\n\n技術方面將涉及安卓APP開發、圖像辨識AI模型、對話機器人設計。\n\n在食安問題日漸增加的背景下，外食族的患病機率提高，也越來越關注疾病的後遺症等負面影響，EATIVA可以通過健康飲食幫助人們改善或預防疾病，呼應市場的長期需求，具有永續發展的潛力。\n\n目前的目標客群是以小資外食族為主，未來的目標是進軍健身族群市場，為健身新手提供更專業的飲食資訊及規劃服務，省下長期聘請健身教練的昂貴費用。\n\nAPP收入方面，除了GOOGLE廣告及使用者贊助之外，將視市場需求推出訂閱制的會員方案，付費會員將享有更多元的服務。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2589,462,'https://drive.google.com/open?id=1olOvEqsd-WHH5ErcU84KzwnXo3il_I-F','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2590,462,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2591,462,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2592,462,'張文嫣','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2593,462,'高翊馨','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2594,462,'吳瑋珊','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2595,462,'','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2596,462,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2597,462,'陳宗澤','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2598,462,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2599,463,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2600,463,'我們可以透過app來提醒使用者甚麼時候要祭拜和忌諱，沒有時間準備供品也能夠用app來請廟方訂購，到了廟宇就會有準備供品了','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2601,463,'現在年輕世代對於廟宇這種習俗並不會將所有細節記得清楚，都需要自己上網查找，如果有個app能夠幫忙統整那就會非常的方便。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2602,463,'我們利用app的方式，提供線上農民行事曆的方式，可以提前提醒使用者要準備甚麼，要祭拜甚麼，和不宜使用的供品。也能夠直接線上請廟方幫忙準備供品，對於沒有時間準備的人來說非常的方便。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2603,463,'https://drive.google.com/open?id=1UkEqd8r2eDJe5W3nVpIWePPO6d23LZtY','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2604,463,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2605,463,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2606,463,'莊凱翔','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2607,463,'