小化，以期展現最佳的營運績效。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2630,465,'為確保計畫執行的所得成果可被實際應用在醫療現場，我們以高雄地區某醫學中心為研究對象，深入探討最佳化手術房規劃與管理的具體可行措施。本提案所需資料係擷取自個案醫院資訊系統的資料庫相關手術紀錄。實作方式為自行建置一套以 Java 程式語言為主的離散事件模擬函式庫，透過模擬真實場域的情形以提供醫院管理階層有關手術房間數量的決策支援建議，兼顧醫療服務品質以及營運績效的提升與發展；同時也能協助手術房現場控檯人員妥善安排手術事件的執行時間與作業場域，使得有限的醫療資源可以發揮最大綜效。','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2631,465,'https://drive.google.com/open?id=1QKj1Z2BNckliErFHNjzYlQJEQEzOiUri','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2632,465,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2633,465,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2634,465,'林彤恩','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2635,465,'蕭裕憲','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2636,465,'李建威','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2637,465,'李貿全','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2638,465,'','2022-05-05 08:55:24','2022-05-05 08:55:24',102),(2639,465,'江傳文','2022-05-05 08:55:24','2022-05-05 08:55:24',103),(2640,465,'','2022-05-05 08:55:24','2022-05-05 08:55:24',104),(2641,466,'(四)自命題類','2022-05-05 08:55:24','2022-05-05 08:55:24',91),(2642,466,'尋找能代替塑膠袋、低成本以及環保的替代品','2022-05-05 08:55:24','2022-05-05 08:55:24',92),(2643,466,'發現塑膠袋容易產生污染且不易分解。容易發生動物傷亡事件。','2022-05-05 08:55:24','2022-05-05 08:55:24',93),(2644,466,'我們認為雖然現在就已經有環保袋這個物品，但現今的環保袋成本太高，不被積極推動，所以認為我們可以用帆布袋的優點結合塑膠袋的優點製作出一個環保袋，再慢慢地去請向藝人、政治人物來代言及推動','2022-05-05 08:55:24','2022-05-05 08:55:24',94),(2645,466,'https://drive.google.com/open?id=1tAmNV2FtVcPW8Nqp6EqceKGyzr9KrGII','2022-05-05 08:55:24','2022-05-05 08:55:24',95),(2646,466,'','2022-05-05 08:55:24','2022-05-05 08:55:24',96),(2647,466,'','2022-05-05 08:55:24','2022-05-05 08:55:24',97),(2648,466,'陳政諺','2022-05-05 08:55:24','2022-05-05 08:55:24',98),(2649,466,'鄭俊永','2022-05-05 08:55:24','2022-05-05 08:55:24',99),(2650,466,'吳宜蓁','2022-05-05 08:55:24','2022-05-05 08:55:24',100),(2651,466,'廖韋涵','2022-05-05 08:55:24','2022-05-05 08:55:24',101),(2652,466,'阮勝彬','2022-05-05 08:55:24','202