5,528,'','2022-05-05 09:09:46','2022-05-05 09:09:46',178),(3596,528,'張珝丹','2022-05-05 09:09:46','2022-05-05 09:09:46',179),(3597,528,'','2022-05-05 09:09:46','2022-05-05 09:09:46',180),(3598,529,'(一)地方創生類','2022-05-05 09:09:46','2022-05-05 09:09:46',166),(3599,529,'開發一個透過在地人認證美食的app，滿足真正想吃到美食的人。','2022-05-05 09:09:46','2022-05-05 09:09:46',167),(3600,529,'嘉義是遊客選擇短程旅行的好地方，到當地必嚐指標性美食雞肉飯。許多人會事先找好評價或是看旅遊行腳的youtube影片，花了不少時間在搜尋相關資訊，但實際造訪卻發現味道不如預期。','2022-05-05 09:09:46','2022-05-05 09:09:46',168),(3601,529,'使用5W1H分析，目的是為了滿足被假評論耽誤的味蕾，減少有花了錢卻得不到相對滿足的心情，花錢也吃得幸福。','2022-05-05 09:09:46','2022-05-05 09:09:46',169),(3602,529,'https://drive.google.com/open?id=1MpCVHKe3keW4biooaZr5xz-naztiJ07T','2022-05-05 09:09:46','2022-05-05 09:09:46',170),(3603,529,'https://drive.google.com/open?id=1c4MnTx-zXw9yX15lcm4l_tbE-T2gXAC6','2022-05-05 09:09:46','2022-05-05 09:09:46',171),(3604,529,'','2022-05-05 09:09:46','2022-05-05 09:09:46',172),(3605,529,'方薏婷','2022-05-05 09:09:46','2022-05-05 09:09:46',173),(3606,529,'沈郁絜','2022-05-05 09:09:46','2022-05-05 09:09:46',174),(3607,529,'蔡宇芹','2022-05-05 09:09:46','2022-05-05 09:09:46',175),(3608,529,'蔡泓岳','2022-05-05 09:09:46','2022-05-05 09:09:46',176),(3609,529,'C109113137','2022-05-05 09:09:46','2022-05-05 09:09:46',177),(3610,529,'','2022-05-05 09:09:46','2022-05-05 09:09:46',178),(3611,529,'張珝丹','2022-05-05 09:09:46','2022-05-05 09:09:46',179),(3612,529,'','2022-05-05 09:09:46','2022-05-05 09:09:46',180),(3613,530,'(一)地方創生類','2022-05-05 09:09:46','2022-05-05 09:09:46',166),(3614,530,'一半電池不可分解，內含有毒液體，市面上只有紙電池及充電電池，討論其缺點後我們構思出可分解、對環境無害且可用於電器的電池。','2022-05-05 09:09:46','2022-05-05 09:09:46',167),(3615,530,'傳統電池：一顆一號電池埋在土中就能使１平方米的土壤永久失去利用價值，；那麼，若是這些汙染透過土壤流到河流中，就可將水污染使其無法飲用。\n充電電池：充電電池一般都含有有害重金屬鎘，在自然界中滲出後，汙染土地和水流，最終進入人體。鎘會使骨質疏鬆，並造成骨骼變形、骨痛，並引起肝和腎受損等等嚴重後果。\n此外，人們時常丟失替代用的充電電池，或是需要幫其他電器充電，因此要來回拔起充電電池的充電座，都會造成我們生活的不便。\n紙電池：可達成一次性使用，且不造成環境污染，但是外型都是紙片型態，不可使用於電器用品。\n','2022-05-05 09:09:46','2022-05-05 09:09:46',168),(3616,530,'市面上已有販售的紙細菌電池，但此種電池無法運用在我們生活中的一般電器上（例如：冷氣、電視遙控器）。因此我們將細菌電池內的細菌以及可分解的一般外型的電池殼進行結合，達到環保又不傷害環境的目標。此產品將達成聯合國永續發展目標14之1項以及15之1項。','2022-05-05 09:09:46','2022-05-05 09:09:46',169),(3617,530,'https://drive.google.com/open?id=1SuV7R0ngoBHUBQCdkAjElxN4RsJXo2Yy','2022-05-05 09:09:46','2022-05-05 09:09:46',170),(3618,530,'','2022-05-05 09:09:46','2022-05-05 09:09:46',171),(3619,530,'','2022-05-05 09:09:46','2022-05-05 09:09:46',172),(3620,530,'賴李歐妮','2022-05-05 09:09:46','2022-05-05 09:09:46',173),(3621,530,'林貞均','2022-05-05 09:09:46','2022-05-05 09:09:46',174),(3622,530,'傅鈞偉','2022-05-05 09:09:46','2022-05-05 09:09:46',175),(3623,530,'楊馨婷','2022-05-05 09:09:46','2022-05-05 09:09:46',176),(3624,530,'C109125223','2022-05-05 09:09:46','2022-05-05 09:09:46',177),(3625,530,'蔡淑安','2022-05-05 09:09:46','2022-05-05 09:09:46',178),(3626,530,'陳建志','2022-05-05 09:09:46','2022-05-05 09:09:46',179),(3627,530,'','2022-05-05 09:09:46','2022-05-05 09:09:46',180),(3628,531,'(一)地方創生類','2022-05-05 09:09:46','2022-05-05 09:09:46',166),(3629,531,'我們想打造一個讓大家都可以輕鬆遊岡山並且這種方式不僅僅可以使用在岡山','2022-05-05 09:09:46','2022-05-05 09:09:46',167),(3630,531,'但事實上岡山這個地區不只經過調查後發現普遍的人對於岡山的理解並不多，好一點可能只知道岡山之眼。離我們楠梓很近，也充滿很多不同特色。\n','2022-05-05 09:09:46','2022-05-05 09:09:46',168),(3631,531,'以岡山之眼型態的魔法棒，可以和岡山在地觀光地點設有裝置互動','2022-05-05 09:09:46','2022-05-05 09:09:46',169),(3632,531,'https://drive.google.com/open?id=1UgsQCG7boWOE5pOWgIt9Nl7zK5B6fdcy','2022-05-05 09:09:46','2022-05-05 09:09:46',170),(3633,531,'https://drive.google.com/open?id=1BE0deaIGwveEJ-VBdIZfOUD-uKDFRGdy','2022-05-05 09:09:46','2022-05-05 09:09:46',171),(3634,531,'','2022-05-05 09:09:46','2022-05-05 09:09:46',172),(3635,531,'陳雨新','2022-05-05 09:09:46','2022-05-05 09:09:46',173),(3636,531,'黃子芸','2022-05-05 09:09:46','2022-05-05 09:09:46',174),(3637,531,'何庭玉','2022-05-05 09:09:46','2022-05-05 09:09:46',175),(3638,531,'賴韋廷','2022-05-05 09:09:46','2022-05-05 09:09:46',176),(3639,531,'c109110119','2022-05-05 09:09:46','2022-05-05 09:09:46',177),(3640,531,'','2022-05-05 09:09:46','2022-05-