81,'黃建凱','2022-05-05 09:18:00','2022-05-05 09:18:00',236),(4388,581,'','2022-05-05 09:18:00','2022-05-05 09:18:00',237),(4389,581,'陳怡君','2022-05-05 09:18:00','2022-05-05 09:18:00',238),(4390,581,'','2022-05-05 09:18:00','2022-05-05 09:18:00',239),(4391,582,'(一)地方創生類','2022-05-05 09:18:00','2022-05-05 09:18:00',226),(4392,582,'原民林下經濟藥草文化智慧','2022-05-05 09:18:00','2022-05-05 09:18:00',227),(4393,582,'台灣林地占比廣大，但是在森林保護及木材砍伐限制下，以往林地使用產值甚低，近年來推動的林下經濟有了養蜂、種香菇等，但目前主要範圍以中北部地區，另外團隊計畫的場域-高雄茂林為國家風景區及水源保護地，因此在林下經濟的發展下較為限制，也因此衍生了團隊轉換劣勢變優勢的動機','2022-05-05 09:18:00','2022-05-05 09:18:00',228),(4394,582,'(一) 原住民保健植物的歷史紀錄\n早在日據時期1924年，植物學家佐佐木舜 編著「綱要台灣民間用藥植物誌」，記載579種藥用植物，而其中各區派出所亦在轄內原民部落使用之保健植物進行採集與調查，建立不下300餘資料，顯示原民早因經驗傳承而持續利用眾多保健植物；眾多部落耆老皆表示，現對藥用植物的印象多來自於小時後，與日本人採集與使用紀錄有所保存，並因為交通不便，才衍生了紀錄對於藥草的民俗療法。\n原住民對於保健植物的利用傳承，皆以部落或家族口語相傳為之，難免漸有疏漏，因此研究祖先對於保健植物之意義，可以追朔並累積作物進化及農業起源外，並讓原住民文化遺產獲得適度的保存與傳承，培養後代對於土地之感情與自信心，增進民族融合。\n(二) 與茂林部落的智慧傳承與合作\n早期交通不便，許多口耳相傳的保健護理方法，讓我們團隊非常感興趣，如皮膚擦傷，可用原生藥草於口腔咀嚼後，敷於受傷處達到部分其功效，而種種的對於藥用植物的認知，因醫學及交通發便後，便無人記錄及對草藥的分辨，因此團隊想田野調查外，更想分享文化智慧並推動因山地限制的農業，轉而更永續的林下經濟。\n(三) 原民藥草精油的研發\n近年來現代社會壓力及對於呼吸道等生活品質要求，精油等保健產品更講求天然有機，正符合茂林因國家風景區及水源保護地內，不能大面積耕種及農藥使用，將過往青年離開的劣勢，轉換成優勢，並結合高科大水產食品科學系的研發量能，及USR的輔導開發，將大學社會責任與社企模式結合，達成相輔相成的效果。\n此外團隊成員林芝在美容保健業的時候發現，許多精油的源頭皆來自同各代工廠，且原物料皆來自國外進口，曾有廠商希望能做出自有品牌，做為工廠示範案例能提供各店家效仿，因此我們想著與其變成從新包裝的品牌，不如回鄉把以前相傳的藥用植物進行研發及推廣部落，從第一部林下經濟到最後一步產業六級化，皆能對部落有益。\n','2022-05-05 09:18:00','2022-05-05 09:18:00',229),(4395,582,'https://drive.google.com/open?id=1uZaGrrq5J-OtDUPM5Z-Z1jS2E2qW-pLl','2022-05-05 09:18:00','2022-05-05 09:18:00',230),(4396,582,'https://drive.google.com/open?id=1Ph-lpRqWQCRpcH5apmHzbCmbOqWkjO74','2022-05-05 09:18:00','2022-05-05 09:18:00',231),(4397,582,'','2022-05-05 09:18:00','2022-05-05 09:18:00',232),(4398,582,'孫致嘉','2022-05-05 09:18:00','2022-05-05 09:18:00',233),(4399,582,'黃品翰','2022-05-05 09:18:00','2022-05-05 09:18:00',234),(4400,582,'翁子庭','2022-05-05 09:18:00','2022-05-05 09:18:00',235),(4401,582,'','2022-05-05 09:18:00','2022-05-05 09:18:00