中，就可將水污染使其無法飲用。\n充電電池：充電電池一般都含有有害重金屬鎘，在自然界中滲出後，汙染土地和水流，最終進入人體。鎘會使骨質疏鬆，並造成骨骼變形、骨痛，並引起肝和腎受損等等嚴重後果。\n此外，人們時常丟失替代用的充電電池，或是需要幫其他電器充電，因此要來回拔起充電電池的充電座，都會造成我們生活的不便。\n紙電池：可達成一次性使用，且不造成環境污染，但是外型都是紙片型態，不可使用於電器用品。\n','2022-05-05 09:18:00','2022-05-05 09:18:00',228),(4450,586,'市面上已有販售的紙細菌電池，但此種電池無法運用在我們生活中的一般電器上（例如：冷氣、電視遙控器）。因此我們將細菌電池內的細菌以及可分解的一般外型的電池殼進行結合，達到環保又不傷害環境的目標。此產品將達成聯合國永續發展目標14之1項以及15之1項。','2022-05-05 09:18:00','2022-05-05 09:18:00',229),(4451,586,'https://drive.google.com/open?id=1SuV7R0ngoBHUBQCdkAjElxN4RsJXo2Yy','2022-05-05 09:18:00','2022-05-05 09:18:00',230),(4452,586,'','2022-05-05 09:18:00','2022-05-05 09:18:00',231),(4453,586,'','2022-05-05 09:18:00','2022-05-05 09:18:00',232),(4454,586,'賴李歐妮','2022-05-05 09:18:00','2022-05-05 09:18:00',233),(4455,586,'林貞均','2022-05-05 09:18:00','2022-05-05 09:18:00',234),(4456,586,'傅鈞偉','2022-05-05 09:18:00','2022-05-05 09:18:00',235),(4457,586,'楊馨婷','2022-05-05 09:18:00','2022-05-05 09:18:00',236),(4458,586,'蔡淑安','2022-05-05 09:18:00','2022-05-05 09:18:00',237),(4459,586,'陳建志','2022-05-05 09:18:00','2022-05-05 09:18:00',238),(4460,586,'','2022-05-05 09:18:00','2022-05-05 09:18:00',239),(4461,587,'(一)地方創生類','2022-05-05 09:18:00','2022-05-05 09:18:00',226),(4462,587,'我們想打造一個讓大家都可以輕鬆遊岡山並且這種方式不僅僅可以使用在岡山','2022-05-05 09:18:00','2022-05-05 09:18:00',227),(4463,587,'但事實上岡山這個地區不只經過調查後發現普遍的人對於岡山的理解並不多，好一點可能只知道岡山之眼。離我們楠梓很近，也充滿很多不同特色。\n','2022-05-05 09:18:00','2022-05-05 09:18:00',228),(4464,587,'以岡山之眼型態的魔法棒，可以和岡山在地觀光地點設有裝置互動','2022-05-05 09:18:00','2022-05-05 09:18:00',229),(4465,587,'https://drive.google.com/open?id=1UgsQCG7boWOE5pOWgIt9Nl7zK5B6fdcy','2022-05-05 09:18:00','2022-05-05 09:18:00',230),(4466,587,'https://drive.google.com/open?id=1BE0deaIGwveEJ-VBdIZfOUD-uKDFRGdy','2022-05-05 09:18:00','2022-05-05 09:18:00',231),(4467,587,'','2022-05-05 09:18:00','2022-05-05 09:18:00',232),(4468,587,'陳雨新','2022-05-05 09:18:00','2022-05-05 09:18:00',233),(4469,587,'黃子芸','2022-05-05 09:18:00','2022-05-05 09:18:00',234),(4470,587,'何庭玉','2022-