3),(4779,983,'林宇翔','2022-11-15 06:07:26','2022-11-15 06:07:26',264),(4780,983,'','2022-11-15 06:07:26','2022-11-15 06:07:26',265),(4781,983,'','2022-11-15 06:07:26','2022-11-15 06:07:26',266),(4782,983,'陳宗澤','2022-11-15 06:07:26','2022-11-15 06:07:26',267),(4783,984,'(三)海洋特色類','2022-11-15 06:07:26','2022-11-15 06:07:26',254),(4784,984,'現今的人越來越重視海洋生態的問題，因此我們透過一些創新方式來解決海洋問題','2022-11-15 06:07:26','2022-11-15 06:07:26',255),(4785,984,'船隻漏油及海上鑽油的問題','2022-11-15 06:07:26','2022-11-15 06:07:26',256),(4786,984,'因為海上油汙的解決方法一直都是一大難題，因此我們的透過吸油海綿及無毒藥劑溶解油汙，希望能透過這些方式還給大自然一個乾淨的家','2022-11-15 06:07:26','2022-11-15 06:07:26',257),(4787,984,'https://drive.google.com/open?id=1M9VEFM4irosfDOzcI85wvRbutiuyuGNQ','2022-11-15 06:07:26','2022-11-15 06:07:26',258),(4788,984,'','2022-11-15 06:07:26','2022-11-15 06:07:26',259),(4789,984,'','2022-11-15 06:07:26','2022-11-15 06:07:26',260),(4790,984,'3','2022-11-15 06:07:26','2022-11-15 06:07:26',261),(4791,984,'沈玉霖','2022-11-15 06:07:26','2022-11-15 06:07:26',262),(4792,984,'黃佩儀','2022-11-15 06:07:26','2022-11-15 06:07:26',263),(4793,984,'李芝庭','2022-11-15 06:07:26','2022-11-15 06:07:26',264),(4794,984,'','2022-11-15 06:07:26','2022-11-15 06:07:26',265),(4795,984,'','2022-11-15 06:07:26','2022-11-15 06:07:26',266),(4796,984,'陳宗澤','2022-11-15 06:07:26','2022-11-15 06:07:26',267),(4797,985,'(三)海洋特色類','2022-11-15 06:07:26','2022-11-15 06:07:26',254),(4798,985,'與海洋垃圾污染連結，利用廢棄海洋垃圾及骨頭製作成環保又不失質感的吊燈創造二次使用的商機','2022-11-15 06:07:26','2022-11-15 06:07:26',255),(4799,985,'海洋垃圾污染','2022-11-15 06:07:26','2022-11-15 06:07:26',256),(4800,985,'看了一些關於海洋垃圾污染的相關資料，發現海洋的垃圾數量可觀，每年流入大海中的塑膠垃圾至少約為800萬噸，因此我們想利用其中的廢棄物創造再生用品，透過使用免洗筷、吸管、廢棄漁網、骨頭製作的燈泡創造出別具一格的海洋環保特色吊燈，我們在網路上有查到運用骨頭製作的骨瓷餐具，利用骨瓷透光度和硬度都較高的特性，加上硬度夠，比一般日用瓷器高出兩倍，因此不容易撞碎，且可以做得更輕薄，因骨瓷中牛骨灰經高溫培燒後，呈現吸水率低、緻密度高的微晶均質，而散發出良好的透光性。希望可以藉此達成減少海洋垃圾污染的問題，而現在也越來越多人關注海洋永續發展的問題，消費者也會選擇相對環保的綠能產品，進而創造出市場的潛在商機，希望可以藉由此產品傳達環境保育的觀念。','2022-11-15 06:07:26','2022-11-15 06:07:26',257),(4801,985,'https://drive.google.com/open?id=1kB7SWlbYcAB_kWzsJKbuoMghdk3wjE7t','2022-11-15 06:07:26','2022-11-15 06:07:26',258),(4802,985,'https://drive.google.com/open?id=1x8O3-cCM-xcnnJcAIeA9LN2Jbgtv4Lr4','2022-11-15 06:07:26','2022-11-15 06:07:26',259),(4803,985,'','2022-11-15 06:07:26','2022-11-15 06:07:26',260),(4804,985,'5','2022-11-15 06:07:26','2022-11-15 06:07:26',261),(4805,985,'鄭文慈','2022-11-15 06:07:26','2022-11-15 06:07:26',262),(4806,985,'洪蔚妏','2022-11-15 06:07:26','2022-11-15 06:07:26',263),(4807,985,'林俊廷','2022-11-15 06:07:26','2022-11-15 06:07:26',264),(4808,985,'王昱雯','2022-11-15 06:07:26','2022-11-15 06:07:26',265),(4809,985,'蘇珮慈','2022-11-15 06:07:26','2022-11-15 06:07:26',266),(4810,985,'陳建志','2022-11-15 06:07:26','2022-11-15 06:07:26',267),(4811,986,'(三)海洋特色類','2022-11-15 06:07:26','2022-11-15 06:07:26',254),(4812,986,'將傳統漁具與現代技術結合，以降低對海洋生物的傷害。','2022-11-15 06:07:26','2022-11-15 06:07:26',255),(4813,986,'問題一： \n    根據(Ghost gear: the abandoned fishing nets haunting our oceans）報告，指出每年約有64萬噸「幽靈漁具」流入海洋，即使這些漁具只佔海洋垃圾的10%，但因他們設計就是用於捕獵，對海洋生物造成的影響也會更大\n\n問題二：\n    受工業進步影響，現今漁具材質大多由塑膠製成，其不易分解的特性會對海洋造成永久的傷害\n\n問題三：\n    被丟棄或遺失的漁具，要在廣大的海洋中找到並回收它們的難度高\n\n問題四：\n    幽靈漁具危害的不只是海洋生物，就連我們人類也是；廢棄魚網可能會纏繞住船隻的螺旋槳、沖到沙灘上的鋒利漁具也可能讓遊客受傷\n','2022-11-15 06:07:26','2022-11-15 06:07:26',256),(4814,986,'解決方法：\n        1. 回收廢棄漁具，使海洋傷害降低。\n        2. 在漁具上增設追蹤器，降低回收難度。\n        3. 追蹤器讓遊客可以注意到漁具的位置，避免危險發生。\n\n可行性分析 - 技術：\n       1. 漁具追蹤器由衛星接收器及訊號發射器構成，實作難度得以降低。\n       2. 追蹤器上裝設太陽能板可以保持訊號的穩定。\n       3. 建構了一個漁具購買或更換的流程，確保漁具不會被隨意丟棄。\n\n預計達成目標與未來市場發展潛力：\n        目標1: 未來將不再有漁具亂丟、幽靈捕撈的事情發生\n        目標2: 沙灘不會再發生遊客受到鋒利漁具割傷等風險','2022-11-15 06:07:26','2022-11-15 06:07:26',257),(4815,986,'https://drive.google.com/open?id=157VPKNuY5QfSwFjUpgCrOMYPY-QyFYSH','2022-11-15 06:07:26','2022-11-15 06:07:26',258),(4816,986,'','2022-11-15 06:07:26','2022-11-15 06:07:26',259),(4817,986,'','2022-11-15 06:07:26','2022-11-15 06:07:26',260),(4818,986,'3','2022-11-15 06:07:26','2022-11-15 06:07:26',261),(4819,986,'陳妍蓁','2022-11-15 06:07:26','2022-11-15 06:07:26',262),(4820,986,'林雅淳','2022-11-15 06:07:26','2022-11-15 06:07:26',263),(4821,986,'王榆涵','2022-11-15 06:07:26','2022-11-15 06:07:26',264),(4822,986,'','2022-11-15 06:07:26','2022-11-15 06:07:26',265),(4823,986,'','2022-11-15 06:07:26','2022-11-15 06:07:26',266),(4824,986,'陳宗澤','2022-11-15 06:07:26','2022-11-15 06:07:26',267),(4825,987,'(三)海洋特色類','2022-11-15 06:07:26','2022-11-15 06:07:26',254),(4826,987,'解決丟日用品所造成之外包裝垃圾的痛點，創造一台無包裝智慧販賣機去解決問題、並提倡環保以及海洋保護。','2022-11-15 06:07:26','2022-11-15 06:07:26',255),(4827,987,'1.	發現問題一：海洋垃圾危機，每年都有許多的海洋垃圾，尤其充滿著許多的塑膠瓶、一些日用品的容器。\n\n2.	發現問題二：獨居的人口日漸增長，若居住的社區裡沒有子母車，就必需在定點時間等垃圾車到點，在垃圾中，日常用品造成的垃圾量又是最多且最難清理的。對於獨居朋友而言，減少倒垃圾的次數和減少垃圾數量是此族群提升生活品質的方法之一。\n\n3.	發現問題三：對平時使用的洗潔用品的產品日漸無感甚至開始厭倦，想換新的洗潔劑，但是無從下手，細心挑選了一款，卻發現味道或者產品特性不符合自己心裡所期望的，但還剩下700毫升的商品等待被用完，此狀況將會造成浪費。 \n\n4.	發現問題四：大家都會需要日用品來維持生活水平，然而平時到大賣場裡購買日用品會產生很多容器，像是洗衣機、沐浴乳、洗髮精…等。這些商品容器通常都為極少部分可回收，即便是補充包，塑膠材質的包裝仍舊無法回收。所以日用品所製造的垃圾對環境造成嚴重影響不容輕視。\n','2022-11-15 06:07:26','2022-11-15 06:07:26',256),(4828,987,'1.    解決問題：我們利用投幣式加水站的概念為核心去加以發想，以販賣機的形式，將日用品以原物料進行購買。販賣清潔保養用品，例沐浴乳、洗髮精、洗面乳、肥皂、牙膏等，以及環境清潔用品，例：清潔劑、洗碗精等。顧客使用已用畢且洗淨之沐浴乳、洗髮精瓶前往本機台進行購買，計價方式以毫升計算。另外顧客也可利用手機APP 查看機台庫存及品牌現況決定是否前往購買以及使用線上支付。\n2.    展現創意：台灣傳統的米店是消費者帶著自己的容器前往商店並秤重購買，Mellow Life希望將販賣機結合這種販售模式帶給大家反璞歸真的感覺。目前所知的類似產品有台塑洗衣精的補充機台，但我們有其他日用品補充，例如：牙膏、沐浴乳、洗髮精及洗潔劑……等，另外我們在機台旁設置了提供再生容器的租借，針對自己的需求，去購買合適的容器、容器可重複裝填，裝取所需的份量，不會造成浪費或購買過多的狀況，在側邊顯示螢幕也會播放環境污染議題的影片吸引經過的民眾，可查看議題相關的影音及資訊，進而了解到全球所面對到的環境問題。\n','2022-11-15 06:07:26','2022-11-15 06:07:26',257),(4829,987,'https://drive.google.com/open?id=10TXU8qcVuJasZJuqZIhhw5sp8RXn4otu','2022-11-15 06:07:26','2022-11-15 06:07:26',258),(4830,987,'','2022-11-15 06:07:26','2022-11-15 06:07:26',259),(4831,987,'','2022-11-15 06:07:26','2022-11-15 06:07:26',260),(4832,987,'4','2022-11-15 06:07:26','2022-11-15 06:07:26',261),(4833,987,'吳婕瑜','2022-11-15 06:07:26','2022-11-15 06:07:26',262),(4834,987,'陳建群','2022-11-15 06:07:26','2022-11-15 06:07:26',263),(4835,987,'張子濬','2022-11-15 06:07:26','2022-11-15 06:07:26',264),(4836,987,'柯欣妤','2022-11-15 06:07:26','2022-11-15 06:07:26',265),(4837,987,'','2022-11-15 06:07:26','2022-11-15 06:07:26',266),(4838,987,'宋旗桂','2022-11-15 06:07:26','2022-11-15 06:07:26',267),(4839,988,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4840,988,'為解決行李箱空間不足，設計理想行，進而改善大眾的煩惱。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4841,988,'人們會因應自己出遊天數或地區，然後購置不同大小尺寸的行李箱，導致家中變成賣場展示櫃。且近年來人們旅遊喜歡shopping，不管是代購或伴手禮的數量都不可勝數，就會產生行李箱容量不足、戰利品擺不完，然而又捨不得再買下更大行李箱。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4842,988,'1.拉鍊的設計是為了讓可拉伸的箱體不會隨意移動，使其保持固定。\n2.我們利用手提箱開關的密碼鎖取代拉鍊，可以不用像其他行李箱，需要把拉鍊拉到固定位置才能鎖住。\n3.最大特點就是可依照個人需求伸縮行李箱，減少購買行李箱需求和行李箱放置空間需求。\n4.拉桿滑軌能讓我們在伸縮時，拉桿位置仍然保持置中，免於受到重量偏差的影響。\n5.開闔凹槽是採榫卯設計，能讓行李箱保持密封的狀態，不論風吹或雨打，都不怕。\n預計達成目標：在市面上量產，人手一個','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4843,988,'https://drive.google.com/open?id=1jcmjGjn8waF0_RsMa8WeL2y6-pkJxnVv','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(4844,988,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(4845,988,'https://drive.google.com/open?id=191qlOq-2OBop2XGXUF0NOIOR4K8o54gt','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(4846,988,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(4847,988,'黃昱婷','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(4848,988,'李依珊','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(4849,988,'黃慧珊','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(4850,988,'林姝蓉','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(4851,988,'周瑄薇','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(4852,988,'	宋旗桂','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(4853,989,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4854,989,'送禮服務整合平台, 讓訊息不再只是文字，而是滿滿的心意。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4855,989,'我們發現近年來 在高科技浪潮的趨使下，人們無論是親友聚會、搭火車、走路、吃飯、上下課等，只要是清醒的時候，總是機不離身。\n曾幾何時面對面吃飯的朋友從聊天打鬧轉變為各自滑手機回訊息；一起出門踏青卻忙著上傳照片，棄一旁的朋友於不顧。\n人際疏離的問題，正在侵蝕著我們的生活。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4856,989,'類實體的送禮-我們想透過WebAR技術將心意包裝成雲端禮物卡形式傳遞給收禮者，有別以往的單純電子票卷，更是加入了類實體的送禮溫馨概念，利用「訊息」讓關係更緊密。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4857,989,'https://drive.google.com/open?id=1SnRtjeweXkWM2iwxIOfsuhaW61y2x9NG','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(4858,989,'https://drive.google.com/open?id=1UJyysTxkTLi4k24A6DKSplVRcsmfJGbB','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(4859,989,'https://drive.google.com/open?id=1OIrlB4EOlbtONnvjsCebsmWTD7qHbpKU','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(4860,989,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(4861,989,'吳紀緯','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(4862,989,'李昱承','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(4863,989,'廖哲寬','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(4864,989,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(4865,989,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(4866,989,'黃照貴','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(4867,990,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4868,990,'透過虛擬實境在輔助認知能力之設計(形狀及顏色等為例)來讓小孩可以訓練認知能力，與訓練基礎上肢運動能力。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4869,990,'        組員的朋友是幼稚園老師，她經常跟我們分享一些任職時所發生的事，其中一個話題就是關於孩童使用3C產品的問題，她提到班上有些孩童已經有在用手機上網的能力，這讓我們都震驚不已，經我們上網搜尋發現台灣展翅協會於2014年11月到12月間，從全國國小分北、中、南、東部及離島等四區分層隨機抽樣80所國小四到六年級學童，調查顯示，有超過五成（54.9%）的孩子在八歲以前已經開始上網，其中有近一成五（14.9%）的孩子在四到六歲時就開始接觸網路，足見台灣網路使用已進入低齡化的狀態。台灣展翅協會進一步分析，有將近九成（89.9%）的孩子已經習慣在網路上看影片，同時有超過六成（65.9%）的兒童在網路影音平台看過不宜內容，但只有不到五成（46.6%）的孩子會向家長和老師反應。因此我們心想，難道網路、科技的普及化只會對孩童造成負面的影響嗎? 難道不能創造出更有價值性的功能嗎?\n\n        一般而言，幼兒的好奇心強烈，也喜歡玩遊戲，在遊戲過程中自發性的探索，同時也在遊戲情境中，學習與人互動及探索物件的意義。既然我們無法阻止科技、網路盛行下對孩童產生的負面影響，因此我們打算利用科技的力量與組員們專業能力之結合，開發出一套適合給孩童訓練認知能力的遊戲，而我們發現遊戲市場上有許多的AR遊戲以及VR遊戲，而且大多擴增實境、虛擬實境遊戲都是娛樂性質的遊戲，相比之下訓練用途之遊戲也較少。\n\n        且VR遊戲對於小朋友來說又不容易觸碰到，畢竟儀器可能對孩童來說比較笨重，因此我們打算透過簡易型較為便利的VR眼鏡來讓孩童做訓練，同時訓練他們的手部運動能力。\n本研究以認知能力為出發點，特別評測虛擬實境等資訊科技融入在教學上的成效。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4870,990,'        整體遊戲的靈感來自於套杯遊戲，所謂的套杯遊戲是一個將指定物品放到指定位置的遊戲，而本遊戲會透過虛擬實境來製作套杯遊戲，遊戲的場景可以設計成小孩會喜歡的樣式，如:擺放機器人、娃娃等。\n\n套杯遊戲規則：\n將指定的物品放置到架子上的指定位置\n指定的物品會隨機的選擇多種物品的其中一項\n指定的位置是多個位置隨機選擇一個去放\n\n       在這遊戲裡面，這不僅僅只是做個動作，也可以讓小孩知道自己的東西要收好要放到對的位置，本遊戲透過虛擬實境來製作出一個可以讓小孩辨識顏色與形狀之差異性的能力，並利用手部運動將物品配對至正確的位置，不僅可以訓練認知能力，也可以達成手部協調的訓練遊戲。\n\n        將遊戲製作玩法製作成如右圖的玩法(詳盡請觀看ppt或pdf)，在遊戲的場景建置可以更親近小孩，遊戲的玩法提示明顯，可以讓小孩更容易理解玩法。\n主要是將不同顏色或形狀的物件做配對或是放在指定位置上，本遊戲也希望能讓小孩知道自己的玩具該放在正確的位置，而不是將物品都丟在地上讓父母整理，也可以讓小孩拿取物品時更加可以更穩定，不會因為太興奮亂甩，這樣也可以讓小孩了解到玩具的珍貴性，進而更愛護玩具，不會破壞玩具，讓小孩在遊戲中學習成長，也可以減輕父母的負擔。\n\n         團隊成員方面每個人的專長都不盡相同，主要分成資訊類(程式撰寫、遊戲測驗)、電子類(電路設計、硬體安裝)以及機電類(互動控制、模型設計)，所以團員能各司其職，且隊長王群昌本身已經有VR相關學識能力，因此這個提案的可行性我們認為是相當可觀的!\n\n        在未來我們希望能製作出VR設備之實體，並實際測試其功能性，期許這項產品能在VR訓練這塊領域中有實際的貢獻，由於近期VR應用的盛行(元宇宙)，讓我們都相信這塊領域會有很好的市場發展潛力，且我們認為多數家長也希望自己的小孩在網路與科技的盛行下，能提早認識這類的事物，提升競爭能力，而不是只讓小孩玩3C產品，反而能做中學是最好的!','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4871,990,'https://drive.google.com/open?id=1Sqc-F_0gPYx_7hUTMf_DyHbBswqAMZyO','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(4872,990,'https://drive.google.com/open?id=1x72RG1SKGuMUEsoxPRmeheH3ZZqfFagh','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(4873,990,'https://drive.google.com/open?id=1fVgc_BRiKrKrcCVvYxsjMbuz5yySWFcu','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(4874,990,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(4875,990,'王群昌','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(4876,990,'丁應','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(4877,990,'吳暉泓','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(4878,990,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(4879,990,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(4880,990,'侯易佑','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(4881,991,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4882,991,'利用蔬果濃縮快速補充人體營養所需，並減少塑膠使用量','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4883,991,'地球上塑膠使用量過多，且因塑膠無法在土壤快速分解，所以導致地球上污染嚴重','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4884,991,'利用可分解於土壤的材質取代外層塑膠包裝，內容物想使用蔬果濃縮來補充人體所需之營養。我們認為現代，大家的生活步調都偏快，導致多數民眾攝取營養不足，認為此產品可以吸引上班族或是沒有時間購買蔬果的客群。','2022-1