9),(4907,992,'顔芷榆','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(4908,992,'陳建志','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(4909,993,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4910,993,'可壓縮瓶身之功能和附有提袋的環保杯','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4911,993,'在整理書包時，發現因為書包內塞滿書和筆電，而塞不下水壺；出去玩時，買飲料忘記自備提袋，而包包空間不夠。根據這些問題一併提出解決方案。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4912,993,'我們決定製作可以結合壓縮和提袋功能的水壺，我們會以矽膠作為壺身，而提袋則是加裝在蓋子上面。我們相對市面上的普通塑膠杯子來說，多了可壓縮的性能，能更方便的收納，還附設了提袋設計可以更好的攜帶，也比一般水壺更好清洗、重量也較輕。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4913,993,'https://drive.google.com/open?id=101P8HkUo4QDTw1tQ86cjDUliB4DiAsM-','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(4914,993,'https://drive.google.com/open?id=1T0_VdJVQcNRz060NYUrjlBw7ZMhebLkM','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(4915,993,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(4916,993,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(4917,993,'林汶靜','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(4918,993,'許芝華','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(4919,993,'馬鈺芳','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(4920,993,'吳家妤','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(4921,993,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(4922,993,'宋旗桂','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(4923,994,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4924,994,'這是一個能夠輕鬆壓縮垃圾、打包垃圾、不髒手的垃圾桶。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4925,994,'在打包垃圾時常常會因為垃圾袋邊緣的髒污而弄髒手，在覺得不舒服的同時也會覺得很不方便。在打包好垃圾之後發現垃圾袋裡其實還有空間可以利用，如果能在垃圾桶滿的時候壓一下，就可以妥善的使用剩餘的空間，不造成浪費。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4926,994,'我們構想出可以利用打氣筒和束口袋的原理，在垃圾要滿出來時，使用垃圾桶上方的把手往下壓，將垃圾與垃圾之間的空間壓縮，進而將垃圾袋裡的空間利用到極致；束口袋的原理則是垃圾袋裝滿後，只需要兩手將兩邊繩圈往外拉即可1秒完成打包，完全不會用髒手，也不會浪費時間，提了就可以走，十分的方便。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4927,994,'https://drive.google.com/open?id=1gQTHW2WyiWgIi_vP8VJ7IsOBoo6pFJ3B','2022-11-15 06:07:50','2022-11-15 06:07:50',272)