,'為了解決駝背等坐姿不良而設計出與擋板結合椅子的產品','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4981,998,'現代人長期滑手機、久坐、長時間維持低頭聳肩的姿勢，導致出現了脊椎及坐姿不良等問題','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4982,998,'為了解決現代坐姿不良文明病所開發的「駝背監督者」在現有的椅子及坐姿矯正器上進行改良，採用結合椅背及軟墊的方式，在固定身姿的同時也達到收納及不壓迫的效果，此外也利用C語言編寫手機綁定操控APP，並結合智慧手環進行身體監測及久坐分析。此外還提供材質、布料相關的客製，給使用者最佳的體驗外，也提供兒童款式，填補兒童市場的空缺。\n\n團隊中姚豫芳、林志翰、鍾思宥3人分別擔任創意研發、產品製作、行銷人員的職責。\n\n本產品的預計售價為4500元/張，我們的預計成本為售價的75%，故利潤為1125元/張，預計第一年出售5000張，並以每年1.5倍成長為銷售目標，預計五年內總利潤可達到4000萬元。未來會越來越自動化，而人們變得越來越懶惰，則文明病的情況會越發加深，使得體態姿勢越來越不良，使我們產品的需求度增加，大眾購買的意願也會增加，也能藉由客製化來進行改良適應市場更迭，最終能穩定的售出一定的數量。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4983,998,'https://drive.google.com/open?id=1shkKmLu-rPWwMcwwPh0VBxwjuCpmA87U','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(4984,998,'https://drive.google.com/open?id=1dMgriRzwFTrSiO5tjVxJCgMDhNa0xw_J','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(4985,998,'https://drive.google.com/open?id=1TOfeX2ucCK3NW2mYDNGO4Mfd3xAXnqh6','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(4986,998,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(4987,998,'鍾思宥','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(4988,998,'姚豫芳','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(4989,998,'林志翰','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(4990,998,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(4991,998,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(4992,998,'巴慧玲','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(4993,999,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(4994,999,'解決大學生月底生活費吃緊及經濟上有困難的學生在飲食不均衡的問題。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(4995,999,'月底很多學生有生活費吃緊的問題，導致飲食不均衡，學習的專注度不佳。並且也看到校內有些學生有經濟上的困難，可能沒辦法天天都吃得很健康。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(4996,999,'學餐舉辦活動，邀請餐飲科及其技優生來校教導經濟困難學生，餐飲科及其技優生可賺取服務時數，大學生可以多元學習學到專業知識且可至學餐工讀賺取生活費。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(4997,999,'https://drive.google.com/open?id=1qdzB_iP-FtZbwTVHbWVZFZr_IVfeVIRU','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(4998,999,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(4999,999,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5000,999,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5001,999,'楊筑安','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5002,999,'徐小媛','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5003,999,'楊婉瑜','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5004,999,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5005,999,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5006,999,'陳宗澤','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5007,1000,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5008,1000,'高中時透過和大學合作使學生提早體驗專業課程，發掘興趣。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5009,1000,'以往學校和家庭幾乎都只強調讀書成績，但很多人直至大學都不知道自己的興趣和未來想做的專業，很多人在大學選了專業之後才發現不是自己興趣所在，才有轉學或是轉系的狀況發生，很可能就會錯過學習最佳時機。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5010,1000,'解決問題 :為了避免學生花費太多時間在自己不喜歡的專業上面，我們認為應該要及早讓學生發掘自己的興趣和專長，將台灣原本大學階段才執行的夢想尋找及生涯抉擇提前至高中階段。\n平日高中與大學校方合作，每個禮拜各類別的大學教授、業師至高中演講及配合業師提供實習機會，讓高中生更理解大學各科系課程內容及規劃，讓高中生提前接觸簡述各系學習內容，可激發興趣及找尋專長。\n寒、暑假時配合大學校方各系所舉辦聯合營隊，寒聯合營隊為期兩個禮拜、暑假營隊可延長至三個禮拜或一個月，於各類群營隊的最後一天可配合企業推廣介紹業界實際狀況，不僅可以了解大學所學也可更為悉知產業真實樣貌，且在營隊的期間中讓學生更多元的學習並且拓展交友圈。\n\n評估預計達成目標與未來市場發展潛力:讓營隊大禮包成為新趨勢，讓參加過的學生能夠透過分享自己成功找到自己興趣的經驗分享給大家，促使讓大家更有想去探索興趣的衝動。未來能夠使這個營隊變成一個既定的活動，希望能有效幫助到對於未來還在迷茫的學生。\n\n可行性:根據《Cheers 快樂工作人》雜誌今年的調查，超過 53% 的台灣年輕人會把「茫然」選為他們當前人生的代表詞彙。並且透過本組觀察發現，經常在網路上看到高中生或大學生發文詢問「未來要做什麼?」、「推薦的科系」、「讀什麼科系不會失業?」，代表著學生們其實並不瞭解自己想要的是什麼，最後選擇的只會是跟著群眾潮流或無所謂的心態，也就造就經常性換工作及鴕鳥心態逃避就業。若是推行營隊大禮包可提前讓學生認知專長興趣，減少此狀況發生讓社會更加有效率運轉。\n\n','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5011,1000,'https://drive.google.com/open?id=1sMda1KZiXltFp2OyDpfnQa6S7O1PIGJW','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5012,1000,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5013,1000,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5014,1000,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5015,1000,'曾詠涵','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5016,1000,'簡婕','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5017,1000,'楊菁宜','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5018,1000,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5019,1000,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5020,1000,'陳宗澤','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5021,1001,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5022,1001,'回收收益換成飼料，解決流浪動物挨餓、亂翻垃圾桶的問題','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5023,1001,'流浪動物會因飢餓而亂翻街邊垃圾桶。流浪動物集結的觀光區--貓村，遊客會亂餵來路不明的飼料造成貓咪身體不適，也造成環境髒亂的問題。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5024,1001,'1、回收寶特瓶、鋁箔包與鐵鋁罐等\n2、將投入的回收物以計點數的方式轉換為飼料與水\n3、溫度感測與鏡頭辨認有無動物來往，影像辨識來區分人或動物\n4、近點感測器來偵測是否有動物在附近\n5、偵測器偵測到有動物，飼料機會自動餵食\n7、使用觸控式螢幕進互動\n8、重量偵測器確認飼料盛放處是否有東西\n9、投幣機、販賣機販售紀念品等\n-----------------------------------------------------------------\n團隊執行力\n羅丹妤 ：應日 / 創意發想 / 創意總監\n陳佑維 ：營建 / 繪製產品設計圖 / 產品設計師\n鄭庭宜 ：環安 / 產品開發評估 / 產品管理師\n趙韋誠 ：電通 / 技術革新 / 技術總監\n-----------------------------------------------------------------\n以租借的方式:20000元/月+廣告收益(8000元/月)\n\n預估在貓村第一個月租售3~5台\n預計年底能達到1,296,000元/年\n\n若有其他五個地區有與貓村相同性質的觀光地，收入能突破6,000,000元/年。未來能發展海外市場，突破10,000000元/年是可以達成的目標。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5025,1001,'https://drive.google.com/open?id=13P2ihGFQE1Ra6OWYmfIJ_M-rzU6AFnXt','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5026,1001,'https://drive.google.com/open?id=1f6a-ZPTVtlNlR-Jh9zzjo_FN7e4xhnp4','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5027,1001,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5028,1001,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5029,1001,'羅丹妤','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5030,1001,'鄭庭宜','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5031,1001,'趙韋誠','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5032,1001,'陳佑維','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5033,1001,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5034,1001,'巴慧玲','2022-11-15 06:07:50'