:50','2022-11-15 06:07:50',270),(5108,1007,'我們製作一個具有開關門的盒子，用來捕抓壁虎。利用開關門與地板接觸時移動整個盒體，達到將門關起的動作。並在盒子周圍處使用刷毛材質、開關門板使用梯形設計，減少捕抓壁虎時傷害到壁虎的機會，並將盒子設計成透明的，方便觀察捕獲情況。\n\n這個盒子本身可以是捕蟲或是家居清潔廠商推出的配件之一，藉由更換前端的工具，去達成一桿多用同時達成便利且環保的目的。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5109,1007,'https://drive.google.com/open?id=1hRo6iQnizmtTyIHhOCynd6-0YZD4iKMy','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5110,1007,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5111,1007,'https://drive.google.com/open?id=1tYQMHEmN0utiN_ennlfGb20eLFwfEC6V','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5112,1007,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5113,1007,'簡敬庭','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5114,1007,'王翔','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5115,1007,'謝向昀','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5116,1007,'彭暐峻','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5117,1007,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5118,1007,'宋旗桂','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5119,1008,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5120,1008,'由自願性的專業人士提供知識給予需要的人','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5121,1008,'1.缺乏教育機會 2.沒有賴以維生的技能','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5122,1008,'由學生架設教育平台招集有意願的專業人士，拍攝教學影片或線上教學來給予有需要的人。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5123,1008,'https://drive.google.com/open?id=1q29XE9873-cF5zSNMk4REHdmbMmmJRmY','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5124,1008,'https://drive.google.com/open?id=1nWSXw1s3SxHgc3ZGc5-GvYDWmbSZNDru','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5125,1008,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5126,1008,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5127,1008,'黃楷烜','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5128,1008,'葉宥均','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5129,1008,'鍾佑安','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5130,1008,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5131,1008,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5132,1008,'陳宗澤','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5133,1009,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5134,1009,'瓶蓋往往不容易回收，若能加入其他元素，便能使其延續利用。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5135,1009,'塑膠無法被大自然分解，因此塑膠對於環境永續的發展占有極大的地位，而在塑膠類垃圾中常見的寶特瓶，瓶蓋是最不容易回收的部分，便想著若能在瓶蓋上動點小巧思，讓大家可以回收善用，而收藏家給了我們一個啟發，若能讓瓶蓋有著能讓人有想收集的價值，那麼便可以讓大家在寶特瓶上多花點心思回收，從小孩到大人都可以奇思妙想、發揮創造力的樂高積木，將平平無奇的瓶蓋，變成人人都可以輕易取得的樂高積木，那麼在未來是否有機會能夠撼動樂高積木的地位呢。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5136,1009,'結合積木的設計，讓難以回收的瓶蓋有了新的家。我們對瓶蓋設計了不同的造型，讓它們組成多樣的模型，對瓶蓋新增了卡榫，方便讓所有瓶蓋做結合。在未來環保意識抬頭的時代，這樣的設計預計會吸引到更多飲料產業的合作，以達到環境的永續發展。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5137,1009,'https://drive.google.com/open?id=1hxJBRIA8sqAVbeexzXYxAokphJvGbQxw','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5138,1009,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5139,1009,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5140,1009,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5141,1009,'陳柏翰','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5142,1009,'黃柏瑋','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5143,1009,'王天民','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5144,1009,'賴柔君','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5145,1009,'葉于瑄','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5146,1009,'陳建志','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5147,1010,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5148,1010,'在坐下前設定好時間，當時間一到椅子就會發出提醒音跟震動提醒。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5149,1010,'根據衛福部國民健康署，連續坐著六小時以上就是久坐。\n經過調查發現，國人平均上班已坐超過六小時，長期久坐會衍生出許多慢性病，增加心臟病、中風、糖尿病、代謝症候群的罹患率，還會造成骨骼傷害、肌肉退化及血液循環不佳。\n坐愈久，代表消耗的熱量愈少，而導致體重增加，肥胖更是許多疾病的主要原因之一。生活愈久坐不動，提早死亡的機率愈高。醫師建議，除了少坐，也可以每坐30分鐘就站起來走動一下','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5150,1010,'我們將設計一款椅子，是一張在人們坐太久時可以提醒我們起來活動的椅子，實體的椅子結合行動裝置（手機、智慧手錶、平板電腦），在坐下前設定好時間，當時間一到椅子就會發出提醒音跟震動提醒，讓我們可以定時起來走走不讓自己只專心在做事情而忽略現在人常見的問題。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5151,1010,'https://drive.google.com/open?id=1MF8NbUjHuwnJiIIM2VNLX7RTYJ0e99QE','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5152,1010,'https://drive.google.com/open?id=1cBI4tMsfyW5OJOdvLjGI1Na8kaQ_y2jp','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5153,1010,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5154,1010,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5155,1010,'劉乙玄','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5156,1010,'連紹宏','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5157,1010,'莊閎棋','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5158,1010,'劉耀勻','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5159,1010,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5160,1010,'陳怡君','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5161,1011,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5162,1011,'現代人都困擾著每餐不知道要吃什麼，我們推出的APP將會解決大多數人的困擾。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5163,1011,'由於團隊常常不知道要吃什麼，也不太清楚周圍有什麼好吃，因此想出能快速解決不知道要吃什麼的困擾以及能利用缺乏某樣營養素而推薦食物的app。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5164,1011,'分為四個階段\n1.自行定義：根據使用者想吃的類型以及範圍來推薦\n2.過濾與更新：使用者可把吃過的食物化上標籤，系統就不會頻繁出現，待標籤移除就能正常出現在選擇裡；新進店家也可把商店資訊自行上架提供消費者選擇\n3.隨機推薦：專門提供給完全沒想法以及對食物無偏好的使用者使用\n4.營養素缺乏技術：利用我們發明的技術，讓使用者清楚了解到自身缺乏的營養而去選擇建議的食物','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5165,1011,'https://drive.google.com/open?id=1Qf6vZkDqGZJlKjgWcRuwqk0Dbaj8-K9g','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5166,1011,'https://drive.google.com/open?id=1kCicd3J4-eAbvoShaXDxz_3HMVxOxU__','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5167,1011,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5168,1011,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5169,1011,'王若琦','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5170,1011,'張譽柔','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5171,1011,'林心嫆','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5