-15 06:07:50',269),(5247,1017,'經過討論之後我們發現，金銀花在年輕人的社群裡比較冷門，不只是功效不被認識，甚至也都沒聽過這個植物，但實際上金銀花作為藥材相當有用，用在中藥上能解熱和抗發炎，還能幫助近年受新冠疫情的患者盡可能減輕不適症狀，因此我們希望能夠讓這樣的植物更打進年輕人的認知中，為推廣出一份力。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5248,1017,'在蒐集資料後，我們決定利用金銀花中的黃酮類和鞣質特性做延伸，黃酮類有提升肌膚抵抗力以及抗氧化效果，鞣質則是能幫助凝固微生物體內的原生質，具有抑止細菌的功效，並減緩細胞衰老，上述這些特質正好很適合拿來做成洗面乳相關商品，所以我們將此定為我們的主題。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5249,1017,'https://drive.google.com/open?id=11vj4D3q4fSHU04SyK1wS_wbNmUMSVbCe','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5250,1017,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5251,1017,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5252,1017,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5253,1017,'白皓尹','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5254,1017,'林虹妘','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5255,1017,'張芝穎','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5256,1017,'王韋凡','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5257,1017,'周凡旭','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5258,1017,'陳建志','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5259,1018,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5260,1018,'這是一款解決「吃飯感到寂寞」的App—「找飯友」。但裡面不只有找飯友，還有其他非常實用的功能。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5261,1018,'尚未升大學時，生活起居都會有家人幫忙，來到大學後，必須獨立的生活，難免不習慣一個人吃飯，因此希望有個媒介，能將有相同需求的人串聯起來。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5262,1018,'我們將要開發一款App「找飯友」，將有「不像自己一個人吃飯但找不到人陪」這樣想法的人，但彼此個性不同的人連結起來。\n\n使用者可以填寫自己喜好的飲食、希望對方的年齡是多少，系統會自動幫使用者匹配合適的人，使用者覺得不合適的話可以拒絕，如果覺得很有眼緣，就可以進一步的向他提出邀請，透過各種話題(如果不知道如何開啟對話，系統會自動生成話題)，並且達成最終目的—一起吃飯。我們的App在每次雙方見面之後提供評分制度(與對方相處的舒適度)，系統會針對每次的評分，更進一步的篩選更適合的對象\n\n除了幫忙匹配飯友之外，還有計算熱量、選餐廳的功能。系統可以根據使用者喜歡的種類（台式、韓式、日式⋯等等），一天攝取多少熱量，生成一個專屬此使用者的菜單，這項功能對於選擇困難，每天都不知道要吃什麼的人是一個很好的發明呢！\n\n我們預估會有很多人願意嘗試用用看這個App，也能鞏固住一定的客群，使用者一多，會願意跟我們合作的餐廳也會越來越多。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5263,1018,'https://drive.google.com/open?id=1dYEdJKw2jV_Idmc3hw5Ax1ZgxFqna5-N','2022-11-15 0