因為比起固定式的距離調整，魔鬼氈并不侷限與距離的大小，只要物品不大於錶帶，都在可調節的範圍之內，而可替換刀片則是使商品變得環保耐用，就算刀片磨損了，也可以購買替換。使用步驟的第一步是先使用刀片刺穿瓶身，再把帶子兩邊的魔鬼氈沾黏起來，一隻手握住切割環的部分，一直手轉動瓶身。因為目前的市場上我們並沒有找到性質相同的產品，所以我們認為我們的產品有很大的潛力。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5291,1020,'https://drive.google.com/open?id=10Y3LSGU8O2J5Dz_xf87hfrgZI_pppy13','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5292,1020,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5293,1020,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5294,1020,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5295,1020,'陳建誌','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5296,1020,'鄭宸璿','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5297,1020,'蔡佳琪','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5298,1020,'李郅陞','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5299,1020,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5300,1020,'宋旗桂','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5301,1021,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5302,1021,'天氣太熱，無法有效降溫','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5303,1021,'今天是小美的約會日，一早起來就精心打扮的她卻在出門後沒多久就因為天氣太熱流汗導致妝容花掉','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5304,1021,'在雨傘上加裝自動灑水噴霧器，噴出的水霧可以讓溫度降低也讓周圍不會太過悶熱。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5305,1021,'https://drive.google.com/open?id=1Vs5aWATBu3CG5aSC_gSuX-DzW8e0UHcs','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5306,1021,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5307,1021,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5308,1021,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5309,1021,'蔡彥侑','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5310,1021,'趙于菱','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5311,1021,'楊軼','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5312,1021,'陳昱燕','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5313,1021,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5314,1021,'張珝丹','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5315,1022,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5316,1022,'以可多人遊玩的復健玩具提高復健者積極性並增加家庭感情，讓復健者在復健之餘還能富足心靈。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5317,1022,'在與護理師的談話中發現，現今復健道具大多為就地取材(豆子、絨毛玩具、貼紙等)或是只能複習單一動作(反覆抓握彈力球)，因此患者常因復健過程過於無練而懈怠，因此我們從賓果遊戲發想，希望能設計出一款針對手部精細動作的復健玩具，提高復健者的積極性。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5318,1022,'以賓果遊戲發想設計出一款可多人遊玩的復健玩具，主要針對精細動作(小肌肉)，復健部位為手指(小肌肉)及手臂(大肌肉)，復健動作則是捏、拉拉鍊、掛勾、旋轉等。\n與現有的復健道具相比多了遊樂性，可提高復健者積極度，且考量到銀髮族較多缺少家人陪伴，所以將遊戲設計可以多人遊玩，以此增加家庭感情並照顧復健者心情。\nBeango老少適宜，可訓練手部肌肉，亦可當益智遊戲，一起玩還可增加祖孫情誼。\n\n玩法：\n1.賓果遊戲可選擇難度(4*4、5*5、6*6)\n2.將號碼勾隨意裝在洞洞板上\n3.裝好後玩家輪流喊出號碼\n4.依照喊出的號碼找到對應的豆莢\n5.將豆子裝入空豆莢並拉上拉鍊\n6.將豆莢掛上相對應的號碼勾上\n7.先連成3條線者勝\n第5項可依復健程度決定是否做\n\n以上想法皆已跟護理師詳談過，目前以護理師角度看來可行，後續跟老師討論確定好外觀後會用SOLIDWORKS及RHINO建3D模型，以3D列印、雷切、手工縫製等技術製作，製作完成後會再護理師洽談，期望給復健者實際操作後看是否需要修改。\n\n我們認為Beango已跟市場上現有產品有區隔，除了能訓練多種動作還提高了娛樂性，最重要的是增加家人陪伴的可能性，讓復健者不再孤軍奮戰，把復健變成家庭活動更能提高復健者積極性。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5319,1022,'https://drive.google.com/open?id=1lHT3McFV7Q96hLoQDbd-fj4PZoKO20CK','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5320,1022,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5321,1022,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5322,1022,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5323,1022,'王之遠','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5324,1022,'許富慈','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5325,1022,'潘彥淇','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5326,1022,'林哲立','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5327,1022,'方冠穎','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5328,1022,'陳建志','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5329,1023,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5330,1023,'兒童遊戲積木組','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5331,1023,'小孩玩積木的過程中容易因為積木硬度及形狀受傷，我們希望小孩玩積木的時候可以在其過程中學習，但不失其中樂趣。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5332,1023,'以軟材質取代過去的木頭等硬材質，EVA海綿。\n海洋生物以幾何形做改變，將尖角做成倒圓角，降低孩童因尖角受傷的機率。\n設計卡牌，以隨機抽取的方式決定堆疊的積木為何，背面為同一花色，正面為動物的真實模樣及其介紹。\n','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5333,1023,'https://drive.google.com/open?id=1iA3v6PYXcPqzN2X0sr5AP-vCJexPfCk3','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5334,1023,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5335,1023,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5336,1023,'3','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5337,1023,'林虹妘','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5338,1023,'吳玉涵','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5339,1023,'林佳錡','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5340,1023,'','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5341,1023,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5342,1023,'張珝丹','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5343,1024,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5344,1024,'因為坐墊常常移動或掉落，所以想辦法更好固定住它','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5345,1024,'坐墊放在椅子上常常會被路過人撞掉，或起來時掉下、跟著移動，所以希望透過一些方法讓坐墊不會再那麼容易移動','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5346,1024,'我們希望在坐墊上加上魔鬼氈，透過魔鬼氈能更好固定坐墊，且也方便坐墊攜帶。可能可以用縫的方式上去。市場面我們希望給那些坐墊常常掉落的人方便。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5347,1024,'https://drive.google.com/open?id=17WrxtFFUcIenrfFUhRYOE5cUiiA8VGxE','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5348,1024,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5349,1024,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5350,1024,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5351,1024,'吳宥瑋','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5352,1024,'張雅姿','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5353,1024,'謝詩梅','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5354,1024,'劉書維','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5355,1024,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5356,1024,'張珝丹','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5357,1025,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5358,1025,'為了改善雨天撐傘時不管事後背包還是背後淋濕的隱憂而發想出了此產品','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5359,1025,'台灣長期下雨，隨身攜帶雨傘是必備的，包包常常被淋濕，為了解決大家的煩惱，我們想出能夠讓雨傘不只是雨傘，此雨傘不但可以讓人不被淋濕同時包包也不會被淋濕。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5360,1025,'我們將雨傘與書包雨衣結合，大家時常把雨傘套用丟，將雨傘套發揮更大的功用，將市面上的雨傘套替換成此產品，此產品未來的潛力可以將背後的後背包雨衣可以與廠商合作，在雨天行走時可以打廣告，說不定未來可以做成數位防水的電子摺疊布然後依靠太陽能或是USB充電，以達到兩全其美的效果。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5361,1025,'https://drive.google.com/open?id=1ZTh19lbX5iEKzNYVF5tmFeEJ8bn_xdyh','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5362,1025,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5363,1025,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5364,1025,'4','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5365,1025,'倪珮慈','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5366,1025,'許恆嘉','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5367,1025,'彭俐婷','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5368,1025,'林書瑄','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5369,1025,'','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5370,1025,'張珝丹','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5371,1026,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5372,1026,'從屏東的金銀花開始發想，將金銀花的效用令人所知。並想出能讓大家信服的產品。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5373,1026,'根據研究，金銀花是可以有效緩和確診的症狀的。但很可惜，並無太多人知悉這種植物。所以本組開始發想如何能讓金銀花在大眾的生活中出現。在偶然間，看到辦公室的老師們在泡茶，而有了想要以泡茶為出發點的概念。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5374,1026,'根據本團隊觀察，許多人使用茶包泡茶並不會當下飲用完畢，而是會放上杯蓋，故本團隊研發將繩子拔掉金銀花可落入杯子的茶包，同時頂部的造型會展開像杯蓋一樣，此產品可以避免使用者燙到又不需要另外自備杯蓋（具暫時保溫的作用）','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5375,1026,'https://drive.google.com/open?id=1RyK1Z9wM3l6vCix2lT8rpkGaeHNhib1R','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5376,1026,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5377,1026,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5378,1026,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5379,1026,'秦玟康','2022-11-15 0