 06:07:50','2022-11-15 06:07:50',269),(5429,1030,'一般的水溝蓋孔洞過大容易掉入物品，女性高跟鞋也容易卡入其中，垃圾常跟著水流一同進入水溝，導致下方孳生許多病蟲害，我們希望透過設計，來解決一般水溝的問題。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5430,1030,'在進水口部分利用切角設計使進洞口減小，減少垃圾及物品掉落的機率。使用FRP玻璃纖維製作整體結構，降低自重。加裝過濾系統，第一層使用粗棉or白棉，第二層使用活性碳，第三層使用生化球，以改善水質。過濾盒使用扣環固定，方便拆解更換過濾材料。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5431,1030,'https://drive.google.com/open?id=1nI2oIc-l5EpE8jH_xlgUSu8x39jPE2gi','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5432,1030,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5433,1030,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5434,1030,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5435,1030,'歐沛宸','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5436,1030,'朱苡柔','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5437,1030,'陳冠甫','2022-11-15 06:07:50','2022-11-15 06:07:50',278),(5438,1030,'郭建杝','2022-11-15 06:07:50','2022-11-15 06:07:50',279),(5439,1030,'盧柏翰','2022-11-15 06:07:50','2022-11-15 06:07:50',280),(5440,1030,'陳建志','2022-11-15 06:07:50','2022-11-15 06:07:50',281),(5441,1031,'(四)自命題類','2022-11-15 06:07:50','2022-11-15 06:07:50',268),(5442,1031,'地球暖化是目前主要嚴重問題之一我們可以如何有效利用二氧化碳轉變成能量。所以我們發想出集中處理與過濾二氧化碳的水壺。','2022-11-15 06:07:50','2022-11-15 06:07:50',269),(5443,1031,'極限運動者激烈運動會造成缺氧，而登山客爬山時也會隨著高度的增加身邊氧氣稀薄。\n藉由此產品可以有效改善這些問題。','2022-11-15 06:07:50','2022-11-15 06:07:50',270),(5444,1031,'此產品結合水壺讓使用者可以方便攜帶，在運動的過程當中持續收集二氧化碳並藉由過濾器轉化爲氧氣，即能夠在即時就給使用者補充所需，無論是水還是氧氣。','2022-11-15 06:07:50','2022-11-15 06:07:50',271),(5445,1031,'https://drive.google.com/open?id=1NILZuoKrdZO70f4VqEoCT2tnGMLvdB4n','2022-11-15 06:07:50','2022-11-15 06:07:50',272),(5446,1031,'','2022-11-15 06:07:50','2022-11-15 06:07:50',273),(5447,1031,'','2022-11-15 06:07:50','2022-11-15 06:07:50',274),(5448,1031,'5','2022-11-15 06:07:50','2022-11-15 06:07:50',275),(5449,1031,'曹芃絜','2022-11-15 06:07:50','2022-11-15 06:07:50',276),(5450,1031,'陳郁欣 ','2022-11-15 06:07:50','2022-11-15 06:07:50',277),(5451,1031,'謝欣蓓','2022-11-15 06:0