為破壞的風險很高','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5546,1038,'實體音樂產業好景不常， 2015年數位音樂下載的市佔率超越了實體專輯，2020年之後訂閱串流服務，像是spotify、kkbox、Apple Music等已經變成最主流的音樂銷售形式，全球串流音樂的收入在2019年已經達到56.1%，超過整體音樂收入的一半。老舊唱片已被電子唱片取代，而面臨轉型的困難，唱片試聽機是讓實體販售黑膠唱片行可以結合物聯網技術讓消費者可以很方便快速的試聽到自己所喜歡的音樂，並且能預防黑膠唱片在試聽過程中被消費者不小心損壞。\n本組的唱片試聽機利用RaspberryPi結合OLED顯示屏幕模塊、Pn532 NFC讀寫卡模組、IC白卡、喇叭，將IC白卡製作成小唱片的外觀，將他放在試聽機上，就能透過Pn532 NFC讀寫卡模組中的無線射頻識別RFID技術去辨識IC白卡的音樂資訊來配合喇叭撥放所選的歌曲，OLED顯示屏幕模塊也會顯示目前所撥放的音樂資訊。讓消費者在挑選與播放的過程，有如一個神聖的儀式，就像黑膠一樣的藝術品來吸引音樂迷。透過HTTP將音樂資訊傳到後台，商家可藉由後台網頁進行查看試聽狀況來制定行銷策略等等。\n此外，我們針對的客群是想要蒐藏或紀念的消費者，不僅能真實還原80年代以前的歌曲原貌，播放起來有一種聽歌的儀式感，音質也更飽滿豐富，期望在這個音樂串流平台盛行的時代，也能讓更多人看見實體黑膠唱片的優點。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5547,1038,'https://drive.google.com/open?id=19bEWEJpvA01KKDCd3lOav4iapzzGO0wg','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5548,1038,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5549,1038,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5550,1038,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5551,1038,'許雅筑','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5552,1038,'古軒誌','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5553,1038,'葉芸如','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5554,1038,'吳銘賢','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5555,1038,'蔡淳雅','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5556,1038,'侯易佑','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5557,1038,'燕巢校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5558,1039,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5559,1039,'宿舍插隊使用洗衣機及忘記取出衣物等問題層出不窮，因此我們設計APP程式來解決，希望能有效率且公平使用機器設備','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5560,1039,'我們是高科大一年級的新生，學校住宿期間每到洗衣尖峰時段或放假前的晚上，洗衣機和脫水機前大排長龍已是家常便飯，致使插隊、忘記將衣服取出、……等造成同學間不睦的問題層出不窮。\n目前僅以「宿舍Line群組」互相提醒 (所有人皆收到通知)，此方式徒勞無功，更是打擾群內其他同學生活作息。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5561,1039,'因此我們開發「衣刻千金」APP, 此APP以不在宿舍洗衣機及脫水機上加裝任何設備為前題，並以人性化的排隊需求設計APP的程式羅輯運算，以最自然的方式達到人性自律的效果，進而解決目前學校宿的洗衣亂象。','2022-11-15 06:0