,'燕巢校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5588,1041,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5589,1041,'智慧家庭讓生活更便利','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5590,1041,'在現代我們越來越注重生活品質，想讓自己的生活變得更便利更輕鬆，讓自己可以在外面工作一整天後，回到家就能有一個乾淨舒適的環境，能夠進家門後就能好好放鬆休息，不用因為家裡髒亂還需要花時間打掃，因此我們整合家裡智慧設備的系統來去串接家裡所有智慧設備。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5591,1041,'使用者能夠把所有設備串起來，並且控制、查看設備、設定自動化場景等。之後就可以使用Home Assistant來控制家中所有的智慧設備，並且可以透過Apple內建的app:Home 來控制所有串接智慧家電，我們還可以透過siri語音控制我們要做動的設備，又或者可以做一些特殊的同步化控制，好比說我們偵測到室內溫度已經達到30度了，然後快到下班的時間，他就能在我們到家以前，讓冷氣自動運轉，又或者感應到家裏面的濕度太濕，即會自己打開除濕機，種種的好處。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5592,1041,'https://drive.google.com/open?id=1OyqNJCz6VbOXV_Icg3YRwlBaIX58KLpq','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5593,1041,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5594,1041,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5595,1041,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5596,1041,'陳宇辰','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5597,1041,'蔡昀廷','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5598,1041,'陳榮佑','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5599,1041,'林童鍠','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5600,1041,'邱昶元','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5601,1041,'侯易佑','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5602,1041,'燕巢校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5603,1042,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5604,1042,'設計一個能偵測車禍衝擊並通知他人的警示器','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5605,1042,'台灣的機車數量繁多，每天發生的車禍也是不在少數，以往出車禍時，若只有小擦傷，有的駕駛會抱有僥倖心態，或是選擇私下和解後，怕麻煩不想在打斷行程，而拒絕就醫，但時常會有車禍當下沒有任何異常，但在一段時間後，後遺症爆發但卻錯過黃金治療時間，而造成遺憾。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5606,1042,'我們決定設計一個與手機APP連動的安全裝置，可以裝置在安全帽上，在車禍發生時，裝置內的感測器會偵測到加速度的劇烈變化，從而判斷發生車禍，這時裝置會將車禍發生的地點跟受到的衝擊力訊息傳送回APP，並經由計算後給予使用者是否就醫的建議，同時會將車禍發生通知給使用者的聯絡人。未來還可加裝GPS等裝置，變成一個多功能的行車記錄儀。','2022-11-15 06:08:15','2022-1