,'實現出門一張卡都不用帶，達到真正將所有功能整合的APP。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5635,1044,'  我們注意到現在社會，大部分人都會帶著證件、店家會員卡、優惠卷、信用卡等，以備不時之需，但是通常會有卡片太多的問題，或者卡片遺失的可能。\n\n  透過討論與觀察，我們發現大多數人都有智慧型手機，且會隨身攜帶，現在有了各種支付工具以及線上會員卡，卻沒有一種整合的方式可以做到一步到位，因此想讓更多人知道整合所有卡片及證件在手機APP的優點與便利性。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5636,1044,'  實際討論後，希望能提供每一張證件、會員卡、信用卡裡面完整的功能，例如存了身份證真的能登記，健保卡真的能掛號，實現出門一張卡都不用帶，達到真正將所有功能整合的APP。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5637,1044,'https://drive.google.com/open?id=1LLpXcJWIVUiKas9EmhsoTnYHwjiFQZ5W','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5638,1044,'https://drive.google.com/open?id=1ct9Bscq91IgQnMkPcAchB3CJRELBr8c2','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5639,1044,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5640,1044,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5641,1044,'吳珈甄','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5642,1044,'簡涔庭','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5643,1044,'黃思宇','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5644,1044,'莊榆蓁','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5645,1044,'陳霈汝','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5646,1044,'陳怡君','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5647,1044,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5648,1045,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5649,1045,'將迷你攝影機裝在車子的A柱及C柱，並加裝投射螢幕在A柱上，','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5650,1045,'汽車駕駛人坐在駕駛座時，無法全方位看到每個視線，就是所謂的視線死角，而這些死角往往都是因為車子結構所影響，當我們如果把那些地方變成透明的，就可以減少許多的死角，避免更多交通事故的發生。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5651,1045,'我們的想法是將解決這個死角，讓它是可以被看到的，將迷你攝影機架設於A柱和C柱外面的車殼，再把加裝螢幕裝設在A柱將加裝螢幕分割成兩個畫面，一半負責A柱，另一半負責C柱，裡面的畫面則是一整面的A柱和C柱，讓駕駛人能及時看到A柱和C柱死角的畫面。\n\nA、C柱透明化跟加裝攝像頭的設計，讓駕駛者在視線上無死角\n\n在許多駕駛者的抱怨中得知A、C柱在駕駛中所帶來的困擾，這困擾讓透明化設計的A柱有了廣大的市場\n\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5652,1045,'https://drive.google.com/open?id=1hinMYXtSulmbWOtsZmXvGKx1Vr6GPE3R','2022-11-15 06:08:1