,1046,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5678,1047,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5679,1047,'台灣人喜愛玩水,但溺水事故層出不窮,我們希望透過此手環降低溺水事故之發生率','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5680,1047,'臺灣氣候由於地理因素，因此夏季長且炎熱，因此戲水這類休閒活動在台灣來說幾乎是無所不在的，但不管是對於危機意識的提升亦或是安全層面的預防卻是少之又少。\n根據消防署2021消防機關水域救援統計，全台溺水事故人數有 926 人，死亡人數高達 544 人，也就是說，平均每 10 起溺水意外，就有 6 起遺憾回不來。\n而統計顯示水域溺水造成的原因，各種水域之水性狀況皆有不同，諸多水域潛藏危險。意外溺水事故多發生在海邊及溪流，主要是因為海邊夏天有颱風，海岸十公尺內會出現海浪、海嘯；內陸河溪則因山高水急，河溪流速湍急，河底坡度大，經常出現暗流漩渦。 如果遊客不諳水底狀況，貿然下水或無視偌大水域隱藏的種種危險，恣意弄潮戲水，很可能要付出極大的代價。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5681,1047,'本產品為溺水求救手環,其目的是為了幫助使用者在水域戲水時能夠提升安全性，當使用者溺水時能夠藉由本產品發出警示提高對外呼救的成功率，並期望能在第一時間將資訊傳送給救生員，使救生人員能夠第一時間獲得消息，提高得救率。\n手環可以檢測配戴者的血壓、血氧及脈搏等數據，當手環檢測到配戴者有出現溺水徵兆的時候會透過手環傳遞警訊及GPS位置給救生員或工作人員，並且手環會閃爍紅光及發出聲音提醒救生員溺水者的位置，如果是誤報的話配戴者也可以自行解除警訊。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5682,1047,'https://drive.google.com/open?id=1F5WwNXEIru9fcgQ-RlKrT6OBXnJHqL2Y','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5683,1047,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5684,1047,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5685,1047,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5686,1047,'許皓寧','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5687,1047,'戰胤駩','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5688,1047,'陳政宏','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5689,1047,'簡琬真','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5690,1047,'沈育琳','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5691,1047,'侯易佑','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5692,1047,'燕巢校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5693,1048,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5694,1048,'同時擁有熨斗和折衣功能的機器','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5695,1048,'現代生活節奏緊湊，回家倒頭就睡，花時間整理衣服實在很難受。故發想這台機器，希望可以解決問題','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5696,1048,'頂部由一塊具加熱功能的金屬件與隔熱件構成，可以在短時間內壓整您的衣物，熨燙結束自動彈開避免燒焦。並且防止意外碰觸頂部而燙傷。\n中間摺衣板部分則與市售之摺衣板有些類似，但這台機器最大的特色便是以Arduino自動化行程，徹底解放雙手。\n透過Arduino控制在摺衣板關節之馬達，即可將衣服自動收納完畢，避免了不常折衣服的人即使折衣服也摺不整齊的困擾。\n初期希望可以先達成做出原型機，並透過抽選試用者試用來蒐集回饋。中期目標則是可以成功在市場作為便利型機器開始販售。長期目標則是不斷更新外觀和功能，甚至可以使用行動端點控制等。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5697,1048,'https://drive.google.com/open?id=1Dvi5QmMe0HGbF5qpUF9f8TTwUV8tz8sP','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5698,1048,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5699,1048,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5700,1048,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5701,1048,'陳炤穎','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5702,1048,'張兆頡','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5703,1048,'吳享翰','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5704,1048,'朱桂玉','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5705,1048,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5706,1048,'宋旗桂','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5707,1048,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5708,1049,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5709,1049,'避免賴床的用具','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5710,1049,'能肆意賴床不起也許人人都想，但無奈，每天我們趕上學、上班打卡、赴約，必須在某個時間被無情的鬧鐘聲吵醒，被迫離開溫暖的被窩，掙扎下床。\n久而久之，就養成了賴床這一個壞習慣，想找有什麼辦法可以避免這樣的事情一再發生……\n\n最後決定要解決這個問題的原因，是大家或多或少會有這樣的經驗。\n','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5711,1049,'1.音響單體\n2.無線充電放置槽\n3.燈管\n4.壓力板\n5.時間顯示\n6.藍芽連結\n-----------------------\n團隊執行力\n龍祥庭 / 資管 / 程式與硬體基礎 / 應用設計與硬體結合\n陳猷翔 / 環安 / 繪圖 / 繪製設計圖\n傅淑媚 / 環安 / 人體工學 / 人體工學設計\n林孜穎 / 營建 / 專案計劃與管理控制 / 發想及整合\n-----------------------------------------------------------------------------------------\n全球家具市場在2022年，有著5561億美元的市場規模，產品預計單價4萬台幣，以台灣總人口2318萬，且每一萬人有五人會想購買來統計，我們預估產品上市後，全台能達到1854萬產值。\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5712,1049,'https://drive.google.com/open?id=1UlviS-52aCRIbV84N30yDAksX0gUmIWJ','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5713,1049,'https://drive.google.com/open?id=1zu3q123YkytifkrHbdqGE91uBNMSoco2','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5714,1049,'https://drive.google.com/open?id=1MhZJ6_qfBLWdFiR-okVmIFtsC4BWbFTC','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5715,1049,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5716,1049,'龍祥庭','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5717,1049,'陳猷翔','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5718,1049,'傅淑媚','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5719,1049,'林孜穎','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5720,1049,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5721,1049,'巴慧玲','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5722,1049,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5723,1050,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5724,1050,'透過能源與科技的結合，方便人們能夠同時享有髮飾、吊飾、充電線的功能。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5725,1050,'    在某天在某天天氣炎熱外出時，滿身大汗披著長髮，手邊卻沒有任何可以\n把頭髮綁起來的物品，剛好同時手機沒電了，更慘的是帶了行動電源，但卻忘了帶到充電線，\n此時該怎麼辦? ','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5726,1050,'         為了一次解決這兩個問題，我們團隊想發明一條抗髒污且耐扯，有韌性的數據充電線，在兩頭加上具扣環式的設計，平常不使用時可當做手環裝飾配件，亦可拆下變成數據充電線及綁頭髮時兩用的髮圈，此手環也具備手搖發電功能，透過走路時手部的擺動，藉此收集需要的電力，此外也可透過Type-C和Ligheing充電設計將手環隨時保持滿電狀態。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5727,1050,'https://drive.google.com/open?id=1wquAfA_A3ysyQZ44HRtSZx2u-o82rtI7','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5728,1050,'https://drive.google.com/open?id=10jTHVJ_S0hGCW-iyhJecFSwhQ6JjtAVF','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5729,1050,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5730,1050,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5731,1050,'陳嘉惠','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5732,1050,'湯庭偉','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5733,1050,'蔡幸妤','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5734,1050,'謝恩','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5735,1050,'郭芸榕','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5736,1050,'劉處英','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5737,1050,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5738,1051,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5739,1051,'使用更高科技的導航杖，使視障者在生活上有更多的便利','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5740,1051,'高科技的導航杖，1.價格問題 2.機器可能短路的問題 3.電池電量充電等問題 4.視障者真的是否需要或者繼續使用傳統導盲杖','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5741,1051,'利用分析3種探測技術比較實用且價格實惠讓更廣大的視障者能以親民的價格去做使用','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5742,1051,'https://drive.google.com/open?id=1sQT1ClaZPszKiagsTwvvmABoJlnlPyxH','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5743,1051,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5744,1051,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5745,1051,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5746,1051,'涂淯竣','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5747,1051,'嚴偉哲','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5748,1051,'林鈺翔','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5749,1051,'陳威翔','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5750,1051,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5751,1051,'劉處英','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5752,1051,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5753,1052,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5754,1052,'以自動偵測方式降低喇叭所造成的噪音','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5755,1052,'現代社會有著許多的問題，除了常見的空氣汙染和全球暖化之外，噪音也是一大問題，研究證實，長期處於高噪音的環境下，不只會造成聽力受損，甚至會引起消化道疾病和精神障礙。\n生活中各種大大小小的聲音是無可避免的，既然我們沒辦法將這些擾人的聲音化無，那我們希望可以讓這些噪音不再對人類帶來著們多的困擾。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5756,1052,'使用聲音感測器偵測周圍聲音，對喇叭進行聲音的調整，改善喇叭對環境所造成的噪音，並提供錄製提醒音的選擇。\n設計理念\n有時按喇叭因為突然的高分貝，導致附近的行人、機車族嚇到，或吵到附近住戶，因此我們設計出可以自動調整喇叭音量的系統。\n功能\n降低所造成的喇叭噪音、錄製提醒音\n使用方式\n緊急時，與我們平常時按喇叭方式相同。\n非緊急時，則可觸控車用平板，使用客製化語音通知。\n產品組合\n與汽車品牌合作，把此系統與特定車型一同販售，於出廠時組裝。\n產品適用客群與情境\n適合18歲以上有汽車駕照，經常以汽車當代步工具，需要按鳴喇叭的人，不限性別職業皆可適用。\n本產品適用於：\n1.綠燈了前方車輛還停在原地沒注意到。\n2.害怕按喇叭聲音太大嚇到對方，導致對方跌倒等。\n3.行駛在需要寧靜醫院、學校附近。\n技術面\n工業級噪音分貝感測器模組 \n樹莓派\nC語言\n衛星定位系統\n設計提案創新之處\n可錄製語音通知。\n結合衛星定位系統，偵測所在位置是否有限制音量，例如醫院。\n自動偵測車輛周圍聲音，調整喇叭聲音大小。\n團隊執行力\n何承祐/電腦與通訊工程/通訊/研發經理\n陳佑瑋/電子工程系/電子/產品經理\n謝坤誼/應用德語系/外語/翻譯\n林庚仁/資訊管理系/程式/軟體工程','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5757,1052,'https://drive.google.com/open?id=13JaJD8laT8Z6tG3j1SUYZD5cwfTSuLAf','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5758,1052,'https://drive.google.com/open?id=10pnryQ5uYyxUzGPBLOo67AMDkwihBDdW','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5759,1052,'https://drive.google.com/open?id=1BqjnqbmQtYx3hxyNoZLWp4JcLE8XcZBk','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5760,1052,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5761,1052,'何承祐','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5762,1052,'陳佑瑋','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5763,1052,'謝坤誼','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5764,1052,'林庚仁','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5765,1052,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5766,1052,'巴慧玲','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5767,1052,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5768,1053,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5769,1053,'設計一個碗跟自己的身體指數做結合，如果盛太多食物會警示','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5770,1053,'由於通貨膨脹，導致國與國之間的貧富差距變大，以致貧窮國家糧食不足，為了改善過度浪費食物的問題，吃多少盛多少，因此我們發想出此碗的創意。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5771,1053,'在碗上面植入數據顯示器及按鈕，碗上可輸入BMI、身高、體重來評估客製化食量，如果盛太多食物會閃紅光警示','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5772,1053,'https://drive.google.com/open?id=1FV1xpJvVQepZk6Sw8DlaDR7VVYiI4i2E','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5773,1053,'https://drive.google.com/open?id=1dqjg9FCw4R0LqG3FKAyMv_ebTYwehpCa','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5774,1053,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5775,1053,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5776,1053,'謝孟茹','202