祭拜也逐漸成為部分年輕人的課題，家中有傳統信仰或是自己想祭拜的年輕人常常不清楚拜拜的資訊。​\n每逢佳節常常會不確定該準備什麼供品來祭拜、不清楚拜拜的正確流程以以及忘記要拜拜的日子。​以現在的解決方法來說，只有問長輩或上網查，但是問長輩可能有問完又忘、要再問一次的困境；而上網找資料耗時費力，又可能查到錯誤資訊','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5891,1061,'因此我們設計一個APP，讓任何宗教節日跟祭拜的時間、流程還有要準備的物品都在APP裡面，讓需要的人一目了然。\n我們團隊分析，可以藉由委託製作APP，來製作出宗教小幫手APP，在這款APP記錄一年當中要拜拜的日子與節慶日期，並且都會有詳盡的相關資訊、祭拜順序、時間、準備供品、祝詞、準備紙錢，並可以設定訊息提醒大家。​\n解決問題優點​:方便、省時​、自動提醒功能​、可查詢祭拜時間、順序、準備供品、祝詞和紙錢等資訊。\n營利方式​:APP會與廟宇、水果店、金紙店、肉販商合作，在每個宗教慶典時，可以在APP行銷所辦活動以及商店商品，然後APP會自動推薦，也會更新每個宗教地點的活動，方便信徒參加，也方便信徒購買拜拜需要的供品。​','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5892,1061,'https://drive.google.com/open?id=1t31XBvNVYsipuVz3yaf11N-TFI1AV_aiMrr7JsPMNn0','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5893,1061,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5894,1061,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5895,1061,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5896,1061,'余天霖','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5897,1061,'陳建原','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5898,1061,'吳鄭郁潔','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5899,1061,'林冠亦','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5900,1061,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5901,1061,'宋旗桂','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5902,1061,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5903,1062,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5904,1062,'實踐永續校園，培養支持環保的態度，最終實踐環保生活與環保教育。  ','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5905,1062,'學生環保意低靡，沒有回收分類觀念，缺乏動力參與校園環保。 ','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5906,1062,'將空瓶、罐、杯、乾電池變成高科數位點數，將點數兌換成圖文部、全家、學餐等商品，提升校園環境品質，促進學生環保之意識。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5907,1062,'https://drive.google.com/open?id=1HtNzUJvj9-K_5CpU9pjSyR2jI4fqR16b','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5908,1062,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5909,1062,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5910,1062,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5911,1062,'  陳玟萱','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5912,1062,'張哲瑜','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5913,1062,'方昱媐','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5914,1062,'','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5915,1062,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5916,1062,'陳宗澤','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5917,1062,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5918,1063,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5919,1063,'因應市面上的智慧藥盒進行改良','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5920,1063,'發現問題 我們注意到市面上已有智慧藥盒的缺點。首先是過度強調居家使用，本體過大不方便攜帶。其次是由於目標客戶鎖定在老年群體，盡可能使簡化操作，對於年輕族群而言反而喪失了便利性。最後，由於沒有設想到多人使用的情況，智慧藥盒本身也較貴，對於家中有多名長輩，或者家中其他成員也需要長期吃藥等需求更高的家庭，反而會因為多台智慧藥盒而不選擇購買。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5921,1063,'解決問題 針對這3個問題，我們提出了幾個構想。首先是在本體之外，另外附贈方便攜帶的小型藥盒。其次是可以為智慧藥盒準備配套的操作app，可以通過手機聯動後在手機上操作。雖然使用者多半是老年族群，但是在設定時由家人幫助的情形也不是不可能，這時有app對於年輕族群而言更為方便，且如果藥盒已經出藥卻沒有人吃時，也可以及時通過app通知。最後，這個app我們預計在基本的設定出藥時間之外，還可以設定多人使用，通過事先設定好語音通知，就可以區分不同人的藥。同時，附帶的小型藥盒也可以不用直接設定時間，將小型藥盒設置在本體上，通過app操作，就能就原本預計在家中服用的藥物以及服用時間聯動到小型藥盒。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5922,1063,'https://drive.google.com/open?id=1QsX0E04TMDXj6zJTVZBDILY2xfiUUNQq','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5923,1063,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5924,1063,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5925,1063,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5926,1063,'謝育庭','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5927,1063,'王子恩','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5928,1063,'洪瑋駿','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5929,1063,'李宥驊','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5930,1063,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5931,1063,'張婷媛','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5932,1063,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5933,1064,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5934,1064,'讓垃圾量及廚餘量減少且能健康管理的機器人','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5935,1064,'我們發現全世界垃圾量及廚餘量與日遽增，所以我們想讓垃圾量、廚餘量減少。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5936,1064,'1.垃圾資料分析\n2. 聲控、面板控制、指令設定\n3.可看機器人乾淨度及垃圾處理狀況\n4.垃圾收拾、處理及分類，分析今日飲食各大營養素\n5.健康管理(分析今日飲時狀況列出缺乏之營養)\n6.組合式垃圾廚餘間健康管理兼健康管理機器人(儲物及機動分開)\n-----------------------------------------------------------------------------------------------------------\n團隊執行力\n謝艷華 /應用德語系/語言及外銷能力口調好/行銷宣傳及市場分析\n薛榆杰 /電腦通訊系/程式演算法撰寫/優化分類程式及機器人內部運作管理\n陳柏瀚 /機電工程系/安裝機器人及垃圾桶等各項外部零件\n------------------------------------------------------------------------------------------------------------\n產品定價預設:55000元\n我們預計產品上市兩年能夠達到25000的銷售產量\n年份越久，銷售產量會越來越高\n預計產品上市的第四年能夠到達到100000的銷售產量\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5937,1064,'https://drive.google.com/open?id=11pUdsBqkqSIkhpO0yGNS4b_gq9SvqRqF','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5938,1064,'https://drive.google.com/open?id=1Y9AO74BU3wVBJRF9mr3EWaOuB_rphXM6','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5939,1064,'https://drive.google.com/open?id=1IbL1ZYDRd84pirAjEQw_6G0PtuKIPZwr','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5940,1064,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5941,1064,'謝艷華','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5942,1064,'薛榆杰 ','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5943,1064,'陳柏瀚','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5944,1064,'','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5945,1064,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5946,1064,'巴慧玲','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5947,1064,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5948,1065,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5949,1065,'可依不同需求更換杯蓋的保溫杯，以及顯示溫度、儲水量等。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5950,1065,'一開始是因為飲料放機車後車箱會有液出的問題，所以想要解決液出的問題，後來更改為多功能保溫杯，可以對應不同需求，減少需要購買多個不同的容具。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5951,1065,'我們提供一個保溫杯和多個不同功用的杯蓋來讓使用者依照各自的需求做更換。\n\n技術：\n溫度感測器(偵測水溫)、水位感測器(感測儲水量)、迷你顯示器模組(顯示溫度、儲水量等)。\n\n團隊：\n鄭宇喆 / 電通四甲 /產品研發\n陳宗益 / 營建三乙 / 銷售企劃\n蔡宜珊 /應英二乙 / 翻譯、拓展國外市場\n謝彤欣／行銷一甲/行銷分析、流通管理\n\n一開始預計達到的目標是以全臺灣約2300萬人，每5000人會有1人購買，約可販售4600組，每組售價約1800元，成本約為1000元，總利潤約為368萬元，這個目標約花費1到3年的時間不等，可能隨著提倡環保杯而增加。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5952,1065,'https://drive.google.com/open?id=1NpuXNcdwJL35su4yzLWvoce-CioDaYB7','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5953,1065,'https://drive.google.com/open?id=1Fv_aZaOt8DjUfTiR4uiULGVCiFzys2n2','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5954,1065,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5955,1065,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5956,1065,'鄭宇喆','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5957,1065,'陳宗益','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5958,1065,'蔡宜珊','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5959,1065,'謝彤欣​  ​','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5960,1065,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5961,1065,'巴慧玲','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5962,1065,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5963,1066,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5964,1066,'現今社會對於家用相關控制設備需求提高，創新發想產品並整合後達到更完善的利用','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5965,1066,'大多數控制器需透過使用者主動去設定，在前期設定比較繁瑣','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5966,1066,'透過資料庫記錄使用者的使用習慣，因應不同需求去做智能客製化的設定，為使用者提供更人性化的服務','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5967,1066,'https://drive.google.com/open?id=19Srb4wAzHGUE1mJHZ6xC-SNPJXZwQXDj','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5968,1066,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5969,1066,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5970,1066,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5971,1066,'林品誠','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5972,1066,'廖柏勛','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5973,1066,'廖邵宇','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5974,1066,'蔡昌龍','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5975,1066,'呂俊緯','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5976,1066,'侯易佑','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5977,1066,'燕巢校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5978,1067,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5979,1067,'以最多人接觸的門把發想，透過感應式消毒減少接觸病毒','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5980,1067,'因為這兩年的疫情影響下, 所以大家對消毒這一塊變得很重視 , 我們發現的問題有以下三點 : \n第一點是最基本的手部清潔, 這也是最重要的一點, 因為我們會用手拿東西吃, 若是沒有清潔乾淨就會有細菌產生\n第二點是有的時候可能出門會換包包, 那就有可能忘記把消毒用品也跟著更換一個包, 這樣自己要消毒的時候就沒東西可以消毒\n那最後一點就是被很多人觸碰的地方就會藏很多細菌, 因為我們不知道上一個使用者使用過後門把到底有沒有做好清潔, 自己心裡擔心的事情搞不好就會發生','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5981,1067,'當我們出入某些地方或是進家門時第一個碰到的東西就是門把，所以我們針對大家都會接觸到的門把進行創意發想。開門時就會觸發感應器，門把上面的圓環就會來回滑動進行消毒。\n預計目標：在我們使用過後即時殺菌消毒，減少病毒傳播，能讓人更安心。\n未來市場：可應用在幼稚園、辦公室、公寓….等 雖然目前很多公共場所是自動門，但還是有許多地方需要手動開門，此創新還是有發展潛力。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5982,1067,'https://drive.google.com/open?id=13hxUSnBKHpqt-cG1iuyG7BKQGBpB3dGf','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5983,1067,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5984,1067,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(5985,1067,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(5986,1067,'林雅慧','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(5987,1067,'王昀宣','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(5988,1067,'陳禾苧','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(5989,1067,'','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(5990,1067,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(5991,1067,'張婷媛','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(5992,1067,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(5993,1068,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(5994,1068,'用資料探勘來預測手術時間，再利用演算法，對醫院手術進行排程','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(5995,1068,'1.手術室在醫院營收中佔了極高的比例(約占40%)\n2.不佳的手術排程會因為延遲而無法順利進行，導致手術病人的風險增加\n3.傳統人工排程效率不佳\n所以我們決定透過資料探勘，利用醫院的手術歷史資料，預測出每個手術的開刀時間，再用演算法，來對手術室的手術排程來做一個規劃與資源分配','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(5996,1068,'解決問題:\n        1.當有緊急手術需要插刀時，傳統的紙本方式，不易更改排程\n        2人工排程時，容易受主觀意識影響，例如資歷較深的醫師會想在較好的時段開刀\n        3.使用彈性易操作的使用者介面，並以圖形化顯示出排程結果 \n技術:\n        1.特徵選取\n        2.資料探勘\n        3.泛用啟發式演算法\n        4. Java UI\n可行性分析-SWOT分析:\n        1.Strengths 優勢:\n           (a)簡單易上手的系統操作介面\n           (b)與傳統人工排班相比，速度較快\n           (c)系統的可移植性高\n        2.Weaknesses 劣勢:\n           (a)發生緊急狀況時，排程結果會有較大誤差\n           (b)需要大量的歷史資料\n        3. Opportunities 機會\n           (a)加入預測手術時間的技術，提高排程的精準度\n           (b)降低醫院手術室及人力成本\n           (c)好的排程可以降低手術的擱置時間，提高病人的滿意度\n       4. Threats 風險\n           (a)未來若與資料庫做連結，需考慮資安問題\n評估預計達成目標與未來市場發展潛力:\n        目標：完成一套完善的系統，並廣泛運用在各個醫療場域\n        發展潛力：本系統與一般人工排程相比有以下幾個優點\n        1.排程速度較快\n        2.插入或刪除手術快速方便，再次排程也快速\n        3.只需學習使用介面就能操作系統\n        4.排程結果圖形化顯示，一目瞭然      ','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(5997,1068,'https://drive.google.com/open?id=1JKckMOOmb58QQiGMcc4PKM4H-7ik3ULL','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(5998,1068,'https://drive.google.com/open?id=1UnHZHq4zUlf7Ms4LkWTfQgvj4xH8GwZ-','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(5999,1068,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6000,1068,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6001,1068,'蘇家陞','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6002,1068,'王榆涵','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6003,1068,'姜懷翔','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6004,1068,'徐國章','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6005,1068,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6006,1068,'江傳文','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6007,1068,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',2