5','2022-11-15 06:08:15',283),(6055,1072,'在日常生活中，有時候停好了車，開心購物或是旅遊回來之後，突然發現自己怎麼都想不起來車子停在了哪裡，就算詢問管理員也很難有迅速又方便的搜尋方式，而且繳完費後也有限制出場的時間，讓人很難慢慢尋找車輛，於是我們就發現這個問題，想透過提案來完善停車場的各項服務，讓使用停車場的民眾有更加便利的體驗。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6056,1072,'解決辦法—導入車牌車位導航系統：\n在一開始要進去停車場的入口，可以使用車牌辨識系統，直接掃描車牌，不需要再另外取票，並且在每個車位加入車牌辨識系統，車子停入後，車牌號碼及所停位置將會自動記錄至資料庫系統，並將資訊傳遞到APP及網頁當中。要離場時，在機台直接輸入自己的車牌，螢幕會顯示自己的停車位，確認後再繳費即可。\n\n使用技術：\n票證設備、進出口車道閘口管制系統、全自動收費機、自動管理系統，以上四項為現有的全自動收費停車場擁有的技術，而導入車牌車位導航系統多了三樣技術，第一個即為車牌車位導航系統，資料庫管理系統則是記錄整合資料與連接APP及網頁使用，最後跨平台系統，不論是ios或是安卓系統都可順暢使用。\n\nSWOT分析：\n優勢：在這步調快的時代，不會做一些浪費時間的事。有了停車導航系統，能夠快速又方便找到自己的車並繳費。加上一條龍服務，使用app繳費導航服務，使顧客愛不釋手。\n劣勢：創意設計成本高，若要發明並在市場廣泛通用，需要花費高昂的價格和寶貴的時間設計與發明。\n機會：經調查，市場還沒有本功能，人們都需要靠自己記憶力找車位。而我們擁有創新技術，能使市場地位高。\n威脅：有些停車場規模小，不需要此設計；或是人們會自己記車位編碼，以至於不太需要此功能。\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6057,1072,'https://drive.google.com/open?id=1Yk-bdRXmAzpRQljbcPnFAMJMONUtbmhg','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6058,1072,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6059,1072,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6060,1072,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6061,1072,'黃姵甄','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6062,1072,'曾苡琳','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6063,1072,'林紫誼','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6064,1072,'張芷晴','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6065,1072,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6066,1072,'劉處英','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6067,1072,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6068,1073,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6069,1073,'針對FB,LINE的網路交易進行實名制評價APP','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6070,1073,'個人帳號、密碼經由網路傳送，過程中個人資料被竊取、信用卡被盜刷\n購買到的商品與期待不符\n使用者一時不察，登入到釣魚網站','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6071,1073,'從ip上來下手，而不是使用身分證字號。\n*使用IP追蹤的原因:根據PPPOE協定每個人的網路中都有一個\n固定ip以此ip進行鎖定。\n交易時雙方必須出示網路身分