22-11-15 06:08:15',295),(6142,1077,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6143,1078,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6144,1078,'透過智慧科技與車體做安全預防上的結合，便能有效降低危險之發生。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6145,1078,'酒駕是因為駕駛飲酒沒有自覺而開車，或者認為意識尚可而駕駛，因此導致意外事故發生的風險提高，所以我們想降低酒駕及疲勞駕駛的危險發生。\n','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6146,1078,'解決問題的方法:\n透過限制、提醒、輔助等方式提升道路安全，並結合眼球追蹤、智能手錶等現有產品技術，\n以及加上身體反應測試作為駕駛能力依據。\n以特定族群駕駛人為主要客群，例如酒駕前科犯以及須長途駕駛的駕駛員等\n\n可行性分析-技術面:\n生理狀態檢測手錶/車體外距離感測器/眼球追縱\n\n團隊執行力:\n蔡藝榕:運籌系-運籌管理-運籌管理師\n吳采霓:風管系-風險管理-企業風管師\n張韋柏:電通系-邏輯思考-設計部長\n余佳晉:電子系-系統設計-系統工程師\n\n目標與未來市場:\n最初階段:\n與政府簽約，在500輛公車進行測試。\n第二階段:\n國營職業駕駛皆有使用。(預估5000輛)\n第三階段:\n職業駕駛都皆有使用。(預估5萬輛)\n第四階段:\n職業駕駛及有酒駕前科者皆有使用。\n(預估10萬輛)\n第五階段:\n台灣有10%駕駛有使用(預估80萬輛)\n理想階段:\n台灣大部分駕駛有使用(預估800萬輛)\n\n建議售價:5,600\n(參考市面電子手錶)\n\n預估銷售量500+5,000+50,000+100,000+800,000=955,500\n\n營業額:5600*955500=5,350,800,000\n\n扣除25%成本，利潤=4,013,100,000\n\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6147,1078,'https://drive.google.com/open?id=1Gln3xwe8A8Mj2yd7MKwmFLu5fEHVSpI4','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6148,1078,'https://drive.google.com/open?id=1HrVGNcnFs6qmEckFeKInh-oJubJbErbi','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6149,1078,'https://drive.google.com/open?id=12woV4JN7IVFEvIL9E3yU6_LMAVEl-Rr3','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6150,1078,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6151,1078,'蔡藝榕','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6152,1078,'張韋柏','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6153,1078,'余佳晉','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6154,1078,'吳采霓','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6155,1078,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6156,1078,'巴慧玲','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6157,1078,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6158,1079,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6159,1079,'為了幫助夕陽產業及減少塑膠汙染，因此我們運用EVA發泡材製作杯套。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6160,1079,'參加辦喜酒應酬時經常會使用具有啤酒的Iogo的酒杯，因杯子較寬不方便拿取容易摔到且看起來也不美觀。在便利商店買咖啡時，若沒有放好容易翻倒導致燙傷。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6161,1079,'EVA發泡材具有防水、防摔等特性，運用此特性製作成杯套，此產品為一片長方形EVA發泡材的左右兩邊設計成杯耳的形狀，因EVA發泡材較軟易凹折可依杯子大小調整，並利用夾子的概念中間有彈簧能扣住在杯子。我們預計和回收EVA發泡材的廠商合作取得材料，藉由社群媒體來推廣此產品，希望能夠在一年內售出的1萬銷售量以及提高此產品知名度。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6162,1079,'https://drive.google.com/open?id=1_z26GoQVGipuRWdjzv1eZYtvsL3DlRJ3','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6163,1079,'https://drive.google.com/open?id=1Su56Uu-YAPnvfS0sQaCAUjKLJRwUyiqk','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6164,1079,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6165,1079,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6166,1079,'趙家新','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6167,1079,'林晉丞','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6168,1079,'黃家榆','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6169,1079,'陳昱蒨','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6170,1079,'施維貞','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6171,1079,'陳建志','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6172,1079,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6173,1080,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6174,1080,'為日常提供便利快速及更有效率的智慧生活','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6175,1080,'生活日常頻繁使用之物品容易遺忘及攜帶不方便','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6176,1080,'利用嵌入式晶片的穿戴物品取代  ex.戒指、手環','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6177,1080,'https://drive.google.com/open?id=1U9W9nzRKuxyyxuBlzJTO-YWYC4PADmm8','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6178,1080,'https://drive.google.com/open?id=1x2wgIU_532g7ioP1ztIL9FmiwfOk8uRh','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6179,1080,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6180,1080,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289