、便宜、吸震、防水種種優點，於是配合本組的主題避免浴室中\"滑倒意外的碰撞\"，希望將EVA投入新型的浴室磁磚的材料，先由廠商到顧客家中丈量，訂做相關尺寸的牆壁底板，並將數據傳回公司個別保存，顧客可上網站藉由數據模擬家中浴室的概況，並動手搭配自己所想要的磁磚顏色或材質面(如石紋、木紋等)，並由電腦運算扣除常規尺寸的部件，不規則的部分則客製化個別製作，將EVA磁磚送到顧客家中，顧客便可藉由先前底座上的卡扣案個人喜好，如積木般的自行組裝浴室。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6207,1082,'https://drive.google.com/open?id=1bax8r--xzNh52ZiwUV83pgrz3-D8Ux9T','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6208,1082,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6209,1082,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6210,1082,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6211,1082,'黃昊泓','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6212,1082,'吳文忠','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6213,1082,'林易澄','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6214,1082,'陳巧珊','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6215,1082,'許庭睿','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6216,1082,'陳建志 ','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6217,1082,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6218,1083,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6219,1083,'利用人臉辨識技術和通用化的概念設計冰箱，減少食物被濫用及弱勢族群自尊心問題，讓大家都可以拿到真正需要的食物。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6220,1083,'1.冰箱食物被濫用\n2.不一定會有自己需要的食物\n3.自尊心問題\n4.放太久沒人拿導致食物過期或不小心吃到過期的','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6221,1083,'1.設置特殊冰箱門，進行身分上的區隔，減少愛心冰箱食物被不肖人士濫用的機會\n2.針對不一定會有自己需要的食物及3.自尊心問題，將冰箱做通用化的設計，讓不同需求族群\n的人都可以取得適當的食物，也可以顧及他人自尊心，免除向人乞討的不堪\n4.針對食物放太久沒人領取導致食物過期的問題，我們在此冰箱每一小格下方做了保存期限顯示器，由機器去記錄每項食物的保存期限減少食物過期的頻率','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6222,1083,'https://drive.google.com/open?id=1b8yBeJnnxlH3HXIz0gJmoKApRfQ0STyv','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6223,1083,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6224,1083,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6225,1083,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6226,1083,'關亦晴','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6227,1083,'許惇雅','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6228,1083,'呂若瑄','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6229,1083,'','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6230,1083,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6231,1083,'陳宗澤','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6232,1083,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6233,1084,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6234,1084,'將日常生活中不要的舊衣服、穿不了的衣服，回收利用製作成可玩的遊戲衣。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6235,1084,'日常生活中我們穿膩的衣服、破洞的衣服、穿不下的衣服，最終的解決方式通常都是丟掉或丟置舊衣回收，但有時可能會有捨不得丟的問題。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6236,1084,'我們將不要的舊衣服剪、拼接成箭靶並縫製在另一件舊衣服上，飛鏢採用寶特瓶等塑膠類製成，使用的也是使用過的塑膠，沾粘性的部分使用魔鬼氈，這項產品使用到的技術只有剪裁和縫紉和手做。\n主要商品是利用丟棄的衣服打造成可玩的衣服，舊衣物可以利用回收進而改造之後可以從公益二手店做起，改善大眾對舊衣又髒又破的印象，之後更進一步成立舊衣改造品牌，使舊衣煥然一新，提高二手衣的價值。\n在台灣算是較少見的設計，比較沒有知名度的品牌，所以我們保守估計可以賣2000-3000件，預估售價:350元，銷售額最高可達105萬。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6237,1084,'https://drive.google.com/open?id=1Rz_-fwhef0CX1kixq3HS_7BIe7SujzlT','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6238,1084,'https://drive.google.com/open?id=17hcnDAKyh5Xzd72xkDpig6k84id5c3tB','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6239,1084,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6240,1084,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6241,1084,'李依宸','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6242,1084,'溫作槺','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6243,1084,'陳彥行','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6244,1084,'張羽柔','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6245,1084,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6246,1084,'巴慧玲','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6247,1084,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6248,1085,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6249,1085,'座位常常因為尖峰用餐時段，而處於滿位的情況。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6250,1085,'在用餐時間點去吃飯時，幾乎都座無虛席，常常到了餐廳要吃飯時才發現裡面已經滿位。因此我們想打造一個座位感應器，並結合地圖顯示出該家餐廳即時的營業狀況、客流量、剩餘座位等。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6251,1085,'主要技術為在座位上裝設感應器，並透過網路隨時偵測並提供資料給顧客了解，再進一步上傳至雲端與各家分店進行統整後顯示於app上。\n可減少部分選擇內用之顧客在消費完後找位子上的負擔，同時讓尚未抵達店家的顧客可提前瞭解目前店內客流量進而評估是否需要選擇前往其他分店。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6252,1085,'https://drive.google.com/open?id=1k3ilyir38t23yVNCv0pSs_0AC5Uy5WPW','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6253,1085,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6254,1085,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6255,1085,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6256,1085,'簡少恩','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6257,1085,'黃宥橙','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6258,1085,'吳易娠','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6259,1085,'陳之婷','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6260,1085,'林妤萱','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6261,1085,'張婷媛','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6262,1085,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6263,1086,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6264,1086,'本提案為一相對便宜的解決方案, 利用簡單的雷達系統試圖在複雜昂貴的智慧車外普及最為基本的防撞機制','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6265,1086,'近年來車禍事故依然頻繁發生, 其中高風險/死亡率事故又以 \"前方車輛減速或停止\" \"緊急煞車\" \"未保持行車安全距離\" 為主要發生因由, 若能針對其提供相應解決方法, 必能在行車安全上有重大貢獻','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6266,1086,'為一相對便宜的解決方案雖然在功能性上做了妥協, 利用雷達系統試圖在複雜昂貴的智慧車外普及最為基本的防撞警示系統, 將車輛視為質點模型(只考慮,位置, 速度, 加速度)並使用PN作為躲避路徑產生器, 可適時的提示使用者躲避的方向, 在市場上應該有其價值','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6267,1086,'https://drive.google.com/open?id=1K7xKCjDR1vs09saOpOHqnwkbkCvdAADN','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6268,1086,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6269,1086,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6270,1086,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6271,1086,'林祖渊','2022