衛生紙，造成不必要的浪費也造成環境資源上的消耗。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6296,1088,'面紙盒盒身使用透明壓克力打造，採用從旁邊將面紙放入的設計，如使用透明包裝衛生紙或將包裝去除可以在使用時直接看到衛生紙使用量，透過類似年輪輪廓線的設計，可以讓使用者根據面紙與輪廓線的相對位置更有依據的了解到使用的情況。底部設有LED燈，透過壓克力的高導光性，面紙盒也可以是一個桌上小燈或夜燈，當手機有訊息通知或使用量告知時會閃爍燈光。\n透過與手機APP的連結，使用者可以透過數據來了解到平常不會注意的衛生紙使用量，讓使用者反思自己是否有浪費的情形。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6297,1088,'https://drive.google.com/open?id=1P6_uetAdPKDdZ4p3Ut-RAdJeDU1FWB1R','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6298,1088,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6299,1088,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6300,1088,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6301,1088,'陳建群','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6302,1088,'魏國順','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6303,1088,'蕭承洋','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6304,1088,'','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6305,1088,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6306,1088,'林龍吟','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6307,1088,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6308,1089,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6309,1089,'將環保紙袋結合一次性拖鞋，且不影響原本紙袋的效用','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6310,1089,'在尋找發現問題的過程中，我們找到兩個主要大方向，也就是環境問題與資源分配不平均的問題，接著我們以資源分配不平均的角度出發，決定了第一個小問題，那就是某些地區的人沒有鞋子可以穿，我們再結合第一個所發想的環境問題，得出一個結論，也就是一次性拖鞋，而一次性拖鞋最主要使用者，就是飯店，於是我們決定結合紙袋及一次性拖鞋，做成結合一次性拖鞋的紙袋。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6311,1089,'我們發現購物袋和紙拖鞋同樣都是紙製品，於是我們思考能不能將這兩樣結合？\n\n我們想到，將紙袋延伸出符合拖鞋的大小，並且延伸處可內折進紙袋內部，亦可延伸出來，讓其可以裝更多東西。\n\n延伸出的部分上面有虛線，可以撕下拖鞋和包腳部分的形狀，簡單組裝後即變成一雙拖鞋。\n\n除去原本紙袋的形狀，延伸出的部分上面也會有可以提的部分，就算沒有用到拖鞋也能輕鬆將小紙袋變身大紙袋。\n\n如此，既減少空間的佔用，也提高了紙袋的使用效率。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6312,1089,'https://drive.google.com/open?id=1wXt3UIVr2zIpWLu_9qpFrQVfGS5Bq0Wu','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6313,1089,'https://drive.google.com/open?id=1w_CW-fjMNKNsvANQWkgyhQ8w2r8_81x6','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6314,1089,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6315,1089,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6316,1089,'李惠慈','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6317,1089,'鐘玟容','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6318,1089,'巫怡蓁','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6319,1089,'劉庭瑋      ','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6320,1089,'江俊萱     ','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6321,1089,'陳建志  ','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6322,1089,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6323,1090,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6324,1090,'農民利用簡易灌溉系統，可以自動灌溉且監控農地狀況。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6325,1090,'在氣候變遷的影響，水資源使用效率的重要性就越發重要，許多農民至今仍維持以往的湛水灌溉方式，在2021年台灣經歷56年以來的大旱，導致糧食產量供應與品質的不穩。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6326,1090,'為了解決農業勞動力不足、提高水資源的利用效率等問題，此系統結合了溫溼度、土壤溫溼度、土壤鹽分、水位感測器、水泵、物聯網，可監測農田中的水位高度、水溫和土溫等數據資料。當水位高度過高時，電動水閥門會自動關閉停止灌水，當水位高度過低時，電動水閥門可根據作物生育期的需求，進行不同模式的灌水作業，如此一來可大幅減輕農民在灌溉管理方面的人力與時間成本，透過日常使用的手機就能輕鬆掌握不同田區的水位與灌水狀況，有效降低過度灌水的溢流情形，提高每塊田區的水資源利用效率。\n\n擴大灌溉服務攸關農業發展、農民生計及公平正義，確有辦理之必要性。若無農田水利設施，多數降雨將直接川流入海；但若透過適當的農田水利建設，如系統性整體規劃灌溉設施，推動多元水資源開發改善及創新服務研發示範與推廣，即可把水留住，灌溉大地，提供穩定、精準的灌溉用水，穩定臺灣農業生產的經濟與發展。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6327,1090,'https://drive.google.com/open?id=1qS10Q3rQrqb8gZxeYQ59FOA5ZhxKCKuR','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6328,1090,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6329,1090,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6330,1090,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6331,1090,'張泊泳','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6332,1090,'黃凱威','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6333,1090,'王擎宇','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6334,1090,'謝秉憲','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6335,1090,'楊詔欽','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6336,1090,'侯易佑','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6337,1090,'燕巢校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6338,1091,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6339,1091,'能夠「提醒喝水」、「保溫」並「記錄喝了多少水」的杯墊','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6340,1091,'飲用足夠的水有助於人體輕鬆執行各項機能，例如：\n1.	幫助溶解維他命、碳水化合物和蛋白質\n2.	促進酶促反應，使人體內的營養物質滲透細胞和排毒\n3.	提升免疫系統，精神提振，使您容光煥發\n4.	促進人體調節溫度和增肌燃脂的能力\n\n那麼您一天該喝多少水呢？\n成年人每天通過呼吸、消化食物和流汗平均流失 1.5 至 2 公升水，就算在不活動的休息期間也是如此，因此人體每天必須補充這1.5 到 2 公升的水。而運動員及炎熱地區的居民，就必須喝更多水來保持水分。\n\n然而現代人往往水分補充不足，原因如下：\n1.	明知多補充水分很重要，卻因忙於工作而疏於喝水\n2.	當杯中的水已經喝完時，卻因手邊的工作而忘了再補充\n3.	想在冬天隨時喝杯溫水，卻因忙於工作，再喝時水卻早已涼了\n','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6341,1091,'開發具備下述功能的智慧杯墊，以改現代人飲水不足的問題：\n1.	透過重量感測器來偵測並記錄喝水量\n2.	結合加熱線圈來達到保溫的功能\n3.	結合手機APP與藍芽來達到提醒、調整溫度與查看喝水紀錄等\n4.	累計每日喝水紀錄，連續7日達標可獲頒電子徽章乙枚，累積電子徽章可兌換/蒐集本公司 \n       特色馬克杯，來達到鼓勵喝水及客戶忠實的效果\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6342,1091,'https://drive.google.com/open?id=1vO50RTUvN5jEmlyYUqfv6xYE-tfH890o','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6343,1091,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6344,1091,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6345,1091,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6346,1091,'王貿新','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6347,1091,'林荿絴','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6348,1091,'石玉潔','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6349,1091,'李芷嫻','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6350,1091,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6351,1091,'宋旗桂','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6352,1091,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6353,1092,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6354,1092,'協助特定人群即時得知路況並找到最適當的路線到達目的地','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6355,1092,'現代人騎車難免遇到一些路況問題,可能路上\n沒車卻要等很久的紅燈,抑或是因車禍問題導\n致的塞