22-11-15 06:08:15',293),(6380,1093,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6381,1093,'陳宗澤','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6382,1093,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6383,1094,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6384,1094,'考量到新婚時，新娘試婚紗的不方便，利用AI技術去解決這件事！','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6385,1094,'因為我們要利用3D投射技術，絕對比平面來的複雜，且必須融入人工智慧才能完成，而創意緣由來自於組員討論出試婚紗的麻煩之處，所以進一步去發想該如何解決！','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6386,1094,'解決方案大致拆成兩大項，一開始先由投射難點，而我在提案影片有分析該如何解決，利用螢幕發光原理，只是將其轉成3D，或許這樣還是有一些問題，像是光的走向造成色準偏差、漏光、LED瑕疵，但這是創意發想必經過程，接著大數據及演算法則是另一大難點，這是關於需要輸入數據，則龐大的演算法必須及時分析該有的數值。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6387,1094,'https://drive.google.com/open?id=1SivQRr6VBzZ2c6iDbylv5RzYfaXuaNxi','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6388,1094,'https://drive.google.com/open?id=1KVWAYduBWCpOvCczlqEp6CtnDKav8xPJ','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6389,1094,'https://drive.google.com/open?id=112WT79pjUbHOIYA1IsJNLXoh6lppsdpZ','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6390,1094,'3','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6391,1094,'林承均','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6392,1094,'張簡佩玉','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6393,1094,'曾德文','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6394,1094,'','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6395,1094,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6396,1094,'李國維','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6397,1094,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6398,1095,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6399,1095,'在公共垃圾桶上加裝定位、垃圾爆滿預警、分類回饋獎勵以及街口監視器','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6400,1095,'提案發想是來自於，有次跟朋友到台南的觀光老街出遊時，卻發現手上的垃圾無處可丟，在一個會大量產生一次性垃圾的地方卻不見公共垃圾桶，也沒有相關指標，很容易造成垃圾隨手亂丟的情況。\n藉由這次經歷而連兩出來的，關於公共垃圾桶的服務進化，讓一班看起來髒亂、不美觀的公共垃圾桶，藉由重新設計與增加新功能，讓明種能更加依賴使用。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6401,1095,'目前針對的升級項目有以下四點: 1.定位、2.垃圾爆滿預警、3.分類回饋獎勵、4.街口監視器\n\n 1.定位: 定位的部分是因為想要製作出垃圾的導航APP，讓使用著能用手機迅速搜尋離自己最近的垃圾桶點在何處，也讓負責清潔部分的人員可以明確知道哪裡有設點需要清潔。(目前台北市已有相似APP的應用程式。驗證為可行)\n\n2.垃圾爆滿預警: 有時候人潮多垃圾一下就爆滿了，需要清潔人員馬上前來做更換，以免垃圾爆滿無法繼續使用。也能配合導航APP即時雲端顯示，讓後台清潔端能迅速針對需更換的點做清潔。(現行居家使用的掃地機器人已有相關技術，相信放到公共垃圾桶上一定沒問題。驗證為可行)\n\n3.分類回饋獎勵: 這部分是希望設置回饋的部分，鼓勵民眾能正確分類，透過獎勵機制來回饋，機制的設計為點數兌換，正確投入多少垃圾就能累積幾點，再配合APP或電子票卡做紀錄。(目前台北市已有部分家樂福提供類似機台做測試。驗證為可行)\n\n4.街口監視器: 一般公共垃圾桶的設點較為人口流動地區，增加監視器也能讓需要證據畫面的民眾，多一點拍攝方向與彌補街口攝影機的拍攝死角。(現行針孔攝影機技術水準相當高，相信在公拱垃圾桶上放置一顆鏡頭絕對沒問題。驗證為可行)','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6402,1095,'https://drive.google.com/open?id=1HTk00K7FluSL0cMcMJ4tfNdpEDu-Ahtm','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6403,1095,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6404,1095,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6405,1095,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6406,1095,'彭林彥','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6407,1095,'張凱畯','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6408,1095,'吳敏豪','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6409,1095,'張偉峻','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6410,1095,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6411,1095,'劉處英','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6412,1095,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6413,1096,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6414,1096,'全自動除菌抗臭壓縮壓縮垃圾桶，當垃圾達到一定量之後會自動幫你壓縮且還會除臭，防止垃圾堆積又能減少病媒源。','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6415,1096,'由於現代人生活忙碌且外食居多，經常外帶餐點回家，生活汲汲營營易忘記其他瑣事如：倒垃圾；而放在家中或房間的垃圾桶若一段時間沒倒就會爆滿，孳生果蠅，又或是蟑螂爬來爬去','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6416,1096,'市面上雖說已經有許多除臭抗菌、壓縮垃圾桶,但沒有一款是真正「全自動」壓縮功能並搭配除臭的垃圾桶,基本上都還是要等到自己覺得垃圾桶太滿了再手動處理,於是我們經過一番腦力激盪發想出「全自動除菌抗臭壓縮垃圾桶」以解決目前面臨到的問題，且加上物聯網，讓手機可以連線遠端，想到就能進行操作，不一定本人要在旁邊，增添了許多方便性。\n','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6417,1096,'https://drive.google.com/open?id=16zaJSwSbyBPTpkpmKGvF_qUr374yVuhT','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6418,1096,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6419,1096,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6420,1096,'5','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6421,1096,'涂元禧','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6422,1096,'陳乙芊 ','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6423,1096,'籃郁萱','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6424,1096,'林家逸','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6425,1096,'吳念恩','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6426,1096,'張珝丹','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6427,1096,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6428,1097,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6429,1097,'洗衣機店常常被插隊或忘記，利用智能app來解決困擾','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6430,1097,'使用洗衣店的洗衣機洗衣服，常常被插隊或忘記自己已經洗完衣物了，造成自己與他人的困擾','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6431,1097,'利用現代人都有的手機，使用預約app來提升洗衣效率，人們常常會忘記洗完衣物，如果app能提醒自己，想必能大大減少這種狀況，去洗衣店如果沒有機台能使用，也會浪費時間，如果有了這款app，就能減少消費者不愉快的等待時間,讓消費者更有意願使用洗衣機，也能增加店家洗衣機的使用率。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6432,1097,'https://drive.google.com/open?id=107L9bwzB3_Tw7a-REjGjqrYEVjj7b4qq','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6433,1097,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6434,1097,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6435,1097,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6436,1097,'高郁涵','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6437,1097,'陳雅晴','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6438,1097,'楊旻庭','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6439,1097,'曹語庭','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6440,1097,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6441,1097,'宋旗桂','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6442,1097,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6443,1098,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6444,1098,'睡著時手機插著充電，不想要手機充整夜的電，也不想要再持續送電怎麼辦 ','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6445,1098,'不想要特地起床拔掉，引響睡眠。在充電器上設定要充到多少電量，電量一到自動斷電','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6446,1098,'因為手機本身就有自動斷電，但還是會顯示充電中，傷電池，所以若能在充電器上設定自動斷電這樣就不會顯示充電中，為了確保電量有達到100%，故在充電器上加裝自動斷電系統','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6447,1098,'https://drive.google.com/open?id=1PvIDCctAih8sSOcE_A_99QNx0-7FXX2F','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6448,1098,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6449,1098,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6450,1098,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6451,1098,'顏蓉','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6452,1098,'高榆婷.','2022-11-15 06:08:15','2022-11-15 06:08:15',291),(6453,1098,'孫暉茗','2022-11-15 06:08:15','2022-11-15 06:08:15',292),(6454,1098,'黃昱翰','2022-11-15 06:08:15','2022-11-15 06:08:15',293),(6455,1098,'','2022-11-15 06:08:15','2022-11-15 06:08:15',294),(6456,1098,'張珝丹','2022-11-15 06:08:15','2022-11-15 06:08:15',295),(6457,1098,'第一校區','2022-11-15 06:08:15','2022-11-15 06:08:15',296),(6458,1099,'(二)智慧生活類','2022-11-15 06:08:15','2022-11-15 06:08:15',282),(6459,1099,'３Ｃ產品的依賴度與日俱增，充電線等電線都是不可或缺之一','2022-11-15 06:08:15','2022-11-15 06:08:15',283),(6460,1099,'各種電線容易因為長期收納而產皺褶，表皮破裂等問題，而我們將改善甚至是解決這個最貼近生活，卻又危險的問題','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6461,1099,'用以延長線材的使用壽命，減少原料物件的消耗與電子垃圾的產出，也減少線材斷裂導致短路起火，進而友好環境與保護生態。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6462,1099,'https://drive.google.com/open?id=1htrUhLSyLd1-kGjfEheGgvEWObo490Ym','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6463,1099,'','2022-11-15 06:08:15','2022-11-15 06:08:15',287),(6464,1099,'','2022-11-15 06:08:15','2022-11-15 06:08:15',288),(6465,1099,'4','2022-11-15 06:08:15','2022-11-15 06:08:15',289),(6466,1099,'邱中彥','2022-11-15 06:08:15','2022-11-15 06:08:15',290),(6467,1099,'李柏偉','2022-11-15 06:08:15','2022-11-15 06:08: