成杯蓋脫落，進而翻倒，且若有發現杯架遇到杯徑不適合之飲料杯，也可能會產生相同問題。','2022-11-15 06:08:15','2022-11-15 06:08:15',284),(6521,1103,'若能在杯蓋上施加一個向下的力，相信\n能讓杯蓋與杯身更不易脫落，因此採用\n魔鬼氈進行固定，其具有輕便、快速、\n有重複性高等優勢。若能自行調整杯徑，相信產品能夠擁有\n更大的彈性。需考慮穩固性、堅固，因\n此將採取機械式結構，可以增加整體的\n穩定、可靠性。','2022-11-15 06:08:15','2022-11-15 06:08:15',285),(6522,1103,'https://drive.google.com/open?id=10Y1SU9GRznbMLOul8OHqSC4L__pKbZhG','2022-11-15 06:08:15','2022-11-15 06:08:15',286),(6523,1103,'','2022-11-15 06:08:16','2022-11-15 06:08:16',287),(6524,1103,'','2022-11-15 06:08:16','2022-11-15 06:08:16',288),(6525,1103,'5','2022-11-15 06:08:16','2022-11-15 06:08:16',289),(6526,1103,'邱湧菖','2022-11-15 06:08:16','2022-11-15 06:08:16',290),(6527,1103,'呂致緯','2022-11-15 06:08:16','2022-11-15 06:08:16',291),(6528,1103,'許宇呈','2022-11-15 06:08:16','2022-11-15 06:08:16',292),(6529,1103,'周逢時','2022-11-15 06:08:16','2022-11-15 06:08:16',293),(6530,1103,'陳柏宇','2022-11-15 06:08:16','2022-11-15 06:08:16',294),(6531,1103,'張珝丹','2022-11-15 06:08:16','2022-11-15 06:08:16',295),(6532,1103,'第一校區','2022-11-15 06:08:16','2022-11-15 06:08:16',296),(6533,1104,'(二)智慧生活類','2022-11-15 06:08:16','2022-11-15 06:08:16',282),(6534,1104,'以梳妝台為原型設計一個鏡子與洗手台結合的升降式洗手台，以按鈕操控高度，調整至合適高度，以增加醫院病人的便利性與安全。','2022-11-15 06:08:16','2022-11-15 06:08:16',283),(6535,1104,'發現洗手台高度會因為個人差異或是身體因素而帶來不便，像是獨自住院的病人，在沒有旁人的協助下，很有可能為了配合高度而滑倒受傷等等，而市面上的升降式洗手台上的鏡子並不能移動。','2022-11-15 06:08:16','2022-11-15 06:08:16',284),(6536,1104,'透過按鈕操控電動升降的方式調整洗手台高度，水管以伸縮管配合升降，在保留U型管優點的情況下去設計且鏡子也會一同升降。目標客群為醫療機構，首要的目標是達成醫院安裝的普及性，在未來也期許能夠擴大市場，提供所有需求者客製化的服務','2022-11-15 06:08:16','2022-11-15 06:08:16',285),(6537,1104,'https://drive.google.com/open?id=1pd-wu255StwV7_n7xGRe1J2LxTksQncV','2022-11-15 06:08:16','2022-11-15 06:08:16',286),(6538,1104,'https://drive.google.com/open?id=1_d9J9yeyGTIKqTtX-AwpqJgQ9eetI8Co','2022-11-15 06:08:16','2022-11-15 06:08:16',287),(6539,1104,'','2022-11-15 06:08:16','2022-11-15 06:08:16',288),(6540,1104,'5','2022-11-15 06:08:16','2022-11-15 06:08:16',289),(6541,1104,'許慕城','2022-11-15 06:08:16','2022-11-15 06:08:16',290),(6542,1104,'余文萱','2022-11-15 06:08:16','2022-11-15 06:08:16',291),(6543,1104,'王韻晴','2022-11-15 06:08:16','2022-11-15 06:08:16',292),(6544,1104,'楊靜玟','2022-11-15 06:08:16','2022-11-15 06:08:16',293),(6545,1104,'鄧惠馨','2022-11-15 06:08:16','2022-11-15 06:08:16',294),(6546,1104,'張婷媛','2022-11-15 06:08:16','2022-11-15 06:08:16',295),(6547,1104,'第一校區','2022-11-15 06:08:16','2022-11-15 06:08:16',296),(6548,1105,'(二)智慧生活類','2022-11-15 06:08:16','2022-11-15 06:08:16',282),(6549,1105,'每天早上都會起不來，常常遲到，跟朋友約出門讀書都遲到等等，所以這對大部分人都是一個令人困擾的問題','2022-11-15 06:08:16','2022-11-15 06:08:16',283),(6550,1105,'對於起床的困擾、創意發想源自網路以及自己想法\n \n利用窗簾的軌道將繩子帶起，能夠讓光照進來的同時，人也站起來醒神，配合鬧鐘能夠讓起床的機率大幅度增加，如果將關閉鬧鐘的按鈕安裝在牆上走動也能加大起床的機率，如果多個螢幕顯示上面就可以設定鬧鐘。\n','2022-11-15 06:08:16','2022-11-15 06:08:16',284),(6551,1105,'1.窗簾自動拉開\n褪黑激素讓人想睡覺，有資料顯示光能讓人降低分泌褪黑激素，如果能讓鬧鐘連接到窗簾或是窗簾比鬧鐘早開個五分鐘提前降低褪黑激素的濃度。在網路上有發現輔助拉開窗簾的一個裝置。在日本推出了「めざましカーテン mornin’」，連接手機藍芽設定鬧鐘，當設定時間到窗簾就是自動拉開，即使手機不在旁邊時間到也會自動打開。\n若是能夠在裡面安裝小喇叭，放出聲音或許能夠增加早上起床的機率。\n2.手上綁掛繩\n手上綁一個具有彈性的繩子，在確保睡眠中翻身或是移動時不會早成過度的纏繞以至於造成身體上的不舒服幅影響睡眠或是造成血液不循環。\n在鬧鐘響的時候繩索緩緩升起，藉由手臂的繩索去帶動全身，順帶著讓全身站起來。\n藉由起身來強制自身腦袋開機。\n\n問題：每個人睡覺習慣不一樣，繩子有可能好心壞了事，在睡覺中不知不覺勒到或因為繩子綁得過緊導致血液循環不良。\n\n解決：將繩子改成可震動床墊配合鬧鐘，在窗簾開始拉動時震動床墊。','2022-11-15 06:08:16','2022-11-15 06:08:16',285),(6552,1105,'https://drive.google.com/open?id=1iyTBgPc-08xiLhuDaRcVcgpvCdB_JEEI','2022-11-15 06:08:16','2022-11-15 06:08:16',286),(6553,1105,'https://drive.google.com/open?id=1QgaxAAOKUzt3GGqBjcJZUqXIV5LSyBxV','2022-11-15 06:08:16','2022-11-15 06:08:16',287),(6554,1105,'','2022-11-15 06:08:16','2022-11-15 06:08:16',288),(6555,1105,'5','2022-11-15 06:08:16','2022-11-15 06:08:16',289),(6556,1105,'塗國豪','2022-11-15 06:08:16','2022-11-15 06:08:16',290),(6557,1105,'陳韻筑','2022-11-15 06:08:16','2022-11-15 06:08:16',291),(6558,1105,'何珮綺','2022-11-15 06:08:16','2022-11-15 06:08:16',292),(6559,1105,'','2022-11-15 06:08:16','2022-11-15 06:08:16',293),(6560,1105,'','2022-11-15 06:08:16','2022-11-15 06:08:16',294),(6561,1105,'劉處英'