(6636,1110,'陳建志','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6637,1111,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6638,1111,'將外送平台服務結合回收食物、衣物及玩具進行結合','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6639,1111,'1.消除貧窮：餐廳剩餘的食物能否用來幫助到缺少糧食的人們\n2.環境保育：減少物品浪費再次回收利用','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6640,1111,'1.各家餐廳每天都會製作大量餐點，但不一定能全部食材使用完畢，可能會造成食材的浪費，故可以回收未使用完的食材另外包裝，利用食材回收的APP將需要回收的食材勾選之後選擇食材儲存方式並上傳，食材回收APP會透過定位服務來顯示各家餐廳過剩食材的數量，讓外送平台把食材運送到有合作乾糧工廠，乾糧工廠收到過剩食材並加工做成營養豐富且價格低廉的乾糧賣出去，將加工完的乾糧一部份運送至批發商、零售商，另一部分捐給各縣市里長或村長。\n2.家中有很多無破損且不需的衣物，也有很多沒在玩的玩具了，都囤積著又占位置，所以發揮愛心把二手的衣服褲子跟玩具等捐出來，由衣物回收的APP來顯示各家家戶戶衣服褲子跟玩具等，讓回收專車把捐贈的東西收集起來送至各家育幼院，育幼院收到二手衣服褲子跟玩具等提供一些孩子有衣服褲子穿，也有玩具可以玩樂。\n本組方案最主要是需要app設計技術與外送平台相關技術，透過觀察知名的外送平台，可知製作app技術以及整個流程，是可行的，最終希望達成app下載人次可達10萬，普及我們的計畫，有效解決資源浪費及物資不足問題。','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6641,1111,'https://drive.google.com/open?id=19ZAoj6DnWsa3uBz2JItkrgd8z-Xf7sHH','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6642,1111,'https://drive.google.com/open?id=13mWXYpg8RnzJb_eWe27ZU4hks2llRHKZ','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6643,1111,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6644,1111,'5','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6645,1111,'蔡傑丞','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6646,1111,'陳佳欣','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6647,1111,'黃鈺茹','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6648,1111,'賴亭曄','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6649,1111,'陳怡安','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6650,1111,'陳建志','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6651,1112,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6652,1112,'金銀花的冰淇淋磚 配合包裝享受養生奢華點心體驗','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6653,1112,'金銀花具有抗新冠肺炎、止咳等多樣功效，卻因為民眾對金銀花的認識不足也甚少有介質讓民眾接觸到金銀花，所以本團隊想製作金銀花冰淇淋塊打開金銀花商機將健康且抗新冠肺炎的金銀花推廣給大眾','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6654,1112,'將金銀花做成金銀花口味的冰淇淋,包裝食用時可當作容器，食用完可作為小花盆使用','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6655,1112,'https://drive.google.com/open?id=1wY9KYlOnVwnpTR3gYn70_T95GTAz6SGW','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6656,1112,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6657,1112,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6658,1112,'5','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6659,1112,'彭俊翔','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6660,1112,'郭俐妤','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6661,1112,'王斯顥','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6662,1112,'傅岑樺','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6663,1112,'黃信凱','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6664,1112,'陳建志老師','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6665,1113,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6666,1113,'收集二手物品，設立物資銀行，搭配線上網站，並用兌換的形式進行，最大的價值在於保護接受方的感受','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6667,1113,'透過圖片，我們發現三大問題，第一，房屋老舊導致的「健康及安全問題」，第二，光線昏暗導致的「教育問題」，第三，物資匱乏導致的「環境及生活問題」，經過討論及觀察，最終我們選定解決物資匱乏的問題，因為它是最廣泛的問題，涵蓋範圍最廣，能解決的問題也最多，包含環境，生活及教育。','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6668,1113,'於資源匱乏地區設立物資銀行站點，深入調查不同區域缺少的物資，搭配線上網站，將不同地區缺少的物資公告在網站上，讓捐贈物品及回收二手物品者能更清楚物資該往哪裡送，更清楚不同地區缺少什麼，與地方政府及超商合作，多方宣傳及代收物資，取得物資的程序為，線上網站、超商、服務站或地方政府都可以進行物資申請，審查通過後，即可進行物資兌換，以銀行形式呈現，物資需兌換才可獲得，兌換物品可為任何物品，如:個人才能/畫或手工藝，物資回饋/提供不用的二手物品，使用回饋/照片回饋給物品捐贈者，遇困難者，服務站會協助回饋，保護接受方的自尊心，物品是對換而來，非無條件捐贈，此為最大價值所在。','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6669,1113,'https://drive.google.com/open?id=1l7ooaov3dFFz0RPzK5y0nUtSH8f8WUVl','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6670,1113,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6671,1113,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6672,1113,'3','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6673,1113,'白玉','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6674,1113,'張文馨','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6675,1113,'高文洋','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6676,1113,'','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6677,1113,'','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6678,1113,'陳宗澤','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6679,1114,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6680,1114,'降低失智人口造成的社會問題，減輕照顧者及警政單位的負擔','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6681,1114,'老年人口增加，失智人口攀升，上班族身為照顧者，無法隨時在家照顧失智者。當患者離家時，家屬無法及時關心或陪同，造成照顧者負擔。失智者失蹤協尋需求逐年攀升，成為警政單位重要的業務和課題。雖然台灣失智症協會設計出緊急聯絡卡，縮短走失尋獲時間，但容易弄丟，效益不大；有一款NFC防走失智慧手環雖然方便，但因為須由協尋中心通報家屬，可能拖延救援時間。由以上問題發想出此產品，優化救援流程，以利於減少家庭與社會問題。','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6682,1114,'解決問題的方法:    我們以手環為原型，上頭有顆紅色警示燈，以及一顆確認鍵。首先在APP上利用電話號碼創立帳號，輸入追蹤器編號，由家屬在追蹤器上按確認鍵，即設定完成。在APP設定平時老人的活動範圍，例如方圓五公里或是一個里(村)。也可設定禁止區域，例如海邊或山區。如超過設定的活動範圍，就會立刻響起警報聲及通知家屬，且紅色警示燈同時閃爍，以告知附近民眾此患者需要幫助，為使追蹤器不易被取下，在內部設有電子密碼鎖，需在APP上設定密碼，設定完成即鎖上。反之，在APP上輸入密碼，即取下。\n分析:    失智者GPS定位手環在現有的技術下是可以製作出來的，我們將產品定位在低價、耐用，目的不在於能夠獲得多少營利，而是能製作出任何人都能負擔的起的產品，目的為降低現今失智人口所產生的社會問題，及減輕受這些社會問題影響的人們。','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6683,1114,'https://drive.google.com/open?id=1ze1NUDjohsjS7m5UtImRqznI_Nif3Qcw','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6684,1114,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6685,1114,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6686,1114,'5','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6687,1114,'江秉倫','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6688,1114,'陳彗慈','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6689,1114,'蔡家芸','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6690,1114,'吳紀緯','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6691,1114,'','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6692,1114,'劉處英','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6693,1115,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6694,1115,'透過平台及實體店面解決低收入戶因經濟壓力無法溫飽的問題','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6695,1115,'臺灣的經濟相對繁榮，卻仍然有部分人民受困於貧窮與飢餓，沒有舒適的居住環境、在經濟壓力下無法溫飽，雖然已有許多公益團體在積極的改善現況，但人民也可能顧及自尊心，不願意接受幫助，這些是我們發現並且想解決的問題，希望能透過我們的解決方案，給弱勢團體帶來更多溫暖的力量。','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6696,1115,'1.店面：\n拓展實體店面，主要在低收人口密集處增設\n\n2.合作對象：\n和菜市場攤販、大賣場等作為合作對象，收集食材來源(像是長得比較醜賣不出去的食材或即期品)\n\n3.銷售方式：\n實施會員制，保護消費者身分隱私，不會損害到低收入戶的自尊心，餐廳銷售餐點時，以原價賣給一般人，以較低價或免費領取為主，提供給低收入戶。\n\n4.營業獲利：\n將以銷售給一般消費者的營利，做為補貼提供給低收入戶餐點的成本','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6697,1115,'https://drive.google.com/open?id=1EsL6_Lmvp5RGCUPolKy5zJcYbkUENOSR','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6698,1115,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6699,1115,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6700,1115,'3','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6701,1115,'劉沂嘉','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6702,1115,'羅心怡','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6703,1115,'伍涵','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6704,1115,'','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6705,1115,'','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6706,1115,'陳宗澤','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6707,1116,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6708,1116,'以預約停車格的方式解決機車亂停的現象','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6709,1116,'騎車到不熟的地方，很常找不到路邊停車格，或是只有紅線可以停。車子停好之後，又被其他人移動，導致找不到車，或是車子被刮傷。','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6710,1116,'目前市面上極少數設計為機車停車的應用程式，但實際上機車停車的問題卻一直困擾著人們，使得機車只能停在人行道及紅線等，也影響市容及行人路權。在這想法中可以解決尋找路邊機車停車格的問題，以及提出預約停車格及防範他人侵占車位等方案。現在已有智慧車鎖的技術可以沿用，並且在app中加入預約車位的功能，能夠偵測使用者目前所在位置，搜尋景點或火車站等都能快速找到並預約車位。 \n預約時間為五分鐘，及一次延長時間三分鐘，且選中的車位將會上鎖。\n預約成功後可導航至停車格，到達後按下到達鍵，車位將會自動解鎖。\n停車後，可再次利用手機上鎖避免車子遭移車或是竊取。\n取車時，可利用app綁定其他支付方式進行繳費。\n繳費完畢後按下離場鍵，會再次解鎖，這時您與愛車可離開此時app顯示空位狀態，以利下一位使用者停車。\n沒有預約也能夠停車，只要車位沒有上鎖也能停車，停好車後利用app進行上鎖及後面的流程和預約後相同。\n如果有用戶停車後沒有連動app，過了10分鐘後，裝置還是會自動將車子鎖起來，用這樣的方式避免佔據停車格卻不繳費的問題。\n本提案以社區及在地問題作為發想，利用APP可以使台灣亂停車造成的交通事故和亂象有所改善，並且將20%的所得捐給該社區。','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6711,1116,'https://drive.google.com/open?id=1EZuara4m_VlcByGPI2FGzQPCfNOJSfW4','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6712,1116,'https://drive.google.com/open?id=1NKqy6MzDvWd4N4dwOQZ0qzwE3n0QPQCW','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6713,1116,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6714,1116,'5','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6715,1116,'張芸蓁','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6716,1116,'陳氏月熙','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6717,1116,'高芮蓁','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6718,1116,'黃筱晴','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6719,1116,'洪郁雯','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6720,1116,'劉處英','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6721,1117,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6722,1117,'因為金銀花本身就有美白及殺菌功能，因此我們想將金銀花的成分加入面膜裡。','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6723,1117,'我們發現問題在於顧客不太了解金銀花這項草藥、缺乏大眾化、經過口服會造成一些副作用、不適合全部的人使用，以及產品不具有特殊性。我們得知，金銀花的功效，有好有壞，既然口服會有副作用，本小組經過發想與討論後，希望能將金銀花萃取物放入面膜中，少量的成分不僅能養顏美容與殺菌，又不會有副作用，一舉兩得。','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6724,1117,'本小組不僅結合金銀花和面膜，也為面膜的外包裝及面膜盒子進行設計，將面膜外包裝設計得更有辨識度，並且在下方給予QR CODE，讓顧客購買面膜後能掃描並且科普金銀花相關知識。而面膜的盒子經過本小組的設計，為了讓該產品外包裝不只是外包裝的功能，我們結合了鏡子，讓即使有外出想使用面膜需求的顧客，攜帶外出時也不需要再額外帶鏡子，透過折疊的方式就可以將盒子架高，讓顧客可以隨時隨地敷面膜，使產品本身的附加價值提升，顧客在購買時不是只有買面膜這項產品。','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6725,1117,'https://drive.google.com/open?id=17E643uGwda7dc9s3eS9E31yyTRULZT_V','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6726,1117,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6727,1117,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6728,1117,'5','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6729,1117,'謝招尉','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6730,1117,'鄭凱馨','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6731,1117,'楊少杰','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6732,1117,'張凱宸','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6733,1117,'邱弘耀 ','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6734,1117,'陳建志','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6735,1118,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6736,1118,'現在網購的垃圾量增加，我們設計了一種防撞又可以重複利用的包裹袋，減少垃圾量','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6737,1118,'網購時總是有很多包裝垃圾','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6738,1118,'我們利用寶特瓶製成的布與廢棄的氣泡紙製成防撞袋，可以在各大商店設立一個回收站使其可以重複利用，以減少垃圾量','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6739,1118,'https://drive.google.com/open?id=1XXUFzvregn7eOMypeVM8oEADdcgilb4D','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6740,1118,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6741,1118,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6742,1118,'4','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6743,1118,'石宸睿','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6744,1118,'陳蕙君','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6745,1118,'許博嘉','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6746,1118,'張耀','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6747,1118,'','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6748,1118,'陳建志','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6749,1119,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6750,1119,'運用溫泉能源加其他控制系統在地下溫室培養農作物。','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6751,1119,'一頓豐盛的餐點需要有多樣的原料，但農作物卻容易受天災影響而無法順利生產，本小組提出地下種植概念，且加以運用臺灣豐富溫泉資源優勢，創造不受天氣影響的種植方式帶來穩定產出農產品的效益。','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6752,1119,'在溫泉附近地下建造溫室，通過溫室地板下的管道，加上自動控溫系統，讓水能在不同季節保持在一定溫度，同時使用自動化技術網路來控制地下生態系統的光源、環境溫度、濕度與 CO2 平衡，一座溫室就相當於一個閉合回路系統，其相對資源的消耗非常少，且環境狀態帶來了外部機會，讓溫泉不單單只能泡，也可以幫助農作物生長，創造更多價值，但較創新的想法缺乏了成熟的技術去實踐，加上資金的缺乏可能降低了可行性，但盼未來能透過此概念完全解決農民訴求。','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6753,1119,'https://drive.google.com/open?id=1XE9nUM042u2uO275jr1rIHtTm-5DT7en','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6754,1119,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6755,1119,'','2022-11-15 06:08:50','