相當高。\n\n預計使台灣人煙稀少的地方，都安裝此一系統，如果台灣政府願意採用，或推廣至國外，必有相當大的發展力。\n','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6823,1124,'https://drive.google.com/open?id=199G3tAjajEms3j1ZYovY2jNxLcdsa_bf','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6824,1124,'','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6825,1124,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6826,1124,'3','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6827,1124,'陳巍','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6828,1124,'陳昱融','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6829,1124,'歐陽安','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6830,1124,'','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6831,1124,'','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6832,1124,'陳宗澤','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6833,1125,'(一)地方創生類','2022-11-15 06:08:50','2022-11-15 06:08:50',297),(6834,1125,'透過改造水溝蓋，減少雨天造成水溝堵塞的機會','2022-11-15 06:08:50','2022-11-15 06:08:50',298),(6835,1125,'由於淹水會造成行人用路安全和人民財產的遺失','2022-11-15 06:08:50','2022-11-15 06:08:50',299),(6836,1125,'運用化學中的過濾法來達到將落葉或是一些廢物可以在紙上過濾，累積到一定程度後可以做替換，改善開口過大使東西容易掉入的技術\n預計可能達成率50%\n濾紙是運用廢紙，所以可以同時達成再重複使用','2022-11-15 06:08:50','2022-11-15 06:08:50',300),(6837,1125,'https://drive.google.com/open?id=1BafRNeq2xU07bsyPDKgFNWmq_wrMQPT_','2022-11-15 06:08:50','2022-11-15 06:08:50',301),(6838,1125,'https://drive.google.com/open?id=1xwjbiVZOAykij2lWWT3BAiqzbTYIA9gL','2022-11-15 06:08:50','2022-11-15 06:08:50',302),(6839,1125,'','2022-11-15 06:08:50','2022-11-15 06:08:50',303),(6840,1125,'4','2022-11-15 06:08:50','2022-11-15 06:08:50',304),(6841,1125,'粘宜蓁','2022-11-15 06:08:50','2022-11-15 06:08:50',305),(6842,1125,'鄭聿倫','2022-11-15 06:08:50','2022-11-15 06:08:50',306),(6843,1125,'劉寬田','2022-11-15 06:08:50','2022-11-15 06:08:50',307),(6844,1125,'施孟辰','2022-11-15 06:08:50','2022-11-15 06:08:50',308),(6845,1125,'','2022-11-15 06:08:50','2022-11-15 06:08:50',309),(6846,1125,'陳建志','2022-11-15 06:08:50','2022-11-15 06:08:50',310),(6847,11