,335),(7408,1292,'創業概念發想','2022-12-26 03:34:44','2022-12-26 03:34:44',336),(7409,1292,'透過營運、行銷形式來紓解壓力','2022-12-26 03:34:44','2022-12-26 03:34:44',337),(7410,1292,'陳怡君','2022-12-26 03:34:44','2022-12-26 03:34:44',338),(7411,1292,'顏致維','2022-12-26 03:34:44','2022-12-26 03:34:44',339),(7412,1292,'土木工程系','2022-12-26 03:34:44','2022-12-26 03:34:44',340),(7413,1292,'C110141212 ','2022-12-26 03:34:44','2022-12-26 03:34:44',341),(7414,1292,'0938720392','2022-12-26 03:34:44','2022-12-26 03:34:44',342),(7415,1292,'c110141212@nkust.edu.tw ','2022-12-26 03:34:44','2022-12-26 03:34:44',343),(7416,1293,'機電運輸','2022-12-26 03:34:44','2022-12-26 03:34:44',335),(7417,1293,'創業概念發想','2022-12-26 03:34:44','2022-12-26 03:34:44',336),(7418,1293,'透過誘發孩童的好奇心，從小培養良好的衛生習慣。','2022-12-26 03:34:44','2022-12-26 03:34:44',337),(7419,1293,'黃照貴','2022-12-26 03:34:44','2022-12-26 03:34:44',338),(7420,1293,'李雯盈','2022-12-26 03:34:44','2022-12-26 03:34:44',339),(7421,1293,'行銷與流通管理系碩士班','2022-12-26 03:34:44','2022-12-26 03:34:44',340),(7422,1293,'F111113125','2022-12-26 03:34:44','2022-12-26 03:34:44',341),(7423,1293,'0952062879','2022-12-26 03:34:44','2022-12-26 03:34:44',342),(7424,1293,'F111113125@nkust.edu.tw','2022-12-26 03:34:44','2022-12-26 03:34:44',343),(7425,1294,'生醫材化','2022-12-26 03:34:44','2022-12-26 03:34:44',335),(7426,1294,'原型產品開發/驗證','2022-12-26 03:34:44','2022-12-26 03:34:44',336),(7427,1294,'遊戲市場上有許多的AR遊戲以及VR遊戲，而且大多擴增實境、虛擬實境遊戲都是娛樂用的遊戲，相比之下訓練用遊戲也較少。VR遊戲對於小朋友來說又不容易觸碰到，畢竟儀器可能對孩童來說比較笨重，因此可以透簡易型較為便利的VR眼鏡來讓孩童做訓練。有些孩童在拿取東西時可能為不便或是會將東西甩來甩去，畢竟孩童好奇心強烈也沒有很高的耐性。此計畫透過套杯遊戲來讓小孩可以訓練耐性，對於現代的孩童來說不常接觸到的虛擬實境遊戲會感到較高的好奇心，將套杯遊戲做成較為可愛風格的遊戲也能夠讓小孩不會抗拒。','2022-12-26 03:34:44','2022-12-26 03:34:44',337),(7428,1294,'侯易佑','2022-12-26 03:34:44','2022-12-26 03:34:44',338),(7429,1294,'王群昌','2022-12-26 03:34:44','2022-12-26 03:34:44',339),(7430,1294,'智慧商務系','2022-12-26 03:34:44','2022-12-26 03:34:44',340),(7431,1294,'F111156107','2022-12-26 03:34:44','2022-12-26 03:34:44',341),(7432,1294,'0981626070','2022-12-26 03:34:44','2022-12-26 03:34:44',342),(7433,1294,'F111156107@nkust.edu.tw','2022-12-26 03:34:44','2022-12-26 03:34:44',343),(7434,1295,'服務文創','2022-12-26 03:34:44','2022-12-26 03:34:44',335),(7435,1295,'原型產品開發/驗證','2022-12-26 03:34:44','2022-12-26 03:34:44',336),(7436,1295,'在路上常常見到導盲磚，但許多導盲磚的設置十分不合理，使得視障人士無法按照正確且安全的路線行走。為此，我們設計一款戴在頭上的盲人頭帶。透過雷達感知周遭環境，並搭配算法分析，自動識別障礙物與危險區，並透過多個震動馬達與強度反饋給配戴者當前環境狀況，希望能藉此設備減少盲人外出發生意外的機率。','2022-12-26 03:34:44','2022-12-26 03:34:44',337),(7437,1295,'陳彥銘','2022-12-26 03:34:44','2022-12-26 03:34:44',338),(7438,1295,'羅翊迪','2022-12-26 03:34:44','2022-12-26 03:34:44',339),(7439,1295,'資訊管理系','2022-12-26 03:34:44','2022-12-26 03:34:44',340),(7440,1295,'C110118136','2022-12-26 03:34:44','2022-12-26 03:34:44',341),(7441,1295,'0965815123','2022-12-26 03:34:44','2022-12-26 03:34:44',342),(7442,1295,'C110118136@nkust.edu.tw','2022-12-26 03:34:44','2022-12-26 03:34:44',343),(7443,1296,'機電運輸','2022-12-26 03:34:44','2022-12-26 03:34:44',335),(7444,1296,'創業概念發想','2022-12-26 03:34:44','2022-12-26 03:34:44',336),(7445,1296,'一外掛式燈具，裝載於背包等配件，可於平常時自定義顯示圖案，同時可在機車騎行時連動機車警示燈提升機車騎士安全性。','2022-12-26 03:34:44','2022-12-26 03:34:44',337),(7446,1296,'薛博文\n陳宗澤','2022-12-26 03:34:44','2022-12-26 03:34:44',338),(7447,1296,'蔡秉宏','2022-12-26 03:34:44','2022-12-26 03:34:44',339),(7448,1296,'機電工程系智慧自動化組','2022-12-26 03:34:44','2022-12-26 03:34:44',340),(7449,1296,'C109107231','2022-12-26 03:34:44','2022-12-26 03:34:44',341),(7450,1296,'0984301988','2022-12-26 03:34:44','2022-12-26 03:34:44',342),(7451,1296,'bill051011@gmail.com','2022-12-26 03:34:44','2022-12-26 03:34:44',343),(7452,1297,'服務文創','2022-12-26 03:34:44','2022-12-26 03:34:44',335),(7453,1297,'原型產品開發/驗證','2022-12-26 03:34:44','2022-12-26 03:34:44',336),(7454,1297,'我們希望可以製作一個多功能的手機殼，加入蓄電、SD讀卡器、3.5mm耳機孔、無線充電與磁吸充電等功能','2022-12-26 03:34:44','2022-12-26 03:34:44',337),(7455,1297,'宋旗桂','2022-12-26 03:34:44','2022-12-26 03:34:44',338),(7456,1297,'侯博偉','2022-12-26 03:34:44','2022-12-26 03:34:44',339),(7457,1297,'電機工程系','2022-1