45',351),(7532,1305,'C110141263@nkust.edu.tw','2022-12-26 03:35:45','2022-12-26 03:35:45',352),(7533,1306,'服務文創','2022-12-26 03:35:45','2022-12-26 03:35:45',344),(7534,1306,'原型產品開發/驗證','2022-12-26 03:35:45','2022-12-26 03:35:45',345),(7535,1306,'初步構想：\n1.杯墊本體會以EVA泡沫板材為主，這種材料有優良的防撞防摔、抗腐蝕、防水性，且無毒無味。較木頭價格親民、較塑膠環保，是我們這次杯墊的第一選擇。\n\n2.包裝部份我們會以還原一個「三明治」為目標，因此以自行設計為主，購買現成三明治包裝為輔，整體的色調是透明/磨砂，配上簡明的標示，讓人可以一眼就看見內容物。\n\n3.宣傳部分我們會在兩片吐司中加入紙片，如紅色紙片作為「火腿」，在紙片內即可載入我們的商品理念等作為宣傳。再者，因為杯墊是日常用品，且以EVA做為主材料，成本並不高，在未來，紙片內容亦可添加或更換，讓學校、創創中心、企業等作為極佳的宣傳品或獎品。','2022-12-26 03:35:45','2022-12-26 03:35:45',346),(7536,1306,'陳建志','2022-12-26 03:35:45','2022-12-26 03:35:45',347),(7537,1306,'吳忠祐','2022-12-26 03:35:45','2022-12-26 03:35:45',348),(7538,1306,'企業管理系','2022-12-26 03:35:45','2022-12-26 03:35:45',349),(7539,1306,'C109157101','2022-12-26 03:35:45','2022-12-26 03:35:45',350),(7540,1306,'0907722563','2022-12-26 03:35:45','2022-12-26 03:35:45',351),(7541,1306,'C109157101@nkust.edu.tw','2022-12-26 03:35:45','2022-12-26 03:35:45',352),(7542,1307,'機電運輸','2022-12-26 03:35:45','2022-12-26 03:35:45',344),(7543,1307,'最小化可行性產品開發/驗證','2022-12-26 03:35:45','2022-12-26 03:35:45',345),(7544,1307,'本研究透過樹梅派搭配Python開發可攜式量測系統，透過快拆式的轉速量測機構，搭配架設於雲端的加速度演算法進行資料判讀，讓馬達量測可以普及至各式使用環境，同時也導入線上資料收集的軟體功能，於大數據的時代進行馬達的長時間監控，讓此套可攜式量測系統在產業界完整發揮其效益。','2022-12-26 03:35:45','2022-12-26 03:35:45',346),(7545,1307,'薛博文','2022-12-26 03:35:45','2022-12-26 03:35:45',347),(7546,1307,'周政穎','2022-12-26 03:35:45','2022-12-26 03:35:45',348),(7547,1307,'機電工程系','2022-12-26 03:35:45','2022-12-26 03:35:45',349),(7548,1307,'F111102119','2022-12-26 03:35:45','2022-12-26 03:35:45',350),(7549,1307,'0968515257','2022-12-26 03:35:45','2022-12-26 03:35:45',351),(7550,1307,'F111102119@nkust.edu.tw','2022-12-26 03:35:45','2022-12-26 03:35:45',352),(7551,1308,'服務文創','2022-12-26 03:35:45','2022-12-26 03:35:45',344),(7552,1308,'創業概念驗證','2022-12-26 03:35:45','2022-12-26 03:35:45',345),(7553,1308,'透過聲音及影像，帶給人們溫暖，去挖掘不一樣的故事，讓更多人看見！','2022-12-26 03:35:45','2022-1