:46','2022-12-26 03:35:46',352),(7704,1325,'服務文創','2022-12-26 03:35:46','2022-12-26 03:35:46',344),(7705,1325,'原型產品開發/驗證','2022-12-26 03:35:46','2022-12-26 03:35:46',345),(7706,1325,'在路上常常見到導盲磚，但許多導盲磚的設置十分不合理，使得視障人士無法按照正確且安全的路線行走。為此，我們設計一款戴在頭上的盲人頭帶。透過雷達感知周遭環境，並搭配算法分析，自動識別障礙物與危險區，並透過多個震動馬達與強度反饋給配戴者當前環境狀況，希望能藉此設備減少盲人外出發生意外的機率。','2022-12-26 03:35:46','2022-12-26 03:35:46',346),(7707,1325,'陳彥銘','2022-12-26 03:35:46','2022-12-26 03:35:46',347),(7708,1325,'羅翊迪','2022-12-26 03:35:46','2022-12-26 03:35:46',348),(7709,1325,'資訊管理系','2022-12-26 03:35:46','2022-12-26 03:35:46',349),(7710,1325,'C110118136','2022-12-26 03:35:46','2022-12-26 03:35:46',350),(7711,1325,'0965815123','2022-12-26 03:35:46','2022-12-26 03:35:46',351),(7712,1325,'C110118136@nkust.edu.tw','2022-12-26 03:35:46','2022-12-26 03:35:46',352),(7713,1326,'機電運輸','2022-12-26 03:35:46','2022-12-26 03:35:46',344),(7714,1326,'創業概念發想','2022-12-26 03:35:46','2022-12-26 03:35:46',345),(7715,1326,'一外掛式燈具，裝載於背包等配件，可於平常時自定義顯示圖案，同時可在機車騎行時連動機車警示燈提升機車騎士安全性。','2022-12-26 03:35:46','2022-12-26 03:35:46',346),(7716,1326,'薛博文\n陳宗澤','2022-12-26 03:35:46','2022-12-26 03:35:46',347),(7717,1326,'蔡秉宏','2022-12-26 03:35:46','2022-12-26 03:35:46',348),(7718,1326,'機電工程系智慧自動化組','2022-12-26 03:35:46','2022-12-26 03:35:46',349),(7719,1326,'C109107231','2022-12-26 03:35:46','2022-12-26 03:35:46',350),(7720,1326,'0984301988','2022-12-26 03:35:46','2022-12-26 03:35:46',351),(7721,1326,'bill051011@gmail.com','2022-12-26 03:35:46','2022-12-26 03:35:46',352),(7722,1327,'服務文創','2022-12-26 03:35:46','2022-12-26 03:35:46',344),(7723,1327,'原型產品開發/驗證','2022-12-26 03:35:46','2022-12-26 03:35:46',345),(7724,1327,'我們希望可以製作一個多功能的手機殼，加入蓄電、SD讀卡器、3.5mm耳機孔、無線充電與磁吸充電等功能','2022-12-26 03:35:46','2022-12-26 03:35:46',346),(7725,1327,'宋旗桂','2022-12-26 03:35:46','2022-12-26 03:35:46',347),(7726,1327,'侯博偉','2022-12-26 03:35:46','2022-12-26 03:35:46',348),(7727,1327,'電機工程系','2022-12-26 03:35:46','2022-12-26 03:35:46',349),(7728,1327,'C109154307','2022-12-26 03:35:46','2022-12-26 03:35:46',350),(7729,1327,'0910856819','2022-12-26 03:35:46','2022-12-26 03:35:46',351),(7730,1327,'c109154307@nkust.edu.tw','2022-12-26 03:35:46','2022-12-26 03:35:46',352),(7731,1328,'服務文創','2022-12-26 03:35:46','2022-12-26 03:35:46',344),(7732,1328,'原型產品開發/驗證','2022-12-26 03:35:46','2022-12-26 03:35:46',345),(7733,1328,'學用落差問題造成學生無法有效發揮潛能，也造成企業缺工現象增加，要如何從傳統教育體制思維下跳脫出來，透過不斷的興趣探索讓每個人都能適得其所，有效的發揮自己的長處。因此我們團隊設計卡牌先喚醒使用者自我意識，使其能夠安排妥當的時間使用在興趣探索上，讓時間很好的利用在熱情上，走對的方向，藉此以自身來縮小學用落差問題。','2022-12-26 03:35:46','2022-12-26 03:35:46',346),(7734,1328,'陳建志','2022-12-26 03:35:46','2022-12-26 03:35:46',347),(7735,1328,'陳昱欣','2022-12-26 03:35:46','2022-12-26 03:35:46',348),(7736,1328,'海洋休閒管理系','2022-12-26 03:35:46','2022-12-26 03:35:46',349),(7737,1328,'C108191158','2022-12-26 03:35:46','2022-12-26 03:35:46',350),(7738,1328,'0908258396','2022-12-26 03:35:46','2022-12-26 03:35:46',351),(7739,1328,'C108191158@nkust.edu.tw','2022-12-26 03:35:46','2022-12-26 03:35:46',352),(7740,1329,'資通訊','2022-12-26 03:35:46','2022-12-26 03:35:46',344),(7741,1329,'創業概念發想','2022-12-26 03:35:46','2022-12-26 03:35:46',345),(7742,1329,'由於保單類型眾多，整理保單不易，透過本應用程式統整保戶的所有保單，在取得保險公司授權同時，也以簡易的理賠指引讓保戶不再為了準備理賠資料而手忙腳亂。以乾淨簡約的商務風、人性化的按鈕設計，讓使用者不會找不到要使用的功能。','2022-12-26 03:35:46','2022-12-26 03:35:46',346),(7743,1329,'王友珊','2022-12-26 03:35:46','2022-12-26 03:35:46',347),(7744,1329,'吳佩庭','2022-12-26 03:35:46','2022-12-26 03:35:46',348),(7745,1329,'金融資訊系','2022-12-26 03:35:46','2022-12-26 03:35:46',349),(7746,1329,'C109161110','2022-12-26 03:35:46','2022-12-26 03:35:46',350),(7747,1329,'0975288926','2022-12-26 03:35:46','2022-12-26 03:35:46',351),(7748,1329,'c109161110@nkust.edu.tw','2022-12-26 03:35:46','2022-12-26 03:35:46',352),(7749,1330,'服務文創','2022-12-26 03:35:46','2022-12-26 03:35:46',344),(7750,1330,'原型產品開發/驗證','2022-12-26 03:35:46','2022-12-26 03:35:46',345),(7751,1330,'隨心變換收納版面 多種收納形式選擇 變換形式延長使用 變換模組無須工具','2022-12-26 03:35:46','2022-12-26 03:35:46',346),(7752,1330,'龔蒂菀','2022-12-26 03:35:46','2022-12