05-03 07:41:15',426),(10213,1928,'李真語','2023-05-03 07:41:15','2023-05-03 07:41:15',427),(10214,1928,'陳尚⺠','2023-05-03 07:41:15','2023-05-03 07:41:15',428),(10215,1928,'陳妍蓁','2023-05-03 07:41:15','2023-05-03 07:41:15',429),(10216,1928,'','2023-05-03 07:41:15','2023-05-03 07:41:15',430),(10217,1928,'陳建志','2023-05-03 07:41:15','2023-05-03 07:41:15',431),(10218,1929,'(一)地方創生類','2023-05-03 07:41:15','2023-05-03 07:41:15',418),(10219,1929,'吸引年輕人深度走訪橫山里並同時傳承無形文化資產','2023-05-03 07:41:15','2023-05-03 07:41:15',419),(10220,1929,'探訪橫山里時，發現當地有許多值得造訪的廟宇，古蹟，及自然景觀，但橫山里鮮少人造訪，特別是年輕人，因為當地特色景點為廟宇，透過訪問廟婆通常為中年以上較常造訪當地。也發現當地特產有農會販賣，廟宇有定期修建，但是沒有人傳承我們透過訪問居民才得知的橫山傳說故事（橫山蟒蛇精傳說）、以及曾經活躍的橫山宋江陣。除了年輕人不願意加入外，也很少人願意主動了解宋江陣知識，而這些無形文化資產若無人傳承，將會漸漸消失。','2023-05-03 07:41:15','2023-05-03 07:41:15',420),(10221,1929,'舉辦一場闖關逃脫遊戲，結合gps 功能app，以橫山蟒蛇精故事為背景，參與的人將化身為故事中被蟒蛇精抓的主角，根據app顯示線索到達橫山里特色地點闖關，要在該地點各處找尋app上跳出與地點相關問題的答案，每關過關後即可獲得宋江陣武器（第一關）宋江陣服裝（第二關）宋江陣陣形（第三關），即可獲得力量與蛇精對戰，最後蛇精道歉，表示自己居住環境受人類破壞才會想抓走人類作為報復，告訴玩家若能開始愛護環境，自己願意放玩家離開。最後關卡，玩家將撿取第四關地點-典寶溪邊垃圾，帶回起始地點，完成逃脫，遊戲結束，即可獲得當地商家消費卷。\n\n預期目標：\n1. 因以年輕人喜歡的密室逃脫為靈感，結合兒童或年輕人較少主動了解的傳說及宋江陣知識，讓更多年輕族群透過親身融入故事，加深對傳說及宋江陣知識的記憶。\n2. 希望能藉由此過關後贈送的消費卷禮物，振興橫山里商家店內消費。\n3. 闖關地點皆富有文化意義，關卡問題需透過玩家親自尋找地點中的線索（如廟裡石板上文字），因此能深度探訪當地特色景點。\n\n可行性：\n1. 活動人員：確認會與樹德科大USR團隊6/30-7/2將舉辦活動結合，樹德團隊人員當天會參與協助\n2. App製作：說明app功能後，樹德科大USR團隊已協助找到可製作出闖關app的同學\n3. 傳說紀念明信片製作費用、商家消費卷仍在與樹德科大討論中\n\n未來市場潛力：\n可定期更換傳說故事及遊戲內容，傳承更多傳說故事及文化知識，並與樹德科大USR團隊長期合作舉辦。','2023-05-03 07:41:15','2023-05-03 07:41:15',421),(10222,1929,'https://drive.google.com/open?id=1uMTa9ZC1Qi7zZxrDfATekQaMpuBUiHar','2023-05-03 07:41:15','2023-05-03 07:41:15',422),(10223,1929,'https://drive.google.com/open?id=1B_me_f4vDj8kksTDXsSM93D2vwLirZnI','2023-05-03 07:41:15','2023-05-03 07:41:15',423),(10224,1929,'','2023-05-03 07:41:15','2023-05-03 07:41:15',424),(10225,1929,'3','2023-05-03 07:41:15','2023-05-03 07:41:15',425),(10226,1929,'林貞均','2023-05-03 07:41:15','2023-05-03 07:41:15',426),(10227,1929,'陳柏攸','2023-05-03 07:41:15','2023-05-03 07:41:15',427),(10228,1929,'張涵甯','2023-05-03 07:41:15','2023-05-03 07:41:15',428),(10229,1929,'','2023-05-03 07:41:15','2023-05-03 07:41:15',429),(10230,1929,'','2023-05-03 07:41:15','2023-05-03 07:41:15',430),(10231,1929,'宋旗桂','2023-05-03 07:41:15','2023-05-03 07:41:15',431),(10232,1930,'(一)地方創生類','2023-05-03 07:41:15','2023-05-03 07:41:15',418),(10233,1930,'非洲河川污染嚴重，人民沒有乾淨的飲用水，所以我們想製作超大型濾水器，過濾量足以供應一個社區民眾日常用水。','2023-05-03 07:41:15','2023-05-03 07:41:15',419),(10234,1930,'非洲河川長年受到山上泥流、工業廢水、當地居民等等的汙染，而非洲的過濾水資源幾乎不能和其他國家相比，導致民眾的生活用水超級髒，連洗澡都泡在滿是垃圾的河川裡洗。而我們考量到非洲人口數量之龐大，用一般的過濾器根本不夠負荷，也不可能每一家都安裝一台，成本太高，所以決定製作一個過濾量超大的濾水器，以社區為單位，放置在社區內，供應這一區的人民使用。','2023-05-03 07:41:15','2023-05-03 07:41:15',420),(10235,1930,'在一般過濾器的基礎下，我們想保持過濾器在體積不變或者更小的情況，過濾出大量的水，這需要馬達的加壓，但馬達轉越快耗電量就會越大，於是我們想到可以結合太陽能板，利用太陽能板吸收到的能量轉化為電，在供應給馬達，馬達就可以瘋狂運轉，加大了流速我們就有了更大的流量，達到足夠提供社區的用水量。\n在台灣我們並不缺乾淨的水，但是在非洲他們很缺，但是為甚麼他們不進口使用過濾器呢?可能是價格太高負擔不起，或是買起來CP值太低了，而我們這台新型超大號社區濾水器，就能以超CP值的過濾量賣到非洲去。','2023-05-03 07:41:15','2023-05-03 07:41:15',421),(10236,1930,'https://drive.google.com/open?id=1lM7ie1xbVQtTF_X2GuhbzNZTZNG6gonS','2023-05-03 07:41:15','2023-05-03 07:41:15',422),(10237,1930,'','2023-05-03 07:41:15','2023-05-03 07:41:15',423),(10238,1930,'','2023-05-03 07:41:15','2023-05-03 07:41:15',424),(10239,1930,'3','2023-05-03 07:41:15','2023-05-03 07:41:15',425),(10240,1930,'鄭郁晨','2023-05-03 07:41:15','2023-05-03 07:41:15',426),(10241,1930,'蔡佩妤','2023-05-03 07:41:15','2023-05-03 07:41:15',427),(10242,1930,'羅麗燕','2023-05-03 07:41:15','2023-05-03 07:41:15',428),(10243,1930,'','2023-05-03 07:41:15','2023-05-03 07:41:15',429),(10244,1930,'','2023-05-03 07:41:15','2023-05-03 07:41:15',430),(10245,1930,'陳宗澤','2023-05-03 07:41:15','2023-05-03 07:41:15',431),(10246,1931,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10247,1931,'幫助弱勢族群提升理財能力計畫','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10248,1931,'發現新住民與原住民缺乏理財能力以及金融投資的知識，導致他們不懂的管理金錢甚至被詐騙，長期陷入在貧困裡面。','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10249,1931,'本執行方案將會採取每兩個月到偏鄉舉辦理財說明會、軟體試用以及心得分享會等活動，有利於當地民眾了解理財商品、學習正確的投資觀念，鼓勵民眾開始小額投資並且改善貧困問題，近一步找到存在價值過上夢想人生。\n   首先理財說明會，會組織社團志工同學一同前往偏鄉活動中心，教導當地民眾(原新住民)正確的理財觀，介紹7Trade如何使用等。\n   接下來會有一個月的軟體的試用期與心得分享會，教導民眾學習使用7trade與解決使用上的問題，同時也可以蒐集民眾的使用回饋近一步修繕軟體的缺失。在民眾都了解正確的理財觀念與投資工具的使用後，就可以鼓勵他們開始小額投資了。\n   說明會地點我們規劃在高雄杉林區、旗山區以及台南高雄屏東等偏鄉地區，原因為事前的統計結果指出高雄的原新住民人口是六都中排名第二，也因為我們所在學校為高科大選在南部也有利於組織活動。\n   另外我們的軟體參加過各項比賽均獲得不錯的成績，也有獲得企業認可簽約使用，因此可以提供民眾安心使用。','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10250,1931,'https://drive.google.com/open?id=15CtAhyBYGpUEopAIRAYyPpqsVjtokPxJ','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10251,1931,'','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10252,1931,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10253,1931,'4','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10254,1931,'陳佳聖','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10255,1931,'林昭賢','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10256,1932,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10257,1932,'希望發展布袋在地經濟、發揚地方特色，讓人們選擇回到自己的故鄉工作，以改善高齡少子化、城鄉發展不均等問題','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10258,1932,'海洋是生命的起源，但隨著近年氣候變遷、環境汙染，已嚴重威脅到海洋生態。\n目前世界各國積極推動守護海洋，提高環保意識，因此本團隊以海洋保育為出發點，結合地方創生，發揚台灣各鄉鎮的美。\n','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10259,1932,'\n希望藉由布袋特色：1海鹽（州南鹽場）：製作海鹽沐浴皂\n2布袋濕地生態園區：沐浴皂中公仔圖稿造型\n3沐浴皂盒：由淨灘中回收的塑膠、寶特瓶，再製而成\n','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10260,1932,'https://drive.google.com/open?id=10MWtheT0z28klrBVtubTs7bVI3_b2_Ft','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10261,1932,'','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10262,1932,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10263,1932,'4','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10264,1932,'曾映嘉','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10265,1932,'宋旗桂','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10266,1933,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10267,1933,'  百香果充斥在我們的生活中，我們卻不能完整利用百香果，所以我們將舊的食材做新的創意，達成零剩食的概念。​','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10268,1933,'在日常中經常使用到百香果，無論是飲品或是入菜，但對於百香果的食材利用並不完整，常會把百香果殼丟棄，造成食材浪費。​','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10269,1933,'我們將百香果拆成三道料理，內部果肉做水餃皮，白色內殼做百香果醬，紅色外殼做百香果乾。','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10270,1933,'https://drive.google.com/open?id=1mi8pmyRLW-4mPtGAalK0p_ARGuCufc_I','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10271,1933,'https://drive.google.com/open?id=1XFDIk3ncoo07ZtDcXDagW5PsAx_DEwiJ','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10272,1933,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10273,1933,'4','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10274,1933,'朱梓福','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10275,1933,'張珝丹','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10276,1934,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10277,1934,'因應鳳梨農民的需求，給予多功能軟體。','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10278,1934,'從小在鳳梨環繞的環境下長大，看著周圍的叔叔阿姨辛勤的在田地裡栽培鳳梨，走在路上都能聞到施肥的味道，但常常聽到阿姨在感嘆「雨季要來了，鳳梨要不好吃了。」、「夏天來臨的時候，蟲蟲也跟著飛來了，鳳梨要怎麼辦。」快接近產季時，叔叔阿姨為了要能及時採收，而採用催果生產，造成鳳梨風味不佳。所以我們決定為她們做出改善方法……','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10279,1934,'因此我們決定要創造一個多功能App\n來幫助生產者栽種鳳梨\nApp包含：\n1.日期計算：計算整地、基肥、覆蓋、採栽幼苗、種植、灌溉追肥除草、產期調整、防曬、採收時間\n2.監測氣候：監測雨季、日曬時間\n3.軟體機器結合：遠端遙控灑水、施肥、農藥\n4.評估施肥蟲害防治時機：農務決策數據化','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10280,1934,'https://drive.google.com/open?id=1nxMZk-Ye9Hqq9BlyfGPM-FJ5bYg0a3pi','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10281,1934,'','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10282,1934,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10283,1934,'4','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10284,1934,'方慈均','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10285,1934,'張珝丹','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10286,1935,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10287,1935,'解決屏東縣竹田鄉鳳梨葉的問題，並設計出鳳梨葉相關的產品來帶動環境永續及經濟循環。','2023-05-03 07:44:13','2023-