3),(10378,1944,'鳳梨水果很多人喜歡吃，但都只吃果實部分，葉子大多人都認為沒用就隨意丟棄，導致環境破壞等問題，但其實鳳梨葉還能再利用，能利用現代科技把鳳梨纖維給取出來，用來做衣服、包包等產品，根據現代疫情趨勢，可以利用鳳梨纖維來製作口罩，以解決鳳梨葉隨意丟棄之問題。','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10379,1944,'鳳梨纖維容易取得、容易種植、生長時間短、運輸便利等優勢，還能解決廢棄鳳梨葉問題，響應現在疫情關係，許多人都需要口罩，剛好可以利用這點來解決鳳梨葉的問題','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10380,1944,'https://drive.google.com/open?id=1_9iBsOtX_y1YoVGy47r4LBbrAz0s2hZ0','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10381,1944,'','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10382,1944,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10383,1944,'4','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10384,1944,'曾盈棕','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10385,1944,'陳建志','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10386,1945,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10387,1945,'鳳梨的種植而產生的農廢棄物導致環境破壞，我們提供了一些可行方案來處理這些農廢品。','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10388,1945,'大量的鳳梨廢棄物不僅浪費，也造成空氣污染、土壤酸化等嚴重問題，我們發現鳳梨的一些部位可萃取精華製成美妝用品等等，鳳梨皮、葉也都有其他意想不到的用處，若能更完整的將這些廢棄物善加利用，一方面解決了環境問題，一方面也是一個創舉。','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10389,1945,'鳳梨葉中的天然植物纖維可製成皮革、包包甚至紡織品等，製作過程環保也不傷害人體，且已經有人成功製造出此產品。鳳梨葉的廢棄物數量龐大，這項技術若仔細鑽研並善加利用，最基本的環境問題夠有效改善，且不僅能引起時尚圈的風潮，尤其在年輕族群更是一項引人注目的新品。','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10390,1945,'https://drive.google.com/open?id=1nb0DBrvc1csHji3PWqkneVdF_5GJi6GQ','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10391,1945,'','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10392,1945,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10393,1945,'5','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10394,1945,'高薪祐','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10395,1945,'陳建志','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10396,1946,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10397,1946,'製作一個APP來整合竹田周圍的特色景點,幫遊客規劃行程,介紹各景點的歷史與特色','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10398,1946,'遊客對竹田火車站周圍眾多的景點不知道從何一一逛起，而