4:13',438),(10543,1960,'4','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10544,1960,'鄭允菲','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10545,1960,'陳建志','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10546,1961,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10547,1961,'吸引年輕人深度走訪橫山里並同時傳承無形文化資產','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10548,1961,'探訪橫山里時，發現當地有許多值得造訪的廟宇，古蹟，及自然景觀，但橫山里鮮少人造訪，特別是年輕人，因為當地特色景點為廟宇，透過訪問廟婆通常為中年以上較常造訪當地。也發現當地特產有農會販賣，廟宇有定期修建，但是沒有人傳承我們透過訪問居民才得知的橫山傳說故事（橫山蟒蛇精傳說）、以及曾經活躍的橫山宋江陣。除了年輕人不願意加入外，也很少人願意主動了解宋江陣知識，而這些無形文化資產若無人傳承，將會漸漸消失。','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10549,1961,'舉辦一場闖關逃脫遊戲，結合gps 功能app，以橫山蟒蛇精故事為背景，參與的人將化身為故事中被蟒蛇精抓的主角，根據app顯示線索到達橫山里特色地點闖關，要在該地點各處找尋app上跳出與地點相關問題的答案，每關過關後即可獲得宋江陣武器（第一關）宋江陣服裝（第二關）宋江陣陣形（第三關），即可獲得力量與蛇精對戰，最後蛇精道歉，表示自己居住環境受人類破壞才會想抓走人類作為報復，告訴玩家若能開始愛護環境，自己願意放玩家離開。最後關卡，玩家將撿取第四關地點-典寶溪邊垃圾，帶回起始地點，完成逃脫，遊戲結束，即可獲得當地商家消費卷。\n\n預期目標：\n1. 因以年輕人喜歡的密室逃脫為靈感，結合兒童或年輕人較少主動了解的傳說及宋江陣知識，讓更多年輕族群透過親身融入故事，加深對傳說及宋江陣知識的記憶。\n2. 希望能藉由此過關後贈送的消費卷禮物，振興橫山里商家店內消費。\n3. 闖關地點皆富有文化意義，關卡問題需透過玩家親自尋找地點中的線索（如廟裡石板上文字），因此能深度探訪當地特色景點。\n\n可行性：\n1. 活動人員：確認會與樹德科大USR團隊6/30-7/2將舉辦活動結合，樹德團隊人員當天會參與協助\n2. App製作：說明app功能後，樹德科大USR團隊已協助找到可製作出闖關app的同學\n3. 傳說紀念明信片製作費用、商家消費卷仍在與樹德科大討論中\n\n未來市場潛力：\n可定期更換傳說故事及遊戲內容，傳承更多傳說故事及文化知識，並與樹德科大USR團隊長期合作舉辦。','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10550,1961,'https://drive.google.com/open?id=1uMTa9ZC1Qi7zZxrDfATekQaMpuBUiHar','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10551,1961,'https://drive.google.com/open?id=1B_me_f4vDj8kksTDXsSM93D2vwLirZnI','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10552,1961,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10553,1961,'3','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10554,1961,'林貞均','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10555,1961,'宋旗桂','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10556,1962,'(一)地方創生類','2023-05-03 07:44:13','2023-05-03 07:44:13',432),(10557,1962,'非洲河川污染嚴重，人民沒有乾淨的飲用水，所以我們想製作超大型濾水器，過濾量足以供應一個社區民眾日常用水。','2023-05-03 07:44:13','2023-05-03 07:44:13',433),(10558,1962,'非洲河川長年受到山上泥流、工業廢水、當地居民等等的汙染，而非洲的過濾水資源幾乎不能和其他國家相比，導致民眾的生活用水超級髒，連洗澡都泡在滿是垃圾的河川裡洗。而我們考量到非洲人口數量之龐大，用一般的過濾器根本不夠負荷，也不可能每一家都安裝一台，成本太高，所以決定製作一個過濾量超大的濾水器，以社區為單位，放置在社區內，供應這一區的人民使用。','2023-05-03 07:44:13','2023-05-03 07:44:13',434),(10559,1962,'在一般過濾器的基礎下，我們想保持過濾器在體積不變或者更小的情況，過濾出大量的水，這需要馬達的加壓，但馬達轉越快耗電量就會越大，於是我們想到可以結合太陽能板，利用太陽能板吸收到的能量轉化為電，在供應給馬達，馬達就可以瘋狂運轉，加大了流速我們就有了更大的流量，達到足夠提供社區的用水量。\n在台灣我們並不缺乾淨的水，但是在非洲他們很缺，但是為甚麼他們不進口使用過濾器呢?可能是價格太高負擔不起，或是買起來CP值太低了，而我們這台新型超大號社區濾水器，就能以超CP值的過濾量賣到非洲去。','2023-05-03 07:44:13','2023-05-03 07:44:13',435),(10560,1962,'https://drive.google.com/open?id=1lM7ie1xbVQtTF_X2GuhbzNZTZNG6gonS','2023-05-03 07:44:13','2023-05-03 07:44:13',436),(10561,1962,'','2023-05-03 07:44:13','2023-05-03 07:44:13',437),(10562,1962,'','2023-05-03 07:44:13','2023-05-03 07:44:13',438),(10563,1962,'3','2023-05-03 07:44:13','2023-05-03 07:44:13',439),(10564,1962,'鄭郁晨','2023-05-03 07:44:13','2023-05-03 07:44:13',440),(10565,1962,'陳宗澤','2023-05-03 07:44:13','2023-05-03 07:44:13',441),(10566,1963,'(三)海洋特色類','2023-05-03 07:56:53','2023-05-03 07:56:53',442),(10567,1963,'食用完的海鮮殼回收製成環保餐具，並將餐具固定於餐盒上。','2023-05-03 07:56:53','2023-05-03 07:56:53',443),(10568,1963,'問題1.因為我們食用完海鮮會剩下大量殼類海鮮垃圾。\n問題2.許多人不使用環保餐具部分原因是攜帶不方便覺得麻煩。\n問題3.我們使用的一次性餐具會造成大量垃圾','2023-05-03 07:56:53','2023-05-03 07:56:53',444),(10569,1963,'將食用完海鮮剩下的殼類製成環保餐具，回收再利用減少海鮮垃圾。並且設計餐具可以固定於餐盒上，解決攜帶不方便的問題。在不再使用貝殼製環保餐具後可製成肥藥用於施肥，減少塑膠餐具垃圾','2023-05-03 07:56:53','2023-05-03 07:56:53',445),(10570,1963,'https://drive.google.com/open?id=1VXm1AWaLJciiH6JvKo5ds4By62c2d-Pl','2023-05-03 07:56:53','2023-05-03 07:56:53',446),(10571,1963,'https://drive.google.com/open?id=1NT5A4kpXFLveUN2-oo5zJnqcDPBKt6Kx','2023-05-03 07:56:53','2023-05-03 07:56:53',447),(10572,1963,'','2023-05-03 07:56:53','2023-05-03 07:56:53',448),(10573,1963,'姚豫芳','2023-05-03 07:56:53','2023-05-03 07:56:53',449),(10574,1963,'陳建志','2023-05-03 07:56:53','2023-05-03 07:56:53',450),(10575,1964,'(三)海洋特色類','2023-05-03 07:56:53'