12',452),(10640,1971,'這個想法的由來是我跟朋友們經常不知道晚餐吃甚麼，附近的店家都吃過了，也不想叫外送或是跑大老遠去吃一頓晚餐，基於這個原因才有了這個想法','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10641,1971,'我們的想法是做成app，然後提供的服務就有例如可以選擇自己想吃的料理，並且尋找相關教學，都確定好之後再透過跟外送平台合作，將食物的原料外送到客戶家中，如此一來，客戶便能邊觀看教學邊實際動手將料理製作出來。再來是技術方面，因為是做成app所以一些現有的app開發軟體就很好用，至於做菜的教學則是跟各方餐飲專業人士合作，盡可能的保障客戶的體驗，至於用戶端驗證這方面應該不會太嚴格，像一般外送平台的基本電話驗證就行，畢竟主要是提供便利的服務。我認為在現在萬物皆漲的時代，前幾年又經過疫情的考驗，像這樣便利的服務應該會有許多人支持；人們現在更追求健康的飲食，像是歐美就很盛行自己下廚，我認為這項服務是很有發展潛力的','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10642,1971,'https://drive.google.com/open?id=1uWV_7Suh9FA0Y6asaqol-nfJYPkWa1Ni','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10643,1971,'https://drive.google.com/open?id=1hQmyO549xWIT9ODV5A3VN9RZ6B20B-hT','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10644,1971,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10645,1971,'劉晏哲','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10646,1971,'陳怡君','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10647,1972,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10648,1972,'不需要外界干預的情況下，自動完成刷牙和洗臉。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10649,1972,'現代人的生活節奏越來越快，有時候很難有足夠的時間梳洗，尤其是在早上趕時間或是出門前匆忙的情況下。這樣的情況不僅會一整天臭臭，也可能影響到個人的健康和工作效率。在早上趕著去上班、上學，或是需要快速準備好外出的行程，因此沒有足夠的時間進行梳洗。我們認為可以開發一個自動化的梳洗裝置讓人們在趕時間的情況下也能夠完成基本的梳洗。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10650,1972,'自動清潔裝置的雛形\n下面附有立柱可依照自己適合的高度調整\n有兩隻機械手臂(自動洗臉機)\n裝置可以透過speak功能接收對話傳到主機在顯示相關資訊於螢幕上\n如果選擇刷牙，裝置會伸出將附有電動功能的牙刷機械臂\n使用者必須配合張開嘴以方便裝置清潔。\n選擇洗臉則是兩個自動洗臉機機械臂根據使用 者臉部資訊(sensor)去調整按摩、清潔軌跡。\n\n我們統整出五項分別是主要客群、功能、還有挑選出來的三項服務。\n1.主要客群: 分為企業用及家用\n企業用_可以用在工業上與醫療。\n家用_大人、小孩、老人\n2.客製化: 組件客製化、酷炫外觀客製化\n3.技術:自然語言辨識、人工智慧、感測器\n4.功能:洗臉刷牙提神\n5.資源快遞: 可以寄送補充包到你家大門口\n\n裝置的互動性、要件、客群、使用的時機、和使用的場合。\n1.互動性: 將你的臉靠到機器上使用這項裝置、材料補給-當耗材不足時，自動補充、緊急停止按紐-當機器發生故障或失控時，按下緊急按鈕即可停止運作、電源及設置\n2.要件: 包含這個裝置所需的工具、電子裝置與補充材料，所需的工具有牙刷、毛巾、海綿、U型支架，而所需的電子裝置有按鈕、馬達、感應器，最後牙膏、水、洗面乳和魔爪是需補充的材料。\n3.客群: 基本上是所有人，老弱病殘婦幼都可以用。\n4.使用時間: 早上、晚上。可以每天使用。\n5.使用的場合: 可以在網咖、公司宿舍、宿舍、飯店、家中使用。\n使用的時機: 早上、活著的時候、去上課上班前、還有到拍攝現場的時候。\n\n預計達成目標:\nphase1:裝置能夠完成洗臉功能\nphase2:裝置能夠偵測使用者生物特徵\nphase3:裝置能夠使用機械臂完成刷牙功能','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10651,1972,'https://drive.google.com/open?id=1TuFvH5tLz-osnZgMPDlAfNjYRmzYVDgs','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10652,1972,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10653,1972,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10654,1972,'袁祥竣','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10655,1972,'陳怡君','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10656,1973,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10657,1973,'此App是為解決美食資訊更新不即時且不多元，以及評論的真實性。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10658,1973,'當你來到一個陌生地，會想品嘗當地的美食，如今的App資訊更新不即時且不多元，除此，留言評論也時常有造假的問題發生，並沒有一個準確的參考值，因此，我們組想藉由所發想的App來解決上述所描述的問題。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10659,1973,'我們會以願意實施線上菜單的業者進行合作，以及請專員或網路創作者以特定符號標註該帳號，藉此雙方來達成信任，除此，會要求裝置來綁定帳號，以免刷帳號降低評論真實性。比較特別的是，我們具有獨特性的服務，因此比其他軟體有更真實的評論、設有新聞資訊以及商家公告，能即時更新資訊和價格來讓顧客安心，而此App還有隨機轉盤功能，這是在各大美食軟體上沒有的，可以讓顧客沒有選擇困難的困擾。\n我們可行性評估總共分為三點，分別為GPS定位系統、大數據分析、AI智能科技技術。此App首頁使用到GPS定位，來自動搜索使用者附近美食，除此也能手動搜索想去的任何地方；藉由大數據分析以及AI智能科技分析出使用者的喜好，將美食推薦至版面上，讓使用者減少搜索的時間。\n而我們預計達成的目標下載量在3到5年內能達到50萬次的下載次數，推廣的部份主要是藉由社群媒體的廣告，預計廣告收益在下載量到達100000會有幾萬美元收益。現在美食已成為流行話題之一，因網路社交媒體逐漸發展網路上已經有instagram和youtube的美食博主已成為主流，若是趕上這波美食潮流且服務內容符合客戶需求所潛在的能力將會爆發並帶來極高的收益。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10660,1973,'https://drive.google.com/open?id=1ixLydSHq31bWuF7_PmLNw73wwCbm9mjO','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10661,1973,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10662,1973,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10663,1973,'葉昱銘','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10664,1973,'巴慧玲','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10665,1974,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10666,1974,'市面上的瓶瓶罐罐易殘留液體，我們的產品輕易就做到了不殘留','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10667,1974,'問題現況:洗髮精/牙膏用到最後都會殘溜一些在包裝裡面，然而包裝的容器大多深且洞口小，用小工具也不太好出來\n需求定義:消費者需要更好的設計以解決內容物殘留的問題','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10668,1974,'技術:1.可調節瓶蓋設計：可拆下裝至其他瓶身調整配合其洞口\n         2.使用鈦觸媒催化合成纖維，降低摩擦力和回收再利用成效\n          （鈦觸媒=當今酯粒中最環保、技術門檻最高，經濟成本合理）\n         3.瓶身無角設計：液體不易殘留\n         4.複合式DIY：吸引家庭購買\n預計達成目標&未來市場發展潛力:設定瑕疵率為2%\n                                                          銷售額為442,530,000元\n                                                          成本為300,000,000元\n                                                          毛利為142,530,000元\n','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10669,1974,'https://drive.google.com/open?id=1H74i78BTtZep01vW3ZIkAoCNRvHwWjg9','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10670,1974,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10671,1974,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10672,1974,'王愷騏','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10673,1974,'巴慧玲','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10674,1975,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10675,1975,'設計積木造型的延長線，解決電線雜亂、容易斷掉...等問題。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10676,1975,'由於現代人生活與工作上的需求，常常需要使用到各種不同的3C產品，讓周遭同時存在很多電線，而造成了電線雜亂、糾纏再一起等問題，不光是使用不便，也會產生安全疑慮。一般的延長線無法解決電線收納的問題，且因為大多數人使用的方式而導致電線頭損壞率上升，因此本組決定結合以上發現的問題，創造一個全新的延長線。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10677,1975,'本組發現目前市面上的延長線商品都缺乏能一次解決線材雜亂、安全性、線頭易損壞的問題，因此本組決定設計一個能解決以上問題的延長線。積木造型的外觀，除了增加商品美觀性，也能讓消費者像玩玩具一樣自由組裝成自己需要的樣子；目前市面上的延長線技術相當成熟,我們將各優點整合在一起形成多功能插座,且以不同的造型與多功能吸引消費者目光,進而達成銷售目的','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10678,1975,'https://drive.google.com/open?id=1GaLdEnag0SHVfgpxmA4Ete9cLUscq0PE','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10679,1975,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10680,1975,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10681,1975,'蔡昀珈','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10682,1975,'陳建志','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10683,1976,'(四