2rxHdrn','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10724,1980,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10725,1980,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10726,1980,'徐宗民','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10727,1980,'陳建志','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10728,1981,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10729,1981,'利用磁吸式和客製化，達成市面上萬向輪不美觀而且用途侷限，希望達成不破壞而且堅固耐用。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10730,1981,'搬離宿舍或搬家時，除了尋找新家外最大的問題就是搬家，想到有一堆家具搬不動後，我們就開始思考要如何解決這個問題。從生活中移動重物的不便，例如搬動家具或大型物品，因為力氣有限，時常放棄想移動這個東西的想法。所以我們想了一個解決辦法：在任何重物底下裝上輪子。\n','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10731,1981,'設計理念 : 輕鬆移動，不需破壞，耐用且美觀\n功能 : 取代傳統螺絲固定的萬向輪，利用強力磁鐵的固定方式就能輕鬆移動物品。\n造型 : 360度萬向滾輪含腳踩煞車，多種顏色的鋼琴烤漆。\n材質 : TPU、不鏽鋼、強力磁鐵、可水洗奈米膠、SKF強化培林軸承。\n使用方式 : 將物品表面清接乾淨後黏上隨附的強力磁鐵(奈米膠片已黏貼在磁鐵上)，在吸上輪子本體即可使用。\n產品組合 : 萬向輪本體*4 + 強力磁鐵*4 (含膠) + 清潔酒精棉片*2 + 使用說明。\n\n技術:\n304不鏽鋼 - 食品級不鏽鋼，相較於200系工業不鏽鋼有更好的抗腐蝕性和強度。\nSKF培林軸承 - 有軸承的輪子，載重時輪心比較耐磨，可以讓台車負重時推動起來很輕巧\n可水洗奈米膠\n釹鐵硼磁鐵 (強力磁鐵)\n輪子種類 - 雙軸承靜音輪\n輪皮材質 - TPR 材質耐水耐酸且輪面光滑具有彈性，耐磨性，抗衝擊性，減震性和靜音，與地面碰撞時，會有緩衝效果，可以保護地板。\n\n預計達成的目標 -----\n    販售定價:單顆 $ 250  / 一組 $ 950\n    耗材 : 磁鐵 $ 50 / 片 、 奈米膠 $100 / 4片 \n    預估一年銷售數量達 : 300 - 400組\n    銷售額 : 300 - 400萬\n\n未來市場發展潛力 -----\n朝女性、老年人或是腰、背部受傷者。\n開發應用於不同場合得滾輪材質(輪皮)。\n外觀可以配合家俱訂製設計，顏色客製化。\n\n\n','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10732,1981,'https://drive.google.com/open?id=1euKc_g7ZI2yiK6UG19Yi_E8TfswOZNtc','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10733,1981,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10734,1981,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10735,1981,'劉彥廷','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10736,1981,'巴慧玲','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10737,1982,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10738,1982,'使用即期罐頭與當季蔬菜所組成的食物百寶箱','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10739,1982,'解決大賣場罐頭與蔬菜水果過剩的問題','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10740,1982,'利用加工廠商的即期罐頭和在地農夫種植的當季蔬菜製作出食物百寶箱，消費者可以用更低廉的價錢購買到食材，預計達到食物不浪費、減少地球暖化的效益。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10741,1982,'https://drive.google.com/open?id=1Bd_Z_5foyf_imI_o18mgh_d33Y7laX-X','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10742,1982,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10743,1982,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10744,1982,'李家昌','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10745,1982,'宋旗桂','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10746,1983,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10747,1983,'利用感溫變色技術結合碗底的圖案達成促進商業活動以及減少食物浪費的目標','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10748,1983,'如果只是一般碗底由圖案的碗的話可能會有店家黑箱作業的風險。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10749,1983,'透過需要溫度變化才會顯現圖案的碗，結合QRcode技術，就能夠為商家吸引客群，同時為客人帶來樂趣以及增加客人吃完食物的意願。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10750,1983,'https://drive.google.com/open?id=105d9588HceRodgalKHCCpu9Xx3VGrdd-','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10751,1983,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10752,1983,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10753,1983,'蘇宥維','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10754,1983,'巴慧玲','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10755,1984,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10756,1984,'以手搖飲自動販賣機及配套系統達成手搖飲產業自動化','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10757,1984,'近年來台灣生育力過低，基本工資上漲，人力成本將越來越高，甚至是人力短缺。除了人力成本外，租金的高漲、人員流動率高、消費者偏好變化也是飲料業的困境，成本的增加將影響消費者的購買力也引響業者的獲利，甚至使CPI上漲。\n我們可以看看日本，日本較少飲料店，而是滿街的自動販賣機。日本的經濟發展歷史也與台灣類似，而現在台灣高齡化及少子化也是和日本似曾相似，因此我們可以從日本的現況看到台灣未來的趨勢。因此我們為台灣手搖飲文化及因應營業成本增加設計了手搖飲自動販賣機及一系列的配套系統。(更詳細內容可察看以下簡報)','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10758,1984,'我們設計了一台手搖動販賣機，並為此自動販賣機設計物流、資訊流及商流的系統，接著我們有做SWOT分析及五力分析，分析技術和市場的可行性，像是需要有互聯網技術、機械設計技術、原料保存及加工技術，除了這些技術還需要其他多項技術，須結合多個領域的專家來實現像是機械工程師、資訊工程師、食品研究專家…，不過這些技術現在皆已存在，只是需要將技術整合。\n台灣的手搖飲市場是年年成長的，即使遭遇疫情也能在疫情後迅速重振市場，另外台灣手搖飲市場也是獨占性競爭市場，要進入也相對其他產業容易，因此只要能控制好成本、維持商品及服務品質、持續創新即可瓜分這一塊大餅(更詳細內容可察看以下簡報)。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10759,1984,'https://drive.google.com/open?id=1mUNEJjQrSHuNnvntzC4STo8WucABLyqB','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10760,1984,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10761,1984,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10762,1984,'張任沂','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10763,1984,'劉處英','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10764,1985,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10765,1985,'將藥局透過販賣機形式，讓急需、不方便的人 “隨時””隨地”取得藥物','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10766,1985,'1.半夜藥物難以取得\n2.領藥過程繁瑣且費時','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10767,1985,'1.24H的自動販賣機，解決無法及時取得藥品的困擾\n2.對於領處方藥路程遙遠的民眾，透過藥局配送至智慧領藥櫃，供行動不便的的居民領取','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10768,1985,'https://drive.google.com/open?id=1AIk5YiXDspzszLhpCPETE_8TocIM3YfX','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10769,1985,'https://drive.google.com/open?id=18wtsUgKKBY9DXG6tfHMmiaQAQTk2NpwS','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10770,1985,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10771,1985,'邱聖鈞','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10772,1985,'張婷媛','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10773,1986,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10774,1986,'利用一般民眾的汽車互相租借，提供給出去玩的人使用。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10775,1986,'台灣地狹人稠，時常連假高速公路就經常塞車，塞車不但會造成環境汙染，二氧化碳的排放量增加，長時間開車會造成疲勞駕駛，容易發生意外。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10776,1986,'透過點對點的方式，假設Ａ家庭要出去玩，能夠將鑰匙給予本團隊保管，Ｂ家庭來到了當地想要租車，就能夠向本團隊租借Ａ家庭的汽車鑰匙，Ａ家庭不但在出去玩的期間，能夠有租車的收入，也能夠減少長途開車的風險，同時Ｂ家庭也能夠開心地開著車出去玩。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10777,1986,'https://drive.google.com/open?id=1GHEwADCsgF1Yr7yjgUBjrlRocf7NreKU','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10778,1986,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10779,1986,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10780,1986,'黃威揚','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10781,1986,'宋旗桂','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10782,1987,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10783,1987,'以高科第一校區的植物之美進行設計，推出一款蒐集植物圖鑑APP，讓學生提高走入自然的意願。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10784,1987,'現代學生都長時間待在宿舍或家中滑手機，沒有機會體驗自然的美好!','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10785,1987,'推出一款可實踐並直接上市的APP，供學校推行實驗教學使用，達到提升學校學生生活品質目標。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10786,1987,'https://drive.google.com/open?id=1TnnyFETkp8k7je7mlFr3JtLkFSEpommz','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10787,1987,'https://drive.google.com/open?id=1Z3IKxSkPd60Yx7XvQvSGAJfuHq7mw47K','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10788,1987,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10789,1987,'魏國順','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10790,1987,'宋毅仁','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10791,1988,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10792,1988,'利用滑坡、分類器、收納盒，完成減少接觸客人零錢的時間','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10793,1988,'現今，疫情遍及整個社會，許多人為了避免有感染的風險，出門都會戴口罩及攜帶酒精隨時消毒雙手，而在服務業必定會接觸客人而增加染疫的風險情況下，我們在盡量減少與客人接觸的前提，便想到如果能減少觸碰客人零錢的時間或是直接不觸碰，那染疫風險也能降低許多。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10794,1988,'透過參考網路上的零錢分類裝置，針對複數個硬幣進入分類會使分類器卡住的問題，利用在櫃檯挖出一個斜坡並使其水平開口面積縮小，小至最後可以限制一次一枚硬幣進入分類器，而後分別透過收納盒收集並得知數量，以及利用蜂鳴器提醒店員有收納盒即將裝滿並做更換。\n\n雖說其不及自動點餐機和繳費機的結合，但對於資本較少的店家可透過此產品來達到減少接觸\n客人硬幣的時間，進而降低染疫風險。少了將零錢分類後放入收銀機的動作，就能多做幾秒鐘的消毒。對於沒有資本協助或沒有充足的資金購入能自動結帳的機器的店家，如果都能擁有這項產品，皆能有效減少細菌病毒的傳播。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10795,1988,'https://drive.google.com/open?id=1KBe2LLKvTBNOnSY7A0OzPpDg-LpJIWFq','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10796,1988,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10797,1988,'https://drive.g