口罩都用嘴巴呼吸容易造成口臭，唾液也會減少，影響健康。\n4.抽菸後，能夠讓口腔的菸味減緩。\n以上四點都是發現的問題及相關需求的說明，這些都是日常生活中一定會面臨的窘境或問題處。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10821,1991,'口腔清新噴霧體積小，能夠方便攜帶。\n產品內加入薄荷可達到提神醒腦的效果。\n隨時隨地解決口腔異味問題。\n這些解決方法都能有效針對我們的產品達成，對於市場的發展潛力就必須要做出區隔性或特定某族群，這也是我們的目標!','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10822,1991,'https://drive.google.com/open?id=1h7Lb0iy_NUya-Da4NuFq651G0Fl7GVFB','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10823,1991,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10824,1991,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10825,1991,'陳誼姍','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10826,1991,'張珝丹','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10827,1992,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10828,1992,'Educational Bank：以群眾集資+NFT債券為核心之新型態P2P借貸平台','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10829,1992,'學生就學貸款為我國政府培育國家人才之德政措施，幫助無數學子向學，依據教育部統計資料顯示台灣每年至少42.4萬人次申請就學貸款，顯示需求顯著。\n申請資格限制-排富條款、無法真實反映學生家庭經濟能力與需求\n核貸項目限制-以學雜費、書籍、住宿等校園學習項目為核心，但部分項目不足支應真實需求及核貸學生個人其他職涯專業學習需求。\n生活費為例，僅有具備中低收入戶證明之學生才能申請貸款，生活急難部分更不在核貸項目中','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10830,1992,'我國政府雖已經為國家高等教育人才培育發展出盡善盡美的就學貸款措施，但仍有一些申請資格限制-排富條款：無法真實反映學生家庭經濟能力與需求、核貸項目限制-以學雜費、書籍、住宿等校園學習項目為核心、部分項目不足支應真實需求…等需求缺口，因此本團隊期盼能夠集結大眾社會力量透過本計畫 Educational Bank讓同學能夠有更多元的合法資金取得來源、針對未來職涯發展需求或興趣投入更多元的學習。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10831,1992,'https://drive.google.com/file/d/1u4xcce-YNHYTpphCmXPRBGN4JXMk11zc/view?usp=sharing','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10832,1992,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10833,1992,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10834,1992,'廖翊翔','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10835,1992,'陳宗澤','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10836,1993,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10837,1993,'行車時它是你的守護者，行人是它將是你最特別的自我介紹，。 ','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10838,1993,' 在台灣機車是每個人的好夥伴，它帶領每個人自由的漫遊在這美麗的城市，但意外的發生總是突然，在台灣機車的車禍數一直居高不下，這讓我們十分痛心。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10839,1993,'為了解決這個問題我們決定延用汽車第三煞車燈，創造一個能讓機車騎士配戴並連動煞車及方向燈的產品，藉以縮短後方駕駛人約35~67毫秒的接收時間，多爭取到1~1.6公尺的剎車距離，降低意外的發生。並且還增加了自定義顯示動畫的功能讓行人配戴時為生活增添樂趣，同時也創造只屬於你的風格宣傳。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10840,1993,'https://drive.google.com/open?id=1gaD6PhQqiJxb2RmgMZBdudYZXTkz0PMw','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10841,1993,'https://drive.google.com/open?id=10-6mtLepkaAimN-yuyKueVFyguAWUd26','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10842,1993,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10843,1993,'蔡秉宏','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10844,1993,'薛博文','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10845,1994,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10846,1994,'以循環經濟的概念為主軸，用廢棄椰子殼做發想，改善屏東環境汙染的問題。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10847,1994,'(一)椰子廢棄物處理困難\n　　由於國內環保意識抬頭，販運商及零售商需負責處理椰殼等廢棄物，此增加之成本負擔會轉嫁到生產者與消費者，若無妥善處理，也會造成環境汙染。\n(二)國產椰子無特色又具易替代性\n　　椰子鮮果在台灣之消費屬性為易替代性之產品，並非每人每日均必需食用，且消費者對國產椰子與國外進口椰子之偏好並不明顯。又國人以飲用椰子汁為主，加工製成之罐裝椰汁飲料商品有替代性，造成椰子有供過於求的情況發生。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10848,1994,'(一)調整產業結構\n　　砍伐之椰株殘株應妥為處理，使「資源再生利用」並減少廢棄物處理量，期達到「物盡其用」。我們運用椰殼纖維做成包裝，極具特色的包裝不但能吸引顧客購買，也能進一步達成循環經濟之概念。\n(二)發展觀光休閒旅遊文化產業\n　　運用高屏地區氣候環境特色及椰子所形成之特殊景觀，創造商機，改變以果實為唯一收入之產業結構。我們將椰絲、外果皮、內果皮做充分利用，可做成各式椰子周邊商品，吸引遊客前來竹田觀光，也帶動屏東的觀光產業，讓大家知道，除了墾丁，屏東仍有許多極具特色的人文景觀值得一去。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10849,1994,'https://drive.google.com/open?id=1YT-Sayh6drdXw16uHe6QUbIp4EymfCFl','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10850,1994,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10851,1994,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10852,1994,'陳建群','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10853,1994,'陳建志','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10854,1995,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10855