5-24歲)，所以將集中討論校園部分。利用Robot Asher與學校合作或與社群結合（Line…)，根據輸入的資料，產出相應的回答，並將每筆資料進行編碼，還可延續之前的諮詢內容持續討論，以利後續追蹤及觀察諮詢者的狀況','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10876,1997,'https://drive.google.com/open?id=1tXukEjrj5jnDIPpNm9F6tlwLShuGGUtP','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10877,1997,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10878,1997,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10879,1997,'施詠絜','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10880,1997,'陳宗澤','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10881,1998,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10882,1998,'使客戶在商場購物或是結帳時更為便利','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10883,1998,'去便利商店或大賣場的時候會有找不到商品對應的價格小卡 而商品上又沒有標示的時候我們就會去請店員幫忙刷條碼看價錢 或是到了結帳的時候櫃檯人員說出促銷話術之後才發現這個商品買二送一 但如果已經走到賣場尾端 通常都不太會想走回去多拿商品 但如果在拿取商品時就知道商品的資訊 這樣可以解決許多麻煩 所以就有了智能購物車的存在。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10884,1998,'商品有任何資訊 例如優惠活動 存放期限 製造日期都可以透過購物車上的QR code連進網站查詢 並且該網站還能管理購物車的狀態 並且還能結帳 針對大部分年輕人都不太會帶太多東西出門 所以希望客戶只需要帶一支手機出門 即可在商場完成大部分的動作 ','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10885,1998,'https://drive.google.com/open?id=1OJPThJ2m_rLl6h4elZTXgqBAAzZ_52J1','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10886,1998,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10887,1998,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10888,1998,'何亭寬','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10889,1998,'李國維','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10890,1999,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10891,1999,'結合多種球類在單一球架，減少分別購入的成本及提高球架實用性。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10892,1999,'一般民營運動場都只提供單一球類，導致場地不能發揮最大效能，然而是因為購入多項器材有許多不利之處，因此我們希望能幫助商業客，讓場地發揮到最大效能。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10893,1999,'我們將球架結合三種不同的球類運動，在設計方面我們也達成架設時能省時省力，，不但為商業客提供更多可能，也為會到運動場運動的客人打造更多不同的運動選擇。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10894,1999,'https://drive.google.com/open?id=1VyuDeL3VPeyFokQiagIBM4rEPtwH3mel','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10895,1999,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10896,1999,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10897,1999,'周柏瑄','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10898,1999,'宋旗桂','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10899,2000,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10900,2000,'主動控制的內外循環系統，填補低階車款的定時切換與高級車款的淨化空氣之間的空缺，兼顧安全與成本。','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10901,2000,'汽車內外循環各有優缺點，需駕駛視情況自行切換，現今車款皆有切室內循環後30分鐘自動切回外循環的功能來避免缺氧，而高階車款的淨化系統如Volvo Clean Zone或是Tesla HEPA 過濾系統，與之類似的系統皆裝配於高階車款上，過於昂貴並非人人皆可享受到的。而駕駛若因廢氣、臭味等因素想切回內循環時便會使雙手與視線無法專注於路況，而帶有致癌物質的廢氣長期下來更可能對駕駛與乘客造成不可逆的傷害，更甚如一氧化碳這種無色無味的氣體更會不知不覺間奪走駕駛的性命。 因此我們想開發一款可以自動偵測車內與車外空氣品質並即時做出調整的切換系統。讓汽車在兼顧成本與安全、舒適的情況下保護駕駛與乘客。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10902,2000,'我們所想出的解決方法就是加裝空氣品質感測器，偵測馬路上常見的有害氣體讓系統依照優先級別切換內外循環，如二氧化碳的立即危害性較大因此濃度超標時立即開啟外循環無論懸浮微粒或細懸浮微粒品質是否超標。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10903,2000,'https://drive.google.com/open?id=19iGq6Qv8NumL-iWrCiwkxQQhbTj6c27J','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10904,2000,'https://drive.google.com/open?id=1fY1CDZjDCQZI62oS2coRLOMOVkOKPrdM','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10905,2000,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10906,2000,'周邑倫','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10907,2000,'宋旗桂','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10908,2001,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10909,2001,'利用紅外線感測器掃描電動車輛及電池存放的位置做自動更換','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10910,2001,'及行動不便的顧客可能操作下來有困難','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10911,2001,'由機器手臂拿取車廂內需更換的電池，放入系統已確認的位置後，拿取充電完畢的電池','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10912,2001,'https://drive.google.com/open?id=1aCL2lJ8WWFX5fZCULAu4bBkZeKviwDdN','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10913,2001,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10914,2001,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10915,2001,'劉峻廷','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10916,2001,'張婷媛','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10917,2002,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10918,2002,'一個防止安全帽被偷的安全帽防盜裝置','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10919,2002,'由於現在機車為了美觀車廂越做越小，導致四分之三或全罩的安全帽放不下，放坐墊或腳踏墊容易被偷，下雨時也會被淋濕。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10920,2002,'設計一個具有防盜、防水且具一定的載貨能力的安全帽防盜裝置。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10921,2002,'https://drive.google.com/open?id=1GFRmwVSItOAS_p017MAc7q0ASBF5ebaL','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10922,2002,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10923,2002,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10924,2002,'林永濬','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10925,2002,'宋旗桂','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10926,2003,'(四)自命題類','2023-05-03 07:57:12','2023-05-03 07:57:12',451),(10927,2003,'自動製作飲料的機器，改善現有飲料店營業生態','2023-05-03 07:57:12','2023-05-03 07:57:12',452),(10928,2003,'我們有組員在飲料店打工，該組員發現在打工時有許多狀況 與問題，嚴重的還有客訴的情況。主要問題為:飲料泡錯、糖冰不對、等待時間過長、找錢找錯等等。還有一些小問題:環保杯沒有 辦法事先製作、奧客讓店員心很累、單量過多店員應付不來等等。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10929,2003,'而我們考慮到這個問題覺得我們可以利用一台機器來解決這些服務上的問題，而機器製作可減少\n人與病毒的接觸及減少人與飲料的接觸。且有點餐機可以使用，支援線上點餐，避免店員點錯飲料以及溝通障礙。而環保杯的問題，在目前的飲料店當中，是無法為使用環保杯且電話預訂的客人先行製作飲料，在自動手搖飲料機器的部分可以先行製作並先冰在冰箱等客人到店取貨時在幫客人倒進環保杯當中，且我們使用重複利用的不銹鋼杯可清洗環保又衛生。再來是線上支付可以減少交易時間。而現金的部分是由點餐機找錢，不會發生找錯錢的問題。再加上由機器製作，飲料出餐快速且不易泡錯。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10930,2003,'https://drive.google.com/open?id=1hzpnGexlNaF0PtL848VRJI0ScGhnsdTO','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10931,2003,'https://drive.google.com/open?id=1geONk16jehkX8KEskVyaQElBh_FUVs9E','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10932,2003,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10933,2003,'洪紀茹','2023-