內市場需求，需從國外大量進口紅豆。雖然進口紅豆品質不如萬丹紅豆，但紅豆加工成甜品後，吃不出兩者原本的風味、口感差異，因此價格較高的本土紅豆難以和進口紅豆競爭。\n當地農會目前策略是維持品質並提高產量，未來希望針對品種特色來研發加工品。我們認為可運用萬丹原有的特色，為加工產品設計出具有品牌識別度的包裝，同時增加買氣。','2023-05-03 07:57:12','2023-05-03 07:57:12',453),(10956,2006,'一、產品設計理念\n1. 包裝\n提到萬丹紅豆的延伸產品，就會想到紅豆餅，具有相當的辨識度，因此包裝設計成紅豆餅主要是為了讓顧客聯想到萬丹，而部分原因是考量到份量。市面上的麥片脆果都是一大包很容易吃過量，也不好保存；而小小的紅豆餅份量適中，平時嘴饞或是下午茶當作小點心就很方便。如果利用紅豆餅的內部空間當作碗，就能盛裝飲品，加入牛奶搭配脆果更有飽足感。另外禮盒包裝是以烤盤發想，禮盒攤開就像紅豆餅攤販的烤盤，為商品增添趣味性，也讓消費者更有體驗感。\n\n2. 內容物\n我們可以看到從歐美國家來的裸食燕麥脆片，或是日本的穀物脆等輕食產品，都非常受台灣消費者喜愛。其實台灣本土也有類似的穀物脆片像是米香和爆薏仁，但大眾對他們的印象就是「老一輩在吃的」，因此我們想讓台灣的穀物脆片轉型，變得像是上述兩者的時尚輕食。本產品主要以古早味的米香作為基底，搭配萬丹的紅豆，也可以有加入薏仁、紫米等其他在地作物。只有輕微的加工和少量調味，盡量維持農產品的原型和風味，且成分單純的低負擔甜食符合現在的市場趨勢。\n\n二、分析\n1. 優勢\n本產品從外觀設計到內容物都跟萬丹特色環環相扣，但也有因應趨勢做一些變化，讓這個產品同時具有懷舊本土又創新國際化的特色。萬丹紅豆本身已有台灣之光的美稱，加上相當具有識別度的紅豆餅包裝和烤盤禮盒，讓本產品在國內外市場更加亮眼。\n\n2. 可行性\n脆果杯本身材質為常見的PE聚乙烯（一般外帶紙碗材質），杯口用PP聚丙烯封膜以防止內容物氧化受潮。我們採用常見也較環保的材質，既降低成本也不會因多個小包裝而對環境造成更多傷害。產品雛型、尺寸及使用方式請見下附檔案。\n\n三、展現創意\nS: 以古早味點心為包裝設計，標誌性的萬丹特產讓消費者第一眼就能辨識出品牌，也讓人留下深刻印象。使用本土食材作為原物料，有當地農會嚴格把關維持的優良品質，讓消費者買得安心吃得放心。\nW: 紅豆能搭配的口味有限，如要維持成分單純又好吃，需投入更多資源研發新口味變化。另外目前的紅豆產量不足以供應市場需求量，如本產品廣受好評需求大增，恐會讓產量不足的問題更加窘迫。\nO: 現代人喜歡打卡嚐鮮，且最近有越來越多以食物外型設計的延伸食品，像是胖老爹出的雞腿餅乾等，因此本產品小巧可愛的紅豆餅包裝可以吸引許多部落客分享。\nT: 市面上已有許多輕食麥片品牌，且擁有各自的忠實顧客。','2023-05-03 07:57:12','2023-05-03 07:57:12',454),(10957,2006,'https://drive.google.com/open?id=1cX9t9o18yMY4O5dt1enBBWKFbTUD4pkn','2023-05-03 07:57:12','2023-05-03 07:57:12',455),(10958,2006,'','2023-05-03 07:57:12','2023-05-03 07:57:12',456),(10959,2006,'','2023-05-03 07:57:12','2023-05-03 07:57:12',457),(10960,2006,'鄧怡凡','2023-05-03 07:57:12','2023-05-03 07:57:12',458),(10961,2006,'陳建志','2023-05-03 07:57:12','2023-05-03 07:57:12',459),(10962,2007,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(10963,2007,'減少人與人的接觸同時兼顧衛生性','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(10964,2007,'因為疫情關係，或許有些人會在意衛生問題，導致大家可能會不敢試穿','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(10965,2007,'所以提出虛擬穿衣的模式，透過app可以不用實際穿在身上，也能達到試穿的效果，也節省換衣服的時間。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(10966,2007,'https://drive.google.com/open?id=1-j-qErtE0A9cycxiyzCqkok5rAUWAfTC','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(10967,2007,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(10968,2007,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(10969,2007,'劉佳慶','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(10970,2007,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(10971,2008,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(10972,2008,'希望能做出讓銀髮族便利生活的手錶。','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(10973,2008,'為了解決銀髮族生活上的不便，也希望能讓銀髮族的家人能夠安心上班，銀髮族也能安心過日子。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(10974,2008,'我們的產品將可以解決重要物品遺留在他處的問題，並且還可以使用者發生重大危險時，即使身旁都沒有路人可以幫忙打電話，ＡＰＰ會先行通知救護單位前來協助，提升使用者的生存率和安全性。手錶的外型在配戴上也可以為外型搭配做一個加分的動作，希望能讓台灣30%以上的老人使用，市面上有少許相似產品，市場競爭性較低。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(10975,2008,'https://drive.google.com/open?id=1WoXDBLHjnGZwzmBrRThwgAnuzIoaC3v1','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(10976,2008,'https://drive.google.com/open?id=1KZK8ICpVNkBqy3fvohiUTL5pyK-SUu_O','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(10977,2008,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(10978,2008,'鄭新豪','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(10979,2008,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(10980,2009,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(10981,2009,'購物車自動跟隨、影像辨識；APP帳戶自動扣款或現金結帳。','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(10982,2009,'購物時不符合自己需求大小的購物車，也要一直推著推車很不方便，可能還會跟陌生人的購物車有擦撞；處於尖峰時段時，還需排隊結帳，並等待店員刷每一樣商品，導致購物時間費時長。\n因此我們設計了三種大小之購物車，可以讓消費者選擇符合自己當日需求的購物車，並提供多元的結帳方式，以加速結帳效率，讓購物更快速且輕鬆。APP則是使用簡易介面，讓消費者使用容易上手。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(10983,2009,'說明：\n消費者進入商場前，要先下載App，利用手機號碼註冊會員即可，App內有線上購物、會員專區。消費者先選擇適合自己的購物車大小（大中小），利用App內的掃描功能，掃描購物車智慧面板上的QR code，掃描成功後，購物車便會以此手機定位自動跟隨消費者。購物中，將物品放入購物車時，會由四周的影像辨識偵測後，物品、數量、價格會顯示於智慧面板上。當購物完成後，即可在智慧面板上點選結帳的按鍵，消費者可選擇App綁定帳戶自動扣款或是現金結帳，若點選現金結帳的話，智慧面板上會顯示條碼，即可讓店員進行掃描，店員端的電腦將會顯示所有購物資訊，即可使用現金結帳。購物車四周會有自動偵測雷達系統，所以購物車間不會有互相擦撞的問題發生，另外購物車的收納方式與傳統購物車相同。\n\n內部分析（產品SWOT分析）\n優勢－有嬰兒座椅、更完整的消費體驗、可選適合的購物車大小、多元結帳方式。\n劣勢－成本高、知名度不足、不易推廣、市場經驗少。\n機會－年輕人接受度較高。\n威脅－市面上已有類似產品。\n\n可行性評估（技術應用）\n相機感測器、雷達、AI學習。\n\n可行性分析（團隊執行能力）\n戴楷暄－創意發想－創意總監\n何詩雯－產品設計－產品設計師\n王裕德－開發推廣－產品銷售師\n黃建駿－執行評估－產品審核師\n\n預計達成目標與未來市場發展潛力：\n根據家樂福來計算，於台灣共經營313間分店，67間量販店型，246間超市店型，下載app為900萬。假設量販店型每間需要150台，超市店型需要30台，市場需求為17,430台。\n產品價格：20,000元\n預計達成現有的市佔率：10%\n預計達成未來的市占率：60%\n現有市場：20,000*17,430*10%=3,486萬元\n預計達成未來的市占率：20,000*17,430*60%=2億916萬元\n希望app下載人口數能達台灣總人口數的45%，將共應1,060萬人口使用。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(10984,2009,'https://drive.google.com/open?id=1QXz93mVHlWXKTJF3t7xI4j3J2zePebQ2','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(10985,2009,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(10986,2009,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(10987,2009,'戴楷暄','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(10988,2009,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468);
INSERT INTO `team_details_datas` VALUES (10989,2010,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(10990,2010,'1.偵測病蟲及水果成熟度之功能 2.儀器具有噴頭，可在偵測到病蟲時立即噴灑','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(10991,2010,'由於蔬果生長有時會有病蟲害的危機，其中百香果的病蟲屬介殼蟲最常見，該蟲會分泌蜜露致誘煤煙病發生，並常招引螞蟻舐食共生，主要汙染葉片與果實，影響光合作用，致被害枝葉生長不良，提早落葉、落果，影響果實品質與產量。\n而百香果愈接近成熟期時，正處於又甜又酸時刻，此時採收最為適當，農民也較好出售但人工又不太能判斷成熟度，以上是本組發現百香果種植時的問題。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(10992,2010,'1.此產品具有特殊鏡頭可以偵測到病蟲，偵測到時握把位置會亮起紅燈警示，並且產品最上方置有噴頭，方便在偵測到病蟲時立即噴灑除蟲。\n2.產品另一項功能為掃描百香果成熟度，在百香果愈趨成熟期時，此時採收最為完美，掃描時，產品螢幕會顯示該果成熟或未熟。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(10993,2010,'https://drive.google.com/open?id=1SXZf0S1Dxaz5ri2eT3OCYs7PNrj9LehB','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(10994,2010,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(10995,2010,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(10996,2010,'陳文富','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(10997,2010,'張珝丹','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(10998,2011,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(10999,2011,'透過QR code可以得知個人病歷，且可以偵測心跳，當有意外時可以即時搶救','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11000,2011,'意外來的太突然，假如身邊沒有其他人，可能會錯過搶救時間。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11001,2011,'智能手錶可以偵測心跳，當有意外時，會發出警報聲，若10秒無回應，手錶會自動向緊急聯絡人或醫院發送求救訊息。\n獨居人或是老年人發生意外的時候可能無法自主尋求幫助，透過此智能手錶可幫助他們。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11002,2011,'https://drive.google.com/open?id=1QoYCIUkt18aYQONqG3KFfwgGdgGRz4ud','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11003,2011,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(11004,2011,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(11005,2011,'謝易璇','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(11006,2011,'劉處英','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(11007,2012,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(11008,2012,'發現超市阻塞嚴重，其中又以排隊結帳為最大花費時間節點故結合科技解決此問題','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11009,2012,'發現超市阻塞嚴重，其中又以排隊結帳為最大花費時間節點故結合科技解決此問題','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11010,2012,'- 結合機器人取代一般人力達到穩定快速的目的\n- 市面上雖然有無人商店了，但並沒有結合快速結帳相關服務\n- 結合多種支付方式讓消費者更方便的進來購物\n- 結合APP及時查看相關庫存\n- 結合APP讓消費者在家也可以透過手機查看並預先購物結帳，節省時間\n薛榆杰(電腦通訊系)\n        ➔程式演算法撰寫，可優化分類程式及機器人內部運作管理。\n廖翊伽(應用英語系)\n        ➔語言及外銷能力口調好，可做行銷宣傳及市場分析，擴大市場，也可以負責翻譯APP，充當客服人員可以馬上解決外籍人士語言不通的問題。\n劉恩言(營建工程系)\n        ➔廠房建造，設計廠房與營造廠溝通及監督，以達到量產商品。\n黃俊瑋(工業設計系)\n        ➔超市品牌識別設計，超市整體視覺設計，機器人與推車專利設計師，超市動線設計，室內空間規劃與設計。\n我們商品的訂價大約在10萬一台，目前台灣無人商店的數量並不多其中最大的原因是電子支付生態系的不完整，而最近幾年因為疫情的影響科技的進步以史無前例的速度在迭代因此預計在四年後可以正式步入軌道台灣無人商店的風氣也會更盛行，一開始的產量可能會不太好，但只要無人商店開始發展我們產品的需求量就會成線性的穩定增長，希望能攻佔至少台灣1%的市場也就是希望能賣到100台，1千萬。\n','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11011,2012,'https://drive.google.com/open?id=1_Wq4eW8UIhUekPxT_qMspKIO7Uvh3qhe','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11012,2012,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(11013,2012,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(11014,2012,'薛榆杰','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(11015,2012,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(11016,2013,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(11017,2013,'可以分析照片裡的食物有包含什麼營養成分','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11018,2013,'問題現況：吃飯時不知道便當的營養成分\n需求定義：讓人方便的知道食物的營養成分','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11019,2013,'裝置：目前市面上的產品都是有額外的裝置進行掃描，我們設計的程式只需下載app即可使用，出門在外就不需要再額外攜帶物品就可以進行掃描了。\n技術：我們的APP用到最新的AI以及圖像掃描的技術\n\n未來市場發展潛力：與智慧手錶等貼身智慧裝置，進行連動，透過裝置檢測監測身體的功能，來更進一步提升APP的功能。也可考慮向海外發展，可增設不同的語言，迎合其他國家的用戶，開拓新的市場。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11020,2013,'https://drive.google.com/open?id=1z97rtskxA6Fnds0KCQifsxfFj6_59zcU','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11021,2013,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(11022,2013,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(11023,2013,'吳敏豪','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(11024,2013,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(11025,2014,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(11026,2014,'設計多元化、金流動透明的捐款箱，並幫助弱勢族群。','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11027,2014,'本組認為現今市面上的捐款箱較不透明化，不知道金錢有沒有好好的被使用，一個捐款箱只會有一種捐款對象，需跑到特定地點去捐款。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11028,2014,'智慧捐款箱之說明與流程：\n設置此裝置於人潮眾多的地方，社福機構以月租的方式向我們購買權利後，我們就會將該社福機構新增於捐款箱的捐款對象中。捐款箱以家為造型，零錢投入處為愛心，給予眾人溫暖的感覺，箱子上也有顯示當日的累計金額。每天晚上的累計總額，超商會匯款至該組織帳戶，零錢就由超商自行運用，此方法也可減少機構須自行前往該店整理錢的時間與成本。\n透過捐款箱智慧面板上可以選擇實體捐零錢／卡片支付／線上捐款QR Code。\n①捐零錢➡️投入零錢➡️捐款箱自動分類零錢並加總➡️顯示捐款金額(捐款$xxx)➡️選擇要捐款的機構➡️簡訊回饋(是/否)➡️是：請輸入您的手機號碼／否：謝謝您的捐款！➡️回到主畫面\n②卡片支付➡️感應卡片➡️輸入捐款金額➡️選擇要捐款的機構➡️簡訊回饋(是/否)➡️是：請輸入您的手機號碼／否：謝謝您的捐款！➡️回到主畫面\n③線上捐款QR Code➡️顯示QR Code讓捐款者掃描➡️回到主畫面\n\n智慧手錶之說明與流程：\n慈善機構向我們租權利後，我們會提供他們智慧手錶。當弱勢群組向機構申請，符合資格者即可獲得智慧手錶。將晶片植入到智慧手錶內，成為消費工具，有設定每日消費金額上限$200，消費限制為食物，禁菸酒。智慧手錶的面板是太陽能充電板，上有會顯示日期、星期、時間、當日餘額，且材質為防水。\n智慧手錶裡有植入晶片➡️弱勢族群利用手錶直接向合作店家進行刷卡消費。\n\n提案創新處：\n1. 金資流動透明化－解決市面上捐款箱的金錢流動並不透明、不知是否有實際幫助需要者。\n2. 單一捐款對象－差異化，可以讓捐款者直接選擇捐款對象不必跑到對應地點。\n3. 智慧手錶－創新，手錶面板使用太陽能充電。\n4. 共用帳戶－價值性，智慧手錶綁定該組織的共用帳戶帳戶統一管理。\n\n適用對象：\n1. 慈善愛好者：對於慈善事業有濃厚興趣的人，通常會主動尋找機會來捐贈。\n2. 個人捐款者：有些人可能會因為個人原因，對某個事情或人感到特別關心，或者在某個特殊的節日或活動中才會進行捐款，是捐款箱的另一個主要客群。\n\n設立地點：\n商場、店家、公共圖書館、大學校園、機場、捷運站、醫院：以上這些場所每天都有大量的人潮，可以讓更多的人看到捐款箱，提高捐款的機會。\n\nSWOT分析：\n優勢－支援多元化捐款、資金流動透明化、具有即時支付的功能、減少人力成本，不需要專人收取捐款箱的零錢、減少捐款箱的數量達到環保功能。\n劣勢－製作的成本比現在市面上常見的捐款箱高、捐款箱吸引力不足、捐款箱客群較狹小，推廣力不足。\n機會－資金流動透明化增加了捐款箱的可信度，藉此吸引更多人願意捐款。\n威脅－社福機構原本就有自己的捐款箱、市面上有其它具吸引力的捐款箱。\n\n可行性分析（技術面）：\n智慧捐款箱－機器防盜技術、讀卡機技術、數據加密技術、圖像處理技術、雙向驗證技術、區塊鏈技術、自動零錢計數、電子資金轉移系統(EFT)。\n智慧手錶－電子錢包技術、即時支付系統、防水技術、太陽能電池板充電。\n\n可行性分析（團隊執行力）：\n張芯茹－創意發想－創意領導者\n戴楷暄－產品規劃－整合企劃師\n林弘逸－產品設計－產品設計師\n張竣誌－執行評估－技術分析師\n\n預計達成目標與未來市場發展潛力：\n年銷量 $5,130,000\n租金：$4500/月\n預計合作機構：95家\n$4500*12個月*95家=$5,130,000','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11029,2014,'https://drive.google.com/open?id=1YrHUsnCX5jvJaucc1ohz1bN1jrxa4El2','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11030,2014,'','2023-05-03 07:57:31','202