03 07:57:31',461),(11054,2017,'1.太陽能可能供電不足。\n2.停電（無法供電）緊急開啟功能。\n3.醫療用品曬太陽、商品保存期限，商品更換的時間差。\n4.買的人可能不多，放的地方，客群要在想一下。\n5.醫療用品有認證嗎？\n6.成本問題，使用商品的機率。\n7.AED防盜的問題，可能要有線固定。\n\n創意發想緣由：想要大幅降低災害發生時，造成的嚴重傷害，提供外服的醫療物資，可先完成第一道醫療處理基本程序，也降低醫療城鄉差距。\n\n滿足需求：滿足在較為城鄉地區醫療資源缺乏的地方，享有基本醫療物資，故減少醫療的城鄉差距！\n\n','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11055,2017,'一、我們要如何增加放置地點：\n1.在山區或偏鄉。\n2.在人口密集且易發生災害地區。\n3.放置在里民活動中心。\n4.常有登山客的地方。\n二、我們要如何提供正確的服務功能:\n1.放入應急醫療用品，生理食鹽水、繃帶、止血帶…\n2.配置AED，或搭配其他生理數值檢測機器。\n3.遇到停電時，可以有緊急照明、供電。\n4.聯網功能，方便知道所在位置。\n5.多元的付款方式，賒帳供緊急時取用。\n6.對應不同的放置地點，放入不同的物品。\n三、我們要如何擁有更快、方便、好理解的操作模式:\n1.簡單明瞭的加大按鍵。\n2.結合手機APP的操作功能。\n3.簡化操作的步驟。\n4.若遇到狀況，可以即時連線溝通處理。\n5.在開發階段找人試用。\n四、我們要如何增加產品被使用的機率:\n1.放置地點要是不易取得醫療用品的地方。\n2.要有顯眼的外觀。\n3.利用新聞報導、政府推廣讓大家知道。\n4.和有知名度的大廠合作。\n5.與公益團體合作。\n\n團隊中來自個不同專長的同學，從技術面來看有結構分析、產品開發、銷售和成本估算、電路設計，從以上的驗證，可以有完整的可行性去達成這次的創意發想提案！\n\n預計達成目標與未來市場發展潛力\n產品價格：5000/月\n預計達成現有市占率=0.1%\n預計達成未來市佔率=1%\n\n現有市場：目前全台販賣機數量大約是480萬\n5000*12月*4800=2.88億\n未來市場：\n5000*12*4.8萬=28.8億\n','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11056,2017,'https://drive.google.com/open?id=1sb7I_HkJwnMj6OsyYmG7O97_A-gnP25k','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11057,2017,'https://drive.google.com/open?id=1byYHqoDn0w4CX3YlA6zM3U8zn9JAHueP','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(11058,2017,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(11059,2017,'林承均','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(11060,2017,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(11061,2018,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(11062,2018,'有些人會因為今天要穿什麼感到苦惱，因此想設計一個程式解決此問題','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11063,2018,'今天要穿什麼，怎麼穿才適合、好看，這是多數人常遇到的問題，這類族群通常需要一些意見來去幫助他們解決選擇障礙的問題','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11064,2018,'寫出一個APP， 可依照自身臉型、身材及個人想 要的風格、場合，讓AI給予穿搭上的建議。 讓有選擇障礙 的人知道今天穿什麼出門比較看。 也可以使用現有的衣物，去自行搭配或是讓AI給 予建議。 可於社交專區分享自身穿搭或是參考他人的穿 搭，以便跟上現今的潮流。我們所需要的技術有這幾項：1. AI人工智慧2. SQL資料庫3. 3D建模技術4.大數據分析4.APP程式開發。這些','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11065,2018,'https://drive.google.com/open?id=1JGaMaTCg55FLJei63l6u6jIGGpvA3n03','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11066,2018,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(11067,2018,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(11068,2018,'李千瑩','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(11069,2018,'巴慧玲','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(11070,2019,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(11071,2019,'這是一款結合智能的行李箱，透過連線即可使用手機遠端操控及近距離操作，以便使用者行動。','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11072,2019,'我們發現老弱婦孺在推動行李時較爲困難，以及手中拿著許多物品的人們也不便推動行李箱，因此我們發想了一個智能行李箱，能透過手機即可方便移動。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11073,2019,'為了減輕行李箱本身重量，我們決定使用輕型馬達(HN210)與電池(輕量化電池)且安裝GPS定位以防丟失，連線部分則是由Wi-Fi、藍芽功能。隨後設計手機APP，可以在APP中做所有控制，例如電量顯示、丟失尋找、手動遙控。設想所有情境希望能打造完美的行李箱。\n市場部分，則透過多通路販賣-線上、線下、百貨公司、專賣店。','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11074,2019,'https://drive.google.com/open?id=1Mxd_yYK86S7pgHjd0JeiyGbM1IDYAAvd','2023-05-03 07:57:31','2023-05-03 07:57:31',464),(11075,2019,'','2023-05-03 07:57:31','2023-05-03 07:57:31',465),(11076,2019,'','2023-05-03 07:57:31','2023-05-03 07:57:31',466),(11077,2019,'張旻謙','2023-05-03 07:57:31','2023-05-03 07:57:31',467),(11078,2019,'陳怡君','2023-05-03 07:57:31','2023-05-03 07:57:31',468),(11079,2020,'(二)智慧生活類','2023-05-03 07:57:31','2023-05-03 07:57:31',460),(11080,2020,'透過APP提醒使用者曬衣服，可伸縮式設計減省空間','2023-05-03 07:57:31','2023-05-03 07:57:31',461),(11081,2020,'在生活中，我們常常將衣服拿去曬之後變忘記收，導致灰塵沾附在衣物上，亦或是碰到下雨天，致使衣服被淋濕，需要重新洗滌，因此我們開始思考什麼樣的產品能夠解決這個問題。','2023-05-03 07:57:31','2023-05-03 07:57:31',462),(11082,2020,'1.可嵌入式曬衣架\n可以置於屋內的天花板，不用晾曬在陽台擔心突然下雨來不及收衣服的問題\n2. 伸縮設計、多支架\n解決較矮的消費者晾曬不方便的問題，多支架讓大量衣服得以晾曬\n3.紫外線消毒燈\n殺死細菌及塵蟎解決目前疫情病菌問題及過敏原等問題\n4.手機app連接\n為了易於操作，使用手機就能遙控它升降與紫外線燈的燈光強弱度，提醒收衣時間避免衣服長期曝曬','2023-05-03 07:57:31','2023-05-03 07:57:31',463),(11083,2020,'https://drive.google.com/open?id=1nJET9dQCThUsYF6R4Iz-uxw0yvjAnDW4','2023-05-03 07: