 07:57:32',468),(11106,2023,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11107,2023,'解決嬰兒車的移動的困擾讓嬰兒車可以輕鬆上下樓梯及自主移動','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11108,2023,'看到家長獨自帶小孩出門時嬰兒車移動的不便之處','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11109,2023,'利用履帶輔助上下樓以及定位演算法來判定保持的距離以及跟隨使用者,我們商品定價在3萬5一台,雖然少子化的影響,台灣的出生人口急遽下降,但對便利性和安全性的觀念提升,希望能夠達到出生人口的0.1%,以2022年的數據也就是約130台,也就是455萬\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11110,2023,'https://drive.google.com/open?id=1brajEeA5K0YHinzoWQSsRx3LYAJYp_gx','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11111,2023,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11112,2023,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11113,2023,'陳盈旭','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11114,2023,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11115,2024,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11116,2024,'為機車人士所做的提醒與紀錄功能，並結合現有手機架的功能，讓騎車的人能更舒適的騎車','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11117,2024,'騎車時常常會有手機忘在機車手機架上的經驗，從中獲得這個發想。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11118,2024,'此設計有助於幫助機車族，不會出現手機忘了拿，導致事後可能被偷的問題。通過與手機的藍牙連接，手機架可以實現自動夾緊、自動調節角度、無線充電等功能。台灣機車據交通部統計有1,414.0萬輛，如果以大學生和社會人士為主我們預估售出的數量由1萬到5萬都有可能，而預計產品價格為新台幣1190元，預計創造的營業額1190萬到5950萬。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11119,2024,'https://drive.google.com/open?id=1vo_K7zF1WLNy_MRH_YUtWt2hudJsHUec','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11120,2024,'https://drive.google.com/open?id=17gbvU1hT3RWLEEQfqVG7J35CuYOkLBqd','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11121,2024,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11122,2024,'張振聲','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11123,2024,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11124,2025,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11125,2025,'使用者可將自己的東西進行捐贈，可獲得優惠及點數，點數可以飼養寵物','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11126,2025,'1.有過多閒置的衣服或物品堆置在家中，無法獲得有效的利用或處理。\n\n2.想做公益卻沒有頭緒\n\n3.生活步調隨科技及社會進步越趨快速，在繁忙的生活裡需要一些小療癒。\n\n4.在沒有後憂的情況下滿足想要飼養小寵物的心願。\n','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11127,2025,'考量到科技進步及社會經濟的提升，人們追求新潮、物慾變高，衣/物的汰換速率自然也會跟著提升，這時如果有一個app可以解決不知如何替自己清倉的問題，又可以回饋社會，同時能透過虛擬寵物療癒己身，利己也利他，想必會得到不錯的成果。\n市場需求：環保和節省金錢的意識增長\n競爭情況：找到與其他app之間的差異 \n產品功能和品質：提供更好的用戶體驗，品質把關、用戶感受、增加遊戲趣味性等\n市場營銷：廣告、社交媒體、口碑傳達\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11128,2025,'https://drive.google.com/open?id=1-i-v85LaAld-7oyOWDLwQveTLQ4zCxDO','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11129,2025,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11130,2025,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11131,2025,'李宛庭','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11132,2025,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11133,2026,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11134,2026,'設計多功能智慧床墊解決現代人的睡眠問題','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11135,2026,'現代人因為壓力而睡不好，因此為了解決他們的睡眠問題，我們決定開發這套多功能智慧床墊。希望這個產品能讓飽受睡眠問題困擾的人找到睡眠的路。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11136,2026,'多功能智慧床墊結合了許多儀器，如空氣清淨機、AI睡眠監測、香氛精油機和按摩床墊等等。我們認為將這些功能結合是可行的，相信在這些功能的輔佐下可以提供最舒適的睡眠體驗給消費者。睡眠品質在現在是許多人注重的目標，因此我們認為產品推出後能夠吸引高消費族群的目光。完善的設計能夠讓我們在市場保有一定的佔有率。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11137,2026,'https://drive.google.com/open?id=1Raeo6UGfuM-c4B_Jq5eQkdI2hgESg4aG','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11138,2026,'https://drive.google.com/open?id=1br8AosqC6fU3Ooh9sLQ9Cj1bCoyq4l3G','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11139,2026,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11140,2026,'周嘉偉','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11141,2026,'陳怡君','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11142,2027,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11143,2027,'為解決在校園內，筆電無法及時充電的問題，設計一共享校園行充系統','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11144,2027,'\n在有高度筆電使用需求的大學中，常因教室環境無法即時供電給上課需要用筆電的師生，有時甚至連充電的器具都沒帶','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11145,2027,'需求：\n1.解決師生移動中或急用充電的功能\n2.提供租賃行動充電服務\n\n技術：\n手機APP開發環境、GPS定位晶片、震動元件、GPS/震動開發程式環境、行動電源充電/租借站、行充、充電線和轉換接頭(線材選用耐65W的粗度)、焊接、行充/充電站內部主要電路板\n\n團隊：\n蔡軍献：APP開發、電路元件拼裝、吳敏睿：GPS元件程式、租借/充電站電路設計、蕭蓉：APP英文相關設計、租借站語文介面設計、謝侑珍：採購、管理行充線材庫存、租借站行充配送/補貨\n\n預計達成目標：\n給我電電在校園內提供便利的租借服務，方便學生隨時隨地充電使用，預計能夠提高學生的生活品質，並且增加品牌知名度和市場佔有率。在營運方面，預計能夠獲得穩定的收益，並且通過有效的市場推廣和管理策略，擴大市場規模和提高品牌形象。\n\n未來市場發展潛力：\n隨著手機等電子設備的普及和使用率的增加，行動電源市場將會持續增長。特別是在校園市場，學生群體的電子設備使用量和需求都非常大，因此未來這個市場的發展潛力非常大。另外，隨著綠色環保意識的提高，越來越多的消費者將關注行動電源的環保性能，這也是未來市場發展的一個趨勢。總體來說，給我電電在未來市場上仍有很大的發展潛力。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11146,2027,'https://drive.google.com/open?id=1SuMmEyFu8kehcQ1qvhQxP33RwwHDdrzA','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11147,2027,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11148,2027,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11149,2027,'謝侑珍','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11150,2027,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11151,2028,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11152,2028,'此裝置結合app，解決找不到車的問題，以及結合其他功能，提高使用率。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11153,2028,'我們做這個產品的原因是因為我們想要讓機車騎士可以不用特別的記得自己的機車停在哪裡，讓自己可以省去找摩托車的時間。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11154,2028,'對於市面上的機車定位系統，我們新增了規畫路線的功能，並且能夠輸入好友的金鑰，來達到能夠尋找對方機車的方法，以便之後出遊的方便性，並且對於產品的特點是能夠透過USB充電的方法，來讓使用者不需要擔心電量不足的問題。產品價格:765元，預計達成的現有市佔率=10% ，預計達成的未來市佔率=30%。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11155,2028,'https://drive.google.com/open?id=1DBZXkixKBW1Xsisk8cI2rPajAuaemdUj','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11156,2028,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11157,2028,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11158,2028,'謝美玉','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11159,2028,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11160,2029,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11161,2029,'飛旋踏板常常忘記收導致踢到，因此設計一款智慧飛琁踏板。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11162,2029,'飛旋踏板忘記收導致踢到，造成腳受傷','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11163,2029,'設計智慧飛旋踏板\n1.自動偵測踏板上無人，5-10秒即收起\n2.滑軌調整有4個階段，可以讓後座的乘客在騎乘過程中更舒適\n3.儀錶板設置收放開關\n4.騎乘時儀表板的開關設置安全鎖，以免誤觸\n未來設置一個屬於智慧飛旋踏板的app，不只可以提醒飛旋踏板沒收，也可以知道機車的狀況\n\n預計達成目標與未來市場發展潛力\n產品價格=2999 \n預計達成的現有市佔率=5% \n預計達成的未來市佔率=30%\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11164,2029,'https://drive.google.com/open?id=1sq9D9JlS20Ws7uZY4hrEUdwvL0PS3EH2','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11165,2029,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11166,2029,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11167,2029,'洪雅婷','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11168,2029,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11169,2030,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11170,2030,'對於單身的人來說,很容易會有食物吃不完以及對環境不熟等問題,所以設計此款APP','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11171,2030,'份量無法獨自購買以及在沒有渠道認識店家的情況下，購買物品跟吃飯娛樂等都，僅限於個人所知','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11172,2030,'合購下結合交友，地圖，社群軟體，能真正找到喜歡的餐廳或其他地點，不想獨自吃飯時，可以在這認識擁有共同喜好的朋友，以及一起合購的夥伴。\n1.可以與其他人合購不同種類的物品\n2.分享真實想法，不被廣告及行銷手法影響。\n預計達成目標與未來市場發展潛力\n預計下載量66萬→134萬→204萬→276萬\n可行性評估-技術應用\n演算法→推薦與用戶匹配功能\nAPP lnventer/Swift→程式開發\nFigma→設計用戶界面\nGPS衛星→定位用戶位置','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11173,2030,'https://drive.google.com/open?id=1ofM4mYezJ6Z01ixbBQrBtMLs8-0aljRF','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11174,2030,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11175,2030,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11176,2030,'楊家柏','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11177,2030,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11178,2031,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11179,2031,'老人常常因為忘記吃藥或是重複吃藥引發更多的健康問題，所以我們想到結合前人所發明的智慧定時藥盒加以改進來改善這個問題。​','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11180,2031,'1.居住在鄉下的老人無人照顧，並且鄉下醫療資源較少​\n2.忘了自己是否有按時吃藥​\n3.是否有重複服藥​\n4.醫療設備及藥物使用說明複雜​','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11181,2031,'Q1.居住在鄉下的老人無人照顧，並且鄉下醫療資源較少​\n\n(Ans) 設置網站供大家查詢各個醫院的醫生和空床數量​\n\n(Ans) 提出優渥的薪資條件，吸引年輕人前往就業​\n\nQ2.忘了自己是否有按時吃藥​\n\n(Ans) 可以在藥盒上設置定時裝置​\n\nQ3.是否有重複服藥​\n\n(Ans) 可減少一天用藥次數，例如原本為早中晚各一次，可以改成晚上一次，然後加重劑量​\n\nQ4.醫療設備及藥物使用說明複雜​\n\n(Ans) 在設備上附上QR碼，掃碼後就會出現相關的使用影片','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11182,2031,'https://drive.google.com/open?id=1_IKYYM3eZJ_pKfEE7USEVtvPOkxvd4MT','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11183,2031,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11184,2031,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11185,2031,'李宜蓁','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11186,2031,'陳建志','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11187,2032,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11188,2032,'解決食物存取期限與多功能的結合','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11189,2032,'我們發現在富裕的國家很常出現浪費食物的現象，買太多食材、放太久、煮太多吃不完等各種原因造成的浪費。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11190,2032,'現在科技日益進步，但許多功能都沒有進行結合，大多數市面上的智能冰箱都是只有單一功能，且操作複雜，不適用於各種家庭。為了滿足大家便利的生活需求製作，可以不用開冰箱就能知道有些相關商品已經快要過期。出門在外，忘記家中是否還有哪些食物，可以立即的用手機app查詢。可以減少在食物上浪費錢。\n\n技術:就是將現有的科技進行結合與簡化\n團隊:需要有科技、行銷、研發團隊\n\n預計達成目標與未來市場發展潛力\n預估售價：12萬\n預估銷量：5000\n預估銷售金額：6億\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11191,2032,'https://drive.google.com/open?id=1NI6KjxYhyg7tdE81703ArfwL7sJS7iyT','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11192,2032,'https://drive.google.com/open?id=1md8G62PhtuZA_t7cSrW91x__c7Ub0XX2','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11193,2032,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11194,2032,'徐琳薇','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11195,2032,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11196,2033,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11197,2033,'針對環島設計出統整多項功能的應用程式','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11198,2033,'在目前的市場中沒有一個程式是統整環島路線、住宿、交友、景點、網路資源。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11199,2033,'路線：在現在的發展中地圖資源相當豐富。\n住宿：結合訂房網站的訂房資訊。\n交友：設計類似交友軟體的功能，並透過人臉辨識，確保身分真實性。\n網路資源：透過搜集各地區免費網路，集合成一個資源包，供離線時也可使用，並結合便利商店及電信業者在沒有免費網路服務的地方提供小額購買網路的方案。\n\n達成目標：以2017年國內旅遊人次為例（疫情前為例），總旅次高達1億8344萬次，若每四人有一個下載則下載人數可高達4586萬人。\n\n未來發展：因疫情逐漸趨緩，旅遊人次會逐漸回歸正常。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11200,2033,'https://drive.google.com/open?id=1qoMgWKyi6S5pfMfyvuooAUrIVnu8pGZc','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11201,2033,'https://drive.google.com/open?id=1ZeLeTlxbXKbg5BWXn9M1-z3r2032rS5B','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11202,2033,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11203,2033,'黃佳淇','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11204,2033,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11205,2034,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11206,2034,'運用智慧科技設備結合全罩式安全帽，增加行車安全。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11207,2034,'我們將生活周遭所遇到的問題進行分類，其中以交通面向的問題為大宗。\n例如:道路坑洞太多、危險駕駛、路邊停車導致機車道縮減等問題。\n又因交通部統計資料顯示，目前台灣道路上為機車族群比例較高，決定朝此方面進行發想。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11208,2034,'解決方法:研發出一款有以下功能的智慧安全帽\n1.前後設有行車紀錄器及廣角攝像頭 2.坑洞水窪偵測 3.藍芽連線\n4.GPS定位 5.車禍偵測系統  6.內建音響設有音量分貝限制 \n7.連結專屬APP提供多項功能\n\n可行性分析-技術面\n1.影像辨識 2.GPS定位 3.藍芽傳輸 4.車禍偵測 5.全息投影\n\n可行性分析-團隊執行力\n陳冠豪/電通系\n職位：程式工程師\n專長：寫程式、研發3C功能\n職責：研發此產品所需要的3C功能\n\n陳羿臻/運籌系\n職位：行銷經理\n專長：銷售及市場分析\n職責：擬定行銷計劃、分析每月銷售金額\n\n王芊媞/運籌系\n職位：倉管人員\n專長：安排貨品配送\n職責：管理庫存、依顧客訂單安排配送\n\n李崇誠/電機系\n職位：製圖工程師\n專長：繪製設計圖\n職責：製作產品設計圖、依客戶需求繪製客製化設計圖\n\n預計達成目標\n根據調查顯示（樣本數：11,363）\n目前使用機車當休閒娛樂及旅遊約佔7.9%，約有898人\n產品售價：15,000\n預計利潤：15,000*898=13,470,000\n未來市場發展潛力\n主要客層為年輕人、熱愛騎車的人\n並適用於所有愛騎車的人，更適合朋友們一同出遊或是環島時使用。\n\n設計提案創新之處\n1.前後方皆設有行車紀錄器，前方有偵測路面系統，後方設有廣角攝像頭。\n2.設有影像投射器，可將行車紀錄器及導航影像投射在前罩上。\n3.內建音響可自動偵測環境分貝限制音樂音量，增加行車安全。\n4.連結專屬APP，有車輛追蹤、定位、群組、顯示附近停車位、找加油站、更改鏡片顏色、顯示天氣…等功能。\n\n產品SWOT分析\n優勢(STRENGTHS)-1.技術前衛 2.產品獨特 3.增加行車安全\n劣勢(WEAKNESS)-1.損壞不易修理 2.成本高 3.價格不易被接受\n機會(OPPORTUNITIES)-1.功能多樣性 2.新興市場拓展\n威脅(THREATS)-1.科技發展快速，屆時技術可能被超越 2.其他大型競爭者出現\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11209,2034,'https://drive.google.com/open?id=10HN3QFCUFOm1VEykVEv5drUvnEtKRwcT','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11210,2034,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11211,2034,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11212,2034,'陳羿臻','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11213,2034,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11214,2035,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11215,2035,'市面上的助行器功能不夠齊全，希望結合智慧科技改善生活。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11216,2035,'市面上的助行器都只有簡單的設計，使用上缺乏了安全性及便利性，例如使用者跌倒時無法及時呼救。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11217,2035,'在科技創新的現代結合智慧科技已不是天方夜譚，於是我們團隊決定在助行器上結合AI系統，可偵測進行障礙物偵測不只可以確保腿腳不便之使用者的安全性，也增加電子系統操作上的便利性。讓每次使用助行器就如同AI機器人陪伴出行一樣。\n假設創意助行器在台灣上市後成功吸引了消費者的關注並獲得了市場份額，且能夠在市場上推廣和銷售。\n第一年 預計銷售一千台；第二年 由於市場及消費者口碑影響，預估銷售數量達兩千五百台；第三年 隨著市場對助行器的接受度進一步提高，預估銷售量增加到五千台；第四年 假設創意助行器的市場份額繼續擴大，並且產品的知名度和需求量進一步提升，預估銷售量可增加至八千台；第五年 假設創意助行器持續保持市場競爭力，預估銷售量達到一萬台。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11218,2035,'https://drive.google.com/open?id=1DHlnl_A3I4BPHQ3e5pL6ZTnk58d8tk67','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11219,2035,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11220,2035,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11221,2035,'鄭雅文','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11222,2035,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11223,2036,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11224,2036,'水壺藍芽連線紀錄喝水量並自動上傳至APP。APP和水壺本身有提醒功能能提醒使用者喝水','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11225,2036,'大部分人不記得上次喝水是什麼時候,更沒有記錄每天喝水量的習慣,長期下來可能導致身體缺水而不自知。而真的想記錄喝水量時又會因為需要手動紀錄而非常不方便導致放棄記錄這個動作。因此我們團隊定義了兩項需求其一為能有自動記錄並上傳引水量的功能，其二為能有提醒使用者喝水的功能','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11226,2036,'我們計畫開發一款水壺，搭配重量感測器和藍牙模組並將晶片等機械零件置於水壺底部，透過感測器將喝水量自動記錄到APP中。同時，透過APP的設計，可以設置定時或定量提醒功能，讓使用者在固定時間或固定喝水量達到時收到提醒，以確保水分攝取充足,其中有個難點是如何解決晃動誤記的可能，我們團隊採用三秒靜止的原理，感測器數據至少靜止三秒才做紀錄，有效減少誤記率。技術可行性的方面，目前重量感測器的技術已經較為成熟，能夠精確地測量物品的重量。藍牙技術也十分普及，能夠實現與手機的通訊。APP的開發也比較容易，可供選擇的開發平台和工具很多。驗證可行性的部分我們在產品完成後將會在校內進行試用，蒐集使用者反饋，從而改進和優化產品。另外，可以進行一些比較測試，例如與手動記錄的方法進行實驗組和對照組的測試，檢測自動記錄水壺是否真的有成效。市場發展潛力部分,根據研究報，全球智能飲水市場正在逐年增長，預計在未來幾年內將保持高速增長。根據MarketsandMarkets的報告，智能飲水市場預計從2020年的價值11.7億美元增長到2025年的21.5億美元，年復合增長率為13.0％。主要是由於越來越多的人開始關注健康和運動，需要更好地追蹤自己的飲水習慣和水分攝取量。由此判斷智能水壺具有商機且會越來越競爭，如果團隊能搶得先機設計出既實用方便的智能水壺，則未來有望在市場中占據一席之地。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11227,2036,'https://drive.google.com/open?id=1WJ5aoMTZz2hTdGrmjnQdcg6u_vilVTtd','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11228,2036,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11229,2036,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11230,2036,'郭宣辰','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11231,2036,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11232,2037,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11233,2037,'想要讓獨居老人有人陪','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11234,2037,'發現獨居老人在自己生活時遇到許多不方便的問題，所以我們想要藉由這個機器人來讓他們生活更方便','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11235,2037,'能解決老人沒有對象聊天（支援各種語言），老人不能自己打掃，提醒老人吃藥物，幫老人復健，且還能以語音操作，有著在市場上獨一無二的功能。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11236,2037,'https://drive.google.com/open?id=1mSsn7aTwkZhgg4zFzm62cRus75Sw1K6O','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11237,2037,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11238,2037,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11239,2037,'黃至菘','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11240,2037,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11241,2038,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11242,2038,'幫助單身族群不孤單，增加交友的機會','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11243,2038,'臨時找不到旅伴，透過App幫助他們尋找伴侶滿足交友需求，結合市面上交友功能外，有另外結合周邊美食、娛樂項目。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11244,2038,'透過此app增加單身族群交友的機會,截至111年代深的族群高達645萬，我們預計app可以佔百分之20大約是129萬人','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11245,2038,'https://drive.google.com/open?id=1D3X4_w6QuahDxvlc2iPxLKHxw5lYBJeu','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11246,2038,'https://drive.google.com/open?id=1l3ZC-pbDLak5rdi1gKOlMvRZbSGrMwcp','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11247,2038,'https://drive.google.com/open?id=1QjW7eyZY4rzQVZ91OMD32V2iNCKSdlfr','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11248,2038,'吳紘宇','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11249,2038,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11250,2039,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11251,2039,'創新助聽器，具有回放，以及耳機的功能','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11252,2039,'可以對手機的文字進行聲音的引導功能，同時具備助聽器的功能性以及創新產品的功能性','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11253,2039,'近年來，隨著科技的不斷進步，助聽器也進行了很多創新。傳統的助聽器主要是通過聲學放大的方式增強聲音，但存在一些問題，例如在嘈雜的環境中，使用者仍然難以辨別出所需聲音；而且，助聽器的體積較大，對於一些人來說不太方便攜帶。因此，我們提出了一種創新的耳機式助聽器，通過專業的算法和高精度的麥克風，可以在各種不同環境下提供清晰、穩定的聲音增強效果，同時還可以充當普通耳機，實現多功能應用。下面將具體說明這種助聽器的解決問題的方法：高精度麥克風我們使用了高精度的麥克風，能夠更好地捕捉人聲，同時也能夠抑制周圍環境噪音，達到更好的聲音增強效果。專業算法我們採用了專業的算法，能夠更準確地識別人聲，同時還可以提高聲音的清晰度和穩定性。多功能應用這種耳機式助聽器不僅可以充當普通耳機，還可以進行通話、音樂播放等多種應用。未來市場發展潛力方面，隨著人口老齡化和耳聾人數的不斷增加，助聽器市場將會迎來更大的發展機遇。我們的耳機式助聽器不僅可以滿足老年人和耳聾人的聽覺需求，還可以吸引更多年輕人的關注，擴大市場規模。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11254,2039,'https://drive.google.com/open?id=1F5l-dENmfyjxBH20Yt1OyNXyZiKsPKF3cFkZ3FsmPU8','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11255,2039,'https://drive.google.com/open?id=1PMlHz8rbE3BcvD1xnYvGPzXQbDwyubWr','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11256,2039,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11257,2039,'陳薪富','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11258,2039,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11259,2040,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11260,2040,'為了讓視障者在行走時的路障感減低，所以想設計一項產品提升視障者的外出動機。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11261,2040,'台灣交交通環境對行人不友善，像是人行道常有機車霸佔、垃圾擺放等等，如果行人通行不易，身為視障者即便擁有導盲犬帶領仍然有很大的困擾，為了讓視障者在行走時的路障感減低，可觸及的範圍擴大，想設計一項產品提供給視障朋友。市面上為視障者設計外出使用的可攜式產品比較多是眼鏡的產品，眼鏡擁有震動語音提示播報前方障礙物的功能也有自動定位、智慧導航的功能，於是決定也同樣設計眼鏡，為視障者行走時能更準確避開障礙物的眼鏡。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11262,2040,'為視障者行走時能更準確避開障礙物的眼鏡，設計發想眼鏡產品擁有紅外線鏡頭偵測影像，並且增設AI的圖像識別技術，擁有ＧＰＳ自身定位也實現語音辨識以及自身定位和導航功能。以上連結眼鏡，當偵測到眼前有障礙物時以及使用眼鏡功能時會有前後震動及語音的提醒，同時連結智慧手機、手錶功能，能讓家人親友知道自己的所在位置外還能語音使用通話，聲音輸出採用骨傳導設計輸出，同時也能搭配藍牙耳機做使用，不僅如此還增設自身健康偵測顯示。自身健康偵測顯示意味著健康紅綠燈，顯示使用者現在使用的狀態，若使用者使用產品時迷失方向，眼鏡上有顯示燈會閃爍顯示，其他人可得知現在使用者需要協助。電池充電有typeC有線充電也有搭配眼鏡盒的無線充電。紅外視界運用到鏡頭及處理器、藍牙技術以及震動技術功能，以上功能和智慧程式撰寫的技術也相對越來越純熟。台灣弱視族群約有54000名左右視障人口，大約佔了台灣人口的2-3%，我們預期可獲得台灣視障總人口20%左右的銷量，預計售價四萬五千台幣，銷售量約一萬副，所以加乘預估年營收銷售金額初估四億五千萬。未來市場發展潛力，因弱視族群日益增加，我們未來展望能與政府談合作，希望政府能補助視障者一些健保費。目前世界趨勢人口老齡化，雖然原本產品客群主要是視障者，不過一般客群一樣適用，不只針對視障者，這項產品能讓更多有需要的這些產品的人群使用，醫療產業及健康產業的發展潛力也大，若有機會還可望銷售至至外國出口。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11263,2040,'https://drive.google.com/open?id=1HYOy66LaZbxx0qxSJRskBLroH9TCdbXr','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11264,2040,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11265,2040,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11266,2040,'蘇家儀','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11267,2040,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11268,2041,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11269,2041,'這是一個用chatgpt構成的Linebot 聊天客服系統','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11270,2041,'\n1. 學生在學校網站上找資訊困難，需要花費大量時間和精力。\n2. 學校網站資訊過於廣泛，導致學生難以快速找到他們需要的資訊。\n 3. 學生在學校網站上尋找資訊時可能會遇到困惑或迷失，不知道該從哪裡開始尋找。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11271,2041,'學校網站資訊尋找困難的問題，以及創新的解決方案。學校網站的資訊太廣泛，導致學生往往無法有效地找到他們需要的資訊。為了解決這個問題，作者採用了Open AI GPT技術，連結LINE Bot和GitHub開源程式碼，以及Vercel雲端平台，創建了一個智能AI聊天機器人。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11272,2041,'https://drive.google.com/ope