043,'劉處英','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11295,2044,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11296,2044,'自動穿搭並且含括交友的軟體','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11297,2044,'選衣困難','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11298,2044,'使我們的APP普及化 並且未來也會不斷更新讓大家去活用它','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11299,2044,'https://drive.google.com/open?id=1HSvzoZsczwc1ApwhAeNUPGWZhzCY-_D2','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11300,2044,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11301,2044,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11302,2044,'吳敏睿','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11303,2044,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11304,2045,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11305,2045,'透過分析人的排泄物傳送至手機app讓使用者能監控身體狀況','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11306,2045,'每隔一段時間就要去醫院做健康檢查，相信對於已經出社會或是行動不便的老人都是容易忽略的事情','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11307,2045,'解決問題:我們希望透過開發一款智能馬桶與醫療儀器做結合，再開發一款app接收馬桶的數據，為使用者提供血糖、血球、糞便形狀、糞便顏色，也希望能統計數據來為使用者分析數值是否過高、排泄物有無異常、是否有便秘情況，哪些營養攝取不足，讓人們在家也能督促身體健康也省下去醫院掛號檢查的時間。\n\n技術:電子軟體結合控制器內置有接線端子、信號控制電路、時鐘電路、LED指示燈、微型無線信號發射端子。其中接線端子用於電源電路連接;信號控制電路用於傳感器信號調理、顯示和微型無線信號發射端子連接；時鐘電路:用於記錄接收信號的時間信息；LED指示燈用於顯示馬桶不同的工作狀態；微型無線信號發射端子用於將傳感器感測信號發送到健康信息中心網站或已授權護理人的手機等移動終端。小便池，大便池的前後分佈，實現大便與小便的分離。\n採用無水馬桶，由電機驅動泵進行抽水沖洗，不需要傳統的水箱。周圍及底部有均勻分佈或點分佈的靈敏的壓力測量裝置，從而可以檢測出尿液及排泄物衝擊在馬桶壁上的瞬時壓力。\n馬桶墊圈:由鈦合金材料製成，當人體坐姿勢，承受壓力部分根據不同人的體重進行不同程度的彎曲，當人離開後可以自動恢復形狀。既可以提高舒適度，又可以確定人坐姿時的具體空間位置。同時，墊圈上有溫度傳感器及加熱器，可自動進行加熱，保持墊圈恆溫。抽吸裝置：重量輕、體積小、功效高，且液體和濕氣均可抽排。其作用是將筒內的殘餘液體抽出，減小測量誤差。開關：位於馬桶上側，所有開關位於控制板上，可以方便實現沖洗、檢測、採樣、殺菌等功能。\n\n團隊:由於我們團隊有電腦與通訊工程系，能夠開發手機app使用介面，並讓馬桶能夠傳送數據至手機，以及電子系幫助我們選擇儀器了解其運作原理，還有營建工程系規劃馬桶大致上的設計圖，畫出馬桶的雛形，以及設計讓使用者能夠維持最佳舒適的角度，最後透過行銷與流通系來為我們的馬桶做廣告以及文宣。\'\n\n預計達成目標與未來市場:希望能夠全面取代家用的普通馬桶或是智能馬桶，相信在能夠監控健康這塊，大多數家庭至少都會買一組，我們相信能夠在上市第一年就達到10萬組的銷售額，也要積極與診所還有各大醫院推廣我們的馬桶。\n\n\n\n\n\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11308,2045,'https://drive.google.com/open?id=1dgTy8IOAfx0W_YDAaMQgfhVZl55b81wJ','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11309,2045,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11310,2045,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11311,2045,'張慶渝','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11312,2045,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11313,2046,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11314,2046,'為減少行人的交通事故，故發想紅綠燈警示器這個裝置','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11315,2046,'我們發現行人的交通事故率逐年上升，而最大原因是車輛未注意車前狀況而撞上行人','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11316,2046,'因此我們運用科技在行人號誌燈上裝了人體紅外線感測器，在紅綠燈上裝了警示燈，裝置互聯，達成如果感測器偵測到有行人在通過斑馬線時，警示燈就會亮起，藉此提醒車輛駕駛人','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11317,2046,'https://drive.google.com/open?id=1f1Wx8VtQctbrHARHBQmnn1x_T8fro2fE','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11318,2046,'https://drive.google.com/open?id=1Sm2AhXo_r2AiGLZzCF72prl-Flg9bg90','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11319,2046,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11320,2046,'吳秉叡','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11321,2046,'宋旗桂','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11322,2047,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11323,2047,'我們想針對中低收入戶給予額外的教育資源','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11324,2047,'家庭收入狀況愈佳，進入頂尖大學的機率與資源成正比，所以想針對中低收入戶給予額外的教育資源。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11325,2047,'發明新型學習系統，以學生角度無法完整的生產出新型裝置，但概念可行性高，對於未來市場有一定程度的影響','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11326,2047,'https://drive.google.com/open?id=1QlNc85Pq2uRqdCUiSeOT34_RZTZCxwCW','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11327,2047,'https://drive.google.com/open?id=1gFzckxr3DDK_uJ_kwoTar77u21j_laCw','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11328,2047,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11329,2047,'周德琳','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11330,2047,'陳宗澤','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11331,2048,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11332,2048,'與香水分裝罐結合，提供給需要一天出席各式場合的人們。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11333,2048,'現代人的生活豐富多采，經常需要一天出席各種場合，不同的場合需要不同風格的香水因時制宜，如執行工作時需要淡雅的香水，而出席晚宴則需要嫵媚的香水；不過這樣需要帶上各種香水分裝罐，雜亂又難找更不方便攜帶。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11334,2048,'於是我們決定製作能夠一次收納各種香水分裝瓶的香水盒，通過替換芯的方式來使用，除了方便攜帶外也省下找東西的時間。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11335,2048,'https://drive.google.com/open?id=1ldJ4uwFCPooKnb8nZKJmZOmQrPLFqlUo','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11336,2048,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11337,2048,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11338,2048,'黃梅君','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11339,2048,'宋旗桂','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11340,2049,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11341,2049,'料理人這項產品結合影像偵測與骨傳導等技術，實現讓料理既安全又輕鬆。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11342,2049,'本組發現，大部分的民眾在料理時，對於不熟悉的料理都需要透過食譜，或手機來查詢該如何去烹調，但料理時分心很容易發生危險或讓食物燒焦之類等狀況發生，為解決上述需求，所以本組發想了料理人眼鏡來解決上述問題。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11343,2049,'料理人是一個專為烹調料理而生的系統，可以分為兩個部分1-料理人官方網站結合食譜庫、2-料理人眼鏡。運作方式是網站可以讓使用者添加自己的食譜產生一個共享的資料庫或是使用料理人官方的內建食譜庫，且網站會透過藍芽連結到料理人的專用眼鏡當你戴上料理人的眼鏡，眼鏡前方的攝影機會自動偵測你的食材可以製作成何種料理給你做選擇，選定後會透過骨傳導耳機將料理的步驟和技巧一步一步的在烹煮的過程間傳遞給使用者，而選用骨傳導耳機可以隔絕廚房的噪音讓收音更加清晰，料理人也解決在料理時需要邊看手機或食譜邊烹調的問題，也大大的提升料理的樂趣和安全性，也可以在引導烹調的過程中慢慢學習如何更加熟練精進技巧。在技術方面，本組資管系學生可以在眼鏡所需要的軟硬體上進行撰寫，應英系可以製作英文食譜讓客群不只侷限於單一語言。在市場發展潛力方面現今的社會更加重視飲食健康的狀況下，注重飲食健康需求的人，可以透過更新穎的模式滿足此需求，而也會有部分外食族群會想體驗新型態的料理方式而進行產品的購買，也可以使外食的比例減少，且料理人在目前市場並未有替代品在未來潛在市場是非常有競爭力的產品。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11344,2049,'https://drive.google.com/open?id=1t19Bbq_6XtXo025JwfDdC0qDIsa9ZX6M','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11345,2049,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11346,2049,'https://drive.google.com/open?id=1SqIXIE9Xr9Gleg9tWumbJwZofYPIrSNq','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11347,2049,'羅傳勛','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11348,2049,'宋旗桂','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11349,2050,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11350,2050,'藉由室內導航系統、一條龍規劃來減少在醫院中浪費的時間','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11351,2050,'大醫院的結構複雜容易迷路，很容易因此浪費很多時間甚至過號。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11352,2050,'我們希望能夠做出一個能夠室內導航的app，當然也整合其他掛號、繳費等功能。另外我們想做出一條龍的規劃，在掛號之後，能夠遵照著app的流程並且完成就診。\n\n以下是我們提出的幾點：\n    1.提示看病的流程 (一條龍 )  \n    2.提示路線\n    3.結合各大醫院\n    4.室內導航系統\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11353,2050,'https://drive.google.com/open?id=1zCDbMsJOqsBvQnVohDSVj_yOy4r6UqY0','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11354,2050,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11355,2050,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11356,2050,'吳健銘','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11357,2050,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11358,2051,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11359,2051,'手機殼結合悠遊卡的功能，並加上卡殼增加置卡空間或是存放少許的現金。           ','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11360,2051,'現在有些民眾搭乘大眾運輸工具是使用悠遊卡或一卡通來搭乘，而我們發現某些人會弄丟卡片，導致沒搭到車或造成困擾。\n在現今幾乎「人手一機」的社會，但有些手機沒有支援NFC功能無法感應，導致沒有辦法直接付款搭車。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11361,2051,'悠遊卡使用的原理是悠遊卡內部有一個小型的磁卡然後刷卡機感應到磁卡去做扣款的動作，如今我們把磁卡嵌入手機殼的內部，就可以讓手機殼與悠遊卡有相同的功能。\n\n若需要多帶其他需確認卡片資訊的交易卡（例如信用卡、金融卡、簽帳卡）可放在卡殼裡。\n\n與市場上的手機殼較不一樣的是長時間接觸手機也不用擔心會有消磁的問題。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11362,2051,'https://drive.google.com/open?id=1F2EOiShzmhwepxPKUSazCAXzEMZb-ZKW','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11363,2051,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11364,2051,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11365,2051,'林筱錡','2023-05-03 07:57:32','2023-