7:32','2023-05-03 07:57:32',461),(11405,2056,'1.不知自身是否適合穿搭 2.沒時間去實體店 3.店家的模特兒跟每個人的身材不同','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11406,2056,'1.做出自身的虛擬形象穿搭 2.線上服飾店家app 3.可自行調整身材數據','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11407,2056,'https://drive.google.com/open?id=1w75jA8UdQ2jZ9xqB9jPj4VbMj-GWsGEp','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11408,2056,'https://drive.google.com/open?id=1Rt-95WcjTcJH0TZCgQdKRDTJq3Adx_X2','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11409,2056,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11410,2056,'蔡文哲','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11411,2056,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11412,2057,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11413,2057,'本提案探討預測性庫存管理系統，旨可在工廠或公司內利用數據分析和預測模型來優化庫存管理，提高庫存回報率，減少庫存浪費','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11414,2057,'為了解決以上的問題，我們需要一種統計和預測消耗程度的方法，以便準確地掌握補貨的時機和數量。可以避免墨水不夠或過多浪費的情況發生，也能夠進而提高印刷效率和降低成本。因此，建立一個墨水管理系統是非常必要的，這樣不但可以確保印刷工作的順利進行，同時也可以節省時間和金錢成本','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11415,2057,'1.	預測模型\n●	使用R語言進行印表機墨水庫存的預測分析和制定相關策略，能夠幫助企業提高效率，減少浪費，提高生產效率。\n1.數據收集：收集影印機使用量、墨水消耗量、墨水補充時間等數據。\n2.數據清理和處理：對數據進行清理和處理，例如去除缺失值、重複值、異常值等。\n3.數據分析：使用R語言進行數據分析，例如統計數據的中心趨勢、變異數、標準差、偏度、峰度等。\n4.建立預測模型：使用R語言的相關套件進行預測模型建立，例如ARIMA模型、回歸模型等。\n5.驗證模型：使用驗證集對模型進行驗證和調整，例如計算模型的MAPE、RMSE等指標。\n6.制定策略：根據預測結果和模型的結果，制定相應的策略，例如定期補充墨水，調整墨水的存儲量等。\n●	指數平滑模型\n是一種時間序列分析中常用的方法，用於中短期經濟發展趨勢預測。\n根據平滑次數不同，指數平滑模型有三種形式：一次指數平滑模型、二次指數平滑模型、三次指數平滑模型。\n1. 一次指數平滑模型 : 當時間數列無明顯的趨勢變化，可用一次指數平滑預測。\n公式:St = αYt + (1-α)St-1。\nSt 為當期的平滑值。Yt 為當期的實際觀察值。α 為平滑系數，通常是由使用者指定。St-1 則表示前一期的平滑值。\n2.二次指數平滑模型 : 對一次指數平滑的再平滑，它適用於具線性趨勢的時間數列。\n公式:St = αYt + (1-α)(St-1+Tt-1)\n        Tt = β(St-St-1) + (1-β)Tt-1\nα 和 β 分別表示平滑系數和趨勢系數。St-1 和 Tt-1 分別表示前一期的平滑值和趨勢值\n3.三次指數平滑預測 : 二次平滑基礎上的再平滑。\n公式:St = α(Yt - Ct-m) + (1-α)(St-1+Tt-1)\n         Tt = β(St-St-1) + (1-β)Tt-1\n       Ct = γ(Yt - St) + (1-γ)Ct-m\nα、β 和 γ 分別為平滑系數、趨勢系數和季節性系數。St-1、Tt-1 和 Ct-m 分別表示前一期的平滑值、趨勢值和季節性值。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11416,2057,'https://drive.google.com/open?id=177NKLutL3xKmnMYrTcU7ga2-W5TDhjHU','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11417,2057,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11418,2057,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11419,2057,' 洪崇文','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11420,2057,'陳彥銘','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11421,2058,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11422,2058,'用咖啡渣代替傳統的塑膠廚餘桶，減塑的同時增加除臭與廚餘回收再利用的功能。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11423,2058,'每次倒廚餘都會有難以忍受的惡臭、且直接丟掉食物殘渣也造成資源浪費。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11424,2058,'想到如果能用咖啡渣製成廚餘桶，不僅能減塑還能除臭。且為了不浪費資源，加入了手動肥料機的功能，能在桶內將廚餘轉為肥料，直接供家庭花圃使用。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11425,2058,'https://drive.google.com/open?id=1HYKgpLPMXNpLGjxPZxgsYRoa1rX-jQ1e','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11426,2058,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11427,2058,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11428,2058,'田育慈','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11429,2058,'陳建志','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11430,2059,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11431,2059,'這個app的功能包括了提供附近餐廳的資訊，即時查詢停車場車位數量，提供即時路況，以及飲食健康管理功能。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11432,2059,'開車族往往三餐不正常，導致營養不良產生慢性胃病、疲勞綜合症，\n而食物是我們人類最容易攝取營養的方式。\n希望能透過日常飲食保健讓開車族的職業傷害能夠降到最低。\n當找餐廳找加油站和休息站時都要花時間找停車位也是一件很困擾的問題。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11433,2059,'這個app主要解決開車族可能較難以取得飲食的問題，透過找餐廳、查詢停車場車位、路況資訊等功能，可以幫助使用者在行車過程中能夠更方便地解決飲食相關的問題，節省時間和精力。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11434,2059,'https://drive.google.com/open?id=1gDMDELfigAFGiPP-aDpRRtbPsDnsGPuu','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11435,2059,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11436,2059,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11437,2059,'黃郁茹','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11438,2059,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11439,2060,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11440,2060,'被稱為＜行人地獄＞的台灣，在行人提醒方面設想很少。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11441,2060,'近年來，行人交通事故不斷發生，造成嚴重的人命傷亡。為了提高行人的交通安全，可透過多種方法改善，例如使用影像投影技術、設置行人提醒燈號、裝設死角感測器等，提醒行人及駕駛人注意路況，降低事故發生率。\n\n另外，在行人專用紅綠燈的設置上，有些路口因為有多組紅綠燈相位，導致行人可能會誤判紅綠燈的狀態，造成交通事故。同樣的，當行人過馬路或駕駛人遇上大型車輛左轉或右轉時，會發出「左轉彎請注意」和「右轉彎請注意」，也有可能因為視野問題而無法察覺對方的存在，發生意外事故。\n\n因此，在路口與行車上增加裝置，提醒駕駛者與行人目前的路況，能有效減少交通事故的發生。例如，設置紅綠燈下的閃爍行人通行警示燈來輔助提醒駕駛人有行人在過馬路，並減速讓其通過，也可提醒看不太到有無行人通過的路口。此外，創新了「已進入死角範圍」之警示聲，不僅行人會受用，駕駛人也會受用，雙雙兩得，但需要有死角感測器以及進入死角提醒警示聲。\n\n為解決大卡車死角帶來的安全問題，需多方合作。政府提供資源支持，司機和公司配合裝死角感測器。交通安全組織和專家提供技術支援。只有多方合作，方能確保大卡車死角交通安全。期望透過這些改善，能夠降低行人交通事故的發生率，達到更安全的交通環境。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11442,2060,'一、利用影像投影技術在斑馬線上投影停止或通行方向，輔助行人注意通行。但在白天時效果可能不佳，需要使用遮光設備進行改善。\n二、設置行人提醒燈號，透過影像辨識技術判斷行人行動情況，控制燈號閃爍以提醒駕駛人注意行人。\n三、安裝死角感測器，透過影像辨識或感應器判別死角區域內是否有行人，並發出警示語提醒駕駛人和行人。\n\n這些方法能讓行人更容易注意到是否能夠安全通行，並且讓駕駛人在不易看見行人的地方提前知道有行人要過馬路。透過多角度的提醒，希望能降低交通事故的發生率。此外，這個方案可以從斑馬線周圍的環境入手，在路口和行車區域增加裝置，提醒駕駛人和行人注意路況。\n\n它具有以下優勢和機會：\n(1)提醒正在使用手機或未注意車況的行人。\n(2)警示駕駛人在轉彎前不能清楚看到是否有行人等待或通過的路口。\n(3)幫助行人避開大型車輛的死角。\n(4)降低大型車輛造成的死傷機率。\n(5)在常有轉彎視線死角的路口中，能更好地降低事故發生率。期望在此方案的實施後，可以有效地降低人行道上的死亡人數。根據111年的統計數據，人行道死亡人數為3085人，期望在此設備上路後，人行道死亡人數能夠降低至1000以下。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11443,2060,'https://drive.google.com/open?id=1D7Ic0bjzBkl00Tr0gIAcr_5-1eIDKg7a','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11444,2060,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11445,2060,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11446,2060,'顏偉智','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11447,2060,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11448,2061,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11449,2061,'透過醫療雲共享平台提供更快速的就醫方式，結合人工智慧給予健康分析與建議','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11450,2061,'據統計高達八成老人罹患慢性病，必須定期拿藥，不過受到交通不便的阻礙，看病一趟往往需耗費數小時以上。\n在地理條件限制下，許多偏遠鄉鎮到重度醫院的車程已超過黃金搶救時間，都可能錯過急救機會','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11451,2061,'1. 提供更快速的就醫方式 : 透過網路平台，可以線上預約看診，讓病患避免排長龍、繁忙的醫院環境，降低就醫門檻\n2. 結合人工智慧技術 : 結合人工智慧技術，可蒐集並分析大量病例資料，協助醫生診斷與治療，進一步提升醫療品質\n3. 解決醫療城鄉不均問題 : 可以讓遠程地區的居民也能使用線上醫療服務，給予相關知識及治療，進一步縮減城鄉醫療差距\n4. 醫療資源普及化 : 透過網路平台查詢醫療資訊，藥物作用資訊等，讓醫療訊息普及化，減少亂買藥所導致的問題\n5. 健康分析與建議 : 透過網路平台分析每次看診狀並給予健康建議，幫助人們進行健康管理\n6. 透過平台定時(每月或一周期期性)配送慢性病處方簽用藥，減少慢性處方箋領藥的不便','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11452,2061,'https://drive.google.com/open?id=1wbsqaZA9fjPYvQF7usMw7L3D-iRL-wTF','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11453,2061,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11454,2061,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11455,2061,'黃宣益','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11456,2061,'陳宗澤','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11457,2062,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11458,2062,'輔助獨居老人生活大小事項，減輕家人負擔，也減少老人失蹤和死亡率。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11459,2062,'獨居老人在日常生活中缺乏照顧、長期處於孤獨狀態、孤獨死之社會問題','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11460,2062,'設計類似手錶的智能手環，來讓銀髮族戴上，手環附上的功能有「提醒、緊急求救、生命體徵偵測」等，以上都在簡報裡！','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11461,2062,'https://drive.google.com/open?id=1l-zRWe2zSuG0Qh4k7WN7fPc-wSpw5ecC','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11462,2062,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11463,2062,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11464,2062,'李秉穎','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11465,2062,'巴慧玲','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11466,2063,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11467,2063,'隨時隨地找相同目標的同好一起運動，共享場地或器材。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11468,2063,'在生活習慣改變的時代，為了健康或愛好，許多人會想在空閒時間來運動，可是自己一個人運動很多人會覺得枯燥乏味，降低運動意願，但每個人的空閒時間也不盡相同，很難配合在一起，就算可以配合，也可能出現與自己實力或經驗不對等的情況，雙方都可能運動的不開心。\n所以需要一個可以隨時隨地尋找相同喜好、興趣、目標與經驗且時間上可以配合的運動夥伴一起的平台。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11469,2063,'我們可以利用手機程式，設定自己的喜好、要求、目標、程度、運動項目跟強度、位置與時間等等，app會幫你自動配對與選擇條件相似的對象。\n將所有資料收集到程式內部進行比對，配對適合的夥伴，推薦附近可供運動合作的場地或公共場所與可以使用的器具等。\n與業者合作推出手環量測身體素質與運動數據搭配積分系統（可以兌換運動用品，餐食等）與競賽賭注功能（增強趣味性），希望能增進大家的運動意願，與平台使用率，也能與運動教練或運動飲食的業者合作，推出相關運動課程與營養餐食。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11470,2063,'https://drive.google.com/open?id=1-rLVc-a1XPvZN_m5WZw8ShXZvWTc_9HA','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11471,2063,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11472,2063,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11473,2063,'林世堂','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11474,2063,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11475,2064,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11476,2064,'設計一個兼具捐款與捐物且能將流程透明化的資助平台','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11477,2064,'非洲之角索馬利亞、衣索比亞、肯亞急需援助，每過48秒就可能會有一個人民餓死','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11478,2064,'通過此平台可專注援助非洲國家，集合捐款捐物的功能，且將流程透明化，製作特別編碼，民眾可以追蹤編碼了解物品情況','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11479,2064,'https://drive.google.com/open?id=1xD59D9eWGnAnZSYlq6ccd4QJ62Hs6nx7','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11480,2064,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11481,2064,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11482,2064,'朱軒毅','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11483,2064,'陳宗澤','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11484,2065,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11485,2065,'就我們的觀察，不少人在學生時期的時候都有掉過文具，學生可能會被家長罵，所以我研發的這項產品能解決兩方的煩惱。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11486,2065,'就我們的觀察，不少人在學生時期的時候都有掉過文具，其實掉文具很麻煩，學生可能會被家長罵，家長還要另外再去買，所以我研發的這項產品能解決兩方的煩惱。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11487,2065,'我們以橡皮擦為發想，發明一款晶片，可以黏貼於小物品上，避免東西不見時找不到','2023-05-03 07:57:32','2023-05-03 