,'2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11509,2067,'游宗育','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11510,2067,'張珝丹','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11511,2068,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11512,2068,'整合市面上大部分的會員，只需使用一個APP，不僅節省手機空間及容量，也較容易找到所需的會員。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11513,2068,'1.市面上有需多品牌各自推出自家的APP，導致有許多的APP在手機主畫面，臨時需要用時，就要找很久，也較難找到不僅浪費時間，且過多的APP也很吃手機的內存容量。\n2.整合在一個APP裡面方便且實用，需要用時很輕鬆就能找到，也不佔空間。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11514,2068,'1.推出一個可以整合各家會員的APP，只需要下載一個APP便可以在裡面加入各家會員，並享有其權益。\n2.因個資問題廠商通常不會授權集點的會員資料，我們將與各個公司簽約，如果他們的會員想使用本APP功能的話，需先在原公司簽署或開通個人資料轉讓協議，而我們雙方也會簽署保密協議。\n3.目前市面上尚有可以和其他廠商集點或推出活動，而我們為此作創新的開發。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11515,2068,'https://drive.google.com/open?id=1743oxKhQpbFKH1u878VJJ13y7wCQHOyc','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11516,2068,'https://drive.google.com/open?id=1GuZyDc1pN560BxpptQo163ZsmrJgGio7','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11517,2068,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11518,2068,'吳怡靜','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11519,2068,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11520,2069,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11521,2069,'將杯墊與手機或電腦連結，紀錄喝水總量','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11522,2069,'人一天喝水須達2000以上，但手提的大型水湖中且不方便攜帶，使用保溫瓶也不會特別計算喝了幾瓶','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11523,2069,'我們將杯墊加入藍芽及秤重功能，杯墊連結手機或電腦中的應用程式，打開應用程式登錄帳號，並點選杯子種類，把杯子放在雲端杯墊上後扣重，即可開始加水，杯墊也會顯示已加了多少毫升，喝水紀錄會傳送至雲端上，不僅知道喝水量的多寡，還有獎品機制來促進人們喝水的意志。這個產品的可行性高，不需要很高的技術就能製作出來，但是這對於喝水量不足的上班族或是需要長時間坐在辦公室的人員來說，是個很好的產品，往往我們都會因為忙碌而忘記補充水分，使身體呈現缺水的狀態，這可以改善這些問題的發生。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11524,2069,'https://drive.google.com/open?id=1NrShY-uKO4mLsyswQ7FuTH_kB5BOi9In','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11525,2069,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11526,2069,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11527,2069,'楊喬鈞','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11528,2069,'宋旗桂','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11529,2070,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11530,2070,'製作電動購物車減少在賣場走動所浪費的力氣','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11531,2070,'消費者在賣場採購時，因為長時間走動而導致小腿酸痛，讓他們想盡快完成購物而忽略其他商品，電動購物車就能幫助他們輕鬆到達想去的位置，減少負擔。\n','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11532,2070,'發明電動購物車，讓人們在購物時可以站在車上面操作車移動，減少因為走動太多導致腳痠的情況發生，增加顧客購物的時間，提升購買意願。\n\n','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11533,2070,'https://drive.google.com/open?id=1pYcupc9qKcX9BvTsFGK5EsI3TJ_V6Irm','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11534,2070,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11535,2070,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11536,2070,'林楷賀 ','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11537,2070,'宋旗桂','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11538,2071,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11539,2071,'讓你在校園中不再迷路，告訴你想知道的事。','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11540,2071,'當我們第一次到其他校區修課時，路痴如我找教室找很久，都會拖延到上課時間，想查詢教室相關資訊時，上到高科大官網卻不知道該從哪裡查看，就會希望有個應用程式可以快速回答我們想知道的問題及帶我們到想去的地點。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11541,2071,'我們希望能夠開發出一款使用智慧型手機操作結合AR實境地圖和問答機器人的APP，只要拿起手機打開鏡頭，螢幕上會有一隻鴨子帶你到想去的地方，解決學生因為不熟悉校園而導致迷路、在校園行走卻不知道自己現在身處何處等問題，設置Beacon當你走到附近時會推播系所相關訊息給你，透過問答機器人直接在系統回答使用者關於學校的問題，讓學生們更快速的獲取校園資訊。\n開發這個APP需要具備前端開發、地圖API的整合、後端資料庫的設計、網路爬蟲、AR引擎、3D建模、物聯網等技術，這些技術已經廣泛的應用與發展，因此技術可行性高；團隊每個成員都有各自擅長的部分，有修過前後端設計課程的同學，也有修過影像辨識的同學，也有修過網路爬蟲及通訊技術的同學，也有修過資料庫及平時對3D建模有研究的同學，相信團隊可行性是很高的；我們初步完成後會在校園進行測試並驗證，收集使用者反饋加以改善APP。預計達成目標是提供校園導覽、資訊查詢等功能必須符合學生需求，維持著高品質的使用體驗。根據市場調查，目前市場上缺乏一款全面的校園導覽APP，且大多數APP的資訊查詢功能不夠完善，本APP提供的功能能滿足學生的需求，吸引大量的使用者。隨著手機的普及，這種應用程式也有很大的市場發展潛力，可以擴展到其他校園、博物館、商場等其他場所。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11542,2071,'https://drive.google.com/open?id=13GDdZjFgIZ4JW6kCoGuIMCAAZwoAzEnt','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11543,2071,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11544,2071,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11545,2071,'張盈綵','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11546,2071,'侯易佑','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11547,2072,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11548,2072,'設計一個可以讓人無痛起床後去起床第一個地方的鬧鐘','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11549,2072,'如何在不影響他人的狀況下，不直接關掉鬧鐘，而且能讓人真正起床的實體鬧鐘，而非是使用手機內建的鬧鐘。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11550,2072,'設計一款可連結鬧鐘的按鈕，在睡覺前一天先放置於起床會去的第一個地方，例如：廁所，當隔天鬧鐘響鈴時，必須去到廁所按按鈕，才能將其鬧鐘響鈴關掉，這樣一來能避免把鬧鐘切掉睡回籠覺，而且不用利用大聲的鈴響讓使用者起床，這樣也不會影響其他同住的人。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11551,2072,'https://drive.google.com/open?id=1h3mwy5SKN5ejXqz1atCpVZUf9j-rjYut','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11552,2072,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11553,2072,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11554,2072,'鍾承恩','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11555,2072,'宋旗桂','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11556,2073,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11557,2073,'希望藉由改善水溝蓋設計，使清理垃圾與取出掉落物能更方便','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11558,2073,'當下著傾盆大雨時，路邊的排水孔卻因為被垃圾堵塞而無法順暢排水，導致道路積水嚴重，給交通帶來了不便和危險。\n或著有些小物品不小心滑落到水溝裡，由於溝道狹窄且深度不淺，無法撿到，不得不無奈放棄。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11559,2073,'我們設計了一款新的排水溝蓋，水溝蓋分成兩層，\n第一層主要是排水，同時還設計了一個隱藏式提把讓我們能提起水溝蓋拿取掉落的物品或清理水溝。\n第二層主要是排水，和防止垃圾直接落入下水道造成淤積。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11560,2073,'https://drive.google.com/open?id=1O6vLdxYhMePkM2ZeuhqgvmDzx-cJ1VyH','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11561,2073,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11562,2073,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11563,2073,'黃建彬','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11564,207