找到車位\n未來市場發展潛力:目前沒有看到這項創新','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11587,2076,'https://drive.google.com/open?id=1YfDpkBQIix2UgmiKg_guma3lByejZJQb','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11588,2076,'https://drive.google.com/open?id=19Y0n7vo29uxwPI8F--nTF7wW3-EiNnXt','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11589,2076,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11590,2076,'林詩琪','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11591,2076,'李國維','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11592,2077,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11593,2077,'確保機車確保機車騎士之行車安全，能於發生意外時觸發保護裝置','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11594,2077,'機車車禍率很高，但保護騎士的措施很少','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11595,2077,'利用觸發裝置，使意外發生時能迅速彈出氣囊保護騎士頸部安全','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11596,2077,'https://drive.google.com/open?id=1TuvSHZXXGG_ia9b785sEdwXR7hOpWBgY','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11597,2077,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11598,2077,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11599,2077,'洪宗茂','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11600,2077,'李國維','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11601,2078,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11602,2078,'能夠讓使用者輸入簡短幾個敘述，就能快速產生報告','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11603,2078,'根據小組內多名成員自身經歷口述，大家都曾因為報告製作而產生許多困擾，比如資料查找浪費許多時間。排版與設計，亦或是動畫更增加了整個報告的時間，卻只增加了部分美觀作用。因此我們希望能夠製作出，更加便利快捷的報告產生ai。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11604,2078,'我們會透過各種 API 或是 Py 有的軟體包，取得gpt類型的功能，並取得圖片生成ai的相關技術。讓使用者逐一輸入標題、標題敘述、修改敘述等....一一產生標題與內文，並讓gpt針對圖片部分進行敘述，再發給圖片ai進行生成。這段過程中可以讓使用者進行修改，以此來確保符合使用者的需求。\n\n技術: 目前有許多方法都是在api 或軟體包有方法，我們只需要進行引用與統整，將生成的模式給逐一寫出，便可產生達到最原始需求的方法。\n\n預估達成目標：礙於排版與動畫沒有相關模型，因此我們目前會期望產生word類型的報告，這種類型的報告較簡易於使用gpt來進行生成，排版方面也更簡易於透過敘述就能產生。\n\n未來市場發展潛力: 我們認為，若成功生產出這產品，將提供給各行各業使用，不僅可以增加其效益，同時也能讓各公司專注於自己產品、服務上，而不必浪費過多時間在製作報告上。再者，也能提供給想要自己創作，但目前毫無靈感的人，給予他們一個生成的文檔，讓他們可以僅僅透過修改就能達到他所期望的報告。\n\n總結:我們認為，這個產品潛力相當大，也有後續很大的規模可以擴展。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11605,2078,'https://drive.google.com/open?id=15XyxlYBsoXPUdMiBYn4CCaDnmbPV3jhL','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11606,2078,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11607,2078,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11608,2078,'楊士霆','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11609,2078,'李國維','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11610,2079,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11611,2079,'讓用路人能有更安全的道路行走','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11612,2079,'在一般的情況之下，行人行走在斑馬線大多數的人都會停在停止線等待綠燈，但也有少部分可能酒駕、闖紅燈和煞車失靈⋯⋯等，若是能將這類事故降低，對於行人來說日後行走在馬路上就不用提心吊膽。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11613,2079,'藉由這些少數事件，我們想出了若是能結合手機或是藍芽等功能，或許能夠將這類的車禍事件降低，才不會造成彼此家庭的悲劇發生。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11614,2079,'https://drive.google.com/open?id=1NTrECqZkdgSuAVuwZSyB39qdrAoUKxMG','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11615,2079,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11616,2079,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11617,2079,'潘奕濬','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11618,2079,'李國維','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11619,2080,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11620,2080,'提醒人們冷氣該清洗了，確保室外機正常運作','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11621,2080,'當冷氣製冷效果變差時，通常會優先清洗濾網而忽略室外機才是關鍵，由於夏天即將到來，而組員大多在外租屋而有冷氣不凉的情形，因此發現此問題而做出提案。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11622,2080,'在室外機內部安裝壓縮機溫度的感測器，再將感測器連接至使用者APP，使感測器可偵測室外機溫度是否異常，如發生異常會發出通知提醒使用者。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11623,2080,'https://drive.google.com/open?id=1QyES-zgOwVJw4eHAypwtHaGSiZj-1GAE','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11624,2080,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11625,2080,'','2023-05-03 07:57