5-03 07:57:32',460),(11647,2083,'方便民眾抵達目的地減少找車位的時間，現今的停車系統只有做到與停車場及車子，我們希望可以增加摩托車的選項以及路邊車位','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11648,2083,'常常抵達目的地找不到車位，或者錯過車位導致需要重新尋找，以及大家擠在同一個停車位，導致交通壅塞。\n我們希望可以藉這個機會改善這些問題','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11649,2083,'擁有一個完善的系統，他可以使用即時影像看到當前車位或者停車位的情況，選擇適合自己的位置，以及可以接受的價格的車位，配合車機廠商全面安裝這個app，使得它大眾化。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11650,2083,'https://drive.google.com/open?id=1-nLJwUhBv0EGa5s_Jsh1Y0XxWvVQ9Owb','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11651,2083,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11652,2083,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11653,2083,'曾宜庭','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11654,2083,'張婷媛','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11655,2084,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11656,2084,'高科第一校區學餐線上點餐及覓食堂餐廳座位查詢App','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11657,2084,'高科第一校區的學生餐廳總是在尖峰時間大排長龍、覓食堂餐廳總是搭電梯到樓上後才發現樓上沒有位置，這樣不僅浪費了電梯能源也會讓學生們白跑一趟，希望能設計APP進行功能整合解決學生在學生飲食方面的問題。','2023-05-03 07:57:32','2023-05-03 07:57:32',462),(11658,2084,'運用建置APP的方式解決問題，由學務處進行管理，我們設計了使用者介面示意圖、學務處廠商管理藉面示意圖、廠商進駐資料建檔示意圖、廠商訂單接收介面示意圖。\n建議可以與資管系專題課程合作，不僅能鍛鍊學生的編寫程式、建置資料庫等能力還能幫助學校，預期能正式在第一校區執行，真正解決學生們的問題，在未來的發展上，希望能擴展到其他校區或學校，未來能將系統進行整合及標準化，可販售給其他學校使用。','2023-05-03 07:57:32','2023-05-03 07:57:32',463),(11659,2084,'https://drive.google.com/open?id=1Goi9cDJMRu65_lXJrJS4L3sD0ROVyJ25','2023-05-03 07:57:32','2023-05-03 07:57:32',464),(11660,2084,'','2023-05-03 07:57:32','2023-05-03 07:57:32',465),(11661,2084,'','2023-05-03 07:57:32','2023-05-03 07:57:32',466),(11662,2084,'洪品璇','2023-05-03 07:57:32','2023-05-03 07:57:32',467),(11663,2084,'劉處英','2023-05-03 07:57:32','2023-05-03 07:57:32',468),(11664,2085,'(二)智慧生活類','2023-05-03 07:57:32','2023-05-03 07:57:32',460),(11665,2085,'可以幫助行動不便的人倒垃圾的問題','2023-05-03 07:57:32','2023-05-03 07:57:32',461),(11666,2085,'社會逐漸高齡化，有許多行動不便者或是獨居老人，因為行動不方便需要他人的照料或輪椅等等的輔助工具才能行動。因此倒垃